INSERT INTO `tb_singer` VALUES ('0', '隔壁老樊', '华语男歌手', 'http://p1.music.126.net/Xl0WENt4F6wsgjjjQWuQsw==/109951164232034479.jpg?param=130y130', '我想 一切都是因为你愿陪在我身边 所以我爱上了民谣也爱上了喝酒 工作请联系邮箱：260565340@qq.com');
INSERT INTO `tb_singer` VALUES ('2', '薛之谦', '华语男歌手', 'http://p1.music.126.net/jq8QrogorsmwJv3Xn7_UOQ==/109951163765021940.jpg?param=130y130', '薛之谦（Joker Xue），1983年7月17日出生于上海，华语流行乐男歌手、影视演员、音乐制作人，毕业于格里昂酒店管理学院。 2005年，参加选秀节目《我型我秀》正式出道 。2006年，发行首张同名专辑《薛之谦》，随后凭借歌曲《认真的雪》获得广泛关注。2008年，发行专辑《深深爱过你》并在上海举行个人首场演唱会“谦年传说” 。2013年，专辑《几个薛之谦》获得MusicRadio中国TOP排行榜内地推荐唱片。2014年，专辑《意外》获得第21届东方风云榜颁奖最佳唱作人 ；2015年6月，薛之谦首度担当制作人并发行原创EP《绅士》，2016年，凭借EP《绅士》、《一半》获得第16届全球华语歌曲排行榜多项奖项，而歌曲《初学者》则获得年度二十大金曲奖。2017年4月，开启“我好像在哪见过你”全国巡回演唱会。 在瑞士就读“酒店管理”的薛之谦，在一次归国探亲中，偶遇唱片公司星探，其星探是在上海音乐领域有着相当知名度的人物，在征得爸爸的同意后，（君子协定：3年内不能在音乐事业上取得一定成绩，就需继续就读“酒店管理”专业）便随即签订合约。但得到的不是歌手的身份，却是演员的工作。从此，薛之谦就出现在各大片场中，对演戏毫无基础的他，曾无数次遭到导演的冷嘲热讽，但为了音乐他依然坚持。在空闲时间薛之谦便用吉他写歌，收入并不多的他甚至自掏腰包录歌。他两度参加全国性大型歌唱比赛：“莱卡”我型我秀Show 全国偶像歌手大赛。首度参加便轻松挺进上海80强，但由于种种的原因，他退出了比赛。2005年他再一次参加我型我秀Show，此次他带着他的原创音乐征服了所有的人，一路过关斩将，虽然没有获得冠军，但是赢得了超高的人气。赛后签约上腾娱乐，正式进入娱乐圈，成为一名歌手。 东方风云榜 ▪ 2016 第二十三届 十大金曲 《一半》 （获奖） ▪ 2014 第二十一届 最佳唱作人 （获奖） ▪ 2014 第二十一届 十大金曲 《意外》 （获奖） ▪ 2013 第二十届 最具突破创作歌手 （获奖） ▪ 2013 第二十届 二十年至尊金曲 《认真的雪》 （获奖） ▪ 2012 第十九届 年度对唱歌曲 《我们爱过就好》 （获奖） ▪ 2012 第十九届 十大金曲 《我终于成了别人的女人》 （获奖） ▪ 2010 第十七届 最佳年度飞跃 （获奖） ▪ 2009 第十六届 最佳舞台演绎奖 （获奖） ▪ 2008 第十五届 本地最受欢迎歌手 （获奖） ▪ 2007 第十四届 十大金曲 《认真的雪》 （获奖） ▪ 2006 第十三届 新人奖银奖 （获奖） 百事风云榜颁奖盛典 ▪ 2006 内地最受欢迎男歌手五强 （获奖） 雪碧中国原创音乐流行榜 ▪ 2008 第七届 最具潜质歌手奖 《你过得好吗》 （获奖） ▪ 2008 第七届 最具潜质歌手大奖 （获奖） ▪ 2007 第六届 飞跃表现奖 （获奖） ▪ 2007 第六届 内地金曲 《认真的雪》 （获奖） ▪ 2006 第五届 新人奖 （获奖） 全球华语歌曲排行榜 ▪ 2013 第十三届 地区杰出歌手 上海：薛之谦 （获奖） ▪ 2011 第十一届 地区杰出歌手 上海：薛之谦 （获奖） ▪ 2011 第十一届 年度二十大金曲 《我终于成了别人的女人》 （获奖） ▪ 2009 第九届 年度金曲奖 深深爱过你 （获奖） ▪ 2006 第六届 最受欢迎男新人奖 （获奖） 中国风尚大典 ▪ 2006 内地风尚新人奖 （获奖） 第四届特步东南劲爆音乐榜颁奖典礼 ▪ 2006 内地劲爆最受欢迎男歌手奖 （获奖） 星光大典 ▪ 2006 最具人气偶像奖 （获奖） 天地英雄校园群英会 ▪ 2006 天地英雄新人奖 （获奖） 雪碧中国原创音乐流行榜 ▪ 2007 飞跃表现奖 （获奖） 华语榜中榜颁奖礼 ▪ 2016 第二十届 榜中榜最受欢迎唱作歌手 （获奖） ▪ 2007 第十三届 传媒推荐奖 （获奖） Music Radio中国TOP排行榜 ▪ 2016 年度最佳男歌手 （获奖） ▪ 2016 2015年年度金曲 《演员》 （获奖） ▪ 2014 年度传媒推荐男歌手 （获奖） ▪ 2014 年度最佳金曲 《丑八怪》 （获奖） ▪ 2013 MusicRadio音乐之声推荐唱片内地 《几个薛之谦》 （获奖） ▪ 2013 内地最受欢迎男歌手 （提名） ▪ 2013 内地年度传媒推荐男歌手 （提名） ▪ 2009 内地最受欢迎男歌手 《你过得好吗》 （获奖） ▪ 2009 年度最佳舞台演绎奖 （获奖） ▪ 2009 内地最受欢迎男歌手 （提名） ▪ 2009 内地最佳男歌手 （提名） ▪ 2009 内地最佳舞台演绎歌手 （提名） ▪ 2008 内地年度最受欢迎男歌手 （获奖） ▪ 2008 内地年度金曲 《你过得好吗》 （获奖） ▪ 2007 内地校园人气大奖 薛之谦同名专辑 （获奖） 无线音乐盛典 ▪ 2008 第二届 无线音乐最具潜力创作偶像 （获奖） 北京流行音乐典礼 ▪ 2009 年度金曲奖 深深爱过你 （获奖） ▪ 2008 20大金曲 （获奖） 中国原创歌曲榜颁奖礼 ▪ 2009 内地最佳舞台表现奖 （获奖） ▪ 2009 最佳专辑奖 深深爱过你 （获奖） CCTV风云音乐 ▪ 2010 媒体推荐创新实力歌手奖 （获奖） ▪ 2010 年度网络最受欢迎金曲奖 （获奖） 全球中文音乐榜上榜 ▪2015 全球中文音乐榜上榜冠军歌曲 《演员》 （获奖） 酷音乐亚洲盛典 ▪ 2016 年度电视音乐金曲艺人 （获奖） ▪ 2016 年度最受欢迎创作人 （获奖） 音悦v榜 ▪ 2016 第四届 年度全能艺人 （获奖） ▪ 2016 第四届 年度风向艺人 （获奖） ▪ 2014 第二届 内地年度创作歌手 （获奖） 网易云音乐原创盛典 ▪ 2017 年度艺人（获奖） 2005年因参加选秀节目《我型我秀》而正式出道，2006年6月9日，发行首张个人原创同名专辑《薛之谦》，包揽了六首曲和五首词的创作 。《认真的雪》打榜成绩和彩铃下载量更是名列前茅，一直成为各大排行榜上的常客，专辑销量1个月破20万张。 2007年7月31日发行第二张个人原创专辑《你过得好吗》。短短一个月时间，销量迅速突破15万，获中歌榜冠军。 同年，薛之谦受邀作为流行音乐的代表，和其他艺术家一起前往俄罗斯，参加由中华人民共和国文化部，和俄罗斯联邦文化电影署联合举办的中国文化节重点项目”沿伏尔加河友谊之旅”，在沿河11个城市作访问演出。 2008年11月26日发行第三张个人原创专辑《深深爱过你》，同名主打歌《深深爱过你》荣登中歌榜等榜单首位，2009年获第9届全球华语歌曲排行榜最受欢迎二十大金曲奖。 12月20日举行首场演唱会“谦年传说”。 2008年，薛之谦当选火炬手，在河南省郑州市传递火炬 2009年9月21日推出单曲《未完成的歌》，这是薛之谦逾一年的创作，迟迟没有发表是因为一直没有很好的词来配合这首曲，所以他一直等到能让他觉得感动的歌词。2009年12月11日发行新歌+精选集《未完成的歌》。 2010年薛之谦跨界影视，主演了个人首部大银幕作品《一只狗的大学时光》 。 2011年3月14日，推出单曲《我终于成了别人的女人》，这首歌曲的编曲由音乐人常石磊编写，音乐录影带由周杰伦的御用导演珍妮花拍摄 。 2012年，主演青春励志片《音乐江湖》，在片中饰演了性格内向、对音乐执着的学生陈浩，并演唱影片主题曲《我们爱过就好》 ；7月17日，发行 专辑《几个薛之谦》，专辑筹备期长达两年半。期间，薛之谦陆续发行《我终于成了别人的女人》、《伏笔》、《几个你》等多首单曲 。该唱片获2013年MusicRadio中国TOP排行榜内地推荐唱片奖 。第二波深情主打《我知道你都知道》被湖南卫视最新大戏《胜女的代价》收为主插曲 ；同年，薛之谦第一家“上上谦”火锅店开业，现已扩张到五家店。之后薛之谦又自创了女装品牌UUJULY、童装品牌UUJULYKIDS、男装品牌Dangerous People 。 2013年11月，发行专辑《意外》，并凭借该专辑获得第21届东方风云榜十大金曲奖。其中收录了主打歌《丑八怪》以及插曲《意外》、《你还要我怎样》、《方圆几里》等在内的10首歌曲 。凭借新专辑《意外》在东方风云榜拿下最佳唱作人和十大金曲两座大奖。 2015年6月8日，推出原创EP《绅士》，收录了《绅士》、《演员》、《下雨了》在内的3首歌曲 ；10月26日，推出个人原创EP《一半》 ，EP发布后试听量一路飙升，夺得多家权威音乐榜单冠军位，11月10日，薛之谦在北京举行EP《一半》试听量破亿庆功会 。11月19日，单曲《Stay Here》MV首发，纪念自己曾经的倔强和已逝去的爱情 ；同年，搭档朴海镇、张亮主演都市爱情剧《男人帮·朋友》 ；10月5日，其主演的都市励志剧《妈妈像花儿一样》播出，并在剧中饰演“多情小叔子”张来福 。 2016年，凭借歌曲《演员》、《一半》获得酷音乐亚洲盛典“年度电视音乐金曲艺人”、“年度电视音乐金曲艺人”； 5月17日，发行EP《初学者》 ，同时也是爱情喜剧片《A测试之爱情大冒险》的主题曲，该电影是由薛之谦首次特别主演 ，歌曲首发后评论数在一天突破8万，两天突破10万 。6月1日，MV上线，这首歌是薛之谦独自包揽词曲，此次再度与金曲奖最佳音乐录像带奖得主黄中平导演合作拍MV ；6月4日，参加真人秀节目《挑战者联盟》 ；6月7日，发行原创单曲《刚刚好》 ；6月17日，薛之谦《初学者》专辑的第二波伤情主打歌《刚刚好》MV正式首发 ；6月24日，推出个人原创单曲《我好像在哪见过你》，同时也是魔幻动画片《精灵王座》的主题曲；6月30日，参加中韩偶像互动音乐节目《作战吧偶像》 ；7月2日，参加湖南卫视音乐节目《中国新声代第四季》 ；7月17日，在北京举办《初学者》免费首唱会，7月18日新专辑《初学者》全网正式上线，实体专辑将制作CD碟及限量版，黑胶两个版本，将于8月初开售 。9月12日，薛之谦携手黄龄献唱由导演冯小刚执导的电影《我不是潘金莲》的推广曲。 9月15日，薛之谦担任《中国新歌声》第五战队队长强势踢馆《中国新歌声》。 9月16日，薛之谦参与的《加油！向未来》在央视一套播出第十期 。12月4日，与黄晓明、阮经天、沙溢、刘烨、岳云鹏合作加盟江苏卫视综艺节目《我们的挑战》，担任常驻嘉宾 。');
INSERT INTO `tb_singer` VALUES ('3', '林俊杰', '华语男歌手', 'http://p1.music.126.net/cnGpIQ6rQCKVrDyVVSpzeg==/3263350518850877.jpg?param=130y130', '著名男歌手，作曲人、作词人、音乐制作人，偶像与实力兼具。林俊杰出生于新加坡的一个音乐世家。在父母的引导下，4岁就开始学习古典钢琴，不善言辞的他由此发现了另一种与人沟通的语言。小时候的林俊杰把哥哥林俊峰当作偶像，跟随哥哥的步伐做任何事，直到接触流行音乐后，便爱上创作这一条路。2003年以专辑《乐行者》出道，2004年一曲《江南》红遍两岸三地，凭借其健康的形象，迷人的声线，出众的唱功，卓越的才华，迅速成为华语流行乐坛的领军人物之一，迄今为止共创作数百首音乐作品，唱片销量在全亚洲逾1000万张。2007年成立个人音乐制作公司JFJ，2008创立潮流品牌SMG。2011年被媒体封为“新四大天王”之一，同年8月8日正式加盟华纳音乐，开启事业新乐章。2012年发行故事影像书《记得》，成功跻身畅销书作家行列。获得多项奖项：第15届台湾金曲奖最佳新人奖，6届新加坡金曲奖大奖，6届新加坡词曲版权协会大奖，8届全球华语歌曲排行榜大奖，5届MusicRadio中国TOP排行榜大奖。  《江南》《一千年以后》《曹操》《小酒窝》《因你而在》 第15届台湾金曲奖最佳新人奖 6届新加坡金曲奖大奖 6届新加坡词曲版权协会大奖 8届全球华语歌曲排行榜大奖 5届MusicRadio中国TOP排行榜大奖 3届CCTV-MTV音乐盛典大奖 第3届美国Pensado Awards颁奖礼 最佳外语歌曲《不为谁而作的歌》 第25届台湾金曲奖最佳国语男歌手 第27届台湾金曲奖 最佳国语男歌手和最佳作曲人 两届MAMA亚洲音乐盛典 亚洲年度最佳艺人（新加坡） 1981年3月27日，林俊杰出生于新加坡的一个音乐世家。在父母的引导下，4岁就开始学习古典钢琴，不善言辞的他由此发现了另一种与人沟通的语言。小时候的林俊杰把哥哥当作偶像，跟随哥哥的步伐做任何事，直到接触流行音乐后，便爱上创作这一条路。 1996年，林俊杰开始参加各种歌唱比赛，前后获得多个词曲创作和演唱大奖。1999年，海蝶音乐在“非常歌手训练班”发现了他。这个腼腆害羞、并不起眼的高中生，却在自弹自唱的时候，展现了对音乐的纯真热忱。当时在学校成绩优秀的林俊杰，在已收到新加坡国立大学入学通知的情况下，放弃升学，与海蝶签下一纸合约，从此开启了他的音乐道路。 新加坡男性均须服兵役，林俊杰亦不例外。由于专长，他加入的是新加坡武装部队文工团。服兵役期间，他积累了大量的舞台表演经验，同时也尝试了无数创作。尽管早期屡遭“打枪”，但在老师的正确引导鼓励下，极具天赋又非常努力的他，终于谱出了令老师首肯的曲子，这便是2001年收录在张惠妹专辑里的《记得》。此后，林俊杰为庾澄庆、阿杜、王心凌等人创作多首主打歌曲，他的创作才华终于得以展示。 2003年 集创作、演唱、舞蹈为一身，发行首张全创作专辑《乐行者》，在偶像当道的全盛时期大胆入局。虽然时逢SARS，但他和团队不轻言放弃，在3个月内走遍26个城市，进行了上百场演出，奠定了之后在中国大陆无懈可击的稳固基础。 2004年 游走大陆，让从小接受英语教育的林俊杰，首次体验中华文化所带来的冲击，结合西方R&B现代曲风以及中国风的《江南》（台版《第二天堂》）由此诞生，红遍亚洲； 同年，更凭借《乐行者》，拿下第15届台湾金曲奖最佳新人奖，事业起飞。 2005年 开始享有更大的音乐空间，《编号89757》穿梭在未来世界与古文明之间，发行后再度缔造经典高峰，横扫各大颁奖典礼的重大奖项。 2006年 1月28日，登上中国中央电视台春节联欢晚会（央视春晚）舞台献唱《一千年以后》，并以33.3%的支持率成为当晚最受观众喜爱的明星； 2月1日，推出《曹操》，掀起一股东方摇滚风； 同年，首次举办个人巡回演唱会，这不仅是个里程碑，也让更多人看到了他的歌唱实力与舞台魅力。 2007年 成立个人音乐制作公司JFJ； 以人性的善恶纠结为基础，大胆推出更具突破性的《西界》； 首度参演电视剧，客串出演台湾偶像剧《花样少男少女》。 2008年 首次主演网络小说改编的偶像剧《原来我不帅》； 同年10月18日，发行具有最多“合作元素”的专辑《JJ陆》，《不潮不用花钱》掀起“叩叩”舞蹈潮流，与蔡卓妍合唱的《小酒窝》更是风靡歌坛，被誉为最经典的合唱曲目之一，也让他成功在香港市场占有一席之地。 2009年 3月28日，第二轮世界巡回演唱会【杰伴2009】于新加坡开启； 随后，林俊杰遭受出道以来最严重的生理打击，几近失声，陷入低潮，演艺活动被迫中止； 12月15日，携《100天》回归歌坛，这本纪录了低潮期的心情日记，体现了心境的转变，首首触动人心。 2010年 凭借《100天》入围第21届台湾金曲奖最佳男歌手，在颁奖典礼上的“金 曲！金曲！”表演，让百万观众见证林俊杰“诉说女人故事”的实力与魅力，使其在台湾的事业攀上了新的高峰； 8月21日，于北京开启第三轮世界巡回演唱会【I AM】，用歌声诠释生命的意义，感受世界的真实，传递音乐的感动，It\'s when I\'m weak that I am strong：我脆弱，却不退缩； 12月8日，发行概念自选集《她说》，从曾经写给众多女歌手的近百首创作里精选出10首，重新改编，赋予全新生命，而新曲《她说》又缔造了一个新的经典。 2011年 二度登上台北小巨蛋，反响热烈，被媒体封为“新四大天王”之一； 8月8日，加盟华纳音乐，开启新乐章； 12月31日，推出加盟后首张创作专辑《学不会》，以近乎赤裸的全心演绎，感动千万听众。 2012年 推出首本个人故事影像集《记得》，跻身畅销作家行列； 凭借《学不会》斩获各大奖项，深拓台湾市场，巩固华语乐坛天王地位。 2013年 3月13日，推出第十张全创作专辑《因你 而在》，通过十支MV十支微电影，以音乐与影像结合的方式，记录“十年有成，光荣十刻”。专辑一经发行即拿下27个榜单冠军，并以83.35%的高百分比刷新五大唱片单周销售百分比纪录，气势如虹； 7月13、14日，于台北小巨蛋开启全新世界巡回演唱会【时线Time Line】，“用三千六百五十个日子，将时间的轨迹连成线，在时线之间，在实现之前，定义我们的不是时间，而是爱过的那些”，化身“时间守护者”：“我控制时间的前进，我寻找生命的线索。” 2014年2月16日 “时线TimeLine世界巡回演唱会”登陆伦敦，林俊杰成为首位在伦敦开个唱的新加坡歌手 ；5月15日 以制作人身份为陈奕迅制作的国语专辑《米·闪》（《闪》的部分）发行，大获好评；6月28日 荣获第25届台湾金曲奖最佳国语男歌手奖，成为新加坡首位获得该奖项的男歌手 ；7月18日 推出首张英文Live翻唱EP《iTunes Session》 ；11月18日 荣获第5届“通商中国青年奖” ；12月22日 林俊杰蜡像进驻新加坡杜莎夫人蜡像馆 ；12月27日 发行第11张创作专辑《新地球GENESIS》 ，获得台湾五大金榜华语榜2014年度销售冠军 。 2015年1月10日 “时线Time Line世界巡回演唱会”在青岛落幕，横跨四大洲、24个城市，突破30万人次；2月14、15日 “时线：新地球世界巡回演唱会”安可场在台北小巨蛋全新开启 ，继《新地球GENESIS》专辑中与Jason Mraz、郑容和跨国合作后，台北演唱会邀来滨崎步担任嘉宾并宣布了合作歌曲的消息，音乐交流版图横跨美、韩、日 ；2月25日 受邀出席由通商中国举办的“中国商数学生论坛”，分享学习双语心得 ；2月27、28日 连续两天担任新加坡妆艺大游行压轴表演嘉宾，演唱其原创活动主题曲《Dreams》；8月9日，受邀担任新加坡50周年国庆庆典表演嘉宾，献唱国庆主题曲《Our Singapore》 。12月25日，个人首张实验概念专辑《和自己对话》正式发行，创华语乐坛先例使用“人头录音”技术，将声音拟真创造空间感，打造“3D超立体环绕听觉”, ，凭借该专辑三度蝉联台湾五大金榜华语榜年度销售冠军，专辑《新地球》亦同时占据榜单亚军位置。 2016年，1月15日，首次参演的电影《消失爱人》在中国大陆上映 ；2月26日，为Dota2创作的游戏音乐包《The Timekeeper》上线；3月6日，受邀担任Dota2上海特级锦标赛决赛音乐会表演嘉宾。4月8日，在《我是歌手第四季》最后一期“歌王之战”帮帮唱环节搭档徐佳莹演唱歌曲《不为谁而作的歌》。 荣誉记录：音乐类 2016 第3届QQ音乐年度盛典 年度最佳唱作专辑 《和自己对话 From M.E. To Myself》（获奖） 2016 第3届QQ音乐年度盛典 年度最佳港台男歌手 （获奖） 2016 第3届QQ音乐年度盛典 年度畅销港台数字专辑 《和自己对话 From M.E. To Myself》 （获奖） 2016-03-07 ——— 2015台湾十大精选行销类微电影 可惜没如果 （获奖） 2016-01-25 ——— 2015Hit Fm年度十大专辑 和自己对话 （获奖） 2016-01-24 第11届 KKBOX数位音乐风云榜 年度风云歌手 （获奖） 2016-01-24 第11届 KKBOX数位音乐风云榜 年度专辑冠军 新地球 （获奖） 2016-01-12 第06届 全球流行音乐金榜 年度20大金曲 不为谁而作的歌 （获奖） 2015-12-31 ——— 2015最动感101金曲跨年倒数百首金