INSERT INTO `tb_singer` VALUES ('4', '陈奕迅', '华语男歌手', 'http://p1.music.126.net/_d1scu7z_1dmd0Zgv9mTLA==/19165587183900212.jpg?param=130y130', '著名实力派粤语流行音乐歌手、演员，香港演艺人协会副会长之一，曾被美国《时代杂志》形容为影响香港乐坛风格的人物，同时也是继许冠杰、张学友之后第三个获得“歌神”称号的香港男歌手。同时他也是继张学友后另一个在台湾获得成功的香港歌手，在2003年他成为了第二个拿到台湾金曲奖“最佳国语男演唱人”的香港歌手。陈奕迅曾被《时代》杂志形容为影响香港乐坛风格的人物。2010年，陈奕迅入选全球华人音乐殿堂华语金曲奖“30年经典评选”，成为1990年代出道歌手唯一代表。陈奕迅曾在多个亚太地区获得多个奖项和提名，包括香港地区的“叱咤乐坛男歌手金奖”、“叱咤乐坛我最喜爱的男歌手奖”、“十大劲歌金曲最受欢迎男歌星奖”。代表作品：《爱情转移》、《十年》、《浮夸》、《K歌之王》。 《爱情转移》《十年》《浮夸》《K歌之王》《好久不见》 香港十大劲歌金曲最受欢迎男歌手 香港十大中文金曲全国最佳男歌手 新城国语力颁奖礼至尊歌手大奖 台湾金曲奖最佳国语男歌手 全球华语歌曲排行榜最佳男歌手 CCTV-MTV音乐盛典最受欢迎男歌手 音乐风云榜最佳男歌手 新秀比赛 陈奕迅于1995年暑假期间回香港参加TVB举办的第14届新秀歌唱大赛，在多个环节均获得高评分，成为该届冠军，随即跟华星唱片公司签下歌星合约。 华星时期 于1996年推出首张个人同名大碟《陈奕迅》，其后《与我常在》和 《我的快乐时代》推出后，渐受大众认识及注视。《我的快乐时代》更夺得首个叱吒乐坛流行榜颁奖典礼的“叱吒乐坛至尊唱片大奖”（至今他总共获得这个奖项八次）。 1999年，《幸福》、《天佑爱人》和《新生活》 等专辑相继热卖，其中歌曲如《幸福摩天轮》和《每一个明天》等流行一时。同年与乐坛巨星梅艳芳合唱《同声一笑》。并在10月7日至10日于香港体育馆举行一连四场的“Big Live陈奕迅大个唱99”演唱会。 英皇时期 2000年陈奕迅转投英皇娱乐旗下品牌Music Plus，与谢霆锋，何嘉莉，叶佩雯，容祖儿和王杰成为公司重要歌手；相继推出的专辑大卖《打得火热》、《Shall We Dance? Shall We Talk!》、《The Easy Ride》、《The Line Up》、《Eason 4 A Change & Hits》和《Live For Today》均成为热卖作品，其中《Shall We Talk》、《打得火热》、《K歌之王》、《明年今日》均进占流行榜冠军。陈并于2000、2001及2002年三度夺得“四台联颁音乐大奖--传媒大奖”，连续三届成为香港四大电子传媒音乐颁奖典礼大赢家；在2001和2002年度《叱咤乐坛流行榜颁奖典礼》连续两次夺得“叱咤乐坛男歌手金奖”，其后在2003年度在《IFPI香港唱片销量大奖》，夺得“全年最高销量本地男歌手”等多个奖项。而在英皇发展期间，于2001年及2003年在香港体育馆分别举行两次名为《The Easy Ride》（共9场）及《Third Encounter》（共7场）演唱会。 在英皇期间陈奕迅亦成功打入台湾市场，国语专辑《反正是我》、《Special Thanks To...》和《黑白灰》在台湾热卖，《十年》、《你的背包》、《兄妹》、《爱是怀疑》等国语歌曲流行一时。在2003年度凭国语专辑 《Special Thanks To...》夺得《台湾金曲奖》“最佳国语男演唱人”和“最佳专辑”，成为了继张学友后首位夺得这个大奖的香港男歌手，亦是第一个同时夺得这两个奖项的香港歌手。 2003年他与英皇唱片公司因未能就续约问题达成共识关系, 而遭到“雪藏”。同时其任职香港房屋署总屋宇设备工程师的父亲陈裘大被控受贿罪成入狱，此事对陈奕迅打击甚大。在整个2004年，除接拍电影外，陈奕迅的事业处于休息状态。 因“雪藏”关系，原本已完成灌录的专辑“I Had a Great Time”亦因此而胎死腹中，其后英皇将该专辑的十首新歌分别放于三张新曲加精选的合辑内推出。 2003年11月，他受邀作为梅艳芳演唱会嘉宾，谈笑间梅艳芳称赞其是“新一代歌手中不可多得的具有天衣无缝声线的歌手，应当好好利用”。后来陈奕迅曾以一首《夕阳无限好》纪念梅艳芳，并多次表示梅姐曾讲“歌手最要紧的是回馈歌迷”，自己则铭记在心。 新艺宝时期 2005年，陈奕迅宣布加盟环球唱片旗下新艺宝唱片公司，新城电台于3月17日举行一场名为《新城唱好陈奕迅05出击音乐会》为其正式重返乐坛打响头炮。而作为“复出”的首张专辑《U87》亦于同年6月7日推出（U87是他录制专辑时的麦克风型号），四首主打歌（《夕阳无限好》、《阿牛》、《浮夸》及《葡萄成熟时》）皆获香港各大传媒流行榜周冠军。 同年11月，推出“复出”后首张国语专辑《怎么样》，由于在内地宣传期间，因急性声带发炎导致失声，令后来的宣传活动皆被迫取消。 凭著《U87》陈奕迅在2005年横扫香港乐坛，《U87》不但成为2005年香港最高销售量的粤语非精选专辑，并斩获了包含《叱咤乐坛流行榜颁奖典礼》的“叱咤乐坛男歌手金奖”及“叱咤乐坛我最喜爱的男歌手”等六项大奖；《IFPI香港唱片销量大奖》“十大最高销量广东唱片”奖，及《CASH金帆音乐奖》“最佳男歌手”等多项奖项。 更于香港四大电子传媒音乐颁奖典礼中，获得“四台联颁音乐大奖－传媒大奖”成为了年度大赢家。而《U87》更获得时代周刊评选为“2005年最值得购买的五大亚洲唱片”，并形容他带领了香港的音乐潮流。 2006年2月，陈奕迅相隔3年后再次于香港体育馆举行了一连9场《Get a Life》演唱会，门票开售首天即售完。演唱会后推出EP《Life Continues》热卖，主打歌《最佳损友》获香港各大传媒流行榜周冠军。其后获奥比斯选为“光明大使”，并探访印度的失明儿童。 同年11月，推出专辑《What\'s Going On》。其中包括多首冠军歌如《裙下之臣》、《黑择明》和《富士山下》。《富士山下》的国语版《爱情转移》亦成为2007年内地各颁奖礼的大赢家。 2007年至今 2007年1月1日，凭著《What\'s Going On...?》于2006年度《叱咤乐坛流行榜颁奖典礼》再次夺得“叱咤乐坛男歌手金奖”和“叱咤乐坛我最喜爱的男歌手”两项大奖；同年1月13日，于2006年度《十大劲歌金曲颁奖典礼》首次夺得“最受欢迎男歌星”奖项。 陈奕迅于2006年囊括了四台的男歌手奖项：“新城劲爆男歌手”、“叱咤乐坛男歌手金奖”、“叱咤乐坛我最喜爱的男歌手”、无线十大劲歌金曲“最受欢迎男歌星”及港台“最优秀流行男歌手”。其演唱会碟《Get a Life Live》亦被IFPI评选为2006年香港最高销量的粤语唱片。 2007年4月，推出国语专辑《认了吧》，在专辑宣传期间，分别于中港台各地举行校园巡回演唱会。 并凭此专辑再次提名《第十九届台湾金曲奖》“最佳国语男演唱人”。 2007年10月，推出专辑《Listen to Eason Chan》，是为一次大突破，整张专辑只有一首慢歌《crying in the party》，其余则是各种类型的快歌。 2007年10月24日至11月6日、11月9日至10日，于香港体育馆举行《Eason\'s Moving On Stage 1》演唱会，因反应热烈关系，一共六度加场至16场。其后两年展开世界巡回演唱会。 自2007年10月起，陈奕迅成功举办《Eason\'s Moving On Stage》世界巡回演唱会累计高达45场，其中踏足的地区包括：香港、澳门、台湾、美国、加拿大、澳大利亚、马来西亚、新加坡以及中国大陆。 2008年1月1日，凭著《Listen to Eason Chan》于2007年度《叱咤乐坛流行榜颁奖典礼》夺得“叱咤乐坛男歌手金奖”和“叱咤乐坛我最喜爱的男歌手”，是继2005年度的商台颁奖礼后，连续第三次同时夺得这两项大奖。2008年1月12日，于2007年度《十大劲歌金曲颁奖典礼》中同时夺得“最受欢迎男歌星”及“亚太区最受欢迎香港男歌星”。是继刘德华后，第二位于同年度获得此两项奖项的男歌星；同年1月20日，于2007年度《十大中文金曲颁奖音乐会》连续三届夺得“最优秀流行男歌手奖”、亦再次夺得“四台联颁音乐大奖－传媒大奖”。在此之前，他与刘德华都一人得过4次传媒大奖，加上2007年陈奕迅共得该奖5次，刷新纪录成为获传媒大奖最多的歌手，亦是第五次成为香港四大电子传媒音乐颁奖典礼的年度大赢家。 同年，陈奕迅参加了2008年北京夏季奥林匹克运动会香港区火炬传递。 2008年8月13日，推出国语专辑《不想放手》。凭此专辑再次提名《第二十届台湾金曲奖》“最佳国语男演唱人”及“最佳国语专辑奖”。 2009年1月1日，于2008年度《叱咤乐坛流行榜颁奖典礼》连续四届夺得“叱咤乐坛我最喜爱的男歌手”。同年1月3日，于2008年度《十大劲歌金曲颁奖典礼》连续二届夺得“亚太区最受欢迎香港男歌星”。 2009年3月23日，推出专辑《H3M》，由Moving On Stage演唱会班底每人写一首歌完成。陈奕迅亦交上冠军曲《沙龙》，其他冠军曲包括《七百年后》和《allegro opus 3.3am》。 2009年6月27日，于《第二十届台湾金曲奖》凭专辑《不想放手》第二次夺得“最佳国语专辑奖”，并成为第一位夺得此奖两次的非台湾男歌手。 2009年9月21日，推出国语专辑《上五楼的快活》，并凭此专辑再次提名《第二十一届台湾金曲奖》“最佳国语男演唱人”。 2009年12月9日，陈奕迅在加拿大蒙特利尔为2010温哥华冬季奥运会传递火炬，亦成为第一位传递过夏季和冬季两季奥运会的亚裔火炬手。 2010年1月1日，凭著《H3M》于2009年度《叱咤乐坛流行榜颁奖典礼》第六次夺得“叱咤乐坛男歌手金奖”，及连续五届夺得“叱咤乐坛我最喜爱的男歌手”，亦连续五次夺得十大中文金曲颁奖音乐会“全年最高销量歌手大奖（男歌手）”。《H3M》同时亦获得四台联颁音乐大奖－大碟大奖。 2010年3月12日，推出EP《Time Flies (EP)》，其中包括三首三台冠军歌《无人之境》、《陀飞轮》及《一丝不挂》。 2010年3月，于香港体育馆举行的《DUO陈奕迅2010演唱会》，并邀请好友谢霆锋等作嘉宾，因反应热烈5度加场至18场。演唱会时间由3月20日开始不间断至4月6日尾场。 2010年5月，陈奕迅举行他个人首次欧洲巡回演唱会，地点分别在英国伦敦皇家阿尔伯特音乐厅（Royal Albert Hall）、曼彻斯特阿波罗剧院（Manchester Apollo）以及荷兰鹿特丹阿侯伊体育馆（Ahoy Rotterdam）。时间依次是2010年5月3日，5月6日以及5月8日。伦敦以及曼彻斯特站的演唱会门票均在正式售票数小时内售罄。陈奕迅是继已故歌手罗文后，第二位进驻Royal Albert Hall演出的香港歌手。 2010年10月06日，《DUO 陈奕迅2011演唱会》台北及高雄站同时开卖，门票三小时即售罄；由于反应过于热烈，主办单位宣布台北站再加场。另外，陈奕迅也成了首位站上高雄巨蛋的香港歌手。 2010年10月15日，推出EP《Taste the Atmosphere》。 2010年12月29日，陈奕迅于新城劲爆颁奖礼共夺5个半奖成为大赢家，凭《一丝不挂》夺全球劲爆歌曲大奖。 2011年1月1日，2010年度叱吒乐坛流行榜颁奖典礼中获得五个奖，亦成为大赢家。包括夺得叱咤乐坛男歌手金奖，叱咤乐坛我最喜爱的男歌手等奖项。 2011年4月16日，陈奕迅在四川成都举行《DUO陈奕迅2011成都演唱会》，现场观众爆满，反响强烈。');
