INSERT INTO `tb_singer` VALUES ('6', '李荣浩', '华语男歌手', 'http://p1.music.126.net/RQ8pNp66CqAsieGtSaj_5g==/109951163398568078.jpg?param=130y130', '李荣浩，1985年7月11日生于蚌埠，中国流行音乐制作人、歌手、吉他手。曾为众多艺人创作歌曲以及担任制作人，也曾为多部电影与多款电子游戏制作音乐。2013年9月17日发行个人首张原创专辑《模特》，凭借这张专辑入围第25届金曲奖最佳国语男歌手奖、最佳新人奖、最佳专辑制作人、最佳国语专辑、最佳作词奖等五项大奖提名，成为最大黑马，实现了从制作人到歌手的华丽转身。 从小自学吉他和低音提琴，后师从低音提琴演奏家尹富源教授。 2004年接受音乐杂志《吉他平方》专访并发表单曲《烦》，同年与乐队合作获得江苏省第五届流行音乐大赛一等奖。 2005年接受音乐杂志《现代乐手》专访并发表单曲《DREAM》，同年9月担任《我的音乐梦想》系列吉他丛书主编，后正式成为吉他中国乐手。 2005年签约日本艾回唱片，成为其台湾地区独家创作艺人。 2007年，李荣浩赴台湾参与制作信专辑《我就是我》，并担任其“2008我就是我·北京演唱会”的表演嘉宾。2008年参与制作赵薇专辑《我们都是大导演》，并担任发布会表演嘉宾；同年担任陈坤专辑《谜&Me》的专辑制作人。2010年2月4日，担任陈坤首场演唱会《谜》音乐总监&吉他手。2011年开始担任东申童画《行走的力量》音乐总监。 2013年8月，首度携手好友陈坤演绎全新单曲《演员和歌手》 ；同年9月，发行首张个人专辑《模特》，举办“Hao·Live——《模特》专辑音享会” 演绎专辑中的6首热门歌曲，圈中好友李泉、权振东都前来大力支持，另外模特陆瑶、王梦雅、那广子等也亲自到场支持 。 2014年3月，发行概念EP《作曲家》，获王菲力荐，称其为“帅歌”，同月入围MusicRadio中国TOP排行榜年度最受欢迎新人；同年4月，荣获音悦台第二届“音悦v榜”年度最佳音悦人，成为了颁奖典礼中最大黑马 ；5月参加《全球中文音乐榜上榜》，现场打榜演唱《作曲家》，同月凭借专辑《模特》入围第25届金曲奖最佳国语男歌手奖、最佳新人奖、最佳专辑制作人、最佳国语专辑、最佳作词奖等五项大奖提名，成为最大黑马 。');
INSERT INTO `tb_singer` VALUES ('7', '华晨宇', '华语男歌手', 'http://p1.music.126.net/eiazGAbIGMBF-Q9lInm5xw==/109951164158509628.jpg?param=130y130', '华晨宇，1990年2月7日生于湖北十堰 ，中国男歌手，毕业于武汉音乐学院。 2013年，参加湖南卫视《快乐男声》获年度总冠军出道 。2014年1月，首登央视春晚舞台。9月6日-7日，在北京万事达中心连开两场“火星”演唱会 ，随后首张个人专辑《卡西莫多的礼物》发行 ，并凭此专辑获第十五届音乐风云榜年度最受欢迎男歌手等奖项。同年7月31日—8月2日，2015火星演唱会在上海大舞台连开三场。12月，发行第二张专辑《异类》。 2016年7-9月，2016火星演唱会相继在北上深三个城市举办。9月27日，出席亚洲新歌榜2016年度盛典，揽获最佳男歌手奖。10月，加盟东方卫视《天籁之战》。12月2日，获2016MAMA亚洲最佳艺人奖。2017年3月14日，专辑《H》发行。 1990年2月7日，华晨宇出生于湖北十堰。他从小就开始接触音乐。小学五年级之前，长笛是华晨宇的最爱。随着年龄增长，他不再满足于长笛带给他的音乐世界，与父亲交流并获得支持后，华晨宇开始学钢琴，虽然过程并不是一帆风顺，但凭着自身的努力，他很快达到了钢琴十级。 初中毕业时，华晨宇已经对自己的未来有了规划，他想学更多的音乐知识，想去武汉上高中。2009年，华晨宇参加了高考。一心想上武汉音乐学院的他，专业课满分，却因为文化课的一分之差与心仪的高等学府失之交臂。但他坚持复读也一定要考上武汉音乐学院。第二年即以文化课高出20多分，专业课优秀的成绩，顺利进入武汉音乐学院学习音乐。 2013年6月29日，《快乐男声》长沙唱区十强决选现场，华晨宇凭借原创的《无字歌》全票晋级长沙唱区10强，也因此被称为“火星弟弟”。比赛中，华晨宇风格多变，渐渐引起关注，更得到了评委的一致肯定。9月27日，华晨宇以1606的总分荣获2013快乐男声全国总冠军 。同年9月，为苏宁易购拍摄电视广告，代言Stride炫迈口香糖，首支个人单曲《我和我》曝光，并收录于2013快男合辑《追梦敢不敢》。10月13日，在北京远洋未来广场参与合辑首签会。11月拍摄御泥坊电视广告。11月6日，为电影《怒放之青春再见》演唱主题曲《青春再见》和插曲《Hi！自由》并发行。11月7日，受邀参加武汉音乐学院校庆表演。12月代言读书郎学生电脑并拍摄电视广告。12月19日，出席电影《等风来》发布会，并演唱主题曲《趁你还年轻》。12月31日，在湖南卫视2014跨年晚会独唱《Creep》。12月6日，华晨宇荣获2013第六届音乐风云榜新人盛典“最受欢迎男歌手”奖。 2013年11月2日-2014年3月15日，2013快乐男声全国巡回演唱会先后在北京、上海、杭州等11大城市举办。华晨宇在武汉，深圳，苏州三站荣获”城市之星“，并于最后一站杭州获封“巡演之星“ 。2013年11月16日-2014年1月18日，代表湖南卫视参加2013直通春晚，并成为首位获得2014央视马年春晚邀请函的选手。 2014年1月30日，首登央视春晚舞台演唱《在那遥远的地方》。1月31日， 在2014北京卫视春晚演唱《We are young》。2月与中手游CMGE合作，代言旗下天天炫舞游戏。2月14日，参加2014湖南卫视元宵喜乐会，并首次演唱《开到荼蘼》。3月代言碧生源功能茶。3月22日，作为嘉宾参加全球中文音乐榜上榜首播盛典。3月31日，在第21届东方音乐风云榜获”最佳新锐歌手“奖，现场再次演唱经典歌曲《我》。4月，参加湖南卫视明星户外旅行真人秀节目《花儿与少年》的录制 ，节目于4月25日-6月13日每周五晚在湖南卫视播出，首播收视率即夺得同时段冠军。6月21日，出席上海电影节传媒大奖颁奖礼。6月27日，受邀成为韩国品牌ALO眼镜首位中国代言人，并于7月赴韩国拍摄广告。6月，为世界级男性杂志《智族GQ》七月号拍片并接受专访。7月12日，出席重庆“The Young The Future 梦想未来”大型演唱会。7月25日，华晨宇主演的电影《我就是我》全国公映。8月5日，华晨宇在万事达汇源空间召开火星演唱会发布会并首唱新歌《Why nobody fights》，成为华语乐坛在千人演出场馆召开媒体发布会的第一人，也是亚洲唯一一位在北京世贸天阶大屏幕播出演唱会海报的歌手。8月16日，“雪碧音碰音”歌唱赛山西赛区总决赛暨华晨宇太原见面会在市青年宫演艺中心举行。9月6日至7日，华晨宇2014“火星”演唱会在北京万事达中心连开两场，并首次采用“场馆演唱， 线上直播”的全新模式。9月9日，出席“百社千校 书香童年”阅读活动湖南省启动仪式并领诵。9月10日，在北京举行首张个人专辑《卡西莫多的礼物》首发仪式暨搜狗网址导航“人气王”粉丝见面会。9月12日，首张专辑同名歌曲《卡西莫多的礼物》首发。同日，Pomellato宝曼兰朵宣布华晨宇成为其旗下品牌Dodo与Pomellato 67系列形象大使，并发布\"火星演唱会\"特别定制款\"MARS\"手链。9月19日，实体专辑内地版及海外版同步发行。这张专辑曲风多样，没有常见的爱情亲情题材，以第一人称“我”来叙述，讲述“我”对于自己、对于世界的感受，制作团队也相当用心，作为新人的首专，足够诚意。专辑海外版发行后在台湾五大唱片榜蝉联冠军。10月，华晨宇登上意大利杂志《L’Uomo Vogue》2014年10月刊\"THE MUSIC ISSUE“专题。10月11日，担任金鹰节互联盛典颁奖嘉宾。10月18日，出席西安超级公园音乐节 。10月19日，出席2015春夏上海时装周。10月29日，出席2015湖南卫视招商会并现场演唱《趁你还年轻》。11月6日，担任辽宁卫视《梦想音乐节》梦想导师。11月7日，《卡西莫多的礼物》音乐录影带上线，讲述生活在地球的雨果星人卡西与喜剧演员星云之间的故事，整片长达40分钟，后剪辑成两首单曲MV。11月8日，出席澳门The Starry Night Music Concert初冬音乐盛宴，现场演唱三首专辑新歌。11月11日，出席第三届凤凰视频记录片大奖盛典。11月15日，出席优酷全视频之夜启动发布会。11月18日，赴香港宣传专辑。11月22日，在北京举办首专唯一场签唱会。12月1日，专辑主打《why nobody fights》MV发布。12月3日，出席“明天的派对”跨界艺术展揭幕式并作为艺术家参展。12月24日，受邀出席郎朗北京演奏会并现场合作钢琴版《卡西莫多的礼物》与《微光》。12月31日，在湖南卫视跨年演唱会现场演绎《卡西莫多的礼物》与《不朽》。 2015年1月1日，加盟辽宁卫视新年欢唱会并献唱。1月10日，华晨宇演唱的《微光》被选为电视剧《何以笙箫默》的插曲 。1月16日，在优酷全视频之夜获全视频热点人物。1月17日，2014火星演唱会精剪版在湖南卫视播出。 歌手类 ▪ 2016-12-18    网易有态度人物盛典    年度最有态度燃爆唱将    （获奖）     ▪ 2016-12-02    MAMA（Mnet亚洲音乐大奖）    亚洲最佳艺人（中国）    （获奖）     ▪ 2016-09-27    亚洲新歌榜2016年度盛典      最佳男歌手    （获奖）     ▪ 2016-04-13    2016乐视生态共享之夜    年度最受欢迎歌手     （获奖）     ▪ 2016-03-29    2016酷亚洲音乐盛典    年度最具影响力歌手    （获奖）     ▪ 2016-03-29    2016酷亚洲音乐盛典    现场人气歌手    （获奖）     ▪ 2016-03-28    第23届东方风云榜    全民选择男歌手    （获奖）     ▪ 2016-03-28    第23届东方风云榜    传媒推荐奖    （获奖）     ▪ 2016-01-16    阿里音乐年度人气榜    年度最受欢迎艺人    （获奖）     ▪ 2016-01-12    2015移动视频风云盛典    最具人气男歌手    （获奖）     ▪ 2016-01-07    2015微博之夜    年度最受欢迎男歌手    （获奖）     ▪ 2016-01-07    2015微博之夜    2015亚洲新歌榜冠军王    （获奖）     ▪ 2015-08-23    2014Music Radio中国排行榜    年度最受欢迎新人    （获奖）     ▪ 2015-04-13    第十五届音乐风云榜年度盛典     2014年度最受欢迎男歌手（内地）    （获奖）     ▪ 2015-03-30    第22届东方风云榜    全民选择男歌手    （获奖）     ▪ 2015-03-25    2015QQ音乐年度盛典暨巅峰榜颁奖典礼     年度最佳内地男歌手    （获奖）     ▪ 2015-03-25    2015QQ音乐年度盛典暨巅峰榜颁奖典礼    年度最佳QQ音乐互动演唱会    （获奖）     ▪ 2015-02-02    2014第四届阿比鹿音乐奖    最受欢迎流行音乐人    （获奖）     ▪ 2015-01-17    腾讯应用宝“星app之夜”年度盛典    年度最佳男歌手    （获奖）     ▪ 2014-12-31    第二届乐动·微乐迷流行音乐 