INSERT INTO `tb_singer` VALUES ('9', '林宥嘉', '华语男歌手', 'http://p1.music.126.net/DeH1T1OKwTL2bIg3l8L21A==/109951163186203713.jpg?param=130y130', '林宥嘉（英文名：Yoga Lin，1987年7月1日－）是中国台湾著名男歌手。出生于台湾屏东县，是家中长子，有一弟一妹，家里经营建材生意。林宥嘉考上凤山高中后搬到高雄居住，高中毕业后就读于国立东华大学运动与休闲学系。2007年7月6日以20岁大学生的身份，获得台湾中视主办的歌唱选秀节目第一届《超级星光大道》冠军，并与华研国际音乐签约成为歌手。演唱歌曲有《你把我灌醉》《悬崖》《我爱的人》《你是我的眼》等。曾获第十届CCTV-MTV音乐盛典港澳台地区年度最受欢迎潜力歌手奖。林宥嘉拥有独特的声线和极佳的唱功，人称“迷幻唱腔”，“迷幻王子”。代表作包括《说谎》、《伯乐》、《我总是一个人在练习一个人》、《诱》、《自然醒》、《想自由》、《心酸》、《残酷月光》等。2017年5月16日入围金曲奖最佳男歌手奖。 ▪ 录音室专辑 神秘嘉宾 ( 2008.6.3） 感官世界 ( 2009.10.30） 美妙生活 ( 2011.5.6） 大小说家（2012.6.22） 今日营业中（2016.6.17） ▪ 迷你专辑 口的形状（2014.5.23） ▪ 现场专辑 Jazz Channel（2013.2.5） 有时THE GREAT YOGA 有时口的形状（2017.1.6） ▪ 影音专辑 \"感官/世界\"影音馆DVD（2010.1.15） \"大小说家\" 影音DVD（2012.12.28） \"神游\"世界巡回演唱会台北旗舰场3DVD/2BD（2013.7.1） ▪ 数位专辑 香港迷宫演唱会数位精选特辑（2009.5.1） 感官/世界音乐会Live精选（2010.6.22） ▪ 影视原声歌曲 电视剧《斗牛，要不要》原声收录《背影》（2007.12） 电影《LOVE》原声收录《傻子》（2012.2） 电影《大稻埕》原声收录《向前走》（2014.2） 武侠电视剧《秦时明月》原声收录《天将明》（2015.11） 戏剧《必娶女人》原声收录《兜圈》《神秘嘉宾》《思凡》（2015.11） 电影《追婚日记》原声收录《如果我变成一首歌》（2015.12） 时代剧《一把青》原声收录《天上的男人 地上的女人》（2016.2） 电视剧《飞鱼高校生》原声收录《我梦见你梦见我》《热血无赖》《天真有邪》（2016.7） 电影《从你的全世界路过》原声收录《全世界谁倾听你》（2016.9） 电影《西城童话》原声收录《长大的童话》（2016.11） 说谎、伯乐、自然醒、想自由、你是我的眼、心酸、残酷月光、传说 等 ▪ 星光同学演唱会系列（共四场） ▪ Star 4 You 校园演唱会系列（共六场） ▪ 迷宫巡回演唱会（共六场） ▪ 感官/世界巡回音乐会（共十场） ▪ 神游巡回演唱会（共十八场） ▪ 口的形状巡回演唱会（共三场） ▪ THE GREAT YOGA 世界巡回演唱会（三十场） ▪ 其他个人演唱会（共八场） 林宥嘉自小展现歌唱天份，他接受壹周刊专访时表示，陶喆是启蒙他音乐的重要歌手。高中时林宥嘉为 校内热门乐团的主唱，当时曾经接受过实力派歌手杨培安关于摇滚音乐方面的指导，杨培安对年少的林宥嘉在R&B方面展露的天份留下了深刻的印象。林宥嘉上大学之后仍继续在校组团练唱，并在校内拥有不小知名度，后来因为想要寻求音乐上的突破而退出乐团，转往花莲当地的餐厅担任驻唱歌手。不过这段驻唱生涯仅维持两个月，就因为餐厅失火停止营业而被迫中止。在2006年12月于高雄参加第一届“超级星光大道”分区初选之前，林宥嘉没有以个人身分参加过正式的歌唱比赛。 林宥嘉是台湾第一届《超级星光大道》总冠军。在比赛中，他用自己独特的嗓音和对歌曲的领悟力，总能用自己的方式诠释出和原唱不同的风格，打动了许多人的心，把听者带入一个迷幻的音乐殿堂。在比赛中，林宥嘉其中，《走钢索的人》首次打响了他的知名度，让听者第一次领略到了他的音乐魅力，也为他赢得了“迷幻宥嘉”的称号；在比赛中他更是不断进步，挑战自己，凭借精彩演绎的《你把我灌醉》、《悬崖》、《我爱的人》、《你是我的眼》、《那些日子》、《拔河》、《爱我好吗》、《到不了》、《老实情歌》、《Creep》、《last order》拿下11次满分，是《超级星光大道》中无可挑剔的满分王。此外，林宥嘉还是第一届《超级星光大道》中保持踢馆赛全胜记录的选手。其中终极指名踢馆赛中演唱的《你是我的眼》和总决赛中演唱的《Creep》，评审更给予25分的满分高分（保持最高分记录），《我爱的人》，《走钢索的人》和《你是我的眼》更因为其独特的演绎成为脍炙人口的热门歌曲，被收录在《超级星光大道×10强纪念合辑》和《爱星光精选昨天今天明天》之中。 ▪ 参赛曲目、原唱及得分 2006-12-27 南部试唱 《Katrina》/ 陶喆 百人初选 《我恨我爱你》/ 张惠妹 2007-1-26 百万巨星殊死战 50取20人（上） 《爱》/ 莫文蔚16分 2007-3-9 鹿死谁手：一对一PK赛（下） 《走钢索的人》/ 李泉19分 胜陶妍妏13分 2007-3-23 石破天惊：快歌指定赛 《can\'t take my eyes off you》/ Frankie Valli 16分 2007-3-30 同舟共济：16强合唱指定赛 VS徐亦晴《梁山伯与茱丽叶》/ 曹格 卓文萱19分 2007-4-6 突破重围:15强淘汰赛（一片歌手陪审团） 《你快乐所以我快乐》/ 王菲11分 2007-4-13 向偶像致敬：大震撼！临场状况考验淘汰赛 《打开爱》/ 王力宏19分 2007-4-20 优胜劣败：1对1PK赛 《真的吗》/ 莫文蔚14分 败 徐亦晴 16分潘裕文20分 2度PK 《我是一只鱼》/ 任贤齐16分平手苏贝如 评审投票淘汰苏贝如 注：由于好友蔡政霖在这次比赛中被淘汰，林宥嘉曾一度崩溃流泪，甚至想要退出比赛。但在诸多人劝说下，林宥嘉决定继续比赛，对音乐的信念更加坚定，为实现梦想而努力。在之后的比赛中，林宥嘉如浴火重生的凤凰般，表现更甚从前。 2007-4-27 挑战.试炼：艺人合唱指定赛 VS黄大炜《你把我灌醉》/ 黄大炜20分（满分） 2007-5-4 机会.命运：踢馆挑战赛Part I 《悬崖》/ 齐秦20分（满分） 胜林道远18分 2007-5-18 心魔：踢馆挑战赛Part III 《我爱的人》/陈小春20分（满分） 胜辛巴 12分 2007-5-25 他山之石可以攻破:终极版指名踢馆赛 《你是我的眼》/ 萧煌奇25分（满分+附加分5分满分） 胜 林道远 17分 2007-6-1 险峰:不插电演唱淘汰赛 《那些日子》/ 陶晶莹20分 2007-6-8 积分赛 水能载舟:地狱悲歌 VS 天堂High歌 地狱悲歌《陌生人》/ 蔡健雅& 天堂high歌《半个月亮》/ 梁静茹17分 2007-6-15 积分赛：旧爱还是最美 VS蔡政霖 《拔河》/ 梁汉文、陈奕迅 23分（满分+附加分3分） 选SHE签唱会的4个人 《爱我好吗》/ 卓文萱 20分（满分）预录没有播出，后来又播放歌曲片断。 2007-6-22 积分赛：偶像对唱抗压战 和康康对唱 《到不了》/ 康康 23分（满分+附加分3分） 2007-6-29 第五名决定赛《老实情歌》/ 庾澄庆23分（满分+附加分3分） 2007-7-6 总决赛《Creep》/RadioHead 25分（满分）《Last Order》/陈奕迅24.5分（分数在决赛后由媒体公布） 说明：林宥嘉在决赛中选的歌是绝对的冷门中的冷门，足见他对音乐的坚持和独到见解。林宥嘉对这两首歌的演绎震撼全场，评委讨论一致决定林宥嘉为最终第一届超级星光大道总冠军。 林宥嘉以第一届《超级星光大道》冠军的身份，顺利和华研国际音乐签下六年的唱片和经纪合约，参与了两张合辑和一张电视原声带的录音，和很多的商业演出和广告拍摄，并以其清新正面的社会形象，成为台湾国家科学委员会科学展览的代言人。 2007年12月29日，林宥嘉和周定纬、潘裕文、许仁杰以及杨宗纬在国立台湾大学体育馆举办《星光老师同学会》演唱会，出道一年后便开办售票集体演唱会，吸引了超过4000人入场。林宥嘉于2008年3月15日和周定纬等华研同门歌手，于马来西亚云顶高原举办海外首场正式的售票演唱会，反应热烈，引起当地传媒的广泛关注。 2008年8月3日，同班人马再于香港伊莉沙伯体育馆开唱，3000张门票于半日内清空，当日再加场也全数售罄，获得观众及香港传媒高度好评。 林宥嘉的首张个人专辑《神秘嘉宾》于2008年6月3日发行。知名电影导演易智言亲自执导专辑单曲〈伯乐〉的MV。2008年5月24日、30日、6月7日分别在台北、台中、高雄举办3场售票演唱会，命名为《林宥嘉2008迷宫巡回演唱会》，创下台湾歌手开办个人售票演唱会的最年轻纪录。首场台北演唱会，三场总座位数一万两千多席，卖座率超过九成，高度音乐性的曲目和极具娱乐性的编排，受到业内人士和媒体的高度评价。 《神秘嘉宾》专辑发行后，更以首周超过四万张的销量，夺下台湾包括G-Music(41.11%)，五大唱片（21.22%），博客来网络书店和新加坡的HMV等几大销售排行的冠军，并一举拿下台湾三大广播网（Hito Radio台北之音，Kiss Radio大众电台，UFO飞碟联播网），和两大网络点播系统（ezPeer+线上音乐，KK Box线上音乐）的冠军。 2008年7月5日林宥嘉获邀于第19届台湾金曲奖担任表演嘉宾，同年10月3日代表台湾赴韩国首尔出席亚洲音乐节，演出获得好评，并获颁亚洲新人奖。接着在10月25日于新加坡金曲奖获得六项入围，首张个人专辑《神秘嘉宾》荣获最佳专辑制作人奖，林宥嘉个人荣获年度人气大奖、优秀新人奖及榜上风光奖。10月29日于香港举行的全球华语歌曲排行榜典礼上，林宥嘉获得“最受欢迎新人奖”，专辑歌曲〈眼色〉获选为2008年全球华语歌曲排行榜的二十大金曲。12月7日荣获香港TVB8金曲榜最佳新人金奖，12月23日于北京音乐风云榜新人盛典荣获年度港台最佳新人，12月26日荣获香港新城劲爆新人王（台湾歌手）。2009年1月4日于重庆举行的雪碧2008中国原创音乐流行榜新势力晚会，林宥嘉荣获台湾地区最优秀新人奖及网络至IN人气歌手奖。 2009年1月23日及24日，林宥嘉在香港成功举行两场“迷宫”演唱会，获得媒体大幅报导。同年2月20日，新加坡站在室内体育馆举行，是“迷宫”巡回的最终站，也是总共六场演唱会当中观众人数最多的一场。 2009年6月27日在台北举行的第二十届金曲奖颁奖典礼，林宥嘉个人入围最佳新人奖，首张专辑歌曲〈病态〉入围最佳音乐录影带导演奖（比尔贾），〈眼色〉入围最佳作曲（李泉），〈眼色〉也入围并勇夺最佳单曲制作人奖（王治平、郭文宗） 林宥嘉第二张国语大碟《感官/世界》于2009年10月30日发行。《感官/世界》由王治平担任总制作人，知名音乐人陈小霞、郭文宗、吕绍淳、陈伟等担任单曲制作人，并邀得黄伟文、林夕、施人诚、黄建为、小宇等知名创作人担任词曲。专辑内歌曲之一《说谎》也成为电影短片“针尖上的天使”之主题曲，林宥嘉担纲男主角，自然内敛的演技深获导演吴米森赞赏，此片亦入围了2010第十二届台北电影奖竞赛项目-非剧情长片类-最佳短片。 林宥嘉并获台湾国家交响乐团邀请合作一系列三场“My Hope”古典和流行音乐结合的跨界音乐会，成为国家交响乐团有史以来合作过最年轻的歌手。唱片公司为了宣传林宥嘉的第二张专辑“感官/世界”在台湾举办了三场live预购新歌抢听会，在香港、新加坡、中国多个城市展开巡回表演。 《感官／世界》获得中华音乐人交流协会2009十大专辑奖项，专辑在海外各大颁奖中也屡获不少奖项，在台湾却仅入围了第二十一届金曲奖“最佳音乐录影带奖”和“最佳专辑包装奖”二项非音乐性奖项提名，让网友评为是金曲奖最大一颗遗珠，最终《感官／世界》获得“最佳专辑包装奖”奖项。 林宥嘉第三张国语大碟《美妙生活》于2011年5月6日发行。 这一次的专辑主要是‘用音乐记录生活’，这张专辑中部分歌曲唱片公司也特别安排林宥嘉到美国录制。《美妙生活》发行后，第二次个人大型巡回演唱会“神游”也展开，首站于2011年8月12日上海大舞台正式起跑，最大的特点是曲目有别于“迷宫巡回演唱会”、“感官/世界巡回音乐会”中大量的翻唱，以演唱林宥嘉自己三张专辑的歌曲为主，整场演唱会30几首歌曲中仅3首翻唱歌曲。 《美妙生活》发行后屡获不少海外奖项，在台湾除获得中华音乐人交流协会2011年度十大优良专辑暨单曲双榜，亦入围了第二十三届金曲奖“最佳国语专辑奖”、“最佳国语男歌手奖”和“最佳单曲制作人奖”三项奖项提名。 林宥嘉第四张国语大碟《大小说家》于2012年6月22日发行。《大小说家》发行后亦屡获不少海外奖项，在台湾再次获得中华音乐人交流协会2012年度十大优良专辑暨单曲双榜，这也是林宥嘉三度连庄“十大优良专辑”。同时也入围了第二十四届金曲奖“最佳国语男歌手奖”、“最佳编曲人奖”和“最佳作曲人奖”三项奖项提名。 林宥嘉首张实体现场大碟《Jazz Channel》于2013年2月5日发行。这张专辑收录了2012年2月26日于台北国际会议中心举行的《林宥嘉邂逅爵士慈善音乐会》16首歌曲现场录音。 林宥嘉首张演唱会现场影音大碟《林宥嘉神游世界巡回演唱会台北旗舰场DVD》于2013年7月1日发行。DVD完整收录2012年6月2日于台北小巨蛋举行的《林宥嘉神游演唱会》全场影音内容，并同步发行蓝光片。 林宥嘉音乐小说概念书《我们从未不认识》于2013年7月29日发行。由自转星球出版社发行，林宥嘉（文本/文字）、万金油（小说）、聂永真（设计）及登曼波（摄影）共同合作完成。 林宥嘉首张EP《口的形状》于2014年5月23日发行。这张专辑收录两首林宥嘉的音乐创作，其中《口的形状》是林宥嘉第一首完全以乐团逻辑去完成的创作，邀请了独立乐团大象体操合作。林宥嘉同时也举办入伍暂别歌坛前的“口的形状”巡回演唱会，于香港、台北、上海举行。 2014年8月13日林宥嘉正式入伍，在艺工队服役期间常巡回各地演出，并利用放假持续创作。2015年7月22日退伍后，即陆续推出多首作品，其中林宥嘉作曲并演唱的《兜圈》及《如同悲伤被下载了两次》（和陈珊妮合作）在2015 Hit Fm 年度百首单曲分居26及34名。 林宥嘉第五张国语大碟《今日营业中》于2016年6月17日发行，其中在专辑里更首次收录了广东歌《坏与更坏》。同年9月，以“帮我消消黑眼圈”身份参加江苏卫视《蒙面唱将猜猜猜》节目录制。林宥嘉凭此张专辑入围了第二十八届金曲奖“最佳国语男歌手奖”、“年度歌曲奖”二项奖项提名。 ▪ 2007年 第一届《超级星光大道》：冠军 ▪ 2008年 2008 HITO流行音乐奖 Hito声猛新人奖（星光帮）、最受欢迎新人（星光帮） 香港新城国语力颁奖礼 跃进歌手大奖、新势力歌手、人气偶像大奖（星光帮）、新势力组合（星光帮） 韩国首尔亚洲音乐节 亚洲新人奖 第14届新加坡金曲奖 年度人气大奖、优秀新人奖、榜上风光奖 第八届全球华语歌曲排行榜 年度二十大金曲〈眼色〉、最受欢迎新人奖 香港TVB8金曲榜 最佳新人金奖 新浪北京首届音乐风云榜新人盛典 年度港台最佳新人奖 香港新城劲爆新人王 劲爆新人（台湾歌手） ▪ 2009年 〔入围 第20届金曲奖 最佳新人奖〕 雪碧中国原创音乐流行榜 新势力网络至IN人气歌手奖、台湾地区最优秀新人奖 HitFM 年度十大专辑《神秘嘉宾》 第三届Freshmusic Awards 最佳新人奖 新加坡e乐大赏2009 1003优势流行榜年度歌曲〈伯乐〉 2008 IFPI香港唱片销量大奖 十大销量国语唱片《神秘嘉宾》 MusicRadio中国TOP排行榜 港台地区年度最受欢迎新人奖、港台校园人气歌手、港台地区音乐之声推荐唱片《神秘嘉宾》 中华音乐人交流协会年度十大单曲〈眼色〉 2009 HITO流行音乐奖 2008年度十大华语歌曲〈神秘嘉宾〉 第六届劲歌王全球华人乐坛年度总选颁奖礼 国语最有前途新人金奖、国语十大金曲奖〈眼色〉 ▪ 2010年 2009年加拿大至HIT中文歌曲排行榜 全国推崇十大歌曲(国语)《说谎》 HitFM 年度十大专辑《感官/世界》 全球流行音乐金榜奖项 推崇新生代男歌手 新加坡e乐大赏2010 1003人气优势歌曲〈看见什么吃什么〉、华语音乐传媒大奖〈说谎〉 第十七届东方风云榜华语五强（台湾地区） Music Radio DJ推荐2010年年度20大华语专辑《感官/世界》 第14届全球华语榜中榜 最佳新晋歌手 2010Hito流行音乐奖 2009年度十大华语歌曲〈说谎〉 2009 IFPI香港唱片销量大奖 十大销量国语唱片《感官/世界》 蒙牛酸酸乳音乐之声中国TOP排行榜 港台校园人气歌手、港台年度金曲《说谎》 第四届Freshmusic Awards 我最喜爱的男歌手、我最喜爱的K歌《说谎》、最佳男演唱人 第10届华语音乐传媒大奖 年度国语歌曲《说谎》 中华音乐人交流协会年度十大专辑〈感官/世界〉 香港新城国语力颁奖礼 全国最受欢迎偶像、优秀演绎奖、国语力歌曲《说谎》 华语金曲奖 十大华语金曲《说谎》、最佳国语男歌手 第十届CCTV-MTV音乐盛典 港澳台地区年度最受欢迎潜力歌手 第十届全球华语歌曲排行榜 年度二十大金曲〈看见什么吃什么〉 ▪ 2011年 香港电台十大中文金曲颁奖典礼 优秀流行国语歌曲奖金奖-《说谎》 第33届十大中文金曲颁奖音乐会 优秀流行国语歌曲奖／金奖《说谎》 雪碧中国原创音乐流行榜 台湾地区最佳男歌手奖、港台金曲奖《说谎》 2010KKBOX数字音乐风云榜《华语单曲榜-说谎》第51名、《华语专辑榜-感官世界》第38名 2010新加坡电台年终百大单曲排行《心酸》《说谎》《Fly My Way》 第二届MY Astro至尊流行榜 至尊金曲／《说谎》 第11届音乐风云榜年度盛典 最佳歌曲奖《说谎》(港台) 第11届全球华语歌曲排行榜 年度二十大金曲〈想自由〉 第17届新加坡金曲奖 酸心龙虎榜榜上风光奖、飞跃大奖、年度专辑奖《美妙生活》 ▪ 2012年 〔入围 第23届金曲奖 最佳国语男歌手奖、最佳国语专辑奖《美妙生活》〕 2011年加拿大至HIT中文歌曲排行榜 全国推崇男歌手(国语) 北京2011年度流行音乐典礼（中国歌曲排行榜）年度最佳男歌手奖（港台）、年度金曲奖〈想自由〉 HitFM 年度十大专辑《美妙生活》 2011 IFPI香港唱片销量大奖 十大销量国语唱片《美妙生活》 第3届MY Astro至尊流行榜颁奖礼 至尊金曲〈想自由〉、至尊大跃进歌手（海外）、至尊演绎歌手（海外） 第六届Freshmusic Awards 最佳男演唱人、我最疯狂迷恋的至Fresh男歌手、我最感同身受的至Fresh金曲《我总是一个人在练习一个人》、最佳单曲制作人：王治平&林宥嘉《我总是一个人在练习一个人》、年度10大专辑《美妙生活》 第19届东方风云榜 华语五强 最受欢迎歌手（台湾地区） 第12届音乐风云