INSERT INTO `tb_singer` VALUES ('11', '徐秉龙', '华语男歌手', 'http://p1.music.126.net/4AFuQr4QxXlq-N3Uqun9AA==/109951163424310880.jpg?param=130y130', '徐秉龙，00后原创音乐人，词曲作者，南方生人。煮草文化旗下艺人，自学写歌。15岁发表第一首原创作品，16岁为林宥嘉创作单曲《船》，17岁开启七城巡演。 2018年联袂制作人许环良发行个人首张EP《零零》收录三首歌曲； 2018年10月举办《来日可期》个人全国12场livehouse专场； 代表作品：《白羊》、《青柠》、《千禧》 微博@Barry徐秉龙');
INSERT INTO `tb_singer` VALUES ('12', '花粥', '华语女歌手', 'http://p1.music.126.net/f2R3-se6DLlcucIusS6mQQ==/109951163610593454.jpg?param=130y130', '音乐工作者 风格：民谣 / 独立 / 小清新 现居：湖南 长沙 生日：7-21 星座：巨蟹座 唱片公司：北京博生兄弟文化传播有限公司  高中：乌鲁木齐高级中学 大学：中南林业科技大学 大学专业：机电工程学院 2012年独自异军突起的“清新”派民谣歌手，来自新疆，就读于长沙某高校的普通大学生。 在同学们着迷流行音乐，花枝招展的勾搭小伙子时，花粥已经抱着一把杂牌吉他创造了中国民谣歌手的诸多新纪录。');
INSERT INTO `tb_singer` VALUES ('13', 'G.E.M.邓紫棋', '华语女歌手', 'http://p1.music.126.net/r7uMnwjWpYMuQI_3ZTg56A==/18528969953189760.jpg?param=130y130', 'G.E.M.邓紫棋（Gloria Tang Tsz-Kei），原名邓诗颖，1991年8月16日生于中国上海，4岁移居香港，中国香港创作型女歌手。 邓紫棋出生在上海，成长于一个音乐世家，父亲是香港人，母亲是上海音乐学院声乐系毕业生，外婆教唱歌，舅父拉小提琴，外公在乐团吹萨克斯风。在家人的熏陶下，邓紫棋自小便热爱音乐，喜爱唱歌。 邓紫棋5岁时便开始尝试作曲及填词，7岁时参与教育电视的演出，13岁完成英国皇家钢琴检定考试八级，并与陈奕迅合拍月饼义卖广告 。 邓紫棋小学就读香港九龙太子道西中华基督教会协和小学，同时为校内诗歌班成员。中学就读真光女书院，从中学一年级开始不断参加各种歌唱比赛，曾一年内获得了5个比赛的冠军。 2006年，14岁的邓紫棋参加Spice It Up学界联校歌唱比赛，夺得比赛冠军，被经理人张丹（Tan）邀请签约蜂鸟音乐，但是因为学业关系，16岁才正式出道成为歌手。而蜂鸟音乐一共只有十几位员工，因此在传统媒体渠道受限的邓紫棋从出道起就一直在微博等自媒体上记录成长并与歌迷直接交流。出道后仍考入香港演艺学院，主修声学。后因工作量日渐增多，她在2009年上半年放弃香港演艺学院的声学课程 。 2008年7月10日，推出第一支单曲《等一个他》正式出道。10月16日，16岁的邓紫棋推出个人首张EP《G.E.M.》，碟内收录3首广东歌与2首国语歌，其中也收录了当年的参赛歌曲《Sleeping Beauty》的中文版《睡公主》。EP推出后获得十大劲歌金曲最受欢迎女新人金奖、第31届十大中文金曲最有前途新人奖银奖等奖项。 2009年，获得叱咤乐坛流行榜颁奖典礼“叱咤乐坛生力军女歌手金奖”。5月5日，赴美国洛杉矶为第二张个人专辑《18...》录音，并于10月27日发行。专辑推出后，获得IFPI香港唱片销量大奖颁奖礼2009“十大销量广东唱片”和“十大销量本地歌手”奖 。11月20日至22日 ，在九龙湾国际展贸中心举行三场《G.E.M. 18 LIVE 2009》演唱会。同年12月，赴加拿大多伦多举行首个海外音乐会。 2010年4月7日，到台湾进行为期10天的宣传，并于5月14日推出个人专辑《18...》台湾版。6月27日，《18...》在内地发行。7月30日，与Mr.举行“拉阔擂台音乐会”。10月28日，推出第三张音乐专辑《My Secret》，11月1日，推出限量纪念版《MySecret Box Set》 。该专辑推出后，获得IFPI香港唱片销量大奖2010“十大销量广东唱片”、IFPI香港唱片销量大奖2011“十大销量国语唱片”  、新城国语力颁奖礼2011“ 新城国语力最受欢迎专辑”等奖项。 2011年，年仅19岁的邓紫棋在香港红馆举办5场个人演唱会，在澳门、广东、澳洲、温哥华、多伦多、美国内华达州里诺等地举办了“G.E.M. Get Everybody Moving”世界巡回演唱会。 2012年3月，邓紫棋代表中国香港，与日本歌手阳光直人、台湾歌手唐禹哲在亚洲博览馆举行以“亚洲三角”为主题的《ASIA MUSIC CONNECTION 2012》，在日本、中国台湾和中国香港举办巡回演唱会。4月，正式开始广东巡回音乐会之旅 。6月27日，邓参与iTunes Live@Hong Kong，与Jason Mraz及方大同同台演出。在排练过程当中Jason建议G.E.M.为《Lucky》重新编曲及填词，把歌词改成中文，让他们这首合唱歌变成独一无二的版本。7月5日，推出第四张音乐专辑《Xposed》，邓紫棋凭此辑获得2012年度IFPI香港唱片销量大奖“全年最高销量国语唱片”及“全年最高销量本地女歌手”等四项大奖，并入围了第24届金曲奖最佳国语女歌手。10月27日，邓的YouTube Channel——（GEMblog）观看量突破6000万。11月19日，她首个官方手机应用程式正式发布。 2013年3月，推出首张个人精选辑《The Best Of G.E.M. 2008-2012》，翌年于参加《我是歌手》期间推出内地版本，首月销量冲破十万张 。同年开启《G.E.M.X.X.X. Live世界巡回演唱会》，4月在红馆完成一连五场香港站个人演唱会后，邓紫棋到奥地利等十个国家游学，9月举办广州站演唱会。10月，推出个人现场创作《LIVE Piano Session》，当中包括原创作品《偶尔》和《我的秘密》，以及重唱苏芮旧作《是否》。10月，获得全球华语歌曲榜颁奖典礼“年度最受欢迎20大金曲”以及“最受欢迎创作歌手”两奖 。11月26日，推出G.E.M. X.X.X. Live演唱会DVD。 2014年初，参赛《我是歌手第二季》，常规赛获得4冠5亚，并于4月夺得总决赛亚军 。3月3日，成为facebook首位突破100万Likes的香港艺人 。3月31日，获得在洛杉矶举行的第27届儿童选择大奖颁奖礼（Kids\' Choice Awards，KCA）“最受欢迎亚洲艺人大奖” 。5月1日至3日，在澳门金光综艺馆举办三场个人演唱会。5月4日，2014福布斯中国名人榜发布，邓紫棋首次进榜，并列在第91位 。5月16日、17日，在北京万事达中心举办两场个人演唱会。6月28日，在深圳举办个人演唱会，演出场地由深圳湾体育馆升级到三万人坐席的深圳湾体育场，门票依然提前一个月售罄 。7月4日至6日，在上海梅赛德斯－奔驰文化中心举办三场个人演唱会 。7月10日，献唱由韩寒首次执导的电影《后会无期》同名主题歌。7月11日、12日，在杭州黄龙体育馆举办两场个人演唱会，成为杭州演出史上首位临时加场歌手 。8月11日，在奥克兰开唱，未满23岁便完成50场个人演唱会。8月28日，成为首位Youtube Channel播放破亿的华人歌手。10月17日至19日，在广州国际体育演艺中心举办三场个人演唱会。9月30日，成为XCOR（环宇亚洲）的首位全球华人形象大使，10月底，作为即将登上太空的首位华人明星，前往荷兰阿姆斯特丹进行太空训练 。12月10日，邓紫棋的蜡像入驻香港杜莎夫人蜡像馆， 成为蜡像入驻该馆年龄最小的艺人。2014年5月份至2014年底，邓紫棋总共举办了35场个人演唱会。 2015年1月14日至18日，在香港红磡体育馆举办5场个人演唱会。1月23日至24日，在马来西亚吉隆坡举办两场个人演唱会。1月30日至2月1日，在新加坡举办3场个人演唱会。2月18日，参加2015年中央电视台春节联欢晚会， 自弹自唱其自创的歌曲《多远都要在一起》 。3月12日，首度在台北小巨蛋体育馆举办个人演唱会，此前本场演唱会门票在4个小时内售罄。北美时间4月21日，在洛杉矶举行发布会，宣布与美国演唱会娱乐公司Live Nation合作，将于2015年11月3日起，在美国、加拿大、欧洲重要城市举行邓紫棋北美及欧洲巡回演唱会。5月12日，2015福布斯中国名人榜发布，邓紫棋再度上榜，综合排名上升第11位。5月，美国Billboard开设首个亚洲网络电台Billboard Radio China，邓紫棋参加节目Big Interview成为首位访谈嘉宾。5月23日，在上海八万人体育场举办个人演唱会。  8月1日，在北京工人体育场完成《G.E.M. X.X.X. LIVE世界巡回演唱会》中国巡演终点站。亦首次采用全程全网现场直播方式，吸引48万观众在线付费观看。此轮巡演到此已完成64场，打破此前华语乐坛女歌手单次巡演59场的记录 。8月7日，确认将联同艾薇儿·拉维尼、阿什丽·提斯代尔及黛米·洛瓦托一起为好莱坞卡通音乐电影《Charming》配音 。8月15日，受邀担任中国好声音第四季梦想导师。当地时间8月31日，邓紫棋受瑞士TAG Heuer泰格豪雅总部邀请，在瑞士阿尔卑斯山脉少女峰举办音乐会，成为首位在瑞士阿尔卑斯山少女峰公开表演的中国音乐人。10月23日至24日，重返马来西亚举办两个个人演唱会 。10月29日，在北京正乙祠举办个人第五张专辑《新的心跳》发布会，宣布将于11月6日发行第一张华语录音室专辑，该专辑十首歌由邓紫棋包办全部的词曲创作，并都有MV，是其首张视听专辑。整场发布会由邓独自主持完成；2015年11月3日，邓紫棋美欧巡演在加拿大温哥华Pacific Coliseum开唱。11月6-7号，邓紫棋分别在美国加州圣何塞SAP Center和洛杉矶The Forum场馆开唱，并成为在The Forum开唱的首位华人歌手 。11月11日，邓紫棋于加拿大多伦多Air Canada Centre继续巡演，同时筹得善款后探访中侨互助会养老院帮助华侨老人 。11月15日，邓紫棋在泰勒、滚石曾举行纽约演唱会的Prudential Center开唱。11月18日在芝加哥举行演唱会后，2015年11月22日，《G.E.M.X.X.X.Live世界巡回演唱会》最终站在英国伦敦温布利体育馆进行 。2015年11月，邓紫棋入选新华网报道的网友投票评选出“中国90后10大影响力人物”，名列第六；同年12月5日，参加了第九届音乐盛典咪咕汇。12月26日，邓紫棋获得Billboard Radio China 年度艺人称号 。2015年12月31日，邓紫棋出席湖南卫视跨年演唱会，演唱《北京北京》等三首歌曲。 2016年1月5日，美国《福布斯》杂志公布2016年度“全球30岁以下最具潜力30名杰出音乐人”排行榜，邓紫棋成为亚洲地区唯一入选人士。 2月26日，《福布斯》公布“亚洲30岁以下30大最具潜力文体明星”榜单，邓紫棋为榜单中唯一中国歌手。3月至4月邓紫棋凭专辑《新的心跳》第6届全球流行音乐金榜年度最佳女歌手、第2届酷音乐亚洲盛典年度最佳歌手（港台）等15个奖项。5月9日至23日期间，邓紫棋再次推出现场钢琴录音系列《Live Piano Session Ⅱ》，其中包括个人创作的新作品《给你的歌》、《画》以及重新用钢琴演绎摇滚旋律的《再见》。5月27日至30日，邓紫棋应TAG Heuer泰格豪雅之邀，以全球品牌大使身份出席2016年F1摩纳哥大奖赛，在摩纳哥驻华大使凯瑟琳·福特里埃女士（Catherine Fautrier）的陪同下参观了摩纳哥王宫。并为红牛车队助阵，参与了泰格豪雅新品发布会，现场弹唱《If I Ain\'t Got You》等歌曲；7月6日，邓紫棋作为鸟叔战队的“秘密武器”加盟由微鲸VR和灿星制作联合出品的中国首档EDM电子音乐真人秀《盖世英雄》；7月11日，“世界杰出华人青年大奖颁奖典礼”在香港举行，邓紫棋身着白色礼服出现，作为唯一一位歌手演艺人身份和各领域优秀人士一起获得“世界杰出华人青年大奖”；同年7月邓紫棋还推出三首EDM电音风格的歌曲，均是来自综艺节目《盖世英雄》中歌手竞技环节的翻唱歌曲，其中《红蔷薇白玫瑰》翻唱自BIGBANG太阳的歌曲《眼鼻嘴》，邓紫棋重新填词献唱，另一首《喜欢你（EDM Mix）》则是改编自BEYOND经典歌曲，由PSY（鸟叔）操刀编曲，G.E.M.邓紫棋重新演绎的一首EDM Mix全新版本，亦是邓紫棋首次与韩国团队跨国合作的作品以及《夜空中最亮的星》则是典型的“邓式”改编，以电子舞曲的方式诠释了这首走心且动人的歌曲，邓紫棋性感又真实的嗓音更是赋予这首歌新的魅力；9月30日，G.E.M邓紫棋《25LOOKS》写真集正式发行，内附的迷你专辑也于各大音乐平台同步上线，里面收录了《泡沫》、《瞬间》、《再见》、《多远都要在一起》四首歌曲的REMIX版本，利用动感的鼓点和魔幻的电音，重新演绎经典曲目，带来新的视听惊喜；11月11日，G.E.M.邓紫棋亮相“双十一狂欢夜”，演唱电音版《再见》燃起晚会火爆气氛；11月30日，邓紫棋与多位明星合作录制的2016年世界艾滋病日公益歌曲《瞳孔里的太阳》上线首发；12月2日，邓紫棋以29644733票摘得第十届音乐盛典咪咕汇最佳人气女歌手奖；12月30日，由邓紫棋创作并演唱的科幻冒险电影《太空旅客》中国区主题曲《光年之外》正式发行；12月31日，出席2017湖南卫视跨年演唱会，演唱《光年之外》，《夜空中最亮的星》两首歌曲。 2017年1月6日，作为邓紫棋大银幕处女作的青春励志电影《一路逆风》全国上映，影片围绕邓紫棋出道10年，讲述了一个深受90后观众欢迎的年轻音乐人，如何在网络时代从一鸣惊人到走向巅峰，再从低谷的绝望到一路逆风飞扬 ；1月21日，第12届KKBOX风云榜在台北小巨蛋举行，邓紫棋身穿纯白细肩带连身裤，演唱歌曲《泡沫》、《光年之外》两首歌曲，并在当晚获得年度风云歌手奖；1月27日，邓紫棋在央视鸡年春节联欢晚会广西分会场上，与张信哲、黄婉秋共同演唱歌曲《歌从漓江来》；4月，邓紫棋《Queen of Hearts》个人第三场世界巡回演唱会正式启动；5月，为电视剧《上古情歌》献唱片尾曲《桃花诺》 ；6月，为电视剧《楚乔传》献唱片尾曲《心之焰》 。8月9日，获得2017华语金曲奖“年度艺人”、“我最喜爱的女歌手（香港）”、“全国传媒联合推介歌手”，同时她的歌曲《光年之外》获得“十大华语金曲” 。12月11日，邓紫棋歌曲《光年之外》荣获Billboard Radio China 2017年度华语十大金曲奖。 2018年5月，邓紫棋以唯一女制作人身份正式宣布加盟《中国新说唱》。6月25日，为电影《阿修罗》献唱主题曲《爱如意》。');
INSERT INTO `tb_singer` VALUES ('14', '王贰浪', '华语女歌手', 'http://p1.music.126.net/daN7qav1x0nWl-TZRe41dw==/109951163303423969.jpg?param=130y130', '一只市井小巷的炸鸡店咸鱼老板 热爱音乐热爱生活。 腰缠万贯，每日不过三餐；广厦千间，夜寝不过六尺。 但求不多，知足就好，有你们聆听就好。');
INSERT INTO `tb_singer` VALUES ('15', '陈粒', '华语女歌手', 'http://p1.music.126.net/Q92YwJrk2f2tsK-7B0VIhQ==/6628955605123612.jpg?param=130y130', '陈粒，又名粒粒，1990年7月26日出生于贵州省贵阳市，中国内地民谣女歌手、独立音乐人、唱作人，前空想家乐队主唱，毕业于上海对外经贸大学。2012年，其所在乐队“空想家乐队”获得“Zippo炙热摇滚大赛”上海赛区冠军。2014年，随空想家乐队推出乐队首张EP专辑《万象》；同年，其演唱的歌曲《奇妙能力歌》入围“第四届阿比鹿音乐奖”年度民谣单曲。2015年，推出首张个人音乐专辑《如也》；同年，推出个人民谣单曲《远辰》。2016年1月，获得“第五届阿比鹿音乐奖”最受欢迎音乐人（民谣）；同年3月8日，化身“粒粒”并推出首支单曲《幻期颐》；同年7月26日，推出第二张个人音乐专辑《小梦大半》。');
INSERT INTO `tb_singer` VALUES ('16', '蔡健雅', '华语女歌手', 'http://p1.music.126.net/sxyGTra05rFof5i9w3PXzQ==/109951163710520009.jpg?param=130y130', '新加坡人，华语著名歌手、词曲作者，音乐制作人。1997年在新加坡由其经纪公司 Music & Movement 旗下的Yellow Music发行英语专辑《Bored》而正式出道，1999年将国语唱片签约于宝丽金唱片旗下，并推出首张国语同名专辑《蔡健雅》。2000年因宝丽金唱片并入环球唱片旗下，因此《记念》及之后的唱片皆由台湾环球唱片发行。在此一专辑中，蔡健雅以〈记念〉一曲成功打响在台湾市场的知名度。同年入围台湾第11届金曲奖最佳新人奖。2002年发行《Secret Lavender》专辑。同年以〈打错了〉作曲者身份入围台湾第13届金曲奖最佳作曲人奖，并同时入围最佳国语演唱人奖。2004年首度担任制作人，替梁咏琪制作《归属感》专辑。同年以《陌生人》获得台湾第15届金曲奖最佳国语女演唱人提名。2008年推出专辑《My Space》，同年获台湾第19届金曲奖7项提名，并获得了最佳专辑制作人和最佳国语女歌手两座大奖。近年移居台湾。2012年获最佳国语女歌手奖。代表作品：《呼吸》《陌生人》《空白格》《若你碰到他》《红色高跟鞋》。 环球时代（1999－2001） 蔡健雅在出道前(1996年)曾参与音乐剧Hot Pants演出。1997年在新加坡由其经纪公司 Music & Movement旗下的Yellow Music发行英语专辑《Bored》而正式出道，其中〈Ashes〉由许茹芸于1998年翻唱为〈Ending〉，并收录于《我依然爱你》专辑，算是华语流行音乐界首度曝光之作。1999年将国语唱片签约于宝丽金唱片旗下，并推出首张国语同名专辑《蔡健雅》。由于宝丽金唱片的政策，在该专辑第一波主打〈呼吸〉MV中，完全看不见蔡健雅本人的面孔，取而代之的是像屏幕保护程式一般的流动文字，其目的为让观众专注于她的歌声。而第一张唱片以“女伍佰”做为吸引歌迷的话题，似乎并未见效，因而在之后的唱片宣传中就没有使用此一称呼。同年，蔡健雅在新加坡发行第二张英语专辑《Luck》，其中包括由陶喆亲手替她制做的〈The Wicked Signs of Trying to Be A Superstar〉。 2000年因宝丽金唱片并入环球唱片旗下，因此《记念》及之后的唱片皆由台湾环球唱片发行。在此一专辑中，蔡健雅以〈记念〉一曲成功打响在台湾市场的知名度，唱片销售量也水涨船高，该曲并请来演出《黑暗之光》的范植伟做为MV男主角。同年入围台湾第11届金曲奖最佳新人奖；参加新加坡“Ready for the World”活动；替电影《Chicken Rice War 鸡缘巧合》谱写主题曲，并在该电影演出。2001年推出《I Do Believe 相信》专辑，受到台湾“三○八”条款的影响，造成无法在电视上播放MV宣传的状况，因此并没有卖的很好。同年在新加坡参与“Love Is the Answer”慈善计划，翻唱〈True Colours〉并收录于该计划发行的同名专辑中；担任新加坡国庆年度主题曲演唱，并配合推出《Where I Belong 属于》单曲。年底发行《默契》新歌加精选，因先前唱片销量不佳而结束和环球唱片的发行合约。 华纳时代（2003－2006） 2002年，日本 S2S Tracks 挑选了蔡健雅曾发行过的七首英语曲子，发行《Secret Lavender》专辑。同年以〈打错了〉作曲者身份入围台湾第13届金曲奖最佳作曲人奖，并同时入围最佳国语演唱人奖；在新加坡发行第三张英语专辑《Jupiter》，其中隐藏曲〈Hello God〉的歌词明显地控诉她在环球唱片所遭受到的待遇。2003年将国语唱片签约于台湾华纳唱片旗下，并于6月6日发行《陌生人》专辑。华纳请来新生代演员桂纶镁、Duncun演出第一波主打〈无底洞〉MV，广受好评并顺利打开专辑名声；随即请原班人马赶拍〈陌生人〉MV做为下集，同样广为流传。华纳趁势追击，于7月6日在淡水渔人码头举办大规模的演唱会，并发行《Jupiter》台压版。2004年首度担任制作人，替梁咏琪制作《归属感》专辑。同年以《陌生人》获得台湾第15届金曲奖最佳国语女演唱人提名。2005年发行于2004年录制完成的《双栖动物》，收录包括和孙燕姿合唱的〈原点〉，但销售量不如《陌生人》理想。2006年发行《T-Time》新歌加精选，收录部份环球时代的歌曲；同年以《双栖动物》获得台湾第17届金曲奖三项提名（最佳国语流行音乐演唱专辑、最佳专辑制作人、最佳国语女演唱人），最后并夺下最佳国语女演唱人奖。同年10月，和台湾华纳约满，结束合作关系；并于同月9日结束与 Music & Movement 的经纪合约。 独立制作（2006至今）天一娱乐有限公司 由于和台湾华纳音乐之间产生了一些不愉快的事，因此蔡健雅和她的母亲合资成立了天一娱乐有限公司（Tangy Music Entertainment LP, Singapore），迈向独立制作阶段，并开始参与音乐节演出。2006年12月3日，参与台北 简单生活节 演出。2007年5月将国语唱片发行权签于亚神音乐旗下。6月，担任张震岳专辑《OK》主打歌〈思念是一种病〉的女合声。7月6日及7月8日分别参与白色海洋音乐祭与贡老挝际海洋音乐祭演出。于10月19日发行由她自己制作的专辑《Goodbye & Hello》，年底与戴佩妮一起于台北新舞台举办共同售票演唱会。2008年3月于香港、7月底至8月初于台湾、12月于上海举办个人售票演唱会，并于12月7日再次参与台北简单生活节演出；7月推出《My Space》，专辑内容包括1月北京小型演唱会现场录音和三首demo；同年以《Goodbye & Hello》获台湾第19届金曲奖7项提名，并获得了最佳专辑制作人和最佳国语女歌手两座大奖。近年移居台湾，持续创作。2009年8月19发行《若你碰到他》，并入围台湾第21届金曲奖流行音乐类《最佳作曲人》、《最佳国语女歌手》、《最佳国语专辑奖》、《最佳专辑制作人奖》。2012年以《说到爱》七项入围，最后获得台湾第23届金曲奖流行音乐类《最佳国语女歌手奖》。 第六届新加坡金曲奖最佳本地作曲（《好无聊》） 第七届新加坡金曲奖最佳本地作曲（《纪念》）、传媒推荐最佳本地音乐工作者 第十一届新加坡金曲奖最佳本地作曲（《夜盲症》）、最佳本地编曲（《无底洞》） 第十二届新加坡金曲奖最佳创作歌手 第十七届台湾金曲奖 凭借专辑《双栖动物》获最佳国语女演唱人奖（2006年6月，台湾） 第六届全球华语歌曲排行榜 最佳作曲人和年度10大金曲奖（2006年10月，新加坡） 第八届全球华语歌曲排行榜 最受欢迎20大金曲《达尔文》，最受欢迎女歌手5强，传媒推荐大奖，最佳作词《达尔文》（小寒），最佳制作人《Goodbye & Hello》，最佳专辑《Goodbye & Hello》,地区杰出歌手 第十九届台湾金曲奖 凭借专辑《Goodbye & Hello》获最佳国语女演唱人奖、最佳制作人奖（2008年7月，台湾） 第十四届新加坡金曲奖获得最佳本地歌手奖、最佳创作歌手奖，《达尔文》获得Y.E.S 933醉心龙虎榜年度十大金曲奖（2008年10月25日，新加坡） 第九届“蒙牛酸酸乳音乐风云榜年度盛典”获得港台最佳女歌手、港台最佳作词奖（《思念》）（2009年4月2日，北京） 第十五届新加坡金曲奖获得最佳作词（《思念》）、本地杰出音乐人奖、亚洲传媒女歌手奖（2009年11月6日，新加坡） SMG&MTV超级盛典获得台湾地区最具风格女歌手奖（2009年12月2日，上海） 《音乐先锋榜》2009年度颁奖典礼获得最佳先锋创作歌手、21家电台联颁传媒大奖，专辑《若你碰到他》获得21家电台联颁最佳专辑奖（2010年3月6日，广州） 第23届台湾金曲奖凭借专辑《说到爱》获最佳国语女演唱人（2012年6月23日，台湾）');
INSERT INTO `tb_singer` VALUES ('17', '双笙', '华语女歌手', 'http://p1.music.126.net/n9ECwrWItBkq1FFuDd9bcg==/1383185640160976.jpg?param=130y130', '微博：双笙子 / echo、5sing：双笙 / bilibili：双笙子 / 荔枝：FM1998256 / 初心不负');
INSERT INTO `tb_singer` VALUES ('18', '任然', '华语女歌手', 'http://p1.music.126.net/Wi-cn8nbHtx1JlNPSBuqCQ==/109951163137464995.jpg?param=130y130', '任然，1989年7月3日出生于四川省成都市，内地新生代女歌手，素有“才女”之称。现居北京，代表作品有《空空如也》、《凉城》、《那年初夏》、《你好陌生人》、《疑心病》、《唇语》、《外愈》等。 中文名：任然 生日：1989-07-03 国籍：中国 出生地：成都 身高：168 经纪公司：北京千和世纪 民族：汉 毕业院校：北京现代音乐研修学院  任然，内地歌手，音乐人。曾经为多位大牌艺人演唱demo，2011年以一首《我一点都不难过》名声大振。随后发表《那年》、《你好陌生人》、《然后呢》、《凉城》、《空空如也》登录各大网站榜单大受好评。 关于任然，也许你在某个唱片里见过她的名字，或者听过她的歌，大气带点沙哑的嗓音，常常被人称为“小蔡健雅”，或许比蔡健雅少几分潇洒，却也不失为任然式的细腻和柔婉。 张亚飞《大女人》DEMO 李宇春《湘江的笔画》DEMO 东来东往《山楂树之恋》和声 湖南卫视自制片《丑女无敌第三季》部分音乐DEMO、和声 湖南卫视2009快乐女生十强开场音乐《虫儿飞+夏天的浪花》DEMO 2012年5月发行单曲《你好陌生人》 2014年1月发行专辑《世界之外》 2015年9月发行专辑《任然精选集》 2015年12月发行单曲《不可名状的忧伤》 2015年12月发行数字单曲《唇语》 2016年1月发行数字专辑《从小到大》 2017年1月发行EP《不舍》 2017年3月发行单曲《三生》 2017年4月发行单曲《最痛》《外愈》 2017年6月发行单曲《看穿》 2017年7月发行单曲《雀跃》 2017年7月发行单曲《时光游人》 2017年8月发行EP《没有发生的爱情》 2017年9月发行单曲《爱后余生》 2017年9月发行《画下年少（蔚蓝50米）网络剧片尾曲》 2017年10月发行《没有发生的爱情（故事版）》EP 2017年10月发行单曲《刚好》 2017年12月发行单曲《失恋俱乐部》 2017年12月发行单曲《空空如也》 2018年1月发行单曲《墨》 2018年2月发行单曲《东亭》');
INSERT INTO `tb_singer` VALUES ('19', '金玟岐', '华语女歌手', 'http://p1.music.126.net/5xovShW1vWSo4CmS3NvNhA==/109951163071307134.jpg?param=130y130', '10年幕后音乐人，为众多大牌歌手及电影电视剧创作及制作歌曲。 2014年走到幕前成为艺人，因电影《北京爱情故事》创作并演唱《岁月神偷》而受到极大关注。 2015年发行首张创作专辑《完美世界》，成为备受瞩目的新生代流行小天后，一举拿下阿里音乐2015年度最佳新人、提名音乐风云榜最佳新人、提名豆瓣音乐最佳流行女歌手、提名华语金曲榜最佳新人等。 2015年底发行单曲《惊天动地》，惊动内地乐坛。 2015年举办个人首次全国剧场巡演，取得很好的票房成绩。 2016年1月为电视剧《五鼠闹东京》创作并演唱歌曲《直到遇见你》。 网易云音乐原创盛典 年度最受欢迎女音乐人（获奖）');
INSERT INTO `tb_singer` VALUES ('20', '王菲', '华语女歌手', 'http://p1.music.126.net/GKhjgN1ltQYK3eYf9DdJwg==/18727981557622763.jpg?param=130y130', '中国著名女歌手、演员。是继邓丽君后大中华地区成就最高、影响力最大的华语女歌手。以其极具辨识度的天籁空灵般嗓音，在华语歌坛创造了属于她自己的时代。她是首位登上美国《时代周刊》封面并接受CNN专访的华语歌手。她是身价最高，演唱会上座率最高，演唱会票房累计最高的华语女歌手。王菲北京出生。1987年放弃厦门大学生物系的录取跟随父母移居香港，并拜师戴思聪学习声乐，1989年签约新艺宝唱片公司并发行了第一张个人专辑，从此正式步入乐坛，曾使用艺名王靖雯。她于1994年在香港红馆第一次举办演唱会，就以连续18场的纪录打破新人红馆演唱会纪录，至今仍未有人打破。王菲自2005年逐渐淡出歌坛，2010-2012年开始复出大规模巡回演唱会。代表作品：《我愿意》《执迷不悔》《天空》《红豆》《流年》《催眠》。 致青春、 因为爱情、 传奇、 红豆、 容易受伤的女人、 红豆、 催眠、 流年、 我愿意、 人间、 闷、 百年孤寂等。 将爱 2003-11-01 国语 王菲2001 2001-10-01 国语 寓言 2000-10-01 国语 只爱陌生人 1999-09-01 国语 唱游 1998-10-01 国语 王菲1997 1997-09-01 国语 浮躁 1996-06-01 国语 Di-Dar 1995-12-01 粤语 菲靡靡之音 1995-07-01 国语 讨好自己 1994-12-01 粤语 天空 1994-11-10 国语 胡思乱想 1994-06-01 粤语 迷 1994-04-01 国语 十万个为什么 1993-09-01 粤语 执迷不悔 1993-02-01 粤语 Coming Home 1992-08-01 粤语 You\'re The Only One 1990-12-01 Everything 1990-06-01 王靖雯 1989-11-01 迷人的卡勒 1985-03-01 幽兰操 （电影《孔子》主题曲） 传奇 （2010“春晚”首唱） 因为爱情 （电影《将爱情进行到底》主题曲主创合影） 愿 （2012年1月1日湖南卫视跨年演唱会首唱） 心经 （《唐山大地震》片尾曲） 致青春 （《致青春》主题曲） 全新启程（1989年-1991年） 1989年，王靖雯以一首《仍是旧句子》在《亚太金铮流行曲创作大赛》决赛中获铜奖。并于同年推出首张个人大碟《王靖雯》，销量突破3万，获金唱片。 1990在，第二及第三张个人大碟《EVERTHING》，《YOU ARE THE ONLYONE》取得更大突破，夺得“叱咤乐坛流行榜女歌手铜奖”被誉为天王巨星接班人。 1991年，由于唱片公司出现问题，王靖雯赴美学习。在她离港期间，唱片公司先后推出了精选《SHIRLEY ONCE MORE》及《MORE SHIRLEY》，前者破白金销量。 天后破竹而出（1992年-1993年） 1992年，在恩师戴思聪斡旋下，王靖雯从美国回到新艺宝。一个全新的天后时代被开启。同年8月13日，推出意义重大的第四张专辑《Coming Home》，专辑推出即卖断市,销量冲破三白金。其中歌曲《容易受伤的女人》红遍全港，横扫香港各大排行榜冠军及年终颁奖礼。声势一时无两。迅速在香港奠定地位。 1993年2月5日，发行粤语专辑《执迷不悔》。专辑曲风有灵魂乐式的演唱色彩，造型前卫，浓重的妆容、黑丝筒袜，让人眼前一亮。主打歌《执迷不悔》是她首次尝试歌词创作，而执迷不悔更是她个性的真实写照。专辑在香港突破四白金销量。 1993年下半年，推出粤语专辑《十万个为什么？》，曲风开始转变。王靖雯首次参与制作。改编歌曲《冷战》成为粤语经典。《如风》成为香港电台冠军歌曲。从这张专辑起，王靖雯在香港乐坛开始了另类音乐尝试。专辑获得香港IFPI唱片销量榜4周冠军，在前十名停留15周！在港销量冲破四白金。 1993年的两张大碟在香港销量突破8白金40多万张，使王菲获得香港IFPI唱片销量女歌手冠军！在香港叱咤乐坛流行榜上首获女歌手金奖！并首次获得香港十大劲歌金曲国内最受欢迎女歌手！由此正式成为香港新一代天后！ 华语天后巅峰（1994年-1996） 1994年4月，发行首张国语大碟《迷》，第二周登上台湾金曲龙虎榜国语销量榜冠军，并在前十名停留14周。主打歌《我愿意》成为传世经典！被众多歌手翻唱，是被翻唱成最多外国语言的中文歌曲。台湾累计销量突破80万，上半年以45万的销量成为女歌手销量冠军。亚洲累计销量突破200万张。 1994年6月，推出粤语专辑《胡思乱想》。王菲大胆将英伦元素融入之中，开创了香港英伦音乐主体风格的新纪元。大碟以残缺不全的汉字为封面，时尚大胆，让人惊艳。王菲在改编歌曲《梦中人》中大量使用咽音技巧，并成为后来其标志性唱腔。专辑获香港IFPI唱片销量榜3周冠军！并在前十名停留7周。在港销量累计破三白金15万张。 1994年11月，发行第二张国语大碟《天空》，唱片推出第二周便登上台湾金曲龙虎榜国语销量榜冠军。在主打歌《天空》中王菲展现了空灵通透的声线，宛如天籁！该专辑也成为众多专业发烧人士试音首选。《棋子》是香港电台冠军歌曲，清唱开头的《矜持》和拖音吟唱的《天使》，亦清新脱俗。《天空》在台湾金曲龙虎榜销售榜前10名停留23周，台湾年度销量近80万张，台湾累计销售点数78660点，台湾累计销量冲破100万。全亚洲累计销量突破350万张。 1994年12月，发行粤语大碟《讨好自己》整体凸显英伦风格，王菲在专辑中全面展现她特立独行，无拘无束的个性，并首次尝试作曲，创作了《讨好自己.》和《出路》。张亚东写了《飘》。该专辑在香港IFPI唱片销量榜前十名停留10周。香港累计销量突破三白金。 1994年是王菲的天后年，在这一年她推出了4张专辑，登顶香港IFPI唱片女歌手销量冠军。横扫香港年度四大颁奖礼，新加坡金曲奖，华语榜中榜等所有大奖，其中蝉联叱咤乐坛流行榜女歌手金奖，在香港十大劲歌金曲颁奖礼中更是创记录的包揽“最受欢迎女歌手”和“亚太最受欢迎女歌手”奖，成为历史第一人，并成为香港首屈一指的天后。 1995年，发行翻唱专辑《菲靡靡之音》，王菲用自己的风格和全新的编曲去演绎。专辑在台湾金曲龙虎榜国语销售榜前10名停留16周。台湾累计销量达70万张，香港达双白金逾10万张，在香港IFPI唱片销量榜前十名停留8周。新加坡逾6万，亚洲累计销量突破250万，该专辑是新加坡年度女歌手销量冠军。 1995年12月，推出粤语专辑《Di-Dar》，第二周登上香港IFPI唱片销量榜冠军，并在前十名停留10周，在港累计销量冲破三白金15万张。林夕作词9首是他首次大批量为王菲作词。王菲创作了《Di-Dar》和《假期》。专辑风格英伦迷幻，编曲精致、醇厚，极富概念意味。《暧昧》，《迷路》，《流星》等5首歌雄霸香港四大排行榜获得冠军，Di-Dar（香港四台冠军），假期（双周冠军）。《Di-Dar》也成为产生冠军单曲多的粤语唱片。这张专辑是王菲最后一张粤语专辑，从1996年开始王菲再没有推出粤语专辑，只是在每张国语大碟中象征的加入一两首粤语歌曲，此后的她更是将影响范围辐射至香港以外的台湾，新马，日本等整个亚洲地区。 1996年5月，发行国语大碟《浮躁》。王菲彻底抛弃商业考虑，《浮躁》是王菲最圆满的艺术尝试。张亚东监制全辑，专辑以王菲自由自在的状态为主导概念，刻意淡化了歌词的作用，歌曲吟唱则用简单重复的音节强化标题模绘的况味，于是成就了这张完全由“意识”或“潜意识”主导的概念专辑。《浮躁》创造了华语唱片的艺术巅峰，成为华语歌坛的瑰宝贡后人品鉴！ 1996年，王菲录制了《玩具》和《自便》两张EP，新艺宝于1997年发行。在《玩具》中王菲开始尝试童音演唱技巧。《约定》和《暗涌》成为粤语经典，其后被众多港台歌手翻唱。《玩具》在香港推出一周突破双白金，香港总销量破三白金15万张。 1996年底王菲再次闪耀各大颁奖礼，第三次获得香港叱咤乐坛流行榜女歌手金奖，夺得香港十大劲歌金曲亚太最受欢迎女歌手奖，新加坡金曲奖最受欢迎女歌手及亚太最受欢迎女歌手奖，《天空》获台湾金曲奖最佳音乐录影带奖，成为第一位获得此奖项的香港女歌手。华语天后地位无人撼动。 亚洲天后巅峰（1997年-2004） 1997年，6000万天价加盟百代创历史！从1997年到2001年百代时期的5张大碟使王菲扶摇直上，站到了亚洲歌坛的最高峰，由华语第一天后蜕变为亚洲天后！ 1997年9月，发行百代时期首张大碟《王菲97》。整体风格慵懒放松，你快乐所以我快乐成为当年华语歌坛流行语。《人间》由中岛美雪特意为王菲作曲，不插电的《怀念》也大放异彩。专辑共诞生包括你快乐所以我快乐（香港四台冠军），我也不想这样，人间，三首香港冠军歌曲。专辑台湾总销量破45万，香港破白金，马来西亚破10万，是1997年度马来西亚女歌手销量冠军。亚洲累计销量超过150万。 1997年9月，旧东家新艺宝推出精选《菲卖品》，专辑发行第二周登上台湾金曲龙虎榜国语销量榜冠军！台湾销量累计突破40万张，并在香港IFPI唱片销量榜前十名停留7周。 1997年底王菲第四次获得香港叱咤乐坛流行榜女歌手金奖，成为90年代女歌手之冠！叱咤乐坛我最喜爱的女歌奖，叱咤殿堂十大歌手，香港十大中文金曲全球华人最受欢迎女歌手奖，香港十大劲歌金曲亚太最受欢迎女歌手奖。产后复出的王菲地位无人撼动。 1998年，王菲再攀事业巅峰，相约九八爆红。10月8日，推出全新大碟《震撼华人地区。被誉为华语乐坛划时代的专辑！专辑中王菲大量运用美声、颤音、拖音、假声、气声等技巧。专辑概念定位天马行空，无拘无束。王菲谱曲四首歌：《感情生活》，《脸》，《小聪明》，《童》。《脸》中美声唱法和自己的独特声线交错，林夕灵光浮动的好词于王菲口中更恍如天籁！《红豆》（粤语版《偿还》）红透华人世界，adrian chan作曲的《情诫》上榜首周即成为香港四台冠军歌曲。专辑中的晒伤妆，冲天辫造型，引发华人世界时尚大流行！专辑在香港IFPI唱片销量榜前十名停留8周。蝉联马来西亚RIM中文唱片销售榜7周冠军销量逾10万张，是1998年马来西亚女歌手销量冠军，在新加坡SPVA销量榜前十名停留6个月，是1999年度新加坡专辑销量冠军。日本销量破15万，亚洲累计销量超过250万张。 1998年底，王菲再次获得香港十大劲歌金曲最受欢迎女歌手，香港十大中文金曲全球华人最受欢迎女歌手奖，香港叱咤乐坛我最喜爱的女歌手奖。新加坡金曲奖和马来西亚金曲奖最受欢迎女歌手。再于香港红馆举办17场唱游大世界演唱会，随后在中国内地，东南亚，日本，美国巡回演唱会。她是香港至今唯一有足够实力和影响力可以在中国内地开大规模巡回演唱会的女歌手！亚洲天后再次迎来事业巅峰。 1999年2月，单曲《Eyes on Me》在日本发卖，并打入日本Oricon销量榜第九位，在日劲销35万，成为当年日本外语唱片销量冠军，夺得“日本金唱片大奖”创造了华语歌手在日本最高排名和销量纪录。该碟在台湾IFPI单曲销量榜蝉联5周冠军。 1999年9月，发行国语大碟《只爱陌生人》。陈晓娟首次为王菲创作《推翻》，C.Y. Kong两首摇滚风格浓厚的《百年孤寂》和《开到荼蘼》亦大放异彩，Adrian Chan写了《邮差》（《蝴蝶》），该曲与《当时的月亮》是香港电台双周冠军单曲，而为百事可乐创作的《精彩》则成为香港四台冠军单曲。大碟在香港IFPI销量榜蝉联双周冠军，在台湾时适大地震也大卖35万，新加坡首日销量破2万，是新加坡年度销量冠军大碟。  01 首位华人歌手登上时代杂志刊于1996年10月14日时代杂志第148期，消息当年已广为传媒报导，轰动一时。 王菲被杂志誉为“流行乐女王”，全文报导王菲出道至走红经过。 02 第二位在日本东京武道馆开唱的外籍亚洲歌手 王菲于1999年就在东京武道馆举办了个唱，2001年又在日本武道馆举办了2场演唱会。（第一位是邓丽君） 03 首位华人出演日剧女主角： 2000年3月正式开记者会对外宣布接拍日剧《弄假成真》，之后数月均留在日本拍剧，剧集于同年7月日本富士电视台首播，台湾新加坡电视台同步播映。 04 首位凭华语歌打入Oricon周榜头十位的华人歌手 王菲的三张唱片《Eyes On Me》《光之翼》《Separate Ways》都打入了Oricon周榜头二十位，《光之翼》打进了第十九位，《Separate Ways》打进了第十四位，《Eyes On Me》更打上第九位，更成了当年日本最高销量的外语唱片。 05 《亚洲周刊》选出的建国50位最重要的华人之一。 06 王菲以广东话唱片总销量之最被编入吉尼斯记录。 *王菲<天空>专集获得最早超白金销售记录 *王菲<唱游>专集为华语乐坛第一张HDCD唱片 *<唱游>平面设计获国际PSTH设计大奖 *SONY新力哥伦比亚唱片公司豪华油轮签王菲 *CNN新闻独家香港连线 王菲 专访 *EMI百代唱片6000万身价签王菲 *MTV 美国STATION-观众投票最佳演绎歌手 *美国“BILLBOARD流行榜”世界最受欢迎女歌手 *美国拉斯维加斯演唱会华人最高票价纪录 *马来西亚第一届“亚洲金曲奖”金曲金奖 *日本最终幻想游戏公司总裁点名王菲配唱单曲:<凝视我> *美国男子乐队J Church创作向偶像致敬英文歌:<（I Want To See） Faye Wong>（我要看王菲） 1989年 “亚太金筝流行曲创作大赛”香港决赛，凭《仍是旧句子》荣获铜奖。 1990年 香港无线电视台劲歌金曲第三季季选：《Everything》 香港商业电台“叱咤乐坛流行榜”：叱咤乐坛女歌手铜奖 1992年 香港电台“十大中文金曲颁奖礼”：十大金曲《容易受伤的女人》 香港无线电视台“十大劲歌金曲颁奖礼”：十大金曲《容易受伤的女人》 香港无线电视台“十大劲歌金曲颁奖礼”：最佳填词奖《容易受伤的女人》 香港无线电视台劲歌金曲第四季季选：《容易受伤的女人》 香港商业电台“叱咤乐坛流行榜”：至尊歌曲《容易受伤的女人》 香港商业电台“叱咤乐坛流行榜”：全国专业推介铜奖《容易受伤的女人》 《音像世界》“摩登谈话”专栏评出的历年十大专辑唱片 1992年十大专辑之一：王靖雯（王菲）-Coming home