INSERT INTO `tb_singer` VALUES ('21', '田馥甄', '华语女歌手', 'http://p1.music.126.net/2XHRjgOcjfdpSEgzP2AbgA==/3412884102389555.jpg?param=130y130', '田馥甄，艺名Hebe，台湾知名女艺人，女子演唱团体S.H.E组合成员，出生于台湾新竹县新丰乡，于2000年参加“宇宙2000实力美少女争霸战”选秀活动，并于同年与宇宙唱片（华研唱片前身）签约培训，接着在隔年与Selina、Ella组成S.H.E，并于2001年9月11日发行S.H.E首张专辑《女生宿舍》正式出道。2010年下半年，S.H.E正式迈向“单飞不解散”阶段，接着同年9月3日，使用本名“田馥甄”推出首张个人专辑《To Hebe》。 本名：田馥甄 英文名：Hebe 昵称：喜碧 出生：1983年3月30日 出道日期：2001年9月11日 唱片公司：华研国际音乐（2000年-） 经纪公司：华研国际音乐（2000年-2018年9月30日）                乐来乐好有限公司（2018年10月1日-） 田馥甄正式出道前曾参加中视《我猜我猜我猜猜猜》人不可貌相之无厘头美少女单元，后又于2000年参加中视《电视大国民》之残酷舞台单元的歌唱比赛并获得一万元奖金，不久之后，该节目制作单位再次询问田馥甄是否愿意再参加宇宙唱片（华研唱片前身）与节目《电视大国民》残酷舞台单元合办之《宇宙2000实力美少女争霸战》选秀比赛，之后在经过初赛和复赛的反复筛选及淘汰后，于决赛后丧失第一名与一年唱片合约之机会。赛后经宇宙唱片（华研唱片前身）内部讨论协商，决定以英文艺名“Hebe”分别与任家萱（Selina）、陈嘉桦（Ella）签约并组成女子团体S.H.E正式进军歌坛，而Hebe这名字有着“青春女神”的意义，在S.H.E团体里代表着“自信”，代表颜色为绿色，其后S.H.E成为华人地区具有代表性、指标性、影响力、知名度、唱片销售量、演唱会票房和销售(量)口碑的女子演唱团体之一。 从小就爱唱歌的田馥甄，在S.H.E于2001年9月11日发行的首张专辑《女生宿舍》中的个人独唱曲《Too Much》和《替我爱你》就得到了初试歌啼的机会。不少评论认为田馥甄到了S.H.E的第七张专辑《Encore》中，歌声已经锋芒毕露并令人惊艳。著名乐评人科尔沁夫曾言：“我最想推荐的还有Hebe田馥甄这个让我惊艳的女生，声音之干净、演唱技巧之好，直逼公认为新生代唱将中最优秀的江美琪。”。 在戏剧方面，2005年，与S.H.E其它两位团员Selina和Ella共同担任女主角主演的电视剧《真命天女》于同年10月16日播出，并且S.H.E也为该电视剧的原声带《真命天女电视原声带》献唱主题曲〈星光〉，除此之外，Hebe也为此原声带献唱个人独唱曲兼戏剧插曲〈摩天轮〉，然后和声也由另外两名团员Selina和Ella参与和声，这次也是与S.H.E第一张专辑《女生宿舍》中所收录的个人独唱曲相隔四年之后，再次演唱个人独唱曲，而此原声带则已于2005年9月28日推出。2007年，Hebe于年底投入电视偶像剧《斗牛，要不要》的拍摄工作，这也是Hebe首次真正独挑大梁担纲女主角的戏剧作品，此剧于同年11月18日首播，然后也为该剧演唱插曲〈来不及〉，并亲自填词，之后收录于此剧的电视原声带《 斗牛，要不要电视原声带》。 2016年，Hebe以S.H.E团员身份受杜莎夫人蜡像馆之邀，于5月29日，正式宣布进驻上海杜莎夫人蜡像馆留下S.H.E三人的蜡像，也代表S.H.E的地位对于华语乐坛有着杰出的表现和卓越的贡献。 2010年3月30日，Hebe在台北The Wall举行名为“330音乐田”的慈善性质生日音乐会，也被视为是Hebe发行首张个人专辑的热身，唱片公司也透露Hebe将发行酝酿已久的个人专辑。2010年5月29日《爱而为一巡回演唱会》台北“旗舰场”结束之后，2010年下半年，S.H.E以“单飞不解散”各自展开新触角。2010年8月，唱片公司先在YouTube释出约90秒MV，只有歌声而不露脸，引起话题，MV更在不到24小时的时间点阅次数随即破百万。8月12日，田馥甄个人第一支MV《Love!》在网络上曝光。同年9月3日，以“单飞不解散”的模式，使用本名“田馥甄”，以新人之姿，正式发行首张个人专辑《To Hebe》。10月8日、9日、10日于台北华山文创园区的Legacy Taipei连续举办共三场“Love！田馥甄To Hebe音乐会”，和香港、新加坡、北京及上海各一场的音乐会，期间签名样式以单字“田”并串上小型图案，以区别以母团身份发片时的签名。同年，亦获得KKBOX年度最佳新人。 2011年5月，《To Hebe》在第22届金曲奖入围最佳国语专辑奖等四项奖项，此外《To Hebe》也被中华音乐人交流协会选为十大优良专辑以及单曲〈LOVE！〉被选为十大优良单曲。同年9月2日，发行第二张个人专辑《My Love》。12月3日、4日于台北的台大体育馆连续举办共两场“田馥甄 To My Love 庆功音乐会”，和北京、上海、广州各一场及新加坡一天两场的音乐会。此张专辑主打歌《还是要幸福》MV于2012年10月17日在YouTube网站上点阅数突破一千万人次，使得田馥甄成为首位MV点阅人次破一千万的华语女歌手，接续著第一张专辑《To Hebe》的《寂寞寂寞就好》MV也于2013年1月21日在YouTube网站上点阅数突破一千万人次，成为首位拥有2支以上MV在YouTube网站上点阅数破一千万人次的华人歌手。 2012年5月，《My Love》在第23届金曲奖共入围七项奖项，其中包括最佳国语女歌手奖及最佳国语专辑奖等，《My Love》亦为该届金曲奖入围最多项目的专辑之一。6月23日，在第23届金曲奖上，田馥甄以Hebe的身份与S.H.E其他两位成员合体担任表演嘉宾，并演唱个人歌曲〈LOVE！〉和S.H.E歌曲〈SHERO〉、〈Super Star〉，并宣告S.H.E再度回归，这是自2010年10月Selina在上海拍戏烧伤以来，三缺一的S.H.E中断合体演出555天之后的首次合体同台演出，而入围该届金曲奖的所有奖项最终无一获奖。同年11月，S.H.E在团员Selina伤愈复出归队后合体推出S.H.E回归专辑《花又开好了》。 2013年11月13日，发行第三张专辑《渺小》，并远赴冰岛拍摄首波专辑同名主打歌〈渺小〉的音乐录影带，而同名首波主打歌〈渺小〉的MV在YouTube上四天点阅人次破百万，专辑未满一周台湾地区销量4万张为年度第四，成为该年女歌手销量之冠（以六周时间最后位排名第五）。唱片公司于同年底在松山文创园区举办为期1个月的《渺小.纪录田馥甄冷静与热情之声影音装置展》。此张专辑在五大金榜连续进榜22周，在G-Music风云榜也有进榜20周的好成绩。12月4日、18日及2014年1月3日，分别于高雄、台中和台北举办共三场门票数量仅60至120张小型的“渺小微巡听歌会”。12月21日，于华山1914文化创意产业园区渺小签唱会的同时宣布将《田馥甄冷静与热情之声影音装置展》展出的照片义卖，共计15万6626元义卖的全数金额捐给爱盲基金会。 2014年2月20日，新专辑MV于中国音悦台的“音悦V榜”上突破港台记录九连霸创新高。3月7日，据Spotify官方统计公告，田馥甄为2013年度Spotify音乐软件台湾地区发片女歌手之冠。同年，田馥甄于“第10届HITO流行音乐奖颁奖典礼”中获得Hito最佳女歌手，并以《渺小》专辑拿下Hito最长寿专辑（累积在榜20周）。之后同年5月，《渺小》专辑在《第25届金曲奖》入围两项，分别入围最佳专辑包装奖以及单曲〈渺小〉入围最佳音乐录影带奖。同年6月28日，田馥甄于《第25届金曲奖》颁奖当天首次以个人身份登上金曲奖‬担任表演嘉宾，并亲自挑选3首经典华语歌曲串成组曲。《渺小》专辑于2014年入围六项“2014世界音乐奖”和2014年入围MTV欧洲音乐大奖两项大奖，最后获得2014年MTV欧洲音乐大奖最佳台湾歌手奖。 2014年8月10日，在S.H.E《Together Forever世界巡回演唱会》台北Encore场上，Selina和Ella宣布12月田馥甄在小巨蛋有个唱，引爆台下观众全场气氛，之后接着于同年12月6、7日，首次以个人身份登上台北小巨蛋，展开《如果世界巡回演唱会》。台北场次两场2.2万张门票于售票日开卖后10分钟内完售。 2015年初，三张专辑内的歌曲在YouTube突破千万点阅，先后创下华语乐坛之点阅纪录；其中《爱着爱着就永远》更登上“YouTube2014最潮台湾音乐冠军”。7月，为电影《我的少女时代》演唱电影主题曲《小幸运》（《我的少女时代电影原声带》于2015年10月21日发行），9月为电影《追婚日记》献唱宣传曲《姐》（《追婚日记电影原声带》于2015年12月4日发行），同月《小幸运》在YouTube突破亿点阅，该曲并获得Hit Fm电台观众票选2015年度百首单曲第一名。《渺小》专辑内歌曲《不醉不会》与《渺小》在YouTube皆突破千万点阅率，接着同月19日于高雄巨蛋举办《如果世界巡回演唱会》，而1万张门票于开票后20分钟内完售，并首唱《我的少女时代》电影主题曲《小幸运》 。 2016年3月，于新加坡室内体育馆举办《如果世界巡回演唱会》1.0版最终场，并宣布《如果世界巡回演唱会》改版第二阶段2.0 Plus版将于香港红磡体育馆展开。 2016年6月，华研国际音乐宣布，田馥甄个人第四张专辑《日常》于7月13日发行(因故延期，原订7月8日发行)，并于6月15日，已先开始贩售与专辑发行同时推出的音乐舞台剧《小夜曲》，该音乐舞台剧由知名剧团“莎士比亚的妹妹们”为《日常》专辑量身制作，在开卖1分钟内，共计12场门票全数售罄。6月17日，田馥甄在香港红磡体育馆展开《如果世界巡回演唱会》改版第二阶段《如果世界巡回演唱会》2.0 Plus版巡演，同时也是首次以个人身份登上红馆开唱，改版演出内容首度提前曝光专辑《日常》中的两首新歌〈人间烟火〉和〈余波荡漾〉。 2016年8月20日，单曲《小幸运》在YouTube点阅率突破1亿次，为华语界最高点阅率歌曲，田馥甄亦是第一位拥有破亿点击率单曲的华语歌手，也是继韩国女歌手泫雅之后，第二位拥有YouTube破亿点阅率单曲的亚洲个人女歌手。2016年10月份加盟《梦想的声音》，也是Hebe的综艺实境节目首秀，该节目以歌手与素人相互之间进行讨教为主轴。12月9日、10日、11日，《如果世界巡回演唱会PLUS》于台北小巨蛋举行，3天票房高达8250万元，并于台北三场演唱会后接着宣布2017年将继续展开第三阶段的海外巡演。 2016年12月9日，于《如果世界巡演》Plus台北场首场当天，正式推出收录了2014年12月6日、7日在台北小巨蛋以及2015年9月19日高雄巨蛋举行的“如果世界巡回演唱会”的现场影音《IF ONLY 如果田馥甄巡回演唱会LIVE》。 2017年3月宣布将于6月和8月，分别在高雄、台中、台北加开与“莎妹剧团”合作的《小夜曲》音乐舞台剧的演出场次，而北中南总共有10场演出。《小夜曲》北中南共1.1万张门票于门票开卖后在10分钟内完售。 2017年5月，第四张专辑《日常》入围《第28届金曲奖》最佳单曲制作人奖与最佳音乐录影带奖两个奖项。5月底，宣布《如果世界巡回演唱会》plus将再度唱回台湾，并将于2017年9月2日、3日在高雄的高雄巨蛋连续举办两场演唱会，并且此两场演唱会也是《如果世界巡回演唱会》的最终场，两场演唱会2.2万张门票于门票开卖后30分锺内完售，而9月3日最终场当日也刚好是Hebe以“田馥甄”个人品牌发行首张个人专辑《To Hebe》七周年的日子，最后这两场演唱会票房总共4800万元。《如果世界巡回演唱会》自2014年12月巡回至2017年9月，历经1002天，共走过23个城市，共计有38场演出。 2017年12月8日，推出收录了于2016年12月9日、10日、11日在台北小巨蛋举行的“如果世界巡回演唱会Plus”的现场影音《IF＋如果田馥甄巡回演唱会plus LIVE》。 ▪ 录音室专辑 To Hebe（2010年9月3日） My Love（2011年9月2日） 渺小 （2013年11月29日） 日常（2016年7月13日） ▪ 影音馆 Love!田馥甄To Hebe影音馆（2010年12月3日） 田馥甄To My Love影音馆（2012年1月20日） 田馥甄 渺小‧纪录影音DVD（2014年4月18日） IF only 如果 田馥甄巡回演唱会LIVE（2016年12月9日） IF＋如果田馥甄巡回演唱会plus LIVE（2017年12月8日） ▪ 演唱会专辑 田馥甄To Hebe Live音乐会（2010年12月3日） 田馥甄To My Love 音乐会（2012年1月20日） IF only 如果 田馥甄巡回演唱会Live专辑（2016年12月11日） 演唱会的日常（2017年11月3日） ▪ 原声歌曲 《摩天轮》（《真命天女》电视原声带） 《只对你有感觉》（《东方茱丽叶》电视原声），与飞轮海合唱 《来不及》（《斗牛，要不要》电视原声） 《爱的预告》、《Love!》、《My Love》（《LOVE》电影原声） 《寂寞寂寞就好》（《我爱幸运七》电视原声） 《口袋的温度》（《爱上两个我》电视原声） 《小幸运》（《我的少女时代》电影主题曲） 《我想我不会爱你》、《寂寞寂寞就好》（《必娶女人》电视原声） 《姐》（《追婚日记》电影原声） 《看淡》（《一把青》电视原声） 《余波荡漾》（《飞鱼高校生》电视原声） 《美女与野兽》（《美女与野兽》电影中文主题曲），与井柏然合唱 ▪ 巡回演唱会 如果世界巡回演唱会，首次以个人身份举办大型巡回演唱会 ▪ 音乐会 330音乐田 Love！To Hebe音乐会（8场） To My Love 庆功音乐会（6场） 渺小微巡听歌会／渺小畅听会（5场） To Hebe 音乐会 ▪ 其他 田馥甄 x 林宥嘉《Love in Music》演唱会 ▪ 嘉宾演出 2009年4月3日 担任动力火车 The Wall演唱会嘉宾，合唱〈你快乐所以我快乐〉、〈静止〉、〈爱情限时批〉 2012年2月25日 担任动力火车 《超越巅峰》马来西亚演唱会嘉宾，合唱〈S