INSERT INTO `tb_singer` VALUES ('22', '房东的猫', '华语组合/乐队', 'http://p1.music.126.net/ohub446GfbVtIJ9_H-cjpw==/7719671138847203.jpg?param=130y130', '快乐的民谣小组合 ：） 不知不觉2019年上半年已过去啦，下半年「生活」巡演即将开始，希望可以一起创造彼此美好的回忆，也很开心能够以这样的方式参与进大家的「生活」。 2019年11月02日 郑州 河南省人民会堂 2019年11月23日 重庆 重庆人民大厦会堂 2019年11月30日 北京 北京展览馆剧场 2019年 时间待定 上海 地点待定 秀动网购票链接：http://t.cn/AiT622Bb 大麦网购票链接：http://t.cn/AiT622Bc 猫眼网购票链接：http://t.cn/AiT622BG 若有相关问题请私信微博：@青柴工作室');
INSERT INTO `tb_singer` VALUES ('23', 'S.H.E', '华语组合/乐队', 'http://p1.music.126.net/GneY52rqwlkoz8wNsy3rnw==/18570751394187297.jpg?param=130y130', 'S.H.E由任家萱（Selina）、田馥甄（Hebe）、陈嘉桦（Ella）组成，2000年共同参加宇宙美少女实力争霸战后受宇宙音乐（现名华研国际音乐）相中并签约，2001年9月11日正式出道。分别代表着温柔、勇气、自信的SELINA、HEBE和ELLA，依照她们e世代的跳跃式思考模式和无厘头的爆笑逻辑，不论在声音或在个性的表现上都能以最自然的、最纯粹的个人特质来发挥她们的个人魅力，呈现出最S.H.E的一面。当年以一首《恋人未满》走红，令首张专辑大卖75万张。其后更凭借《美丽新世界》《Super Star》《波斯猫》《不想长大》《中国话》等多首热门歌曲风靡大街小巷。如今S.H.E已跨足音乐、戏剧、主持、广告、书籍、配音等方面。');
INSERT INTO `tb_singer` VALUES ('24', 'Beyond', '华语组合/乐队', 'http://p1.music.126.net/10SJIPMH-WYPfUv7gD3wWg==/109951163720168310.jpg?param=130y130', '一支来自于中国香港的著名摇滚乐队，也是华人地区的殿堂级乐队之一，成立于1983年，其队名的中文意思为“超越”。乐队属于原创型，其作品以写实为主。乐队曾经有过多次的人事变动，其中以黄家驹、黄家强、黄贯中、叶世荣四人的阵容最广为人知。自从黄家驹于1993年在日本东京意外去世之后，乐队没有再寻找新成员填补。也因此，乐队失去了主要唱作人；但也驱使了后Beyond时期的音乐风格不仅变得具有更重的摇滚味，而且还朝向多元化发展，因此乐队无愧于“超越”二字。2005年Beyond举行了“Beyond The Story Live 2005”世界巡回告别演唱会并宣布解散，三人继续以个人的姿态发展自己的音乐事业。 beyond照片(80张)乐队之名“Beyond[1]”是由其首任主音吉他手邓炜谦所取，中文的意思为“超越”。在1998年时出版的乐队自传书籍《拥抱Beyond岁月》中，其鼓手叶世荣解释“在当时有很多的乐队都是以翻唱别人的作品为主，然而Beyond却爱创作属于自己的音乐，所以把乐队命名为‘Beyond’实有着超越一般乐队所涉足的音乐领域之意”。但叶世荣也重申“把乐队命名为‘Beyond’并不是要超越别人，而是要超越自己”。自从黄家驹于1993年意外去世之后，乐队失去了主要唱作人；但也驱使了后Beyond时期的音乐风格不仅变得具有更重的摇滚味，而且还朝向多元化发展，因此乐队无愧于“超越”二字。 乐队的作品以写实为主，其内容每每地反映出社会的时弊与及他们的所见所感，作品在有时会引来社会的广泛讨论。乐队一直坚持着由各自成员负责创作所有作品的旋律和编曲部分；而他们为了真实地表达自己对某一主题的意见或感受，所以歌词也尽量由自己创作，但有时也会交给刘卓辉等填词人操刀。 《海阔天空》《光辉岁月》《真的爱你》《喜欢你》等 列举Beyond的音乐风格（主要为摇滚） 艺术摇滚、前卫摇滚、硬摇滚、重金属、弗拉明戈、雷鬼、Grunge、迷幻、氛围音乐、英伦摇滚 成员介绍:黄家驹、黄家强、黄贯中、叶世荣 组队 八十年代初，黄家驹与叶世荣通过Tom Lee琴行老板的穿针引线下结识为好友，并发觉彼此都受英国摇滚乐的影响，音乐取向都一致，于是合组乐队，负责弹奏主音吉他的邓炜谦便把乐队之名命为“Beyond”。 1983年 Beyond于组建，并参加了《吉他杂志》所举办的“山叶吉他比赛”；他们不负众望，演出自己作品得到冠军，当时的成员是黄家驹、叶世荣、邓炜谦、李荣潮。创作的歌曲，如《大厦》等，以英文歌曲为主，曲风都是走向Art Rock，比较讲求技术性，重视音乐上的变化。 李荣潮与邓炜谦相继离队，而后黄家强（黄家驹之弟）与Owen Kwan皆于年底加入了Beyond，分别担任其贝斯手与主音吉他手。 1984年 Beyond在得奖后，也是一边工作一边玩Band，偶尔在一些酒吧等地做小演出。同年香港的一家唱片公司集合了一些地下乐队灌录了一张名为《香港》的唱片，其中包括了Beyond的两首英文原创歌曲；当时一起进录音棚的都是地下音乐分子，其中还包括了达明一派的刘以达。 Beyond创作的作品仍是以英文歌曲为主，包括《Long Way Without Friends》（此作品后期在《亚拉伯跳舞女郎》唱片里面并被改成中文作品《东方宝藏》，而英文版本则收录于《孤单一吻》盒带内）和《Myth》。以后，还完成了些中文歌，例如《永远等待》等。 1985年 这时Beyond的成员为家驹、家强、世荣和陈时安，四个人一起创作了不少的歌曲，于是打算开个演唱会把自己的歌曲和大家分享；不过陈时安要出国，于是Beyond便积极寻找一名吉他手。世荣认识阿Paul（黄贯中）在先，当时他请在大专读美术的阿Paul帮Beyond做海报设计方面的工作；阿Paul本身也参加了其他的乐队，吉他技术高超，于是Beyond便请Paul代为帮忙，四个人就一起积极筹备演唱会的工作。 Beyond自己出钱出力，租下港岛明爱中心；又自己租音响、服装、卖票，一切亲力亲为。Beyond以地下乐队的身份，开了一场“永远等待”演唱会。虽然当日到场的乐迷不太踊跃，但热情依然。Beyond邀请多家唱片公司人员来观看，却一个也没见；幸好，有一位与他们签订五年的合作关系的，也就是以后与他发生法律纠纷的Beyond的第一位经理人—陈健添。 这次演唱会的台前幕后的一切事务皆由他们自己动手，更向银行贷款一万六千元，才可顺利举行，但最后结算还亏欠了六千元。当时，他们的人工只有一千元而已，那更显出他们的决心。当时他们的想法是要以一个公开的表演形式，将自己的作品介绍给其他朋友认识；更乐观的想法是希望籍此音乐会，能赚取一笔钱，来应付之后出版盒带的费用。 在当时而言，可以说是个大胆而自信的尝试：当时Beyond尝试了多种音乐风格，包括艺术摇滚、后朋克、新浪潮、重金属甚至华丽摇滚；也开始尝试用粤语创作摇滚作品，如《永远等待》、《旧日的足迹》便是当时的作品。Beyond以前卫乐队的形象确立在香港地下乐坛的江湖地位。 1986年 Beyond对音乐的狂热，让他们又完成了一个创举：他们自己去租录音室，然后将自己创作的歌曲，做成一张名为《再见理想》的唱片；他们从专辑的包装设计，到所有的录制配唱，完全一手包办，包括找唱片行寄卖等。Beyond在这年新增一名成员—刘志远，作为吉他手和键盘手。 他们和小岛、达明一派合录了一张盒带《劲歌金曲》，其中收录了他们的四首歌曲；他们和小岛也在七月份应台北泛亚音乐节之邀到台北参与演出，而他们是当中唯一加场演出的乐队，因为他们的音乐颇受欢迎。 同时，世荣和阿Paul与邓炜谦、马永基组成一支重金属乐队—高速啤机（该乐队也是Beyond的分支乐队），以玩票性质参加一些地下音乐会的演出，并参加了八六年度“嘉士伯流行音乐节”。Beyond也于正式签下Kinn\'s Music Ltd，为进军流行乐坛做准备。 1987年 Beyond出了一张EP《永远等待》，其中《昔日舞曲》、《Water Boy》及标题歌《永远等待》随即成为的士高的热门歌曲；而《昔日舞曲》还曾走上香港电台流行榜，并被电视台拍成MTV，这也是Beyond第一首作品被拍成MTV；这张EP，成了他们前进流行乐坛的跳板。不过实际上Beyond仍未被大众所接受，他们的装扮更被评得一文不值；当时的Beyond，就走在这吃力不讨好的两难局面中：旧日的追随者指责他们背弃理想和原则并走向商业化，而初接触的又批评他们过于前卫；他们在首次接受港台DJ车淑梅访问中，亦被取笑是否常被称作“长毛飞”。 此时乐队风正在流行，香港爆发劲Band浪潮：达明一派、太极、风云、Beyond、小岛等二十余支劲旅震撼流行乐坛；Beyond称这不是复苏，而是一场音乐革命，他们对于未来寄予厚望。 beyond专辑封面(9张) 同年，Beyond终于发行了首张大碟《亚拉伯跳舞女郎》（《阿拉伯跳舞女郎》）。唱片封面取景自新加坡，是一张充满中东风情的专辑；在音乐上他们有特别的表现，但在形象上却再次受到严厉的批评。Beyond正尝试寻找介于商业和摇滚间的平衡点，不过，这倒让他们成了非主流中的主流音乐；他们在音乐中加入了多一些的电子元素，使音乐比较柔和，易于让人接受。除主题曲夺得流行榜冠军外，《无声的告别》和《孤单一吻》也相继打入排行榜。不过销售成绩仍欠理想，Beyond的命运仍是未知数。 他们在高山剧场举行了“Beyond超越亚拉伯”演唱会，虽然仅此一场，但对于当时只出版了一张专辑的乐队来说，殊不简单。自此之后，陈健添为他们接下不少演出工作，各大小商业典礼都有他们的踪迹，这无疑是成功的商业策略；但对于Beyond自身来说，便显得无可奈何。 1988年 Beyond发行了第二张大碟《现代舞台》，重新收录了《旧日的足迹》，音乐走向比以前更显得柔和，有些歌曲走流行路线；Beyond式的慢版情歌，也于这时出现，如《冷雨夜》、《天真的创伤》，但曲风仍独树一帜；讽刺社会的《现代舞台》，是Beyond开始批判社会现象的开始；阿Paul和家强首次有了自己的主唱歌曲。不过这张专辑的销售量也是欠佳，而他们的经纪人也对他们言明如果专辑再不卖，他们就没有发片的机会了。 Beyond发行了一张《旧日足迹》精选集，在大专会堂举办了一场音乐会；而在音乐会上，刘志远正式退出Beyond，成员再次恢复到四人。也许是也了了即将不再发片的忧患意识，《秘密警察》更尝试走向大众化，重新收录四人合唱的《再见理想》，而合唱歌曲也成了他们最受欢迎的风格之一；《大地》那有着强烈东方色彩的Rock，更是深深的唱入了众人的心中，这首歌成了Beyond的第一首经典名曲；而《喜欢你》成了极受欢迎的情歌之一。 Beyond于终于拿到港台流行乐坛的奖项，他们也得以继续发片。虽然歌曲能被大众接受，但是这些并非Beyond最喜欢的音乐种类，加上部分地下时期追随的乐迷批评他们失去乐队原有的风格，被骂为“摇滚叛徒”，这段日子Beyond过得并不容易。不过，Beyond并没有理会外人的指责，黄家驹表示：要在商业化的香港市场玩自己真正喜欢的音乐，就必须先要打响乐队的知名度；当更多人去听Beyond的歌后，就会玩回自己喜欢的音乐。 Beyond与达明一派、小岛乐队合作录制了香港摇滚史上第一张混音作品集，Beyond的混音加长版作品共三首，即《过去与今天Remix》、《孤单一吻Remix》、《昔日舞曲Remix》。同年，香港电台为六十周年台庆推出纪念杂锦大碟，其中收录了Beyond与达明一派、蓝战士、基本、Raids、太极、Cocos共七支乐队合唱的《劲Band特别即兴串烧》，这是香港摇滚乐坛唯一一首串烧合唱歌。Beyond也为达明一派的大碟《你还爱我吗》担任两首歌的和音，为我们留下了Beyond专辑外的珍贵声音。 1988年10月15日至16日，Beyond前往北京首都体育馆举办演唱会，成为最早在中国大陆演唱的香港明星。由于Beyond是以唱粤语歌为主，所以一般大陆听众并未接受；从原来客满到终场时走了一半的人，但Beyond仍成功的办完了这场演唱会。 1989年 Beyond返港后参加了电影《黑色迷墙》的配乐工作，并为其演唱主题曲。推出了一张EP《四拍四》及大碟《Beyond IV》，其中的《真的爱你》成为大街小巷人人琅琅上口的歌曲之一。而此时的Beyond发展的更为广泛，音乐的商业色彩也更显浓厚；Beyond也开始成为人们眼中的偶像乐队，香港导演杜琪峰也邀请他们参加《吉星拱照》（大陆译“福星高照”）的演出及配音。 同年，Beyond又发行一张大碟《真的见证》，收录了多首他们为其他歌手创作的歌曲。11月份，Beyond与宝丽金参加台湾“永远的朋友”演唱会，第一次演唱国语歌曲。年底在新建成的伊利莎白体育馆办了一场热热闹闹的“真的见证”演唱会，更把他们的声势推向高峰。 1990年 Beyond在此时已成为香港的顶尖乐队，同时跨足商业及非主流音乐中。1990年的行程亦十分忙碌：他们参加了《开心鬼3—开心鬼救开心鬼》的演出，并为其演唱主题曲《战胜心魔》和《文武英杰宣言》；他们也应邀为“绿色一代新主张”写了一首《送给不知怎去保护环境的人（包括我）》；又为电影《天若有情》演唱了插曲，其中家驹、阿Paul、家强各唱了一首。 这年他们正式向东南亚进军，发行了首张国语大碟《大地》，值得一提的是《文武英杰宣言》的国语版（并未收录在此张专辑中）。而同年也出了一张大碟《命运派对》，其中的《俾面派对》是讽刺演艺圈光怪陆离的现象；而在这张专辑中，有不少关怀第三世界的歌曲，如《光辉岁月》就是家驹为南非第一位黑人总统曼德拉致敬所写的；家驹也凭借《光辉岁月》成为了年度最佳填词人。Beyond也成为了香港世界宣明会的代言人；反对种族歧视，希望世界和平，一直是Beyond的心愿。Beyond也开始一点一滴，朝着国际化迈进。 1991年 Beyond应世界宣明会之邀到非洲等地去探访第三世界的穷困人民，并成立了一个第三世界基金。在4月发行了第二张国语大碟《光辉岁月》并在台湾举行了一个小型的演唱会，这是他们继1986年演出之后，另一个在台的现场演出。同时他们也晋升为主角人物，电影公司为他们量身定做了一部《Beyond日记之莫欺少年穷》的励志电影，而他们也为其电影创作了《谁伴我闯荡》、《不再犹豫》等多首歌曲。 同年，Beyond为TVB主持一个带状综艺节目《Beyond放暑假》，在其中访问歌手及演出短剧等。而第七张大碟《犹豫》使他们被人批评为最商业的一张专辑，世荣也有了一首自己主唱的歌曲，即《完全的拥有》。 9月，他们正式踏上香港歌手心目中最佳的演唱会圣地—香港红勘体育馆，举办了“生命接触”演唱会。在年底的一个偶然的机会，他们在NHK的节目上出现，签约为Amuse经纪人，正式进军日本乐坛。 1992年 Beyond将发展重心移往日本，同时结束了与新艺宝长期合作的关系。与前几年相比，前半年他们沉寂了不少，香港乐坛似乎少了Beyond的踪迹。成为国际化的乐队，一直是Beyond的遥远梦想；如今梦想有了实现的机会，他们便努力抓住。不过日本对于音乐制作上的严格要求，加上语言不通，他们颇为消沉了一阵子；但为了让香港音乐能在日本乐坛上发出一点光，他们仍是十分努力，于是一张与以往Beyond音乐不同的大碟《继续革命》出现了。他们的形象也从亲切温和而转变为冷酷高调；《长城》更被邀请到日本音乐大师喜多郎制作片头音乐；整张专辑编曲华丽漂亮，让人耳目一新。不过由于沉寂了一段时间，使他们的声势有点下坠。 同年年底，Beyond在台湾发行了第三张国语大碟《信念》，重新签约滚石为其发行国语唱片，不过Beyond的国语唱片在台湾一直叫好不叫座；他们在日本，也发行了几张单曲唱片。Beyond正为打入日本市场积极努力，不过成绩平平。 1993年 Beyond结束了在台湾短暂的宣传期，又赴日本去创作新专辑，为着在日本发行新专辑而努力。5月底，他们回到了香港，带回《乐与怒》这张大碟。Beyond对这张专辑非常满意，在录音及编曲上也更为自由；《海阔天空》这首充满了Beyond十年心路历程的歌曲，成了本地最佳原创歌曲。Beyond在香港和马来西亚各举办了一场大型不插电的演出，并在6月底推出了日语专辑。 这年是他们成立十周年的日子，年底也打算举办一场纪念十周年的大型演唱会。可是谁也没有想到：6月24日，Beyond在东京富士电视台录制节目时，家驹不慎从舞台上跌落成重伤，昏迷不醒；6月30日下午16时15分（该时间为日本当地时间，而中国当地时间是当天下午15时15分），家驹永远地离开了大家。这对于Beyond简直是一个沉重而悲惨的打击！家驹一直是乐队的主要唱作人，整张专辑词曲，大部分都是由家驹包办，而他一离开，也为Beyond的命运带来重大转折。 对于Beyond及乐迷来说，这一年除了痛苦和悲伤外，更有着害怕和疑虑，Beyond是否会解散，一时间谣言四起。不过11月底的创作人音乐会，是Beyond在家驹去世后的首次大型演出，他们表演的格外精彩：吉他声音凄厉而撼人，强烈的Power排山倒海；如此高能量的演出，是空前的，也是绝后的。Beyond正从伤痛中一点点醒来，而香港乐坛，也痛失英才。不过原创音乐却因此抬头，一改香港歌手爱翻唱日文歌曲的歪风，香港乐坛似乎觉醒了不少。四人Beyond，也成为了历史，成了一段传奇。 1994年 Beyond结束了与华纳的合作关系，与滚石签约，成为旗下歌手。他们又再度返回日本，尝试三个人去完成四个人的音乐；在他们内心的挣扎和矛盾下，《二楼后座》发行了。这张专辑试图延续之前的曲风，阿Paul的唱腔，也开始转为愤怒呐喊；家强不自觉的和家驹的唱腔接近；《醒你》这首批评香港民众盲目崇拜偶像的歌曲使得他们倍受争议。 这一年，Beyond不再续约Amuse，自己做自己的经纪人，而和前经纪人陈健添，也打了场官司。7月多在台湾发行《Paradise》，办了三场歌友会。他们的形象也开始改变，走另类乐队的路线。 1995年 Beyond和Jim Lee开始合作，并远赴洛杉矶、温哥华等地录制新专辑。6月底发行新专辑《Sound》，也于香港活动中心举行了一场大型的户外演出，以光纤电缆将演唱会实况传送到各大商场。Beyond极注重吉他方面的表现，及音乐上的丰富性；而在专辑中加入一首纯音乐，也是从此时开始。他们留心电子音乐的发展，三人乐队的音乐形态就此成型。《教坏细路》这首抨击TVB的歌曲，也为他们带和TVB间的嫌隙；香港的节目上，他们的宣传大减。 同年11月，Beyond在台湾发行了专辑《Love & Life》，创作了四首全新的国语歌曲，并且办了三场名为“土洋大战”的音乐会。不过这张专辑的销售量不佳，使Beyond隔两年半才推出新国语大碟。Beyond也远赴韩国参加音乐活动，受到当地歌迷的欢迎。 1996年 Beyond于3月初在香港红勘体育馆办了四场演唱会“Live & Basic”，精彩而精湛的演出及弹奏。办完演唱会后，沉寂了一段时间。 此时，家强也积极地为其他歌手创作歌曲，Beyond也不时放出将要走向幕后的风声。而同年Beyond将自己多年以来一直使用的Band房“二楼后座”投资不少改建为录音室，使他们成为了一支有自己录音室的乐队。他们也着手培训新人，想为香港乐坛增添新鲜血液；他们也拿到本年度的最佳团体金奖，摆脱了长久以来都是拿银奖的命运，成了香港民众票选最爱的乐队。 1997年 Beyond经过漫长的时间后，终于推出了大碟《请将手放开》。整张大碟充满了试验性，Beyond的音乐也开始溶入迷幻电子音乐；《请将手放开》、《大时代》那种表现香港末世纪心态的歌曲，写得十分出色；他们也为保护动物基金会及聋人基金会写了歌曲，分别是《谁命我名字》和《回响》，不过《回响》被批评有Oasis的味道；《吓！讲乜嘢话》被指模仿Anodize的歌曲；不过整张专辑是在“二楼后座”录音室录制的，这是Beyond的自傲之处。 年底，他们又发行了一张大碟《惊喜》，Beyond的电子音乐风格仍在这张专辑中呈现。Beyond试着在唱腔上改变，想给歌迷全新之感；不过乐评人却觉得Beyond的音乐逐渐走向“黄贯中+黄家强+叶世荣”的感觉，而纯摇滚音乐也似乎不复以往；《回家》是写香港人回归后心态的歌；《雾》、《深》这类印象派歌曲，成了Beyond的新特色；而世荣用Drum Loop创作的《无事无事》，更展现了他们音乐上的另一种新风貌；在纯音乐方面，Beyond亦交出了精彩作品。而他们也积极的录制国语专辑。 1998年 农历年过后，Beyond总算再度发行新国语大碟《这里那里》。虽然大部分都是采用旧歌曲，但编曲及诠释上都全部更新，电子音乐似乎成了Beyond的主流；《缓慢》的微冷音调，比其他的歌为之出色不少；他们在台宣传也比上一张专辑多了一些。 3月14日，Beyond办了场演唱会，歌迷除了台湾的，更有来自香港和韩国的，这让台湾媒体也见识到Beyond的魅力；后于4、5月份在台湾参加了几场校园演唱，他们希望能打入台湾市场的心情可见一斑。4月份在香港出了一张精选辑，《管我》这首歌改成了粤语版，并请香港各大学的乐队来参与配唱。 7月，美国华纳电影邀请Beyond为其即将上演的电影《轰天炮4》演唱主题曲，于是发行了一张EP《Action》，其中《打不死》那颇为007的前奏，极具爆发力的演唱，十分出色！他们亦配合梅尔吉勃逊和李连杰一起宣传此片。 9月，台湾发行了一张精选辑《Beyond Files》。而年底，他们推出全新粤语大碟《不见不散》，音乐的编排及演绎都十分出色。长达六分多钟的《不见不散》，在编曲上十分精彩，背景音乐相当悠远，营造出相当好的效果；而《牺牲》的前奏笛音，让人耳目一新；世荣也似乎找到适合自己创作的音乐。 1999年 Beyond于3月7日在新城电台的主导下，举办了一场纪念十五周年的“Beyond 2000”演唱会；不过由于音响不佳，主办单位的失职，歌迷们颇有指责。他们在11月发行了大碟《Good Time》，又在12月圣诞节举行了“Good Time”演唱会并宣布暂时解散，三人各自开始发展自己的音乐事业。 2003年 Beyond为纪念乐队成立二十周年而再次复出，并于五月在红馆举行一连五场的“Beyond超越Beyond Live 2003”演唱会，取得成功；这是在Sars肆虐的情况下取得战果，可见Beyond的影响力之大。之前为配合Beyond二十周年演唱会，特别推出EP《Together》，其中收录全新演唱会主题曲《抗战二十年》。其后又分别在北京、马来西亚、广州、上海、美国、加拿大、深圳等地区、国家举行了世界巡回演唱会。巡回演唱会结束后，Beyond再次活跃于乐坛之中，并参加了不少音乐会的演出。 2004年 Beyond凭电影《无间道II》主题曲《长空》而荣获“香港电影金像奖之最佳原创电影歌曲奖”。同年11月宣布因三人音乐理念，对香港乐坛不满等问题，决定于翌年举办巡回演唱会后正式解散。 2005年 Beyond举行了“Beyond The Story Live 2005”世界巡回告别演唱会并宣布解散，三人继续以个人的姿态发展自己的音乐事业。 Beyond获十大中文金曲颁奖礼“终身成就奖” Beyond获九八年度叱咤乐坛流行榜“乐队组合金奖”、“我最喜爱的乐队组合奖”与九八年度新城劲爆音乐颁奖礼“劲爆摇滚组合奖” Beyond获九九年度叱咤乐坛流行榜“乐队组合金奖”、“我最喜爱的乐队组合奖”与九九年度新城劲爆音乐颁奖礼“劲爆摇滚组合奖” ...');
INSERT INTO `tb_singer` VALUES ('25', '五月天', '华语组合/乐队', 'http://p1.music.126.net/Hf-0kjdtbn1169gN7WE_hA==/109951163720138703.jpg?param=130y130', '台湾乐团，由乐队团长兼吉他手怪兽、主唱阿信、吉他手石头、贝斯玛莎和鼓手冠佑组成。五月天的前身是SoBand，是由四个师大附中学生组成，329野台开唱的表演所以就改叫五月天，同时也把329当成五月天的成军日。在1997年3月29日改名为“五月天”。乐团的名称是来自贝斯手玛莎在网络论坛上的代号。1999年，台北市立体育场五月天第168场万人演唱会。台湾第一个站上体育场开演唱会的乐团，被视为华语乐团的奇迹，奠定了五月天的live魅力。截至2012年6月，四次夺下金曲奖“最佳乐团奖”，代表作《志明与春娇》、《疯狂世界》、《终结孤单》、《诺亚方舟》等。2017年5月16日入围金曲奖最佳乐团。 阿信 ( 主唱) 、怪兽 ( 吉他手、团长) 、石头 ( 吉他手) 、玛莎 ( 贝斯手) 、冠佑 ( 鼓手) 第一张创作专辑 ( 1999.07.07) 、 爱情万岁 ( 2000.07.07) 、 人生海海 ( 2001.07.06) 时光机 ( 2003.11.11) 、 神的孩子都在跳舞 ( 2004.11.05) 、 为爱而生 ( 2006.12.29) 后青春期的诗 ( 2008.10.23) 、 第二人生 ( 2011.12.16) 志明与春娇、温柔、倔强、知足、天使、突然好想你、诺亚方舟等 亚洲第一摇滚天团 MR中国TOP排行榜最佳乐团 全球华语音乐榜中榜最佳乐团 中歌榜最受欢迎乐团 CCTV-MTV音乐盛典最佳乐团 华语乐坛最受欢迎乐团奖 HITO流行音乐奖最受欢迎乐团 KKBOX数位音乐榜最佳团体 《第二人生》十白金唱片认证 四次台湾金曲奖“最佳乐团奖” 新加坡金曲奖最佳乐团 港台地区最佳乐团奖 Mayday is Monster, Stone, Masa, Ming, Ashin & U 出道时间：1999年 曾所属公司：滚石音乐 现所属公司：相信音乐 五月天（Mayday），台湾著名摇滚乐团，由乐队团长兼吉他手怪兽、主唱阿信、吉他手石头、贝斯玛莎和鼓手冠佑组成。乐团于1997年青年节成立，发源于台湾台北市。五月天的前身是So Band，最初由四个师大附中学生组成，为了329野台开唱做表演，同时也把329当成五月天的成军日。前三任鼓手分别是钱佑达、陈泳锠及浊水溪公社的鼓手Robert。现今鼓手为已解散乐队whynot的鼓手冠佑。 1992年－1994年 除鼓手冠佑（刘谚明）以外的四人：阿信（陈信宏）、怪兽（温尚翊）、玛莎（蔡升晏）、石头（石锦航）先后结识于台湾师范大学附属中学，加入师大附中的吉他社，开启了音乐旅程。 1997年 3月29日“第一天，我存在，第一次能飞起来！”青年节，野台开唱，五月天正式成军！天字第一号的演出就在这一天。 1998年 1月全世界第一次听见五月天，发行第一张乐团合辑：《ㄞ国歌曲》轧车一曲制作发行。 6月华语第二张同志专辑《拥抱》，五月天担任了大部分的词、曲创作及编曲，没有疆界拘泥的诠释，惊艳整个华语乐坛。 台北艺术季表演。 公视Y世代节目主题曲、片尾曲制作演唱。 加入滚石集团。 德保育专案主题曲“大地之歌”编曲，演唱。 1999年 7月7日《第一张创作专辑》由滚石唱片发行。正式发行疯狂五月天，占领西门町演唱会。连续四场演唱，在第五场于新公园音乐台涌进两千人。 7月《志明与春娇》获得钱柜点唱榜冠军，并且于其后占领冠军位置两年之久。 全省游乐园巡回演唱。 8月28日台北市立体育场五月天第168场万人演唱会。台湾第一个站上体育场开演唱会的乐团，被视为华语乐团的奇迹，奠定了五月天的live魅力。 《五月天/第一张创作专辑》获得中华人音乐人交流协会评选为推荐专辑。 五月天第168场LIVE演唱会全纪录发行。 2000年 7月7日发行第二张创作专辑《爱情万岁》。完成河口湖乐团同步录音，第二张专辑《爱情万岁》在大学课程的压力之下，突破重重困难，终于完成发行。 7月15日台北贡寮 海洋音乐祭 8月举行台湾北，中，南《十万青年站出来》三场总计十万人演唱会。 8月12日  十万青年站出来 台北市 中山足球场 8月19日  十万青年站出来 彰化县 县立体育场 8月26日  十万青年站出来高雄市 中山体育场 9月九二一大地震后，石头与怪兽私下前往灾区埔里，身体力行做了一星期的义工，与当地的小孩老人住帐篷，抬水喝。回台北时身穿破烂脏T恤，与一颗贴近土地的心。 12月十万青年站出来live全纪录发行。五月天团员共同前往马来西亚邻近岛屿，“热浪岛”的短暂假期，也完成了人生海海的概念《十万青年站出来live演唱会全记录CD》发行。 2001年 5月大鸡腿录音室落成，GLAY成为第一组前来祝贺的好朋友。 以《爱情万岁》获得第十二届金曲奖最佳乐团。 5月5日  参加在高雄中正文化中心举办的第12届金曲奖，并获得最佳乐团奖。 5月16日发行音乐作品《候鸟》电影原声带。 于日本发行日版精选集《Call Me NO.1》。 7月开始主持电视节目《OK！啦！五月天》，广播节目《今夜好不好》。注：《OK！啦！五月天》共分为空手道；摄影棚代班；随堂测试；平溪火车之旅；放天灯；音乐旅程；开怪手；澎湖之旅；澎湖花絮；终极企划答客问。《今夜好不好》从7月29日到9月30日，每周一期。 7月1日人生海海发布记者会。 7月6日发行第3张创作专辑《人生海海》。继两张空前成功的专辑后，推出暂别歌坛之作《人生海海》。 8月担任日本乐团GLAY《Glay Expo 2001 Global Communication》福冈10万人演唱会嘉宾。 8月18日举行三场五月天《你要去哪里》，台湾巡回售票演唱会开跑，首站为台县立板桥体育馆。 8月25日五月天《你要去哪里》第二站高雄中山体育场，石头于情人节演出当天在两万人面前向狗狗求婚成功。 9月7日于新加坡举行五月天《你要去哪里》新加坡暂别乐坛售票演唱会。 9月10日于马来西亚吉隆坡举行《大马青年站出来》演唱会。石头从马来西亚飞往英国成为第一个离团的团员，当晚发生震惊世界的9.11事件。 10月怪兽、玛莎、阿信准备入伍，发行《五月天素人自拍》。 11月由于团员入伍暂别乐坛，各奔前程，预计2003暑假复出。 12月发行五月天《你要去哪里.台湾巡回演唱会live全记录》冠佑前往洛杉矶进修打击乐器。 2002年 2月《五月天摇滚本事》写真书上市。 3月怪兽、阿信相继退伍，进入滚石唱片制作部。 中华音乐人交流协会年度十大优良单曲推荐《借问众神明》。 9月怪兽、阿信统筹制作的《半成年主张》专辑发行，怪兽、阿信与歌手孙燕姿共组团体Kid&Dream并合作《王子面》。石头英国学成归来，并且于同年与狗狗结婚，婚礼上请到滚石唱片董事长，四分卫等好友，并且请到李宗盛大哥担任证婚人。 12月12日创作EP《摇滚本事》发行。 12月20日五月天记录电影《摇滚本事》上映。 2003年 于台湾以外地区推出首张华语精选辑《我们是五月天》。 1月19日参加在上海大剧院 举办的第9届全球华语榜中榜第九届华语榜中榜。 7月玛莎退役，五月天重聚正式复出，发行新单曲《武装》，作为正式复出的序幕曲，也为《天空之城》复出演唱会主题曲。 8月16日举行《天空之城》复出演唱会，缔造了破售票纪录的四万人，开启台北市立体育场演唱会新纪元。其中收入五月天重新编曲演唱张雨生从未发表过的作品《小时候》。 担任康师傅冰红茶乐队大赛评审。 为梁静茹制作精选辑首支单曲《听不到》。 创作演唱蔡明亮导演的《不见不散》电影主题曲《不见不散》。 9月  与任贤齐一期参加康师傅冰红茶冰力先锋乐队杭州分赛区活动。 9月5日助阵在福州会堂举办的第2届“康师傅冰红茶”冰力先锋乐队选拔赛半决赛。 9月6日参加康师傅冰红茶冰力先锋乐队选拔赛广州分赛区活动。 9月12日参加康师傅冰红茶冰力先锋乐队选拔赛长春分赛区活动。 9月14日参加在西安交大举行的康师傅冰红茶冰力先锋乐队选拔赛活动。 9月21日参加在北展剧场举行的康师傅冰红茶冰力先锋乐队总决赛。 11月11日在怪兽母亲突然病重的情况下，五月天发挥手足情深，克服重重困难，顺利共同完成了团史上最具音乐性的唱片《时光机》。 怪兽、玛莎以裸奔庆祝发行第四张创作专辑《时光机》。 2004年 为歌手梁静茹量身打造转型歌曲《燕尾蝶》大受好评，专辑内并合作《宁夏》、《纯真》。 1月8日出席在上海大舞台举办的第10届华语榜中榜。 3月发行《天空之城演唱会 2CD+VCD》专辑发行《时光机 MV+Single》VCD+DVD发行《天空之城Live DVD&VCD》。 3月17日 上海，时光机登\"陆\"记者会，以小型演唱会方式呈现，五月天连唱六首歌。 3月24日  香港，红馆，新专辑发布会歌迷见面会。 3月26日  北京，西单印象大世界，签售会。 3月28日  深圳，参加第4届百事音乐风云榜。 4月10日  广州暨南大学，channel V音悦台节目录制。 4月18日上海，天地英雄校园行节目录制。 4月24日  MusicRadio中国TOP排行榜颁奖礼。 5月五月天五周年庆祝五人肖像登上民航机飞上蓝天五周年庆祝活动，突袭西门町演唱。 入围MTV台[BuzzAsia大奖]。 5月8日参加第15届金曲奖，并以《时光机》获得最佳乐团奖（幕后采访时玛莎露股沟）。 5月11日浙江金华江南体育馆演出。 5月14日浙江绍兴动