UMP！”个人演唱会，那天是冠佑的宝贝女儿小玫瑰的一周岁生日，全场八万人一起为玫瑰公主唱生日快乐歌，冠佑感动落泪还现场连线小玫瑰。回想2004年第一次在上海的演唱会，场地仅能容纳八千人，如今美梦成真，顺利踏上八万人的豪华大舞台，主唱阿信感动的说：“从2004年的上海大舞台到今天的八万人，短短不到200公尺，我们走了1540天。”心里头的感动溢于言表。 10月28日歌手丁当举行签唱会，师兄阿信及怪兽也到场站台，希望歌迷能好好爱护丁当。五月天的阿信也现身与丁当合唱歌曲《走火入魔》。 12月15日天津，五月天“离开地球表面 JUMP！”世界巡回演唱会开场，为07年“离开地球表面 JUMP！”世界巡回演唱会画上圆满句点。（场馆：天津体育馆） 2008年 1月1日五月天在2008年的第一天，又替自己树立了新的纪录，一路从凌晨2点唱到上午7点20时才结束，近五个半小时的“突然很想见到你”演唱会，是他们2007年最后一张，也是2008年的第一张成绩单，五月天用他们的音乐，叫醒崭新的一年。 3月29日五月天成军日首发《回到地球表面》主题曲、天喔茶庄主题曲《小太阳》单曲。 4月19日五月天“离开地球表面 JUMP！”系列第19站也是最后一站，来到马来西亚，五月天“离开地球表面 JUMP！”系列世界巡回演唱会圆满落幕。（场馆：云顶云星剧场） 4月26日五月天“回到地球表面”演唱会旗舰场第一站在狮城新加坡举行。 4月30日五月天“回到地球表面”演唱会旗舰场第二站在上海八万人体育场开演。整场演唱会的节目内容以及硬件全数更新，半年内五月天在八万人二度开唱且场场爆满，让五人不禁对上海歌迷道出一句“谢谢侬”来表达他们心中的感动与感谢。而当晚的蓝色海洋，比2007年10月20日“离开地球表面”演唱会时的更蓝，达到99%的蓝，让八万人真正沉浸在了蓝色的海洋中，创造了一个蓝色奇迹。 5月17日五月天“回到地球表面”演唱会旗舰场第三站在台中开演。选在2005年“FINAL HOME 当我们混在一起”演唱会的国立台湾体育大学体育场举行。为替四川大地震灾民祈福，他们演唱「两只老虎+天使」时关掉所有舞台灯，带领3万粉丝挥舞荧光棒传达关怀。 10月本来“乐无疆，爱无界”中国演唱会，林肯公园携手五月天于10月12日、19日于上海和北京开演，但是由于林肯公园的主唱肌肉拉伤，所以在中国的演唱会都取消。 10月23日发行第七张专辑《后青春期的诗》(The Poetry of Day After)。 2009年 开启“DNA五月天创造”世界巡回演唱会（2009年至2010年） 1月1日台湾，桃园跨年演唱会。 2月21日在澳门威尼斯人，五月天和丁当、梁静茹、品冠一起举行了相亲相爱演唱会。 3月20日宣布启动世界巡回演唱会“DNA五月天创造演唱会”，并与跨国团队合作，首次增加澳洲站。 3月29日台北，“A.N.D 同党万岁 五月天 and Friends”演唱会。 4月17日上海，“不准不开心”小型表演。 4月19日南宁，“不准不开心”小型表演。 5月20、21、22日香港，五月天”DNA 创造”世界巡回演唱会 香港站（红磡体育馆）。 5月28日 澳洲，五月天”DNA 创造”世界巡回演唱会 悉尼站。 7月3、4日上海，五月天”DNA 创造”世界巡回演唱会 上海站。 7月11日北京，五月天”DNA 创造”世界巡回演唱会 北京站（首都体育馆）。 8月1日哈尔滨，五月天”DNA 创造”世界巡回演唱会 哈尔滨站。 8月21日杭州，五月天”DNA 创造”世界巡回演唱会 杭州站。 8月28、29日新加坡，五月天”DNA 创造”世界巡回演唱会 新加坡站。 9月24、25、26、27日台北，五月天”DNA 创造”世界巡回演唱会 台北站。 10月6日南京，五月天”DNA 创造”世界巡回演唱会 南京站。 10月17日佛山，五月天”DNA 创造”世界巡回演唱会 佛山站。 10月31日重庆，五月天”DNA 创造”世界巡回演唱会 重庆站。 11月21日广州，五月天”DNA 创造”世界巡回演唱会 广州站。 12月5日高雄，五月天”DNA 创造”世界巡回演唱会 高雄站（世运体育场），并创造入场55555人记录。 12月12日郑州，五月天”DNA 创造”世界巡回演唱会 郑州站。 12月13日广州，五月天河源歌友会。 12月24日上海，五月天圣诞演唱会。 12月26日长沙，五月天”DNA 创造”世界巡回演唱会 长沙站（长沙国际会展中心）。 12月31日台北2010跨年演唱会倒计时压轴表演。 2010年 1月13日五月天参加厦门卫视、两岸电视媒体联手制作的《欢喜大围炉——2010两岸闽南话春晚》的录制。 4月4日纽约，五月天“变形DNA无限放大版”演唱会 纽约站（康州金神大赌场体育馆）。 4月10日洛杉矶，五月天“变形D