INSERT INTO `tb_singer` VALUES ('27', '苏打绿', '华语组合/乐队', 'http://p1.music.126.net/znozXOyHQXRc52hU6UAtmg==/756463999935630.jpg?param=130y130', '于2001年由国立政治大学的学生组成，2003年时确立了现在的六人阵容：主唱吴青峰（青峰）、贝斯手谢馨仪（馨仪）、鼓手史俊威（小威）、电吉他手刘家凯（家凯）、木吉他手何景扬（阿福），以及键盘与中提琴手龚钰祺（阿龚），其中除了阿龚为台北艺术大学音乐研究所的学生外，其余五名成员都曾就读政治大学。主要以摇滚乐为主，自出道开始，苏打绿所有发表歌曲皆为团员所创作。这群个性张扬的年轻人，成就了音乐史上的奇迹。苏打绿的音乐，没有刻意的落笔，没有虚伪的诉求，但却极其真诚与善良。 吴青峰 ( 主唱) 、谢馨仪 ( 贝斯手) 、史俊威 ( 鼓手) 刘家凯 ( 电吉他手)、 何景扬 ( 木吉他手)、 龚钰祺 ( 键盘手、中提琴手) 概述 2003年7月，苏打绿在海洋音乐祭小舞台演出，在此次活动中结识音乐制作人林暐哲，而后加入林暐哲音乐社，陆续发行三张单曲，并于2005年9月发行第一张同名专辑《苏打绿》。 自出道开始，苏打绿几乎所有发表歌曲皆为团员所创作。（其中主 荧幕中的苏打绿(15张)要为主唱吴青峰所作）这群个性张扬的年轻人，成就了音乐史上的奇迹。 苏打绿的音乐，没有刻意的落笔，没有虚伪的诉求，但却极其真诚与善良。就像飞鸟忘神地跳芭蕾，很简单地，想在自己或你和你的脑袋里转个不停；就像喝下一杯不知名的苏打，很清淡地，却在吞入之后让泡泡打不停的嗝。没有伟大、没有华丽、没有艰深，看穿了轻薄的所有风景，安静地回到自己的内心，甚至还能进到更多人的心。 指南针也有失效的时候，地图也帮不上忙，瞎混着不知道去哪里，只有音乐才是唯一的方向。网路上纷纷冒起歌迷说着第一次听苏打绿的心情，全都是来自心里的震撼与感动，相信许多人迷恋苏打绿是因为相互陪伴的特性太强烈；就像某些人听到陈绮贞的“还是会寂寞”就非得想起十七岁不可，或许苏打绿的“频率”也使他们忘不了自己的二十一 苏打绿专辑及宣传(14张)岁。 苏打绿是一个非常奇妙的乐团：既是知名学术大学的研究生也 是疯狂的音乐份子，每个人的个性都完全不同却组成一个风格一致的乐团，主唱青峰的歌声别致高亢，收放自如，有着魅惑听觉的神奇美感。词曲时而魔幻，时而写实，曲风可清新如民谣，也可摇滚地狂烈，不管什么风格，都具有很令人惊艳的旋律性，加上编曲的细腻巧思，信手捻来，神来之笔随处可见，恣意奔放，无法预测。这么说吧，苏打绿就是简单又复杂。 经过两年三张单曲，以及无数现场演出，苏打绿终于要发行自己的第一张专辑，也许它会改写乐团音乐在台湾的历史，也许它只是某些乐迷耳中不能错过的珍宝，唯一能肯定的是它绝对是一张“好听到离谱”“离谱地好听”的首张专辑。 苏打绿的成员多半是政大的学生，鼓手小威、贝斯手馨仪以及主唱青峰是在附中时就组团，大家不约而同考上政大，中间经过几次团员的更迭，电吉他手阿凯、吉他手阿福的陆续加入，最后则是在去年入团的提琴手阿龚，完成了现在的阵容。苏打绿之所以叫苏打绿，怪名字并非有什么深沉的涵意，纯粹只是因为团员觉得“苏打”很适合用来形容自己的音乐，而主唱青峰喜欢绿色，“苏打绿”的名字就此拍案。 苏打绿的音乐很难定义，这和陈绮贞的音乐大概趋同，又不完全一样，于是被定义为“清新派”。这也许和六个成员，对于音乐的启蒙和品味都大不相同有关。 这个想像力无穷，无法清楚界定曲风的新秀乐团，带着一种台湾年轻乐团中罕见的早熟态度和技术，勇敢的挑战自我极限，在2009年的夏天，用令人喘不过气的爆发力飙起了摇滚，却依然保有原来的华丽美感，这就是苏打绿，永远带来猜不到的惊喜。 苏打绿/ sodagreen: [ n.] 一种慢性腐蚀心灵的旋律性饮料。 [ v.] 专指某种变调摇滚精神试着改变受众音乐习性。 [ adj.] 乍听之下令人难以忍受却又无力抗拒的。 [ adv.] 绵密而愉悦、轻松又带点温柔地。 注：苏打绿不为摇滚乐团，音乐风格为sodagreen。 注：苏打绿官网2011.3.31发布，龚钰祺（阿龚）正式退役。 （2001年－2003年） 2001年4月，苏打绿由主唱吴青峰（青峰）、贝斯手谢馨仪（馨仪）和第一任吉他手新哥组成，鼓手史俊威（小威）是馨仪泳队的学长，听了青峰的demo决定加入。随后由于报名金旋奖的关系，由鼓手小威觉得符合乐团音乐特质的“苏打（舒爽气泡的清新感）”和青峰所附加上的“绿”字决定了团名“苏打绿”。同年5月参加了政大第18届金旋奖，以当时唯一练习的创作曲《窥》演出，获得乐团组最佳人气奖，6月被第18届金旋奖评审应蔚民挖掘，参与角头音乐《少年ㄞ国》合辑，收录的歌曲即为“窥”。 2002年4月第一次于垦丁春天呐喊演出，同年5月再度参加政大第19届金旋奖；在这之前，苏打绿经历了不少成员的更迭，包括第二任吉他手彦廷，以及第三、第四任吉他手小为和宏儒。在第19届金旋奖中， 苏打绿以《空气中的视听与幻觉》获得了乐团组冠军，以《飞鱼》获得了创作组冠军，和最佳作词、最佳作曲四项大奖。 2003年同是政治大学学生的何景扬（阿福）、刘家凯（家凯）和台北艺术大学的键盘手兼中提琴手龚钰祺（阿龚）加入苏打绿，从此形成如今的阵容，于5月受邀政大第20届金旋奖表演，该届主题曲为创作歌曲《相对论Ⅳ》，但其后因SARS事件而停办。同年7月期间由于团员都即将于政治大学毕业，故打算独自举办“in summer（印夏天）”台湾西部小巡回表演，于西门钉、海洋音乐祭热浪摇滚、台南乌托邦、高雄ATT秘密基地、台中老诺、台北大学博览会等地表演，将此表演视为苏打绿的解散演出。但是随后的海洋音乐季表演却让苏打绿走向一条完全不同的道路。 （2003年－2005年） 2003年7月13日参加了第4届海洋音乐祭热浪摇滚舞台（小舞台）表演，音乐制作人林暐哲在台下听得如痴如醉，并且有了签约苏打绿的念头，苏打绿正式加盟了林暐哲音乐社。 2004年3月13日于西门红楼举办演唱会，并于同年5月15日参加政大第21届金旋奖决赛表演，释出歌曲《Believe in music》为该届主题曲，5月30日与陈珊妮、陈绮贞同台政大Sch ool Rock演唱会，当天同时发行了首张单曲《空气中的视听与幻觉》，后来音乐社将5月30日称为苏打绿日，以庆祝苏打绿正式出道，过两个月在7月17日获得了第5届海洋音乐祭评审团大奖，同时发行第二张单曲《飞鱼》。9月18日，于MTV BAND HUNTING 百万乐团挑战赛，获得网路最佳人气及最佳主唱。11月17日，发行第三张单曲《Believe in music》，该单曲为the Stage表演时的录音专辑，并于11月21日、12月16日参加硬地音乐展及政大School Rock II演唱会。 2005年6月17日于女巫店表演的同时，发行《鱼丁糸首张专辑试听吸滴》（纯手工压制版），收录9首歌，全长约7分钟，为《OH OH OH OH!夏天来听苏打绿乐团唱歌》试听单曲前身，后于7月15日台南海安路封街演唱时，正式发行首张专辑之试听单曲《OH OH OH OH!夏天来听苏打绿乐团唱歌》。 《空气中的视听与幻觉》 《空气中的视听与幻觉》是台湾独立音乐乐团苏打绿于2004年5月30日政大School Rock演唱会现场发行的一张单曲，内含《空气中的视听与幻觉》及Remix版的《空气中的视听与幻觉》（称作《Air》），前者主要音乐类型为抒情摇滚，后者为迷幻摇滚，两者皆以清亮的曲风想要表达苏打绿“清新”的乐团特色，主唱青峰甚至将“Sodagreen”解释为一种有清新感的音乐类型的名词。 此单曲是苏打绿加盟林暐哲音乐社后的第一张单曲，也是苏打绿自创团以来第一张商业音乐CD。 《飞鱼》 《飞鱼》是台湾独立音乐乐团苏打绿于2004年7月17日发行的第二张单曲，《飞鱼》这首歌是在2002年前往春天呐喊表演，久患忧郁症的主唱青峰，行车途中看着海面时所写下的歌曲，在此之后青峰的忧郁症即痊愈，故也被很多人认为是一首民谣摇滚的疗伤系歌曲。 这首歌后来又被收录于《苏打绿同名专辑》中（只收录了一个版本）。 《飞鱼》（词/曲：吴青峰） 《Believe in music》 《Believe in music》是台湾独立音乐乐团苏打绿于2004年发行的现场RemixEP，虽然是在the stage表演的现场录音，但三首歌曲皆是没有发表过的新歌。除收录了三首新歌外，更收录了《Air》及《Believe in music》的MV，所以CD采用了AVCD格式。 《苏打绿同名专辑》 2005年9月3日发行了首张同名专辑《苏打绿》并进行全台湾签唱会表演。 2006年3月25日于The Wall 表演。5月5日，入围第17届金曲奖最佳编曲人奖（苏打绿《oh oh oh oh》）、最佳乐团奖（苏打绿《苏打绿》）。随后开始准备《小宇宙》专辑的创作及录音，并于8月26日、9月3日在西门钉及诚品敦南店进行小宇宙新歌发表会。在专辑即将发行前发生了小插曲。青峰在PTT上公布新歌名称时称“只要板上人气白爆就发新单曲”。靠着粉丝们的热情，9月18日顺利发行了第四张限量单曲《迟到千年》，并于9月30日-11月18日举办The Wall Live House连续八周爬墙摇滚纪事，创下6000人次观看的live house演出。 《苏打绿》是台湾独立音乐乐团苏打绿于2005年9月3日发行的第一张正式专辑，音乐类型主要为摇滚及抒情歌，在这之前，苏打绿已经发表了三张单曲。由于是苏打绿第一张完整的专辑作品，所以不少人认为此张是最能代表苏打绿风格的专辑，而苏打绿也靠此张专辑入围第17届金曲奖最佳乐团奖，但并未获得该奖项。另外，专辑中不乏许多苏打绿出道前即创作出来的歌曲，因此其中就有作品在出道前曝光及得奖，例如〈窥〉是主唱青峰人生中所写下的第一首歌曲，此曲在专辑发行前就曾在2001年参加《少年ㄞ国》合辑。 除了主打歌《频率》及抒情摇滚《漂浮》的词曲是由鼓手小威创作外，其余歌曲的词曲皆为主唱青峰的创作。 《迟到千年》 《迟到千年》是台湾独立乐团苏打绿在2006年9月18日发行的一张单曲，限量5000张，售完即绝版。会突然发行单曲的原因是在8月24日晚上青峰于网路BBS“PTT”公布小宇宙专辑曲目时，制作人林暐哲说只要冲到“白爆”（即板上人数1000人以上），就发新单曲。8月25日晚上，PTT苏打绿版涌入大量歌迷，板上人数并于8月26日0时23分成功突破1000人（白爆），约莫一个月后单曲开始预购。 《十年一刻》 （2010年） 由于2010年乐团成员阿龚（3月）、阿福（11月）相继入伍，四季音乐韦瓦第计划只有暂时推迟：“苏打绿是六个人的团体，虽然词曲都写好，但一定要等他们回来一同编曲、制作专辑”。 《十年一刻》是乐团苏打绿的第七张大碟，于2010年盛夏推出。新辑收录《2009日光狂热小巨蛋演唱会》现场实录曲目，加上全新创作的两首歌曲《十年一刻》、《笑闹人间》及《无眠》国语版本，同场加映影音DVD内容满载The Making Of《日光狂热》、八首小巨蛋演唱会的Live MV，还有三首大屏幕播出的影像将完整的呈现苏打绿音乐历程重要关键时点──2009-2010年蜕变全貌。“十年一刻”和“笑闹人间”是苏打绿在诺基亚的天下玩乐令采风时创作的新歌。主唱青峰填词谱曲《十年一刻》，向社会上默默在各自工作岗位敬业打拼的人们致敬。《无眠》（国语版）的曲是小威所作，闽南语版出现在《夏/狂热》，此次青峰填词“有没有和我相同的感觉 固执等著谁 却惊觉已无法倒退”。 《小宇宙》 （2006年－2007年） 《小宇宙》是台湾独立音乐乐团苏打绿于2006年10月20日发行的第二张专辑，主要为摇滚歌曲及抒情歌。苏打绿借由此专辑在第18届金曲奖入围多项大奖，更获得最佳乐团奖及最佳作曲人奖（小情歌），也因此该专辑多次回锅各大销售排行，是苏打绿早期最成功的专辑之一。 除了《暂时失控》及《吵》（与主唱青峰共同填词）的词曲是由鼓手小威创作外，其余歌曲的词曲皆为主唱青峰的创作。 专辑的主题曲《小宇宙》再次确认专辑轴心，这次苏打绿的歌里头，第一次正面提到一些自己观察到的社会样貌，虽然书写了城市的混乱面，但是在这样的城市依旧相信可以找到自己的美丽地盘。 《小宇宙》 这首歌的主歌在抱怨一些平常的琐事，写的东西满符合我平常某一部分的个性，对于不满的事情总是忍不住说出口。我讨厌在我认知理应该有，却没有秩序和礼貌的事件，例如插队、乱丢垃圾、搭捷运手扶梯却不保持左道畅通挡住后面的人，这些事情每天都在我的生活中令我毛躁，我不是个很有耐性的人，偏偏犯这些错误的人又老是脸上一副不知所云的理所当然样。不尽责以及态度不好的服务业也会令我暴怒，有一次我被卖衣服的店员恶意泼到水，我就真的把手中的矿泉水浇在她卖的衣服上。 每次这些情况搞得自己乌烟瘴气的时候，我都想赶快躲回自己的房间，常常自己一个人发呆去反省这一天的细节，每天都必须提醒自己放开胸怀，免得锱铢必较的龟毛个性把自己逼疯。但大致上我还是相信这世界美好，所以才需要提醒自己别被少数丑陋的事物所羁绊，找寻自己美好的小宇宙。当时我很着迷陈黎和夏宇的诗作，《小宇宙》标题的灵感也来自陈黎的《小宇宙》诗集。 这首歌的主歌录出来的效果，每次听我都觉得，自己好像不知道在气什么气成这样，当然暐哲是乐见我展现凶狠的一面。 2006年，第二张录音专辑《小宇宙》于10月20日发行，并于12月2日出席简单生活节活动于天空舞台演出，12月10日更与阿霈乐团于自由时报演唱会表演，随后于12月15日与同唱片公司的阿霈乐团推出《我的未来不是梦》公益单曲。 2007年1月6日了出席ESPN超级篮球比赛代言及开幕战表演。2月2日，获KKBOX数位风云奖最佳独立精神奖及2007年国际书展代言，应邀演出“书展之歌-隐形翅膀”演唱会。 3月31日，担任张韶涵“le_tea百变张韶涵世界巡回演唱会台北场”特别嘉宾，并与张韶涵于4月4日发行全数位单曲《蓝眼睛》，首周点播下载五万次。 5月4日，入围第18届金曲奖最佳年度歌曲（小情歌《小宇宙》）、最佳国语专辑奖（苏打绿《小宇宙》）、最佳作曲人奖（吴青峰《小情歌》）、最佳作词人奖（吴青峰《小情歌》）、最佳编曲人奖（苏打绿《小情歌》）、最佳专辑制作人奖（林暐哲《小宇宙》）、最佳乐团奖（苏打绿《小宇宙》）7项大奖，并于6月16日获得第18届金曲奖最佳作曲人奖及最佳乐团奖。 同年于8月11日在新加坡举办“今年夏天特别绿”演唱会。 10月27日，电影《六号出口》主题曲〈小情歌〉入围2007年金马奖最佳原创电影歌曲，更于10月27日获2007年新加坡金曲奖最佳乐团奖（苏打绿《小宇宙》）。苏打绿发行第二张专辑后获得大量奖项及代言活动，显示出这个乐团在华语流行音乐界渐渐获得支持。 《无与伦比的美丽》 （2007年－2008年） 2007年11月2日，发行第三张专辑《无与伦比的美丽》，并于11月3日举办的《无与伦比的美丽》小巨蛋演唱会中连唱四小时四十分钟刷新小巨蛋的演唱纪录，成为“独立音乐里面第一个站上小巨蛋的”。同时发行演唱会周边商品：“无与伦比的美丽T-Shirt”、“苏打历”。12月8日，《苏打志3（Sodazine 3）》发行（内含《无与伦比的美丽absolutely beautiful version》单曲），12月18日，出席香港Wild Day Out Pub Party演出。 《无与伦比的美丽》是台湾独立音乐乐团苏打绿于2007年11月2日发行的第三张专辑，专辑发行次日即进行了《无与伦比的美丽》小巨蛋演唱会。相较于前面两张专辑，此次专辑中使用了更多的弦乐，曲风也偏向了抒情摇滚及民谣摇滚。此一专辑也为苏打绿在第19届金曲奖入围许多奖项，其中更获得了最佳乐团奖。 除了《四季狂想》及《简单生活》的词曲是由鼓手小威创作外，其余歌曲的词曲皆为主唱青峰的创作。 详见百科无与伦比的美丽 《陪我歌唱》 LiveCD（2008年－2009年） 2008年5月2日，发行第四张专辑《陪我歌唱》。接下电影《鸿孕当头》（Juno）代言中文主题曲《爱人动物》。5月22日，入围第19届金曲奖最佳年度歌曲奖（无与伦比的美丽《无与伦比的美丽》）、最佳国语专辑奖（苏打绿《无与伦比的美丽》）、最佳音乐录影带导演奖（徐筠轩《左边》）、最佳作曲人奖（吴青峰《无与伦比的美丽》）、最佳编曲人奖（吴青峰、史俊威、谢馨仪、刘家凯、何景扬、龚钰祺、林暐哲《无与伦比的美丽》）、最佳乐团奖（苏打绿《无与伦比的美丽》）6项大奖，并于6月5日获得第19届金曲奖最佳乐团奖，成为迄今唯一蝉联该奖项的乐团。紧接着于6月12日－10月18日进行了六场《陪我歌唱》巡回演唱会。参加7月30日香港恒生劲爆Music World新城国语力颁奖礼，并获得2008年：新城国语力歌曲（苏打绿《陪我歌唱》）、新城国语力跃进乐团奖（苏打绿）、新城国语力乐团奖（苏打绿）。8月7日，发行《苏打绿THAT MOMENT小巨蛋现场全纪实 2007 Taipei Arena Concert 4 Live DVDs》，内含4片DVD及现场摄影书－苏打志4（Sodazine 4）。9月12日、9月14日，以“左边乐团”之名，参与几米音乐剧《向左走?向右走》演出，并担任音乐（词曲）创作。10月25日，获2008年新加坡金曲奖最佳乐团奖（苏打绿《无与伦比的美丽》）。10月25日，获第八届华语音乐传媒大奖最佳乐队（苏打绿《无与伦比的美丽》）、最佳编曲人（苏打绿《白日出没的月球》）、最佳制作人（林暐哲《无与伦比的美丽》）、年度国语专辑（苏打绿《无与伦比的美丽》）。12月7日受2008简单生活节邀请在天空舞台与林忆莲合唱。 《陪我歌唱》是苏打绿的第四张专辑，于2008年5月2日在台湾发行。 本张专辑为双CD，第一张CD“Live”收录苏打绿于2007年台北小巨蛋演唱会的部分曲目现场录音，第二张CD“Studio”则收录三首新的录音室录音歌曲。 一万人见证的演唱会，曲曲改编的新意。古典乐也能摇滚得吓死你， 如梦似幻迷蒙至极。 主唱时而怪魅疯癫，唱得歇斯底里。时而轻柔深情，多了一个人的思念深意。 全团磅礴编制，高亢激情 ，你不能没有过的体验，错过了现场参与的机会可以藉由这张现场专辑幻想聆听。 苏打绿sodagreen无与伦比的乐团奇迹 最灿烂的美丽音乐夜晚 这1晚苏打绿陪我歌唱 唱出我的青春 我的自由 我的飞翔 永远不会忘记苏打绿站上小巨蛋的这份感动 永远不会忘记苏打绿完整唱出我的这个青春 2CD珍贵极选苏打绿第1次小巨蛋演唱会精选13曲 +3首全新作品：‘呢喃’、‘陪我歌唱’、‘爱人动物’');
INSERT INTO `tb_singer` VALUES ('28', '阿里郎', '华语组合/乐队', 'http://p1.music.126.net/NumwS9sdwghUWgpYRwx06Q==/109951163462721013.jpg?param=130y130', '阿里郎又称阿里郎组合，被誉为“音乐绅士”、“内地音乐第一组合”，现在组合成员为权赫、崔金水、金君龙。 代表作品：《兰花指》《阿里郎》《隔壁泰山》等 2002年，一曲家喻户晓的改编自朝鲜族民歌的《阿里郎》，让阿里郎组合在内地歌坛异军突起，一炮走红，发展势头强劲。阿里郎扎实深厚的演唱功底、独具特色的三部和声、劲爆震撼的舞台表现力、国际化多元的音乐风格与时尚造型让他们的专辑获得了非常广泛的好评和认可。 2017年经历成员换血重组，由前成员权赫担任队长，合流新成员崔金水、金君龙，以三人形式复出。 2018年6月，发行单曲《隔壁泰山》，歌曲与MV登陆各大音乐及视频平台后反响热烈。 ');
INSERT INTO `tb_singer` VALUES ('29', 'Higher Brothers', '华语组合/乐队', 'http://p1.music.126.net/U9_yVbWosdU9hd2PluL7mQ==/109951164269437732.jpg?param=130y130', 'Higher Brothers的成员大都来自“说唱会馆CDC”，一个以成都为根据地，影响力辐射全国的说唱群体。“MASIWEI马思唯”作为Higher Brothers团队领袖，是一位写歌、制作、混音、MV剪辑的全能手，凭借《崂山道士》、《姚明》等作品成为2014年说唱圈现象级新人。“DZKNOW丁震”的嗓音深入人心，唱功圈粉无数，凭借着惊人的天赋与想法，受到全国各大厂牌和团队的青睐。“PSY.P杨俊逸”的歌词让人印象深刻，善用巧妙的押韵、比喻且拥有连贯的逻辑性，声音辨识度极高；“Melo谢宇杰”曾是西南说唱比赛中当之无愧的battle King，风格多变，擅长各种高难度复杂押韵及flow。高手云集的Higher Brothers，实力不容小觑。');
INSERT INTO `tb_singer` VALUES ('30', '茄子蛋', '华语组合/乐队', 'http://p1.music.126.net/HPoJJ_knq4VzM2CYV44b3Q==/109951164188414801.jpg?param=130y130', '喜欢用戏谑自由的文字来谈论人生，谈论爱情。 人生其实没什么坏事，至少我还活着，而且还拥有着音乐。');
INSERT INTO `tb_singer` VALUES ('31', '逃跑计划', '华语组合/乐队', 'http://p1.music.126.net/Ii8U2ugJxfpWQZvZPZsYwg==/3418381652800638.jpg?param=130y130', '逃跑计划，乐队的前身是孔雀乐队，成立于2004年底，直到2007年夏天贝司手小刚的加入，乐队得以正式确立，并且乐队的音乐风格较之前也有所改变，以Indie pop(独立流行)为主，其间也融入了New wave(新浪潮)；Post punk(后朋) 等新音乐形式的元素，使得乐队的音乐在保留了原来唯美旋律的同时更加新鲜，时尚，更有活力。成员：吉他：马晓东 鼓手：李洪涛 贝斯：刚昂 键盘：菲璐 主唱：毛川 成员 Guitar ： 马晓东 Drum ： 红桃（原 张超） Bass ： 刚 昂 Vocal ： 毛 川 Escape Plan(原Perdel)逃跑计划乐队的前身是孔雀乐队，成立于2004年底，直到2007年夏天贝司手小刚(原名王新刚,来自博山)的加入，乐队得以正式确立，并且乐队的音乐风格较之前也有所改变，以Indie pop(独立流行)为主，其间也融入了New wave(新浪潮)；Post punk(后朋) 等新音乐形式的元素，使得乐队的音乐在保留了原来唯美旋律的同时更加新鲜，时尚，更有活力。 2006年4月 乐队参加通力杯全国乐队大赛，获得第三名。 2006年8月 主唱毛川代表乐队参加了北京电视台“欢度世界杯”栏目的现场直播，在为期一个月的时间里，毛川以每两天一首新歌（词，曲）的超强创作能力，为乐队打开了现身大众媒体的第一扇门。 2006年10月 参加了第一届“北京摇滚啤酒节”的演出。 2006年11月 与“麦丁国际”签约奥运单曲，创作了《08年我们结婚》。因相关事宜不完善，所以合约失效，作品被乐队自己保留。 2007年3月 乐队接受《广播歌选》杂志采访，并且被专刊报道。 2007年6月 乐队作品《APPLE》被《我爱摇滚乐》有声杂志收录于第66期。 2007年7月 在MAO Livehouse参加“我们还有时间拯救”救助三个失血儿童的慈善义演活动，是乐队自成立以来参加的最有意义最有价值的活动。 2007年7月 参加“青岛沙滩音乐节”演出。 2007年8月 赴重庆参加“重庆啤酒节”演出 2007年9月 参加北京798艺术沙龙社区举办的“与建筑的对话”摇滚演出活动。 2007年10月 乐队作品《08年我们结婚》入闱北京电视台“唱响奥运”栏目的奥运征歌的前十名，并且在同年12月应邀参加了栏目组的电视节目录制。录制当天《08年我们结婚》被在场的费翔大加赞赏。 2008年1月，Perdel逃跑计划入选MAO Livehouse举办最佳新生力量提名，并获得名次。 2008年1月，乐队与国内知名大师，音乐制作人李宗盛合作参加“百年CONVERS（匡威）”广告的录制，乐队作品以及现场得到李宗盛好评，更可贵的是得以大师在音乐理念和更深层面的指点，使得乐队又有了更高的上升空间。 2008年2-3月期间，乐队便开始大范围活跃在北京的各个演出场所，受到诸多来自圈内外的好评。 2008年4月 推出乐队首张EP。并且将在2008年MIDI音乐节的主舞台亮相。 2009年《A City Without Sorrow没有悲伤的城市》逃跑计划乐队首次全国巡演 2009年 首届中国摇滚迷笛迷笛奖，斩获“最佳年度摇滚新人奖” 2009年  在《快乐女声》决赛中与李霄云合作  2010年迷笛音乐节（宋舞台）、草莓音乐节（草莓舞台）、海淀音乐季（A舞台） 2010年5月15日西安草莓音乐节 2010年7月31日张北草原音乐节 2010年8月29日长城音乐节 2010年9月3日沈阳棋盘山摇滚音乐节 2010年9月4日青岛金沙滩音乐节 2010年9月22日 北京长阳音乐节 2010年9月24日西安张冠李戴Happy holiday 2010年10月1日 济南城市森林音乐节 2010年10月2日 摩登天空音乐节 2010年10月6日 厦门浪潮音乐节 2011年4月30日 北京迷笛音乐节 2011年6月6日 淄博BOBO音乐节 2011年8月5日 日照迷笛音乐节 2011年9月11日 泰山国际音乐节 2011年10月3日 摩登天空音乐节 2011年10月29日 武汉草莓音乐节 2011年的15届“首尔国际动漫节”上，为参赛动画《星游记》主题曲进行演唱 2012年2月14日 石家庄万达国际洲际酒店“2012新浪微博织爱”活动 2012年3月16日 参加山东卫视歌声传奇摇滚崔健专场 2012年4月30日 参加北京草莓音乐节 2012年5月1日 参加北京迷笛音乐节 2012年5月26日 贵阳南国花锦购物中心 牛仔摇滚party表演嘉宾 2012年5月27日北京城市学院（航天城校区）音乐节 2012年6月22日西安张冠李戴音乐节 2012年7月1日 合肥玩石音乐节 2012年7月27日 张北草原音乐节 2012年7月29日 厦门白海豚音乐节 2012年8月17日 上海喜马拉雅之夏音乐嘉年华 2012年8月19日 青岛2012世界城市音乐节 2012年8月23日 贵阳哟嘎迷笛音乐节 2012年9月8日  长沙橘子洲头音乐节 2012年9月14日 北京雍和宫糖果KTV 音乐情人节 2012年9月22日 虎牌啤酒乐队龙虎榜全国总决赛 2012年10月2日 镇江长江草莓音乐节 2012年10月20日 无锡自然醒生活节 2012年11月12日 中国人民大学甩掉地球——第11届搜狐微博“歌影年华”校园原创音乐会[1] 2012年11月17日 浙江台州第六届网络音乐节 2012年11月21日 哈尔滨sublive演唱会 2012年11月23日 逃跑计划《earth》 长春站 2012年11月24日 逃跑计划《earth》 沈阳站 2012年11月25日 逃跑计划《earth》 大连站 2012年12月16日 第四届中国摇滚迷笛奖 乐队一举摘得四项大奖：最佳年度摇滚乐队、最佳年度摇滚专辑（《世界》）、最佳年度摇滚歌曲（《夜空中最亮的星》）、最佳年度摇滚男歌手（毛川） 2012年12月22日 逃离末日——逃跑计划上海专场 2012年12月29日—31日 逃跑计划北京MAO LIVEHOUSE三专场 2013年2月1日 《爱在北京的岁月》 2013年2月2日 第四届摇滚春晚 2013年4月4日逃跑计划《earth》西安站 2013年4月29日 大理洱海世界音乐节 2013年4月30日 镇江长江国际音乐节 2013年5月1日 北京迷笛音乐节 2013年5月4日 上海迷笛音乐节 2013年5月18日 深圳迷笛音乐节 2013年6月12日西安城市森林音乐节 2013年7月20日沽源湿地音乐节 2013年7月27日张北草原音乐节');
INSERT INTO `tb_singer` VALUES ('32', 'Alan Walker', '欧美男歌手', 'http://p1.music.126.net/AsrGD4Sf0HWJ3mK-Y__PLw==/18981968742063387.jpg?param=130y130', '艾兰·奥拉夫·沃克（Alan Olav Walker），1997年8月24日出生于英国英格兰北安普敦郡，挪威DJ、音乐制作人。 2014年11月，在YouTube上推出个人电音作品《Fade》而出道。2015年12月，通过索尼音乐发行个人第一首正式单曲《Faded》，该首歌曲的MV在YouTube上的点击量突破了12亿。2016年6月，发行人声伴唱电音单曲《Sing Me To Sleep》 。同年11月6日，获得MTV欧洲音乐奖“最佳挪威艺人”奖[4] 。2017年2月22日，《Faded》入围第37届全英音乐奖“年度英国单曲”奖 。同年5月，发布首支由男声伴唱的电音作品《Tired》 。 中文名：艾兰·沃克 外文名：Alan Walker 国籍：挪威 民族：诺曼 星座：处女座 血型：O 身高：1.78 出生地：北安普顿，英国 出生日期：1997年8月24日 职业：电子音乐人 代表作品：《Fade》,《Faded》《Sing me to sleep》 艾兰·沃克在英国北安普敦郡出生，两岁时随父母搬到挪威西南部的卑尔根，他从小就对电脑感兴趣，后来又被编程和平面设计吸引 。14岁时，他开始通过YouTube上的各类视频来学习音乐制作，并开始将自己所作的音乐发布在YouTube和Sound Cloud上。 2014年11月19日，艾兰·沃克通过YouTube的音乐品牌“无版权音效”（NCS）发布个人电音曲目《Fade》，随后该作品被NCS的音乐合集《NCS: Uplifting》收录 。 2015年，艾兰·沃克推出《Spectre》和《Force》两首作品 ；同年，他离开NCS，与索尼音乐旗下的MER Musikk签约；12月4日，通过索尼音乐发行第一首正式单曲《Faded》，该首歌曲以《Fade》为基础，加入了挪威女歌手艾斯琳·索尔海姆的演唱部分，该首歌曲的MV在YouTube上的点击量突破了10亿 ，并取得了超过400万的全球实体销量，还成为欧洲十个国家单曲榜冠军，荷兰DJ提雅斯多对该首歌进行了重混 。 2016年2月12日，艾兰·沃克受汉斯·季默等电影原声制作人的启发创作了《Fade》的管弦乐版本；2月27日，艾兰·沃克在挪威奥斯陆举行的第19届冬季极限运动会（Winter X Games）上表演了《Faded》等十五首歌曲，这是他的首次现场演出；6月3日，发行电音单曲《Sing Me To Sleep》，该首歌曲也是由艾斯琳·索尔海姆演唱，其MV在中国香港进行了拍摄；9月，在中国MTA天漠音乐节表演了《Faded》、《Sing Me To Sleep》、《Hymn For The Weekend (Remix)》等曲目，这是他的中国首演[12]  ；11月5日，参加深圳丛林电子音乐节的演出；11月6日，获得MTV欧洲音乐奖“最佳挪威艺人”奖 ；12月2日，推出由挪威女歌手诺米·鲍（Noonie Bao）献唱的电音作品《Alone》，并同时释出歌曲的MV。 2017年1月5日，获得第12届台湾KKBOX数位音乐风云榜“年度西洋歌手”和“年度西洋歌曲”奖；1月7日，来到中国上海MYST酒吧进行了演出；2月22日，《Faded》入围第37届全英音乐奖“年度英国单曲”奖；4月，推出与DJ K-391联合制作的EDM作品《Ignite》；5月，推出EDM曲目《Tired》，该首歌曲由爱尔兰创作歌手加文·詹姆斯（Gavin James）献声 ；9月，发行电音单曲《The Spectre》，该首歌曲在《Spectre》基础上进行了重新制作，并加入了人声  ；11月，在北京水立方参加英雄联盟音乐狂欢节的演出 。');
INSERT INTO `tb_singer` VALUES ('33', 'Charlie Puth', '欧美男歌手', 'http://p1.music.126.net/zp_FrMQbZGUmcANocOKqag==/109951164294622762.jpg?param=130y130', '小查尔斯·奥托·普斯（英语：Charles Otto Puth Jr.）是一位美国流行歌手，出生于美国新泽西州。2009年创建YouTube频道，上传翻唱视频并拥有一定的知名度。2011年凭借与Emily Luther翻唱的《Someone Like You》获得艾伦赏识。 2015年，凭借与Meghan Trainor合作的《Marvin Gaye》被大家所知。 尚未正式出道即与饶舌天王Wiz khalifa联手合作《速度与激情7》电影片尾曲《See You Again》，官方MV累计超越全球24亿播放次数，空降美国公告牌冠军，并在澳大利亚、奥地利，英国、德国、加拿大、新西兰、爱尔兰、瑞士多个国家排名第一，总计非连续12周登顶美国公告牌单曲榜；缔造美国Spotify单日流媒体播放量最多单曲、Spotify全球26国单周最高收听次数记录；登顶英国单曲排行榜，成为2015年英国销量最快单曲；空降全球100多国iTunes排行榜第一名。此单曲迅速红遍全球，Charlie Puth正式走进人们的视野并获得大量关注。 2016年1月，与Selena Gomez 合作的《We Don\'t Talk Anymore》更突破它在YouTube上以往的六亿点击率，成为Charlie Puth第二支在Billboard百强单曲榜的前十单曲。 中文名：查理·普斯 英文名：Charlie Puth 全名：Charles Otto Puth Jr.（小查尔斯·奥托·普斯） 生日：1991年12月2日 出生地： 美国新泽西州拉姆森（英语：Rumson, New Jersey） 现居住地：美国洛杉矶 职业：歌手、音乐制作人、词曲作家 音乐类型：流行、Soul、R&B 演奏乐器：歌唱、钢琴、键盘 唱片公司：大西洋唱片 查理右边的眉毛有道疤痕，据他自己透露，这道疤痕在他两岁时被一只黑色拉布拉多犬咬伤而留下。 2010年发布首张EP《The Otto Tunes》 2013年发布第二张独立EP《Ego》 2015年2月发布出道首单《Marvin Gaye》 2015年5月发布EP《Some Type Of Love》 2016年1月29日正式发行首张录音室专辑《Nine Track Mind》 2011年《Some One Like You》获得PopCrush音乐大奖 2015年 获得青少年选择奖 2015年 获得MTV音乐录影带大奖提名 2015年 获得全美音乐奖提名 2015年 获得金球奖最佳原创歌曲奖提名 2016年 第58届格莱美凭借《See You Again》揽获\"年度歌曲\"、\"最佳流行合作\"、\"最佳影视歌曲\"3项大奖提名 2016年 获得美国公告牌音乐奖 Nine Track Mind Tour(2016) Don\'t Talk Tour(2016)');
INSERT INTO `tb_singer` VALUES ('34', 'Justin Bieber', '欧美男歌手', 'http://p1.music.126.net/klw3kafBKLvJ_M95vPomPA==/109951163766146257.jpg?param=130y130', '加拿大少年歌手Justin Bieber，早期因为在YouTube翻唱其他艺人的歌曲而出名，随后被经纪人挖掘并被Usher培养进入美国音乐歌坛。他是YouTube观看量最多的艺人及首位19岁前拥有五张冠军专辑、在首张专辑发行前就有4首TOP40单曲的歌手。2011《人物》杂志公布的年度好莱坞最富有的年轻人。在“福布斯全球百位巨星排行榜”上贾斯汀连续2年名列第三，男歌手权利排行第一，推特粉丝全球第一。Billboard与VH1评选的当今最具影响童星。 贾斯汀·比伯（英语：Justin Bieber，1994年3月1日－），加拿大歌手。早期因为在YouTube翻唱其他人的歌曲而出名，为亚瑟小子（Usher）所赏识，而目前已与小岛唱片（Island Records）签约，居住在美国洛杉矶，并已于2009年11月17日发行他的第一张专辑《我的世界》（My World）的第一部分。[2] 截止发行后第五周，该唱片已在美国售出百万张，并在加拿大被认证为城市唱片[3]。专辑的第二部分已于2010年3月发行。身体有多处刺青，左边小腿有“Jesus”刺青[4]。Justin Bieber于2011年冬季出版第二张专辑《Under the mistletoe》，于2012年春季发行第三张专辑《Believe》，让Justin Bieber正式成为美国热门歌手之一，也是最年轻便抢攻音乐排行榜前几名的歌手。 Justin Bieber在12岁时，获得了斯特拉当地歌唱比赛第3名。（他是后来才知道的）他自学了钢琴、鼓、吉他和小号。为了让一些不能出席看他表演的家人和朋友看到自己的表演，在2007年年底和他的母亲在YouTube上传的自己影片和翻唱歌曲。Justin Bieber很快被一个多伦多的一家名为 Rapid Discovery Media公司发现，并在YouTube和MySpace申请了帐户和制作，编辑和推行他的影片。Scooter Braun看到Justin Bieber的录像，飞往比耶贝到亚特兰大(Atlanta) ，乔治亚州(Georgia)，会见了R&B歌手/歌手亚瑟小子(Usher）。Bieber引起了亚瑟小子的极大的兴趣，让Bieber与安东尼拉雷音唱片在港岛2008年10月签约。据报道，Bieber最终与亚瑟小子（Usher）签约。 1994年，比伯出生于加拿大安大略省一个单亲家庭。他很小就有表演天赋，与其他同龄人一样，渴望受到关注。从五岁起他就无师自通，自学了钢琴、打鼓、吉他和小号，才华横溢的比伯还非常热爱唱歌，他的歌声清脆而优美。 12岁那年，比伯参加了当地的一次唱歌比赛并获得第三名的好成绩。赛后，比伯的母亲把比赛的片段放到了视频网站YouTube上，最初的目的是让住在其他地方的亲戚们可以看到比伯的表演，不料却意外被亚特兰大资深音乐经纪人斯科特·布劳恩看到。 2007年的一天，布劳恩正躺在床上上网，无意间点到了比伯的家庭视频——比伯正深情并茂地唱着阿瑞萨·富兰克林的歌曲《Respect》。“当时比伯的账户下只有六七个视频，每个也不过有几千的浏览量。但当我听到他清脆的歌声，就觉得他真是个罕有的天才，我欣喜得快要疯掉了。”布劳恩这样形容当时的心情，敏锐的职业直觉告诉他：比伯有巨大潜质和可塑性。于是，他很快联系到了比伯的母亲，说服她带着比伯一起飞到亚特兰大与自己碰面。这是母子俩第一次坐飞机。布劳恩说：“比伯的家庭并不富裕，他的母亲为了生计做过很多份不同的工作，还时常需要家中的长辈贴补家用。”两周之后，经过几个回合的谈判，布劳恩最终签下了当时年仅13岁的贾斯汀·比伯，成为他的经纪人。 一开始，布劳恩还想走包装童星的常规路线。他走访了好几家主流厂牌，想要找到合作者一起经营包装比伯，但是每一家都拒绝了。尽管这些唱片公司也认同比伯的天赋和潜质，但在经济不景气的大环境下，大家都格外谨慎，不想冒险。布劳恩回忆：“他们都认为比伯是个出色的歌手并有惊人的天赋，但是他没有迪斯尼频道的支持，也从来没上过电视，对大众来说，比伯只是个乳臭未干的无名小卒。即便他的歌声很动听，也不足以让唱片公司冒险。毕竟为未经市场检验的少年发行唱片需要极大的魄力。” 吃了闭门羹之后，布劳恩开始将目光转向新媒体。他和比伯花了近半年时间在网络上建立了强大的粉丝基地。在YouTube上发布新歌让歌迷订阅，并以更自由的方式直接从YouTube和Twitter上与歌迷建立真实又真诚的连接。 与此同时，流行歌手亚瑟小子的巡演经纪人找到了布劳恩，询问他是否签下了一位极具潜质的新艺人。当布劳恩把比伯在YouTube上的视频给亚瑟小子和Island Def Jam音乐集团主席兼首席执行官安东尼奥·雷德看时，二人马上表示愿意签下比伯。雷德说：“虽然这个孩子缺乏电视平台，但也许通过《美国偶像》和《歌舞青春》等选秀节目来推出艺人的方式太过时了。虽然我们知道那些上过迪斯尼频道的孩子都很有才华，但大众普遍是因为 ‘童星’或‘电视明星’的身份而接受他们，其次才是歌手。而比伯不同，他是以音乐为先的。”于是，雷德、亚瑟小子和布劳恩强强联手，决定用各自不同的专长和经验一起从市场定位、歌曲选择、专业声乐训练、舞蹈等多个角度为比伯量身打造属于他的音乐。布劳恩更是为比伯预约了顶级的流行乐制作人兼创作者特里基·斯图尔特等人为他的音乐出谋划策，而这些新鲜出炉的音乐都是第一时间在网络（而不是电台、电视台）让歌迷欣赏。公司数据表明，他在短短的几个月内，就为公司谋利近7亿美元，这是让人难以至信的事实！ 出道三年后，美国流行音乐王子贾斯汀·比伯(Justin Bieber)的专辑已经售出1500万张，他曾在24个国家进行157次巡演。他的传记《永不说不》为他吸金3000万美元(约合1.9亿元人民币)，音乐会唱片带来1亿美元(约合6.3亿元人民币)收入，他的香水上市6个月即获利6000万美元(约合3.8亿元人民币)。 除了令人惊异的赚钱能力外，比伯的人气也非常旺，他继续被选入2012年度福布斯名人权力榜，位列第三。他在微博客上的“粉丝”超过2100万人，在社交网站上的“粉丝”超过4300万人，比美国总统奥巴马及其政敌罗姆尼(Mitt Romney)的粉丝加起来还多。比伯已经很好地展现出其影响力与赚钱天赋，并走在成为风险资本家的路上。他不投资自己不喜欢的行业，相信产品而非虚无缥缈的名牌。他将大量资金投入新兴企业，并握有数十家此类公司的股份。其2012北美巡演40场门票1小时之内售空，其中最著名的场馆麦迪逊花园2场的门票30秒之内就售完。');
INSERT INTO `tb_singer` VALUES ('35', 'Olly Murs', '欧美男歌手', 'http://p1.music.126.net/SQ0UDJ-eaCyi-ZTVvnlYsQ==/109951163888354410.jpg?param=130y130', '英国歌手奥利 莫尔斯 （Olly Murs）1984年5月14日出生于英国埃塞克斯（Essex，England）。获得2009年英国偶像亚军。于2010年2月签约sony旗下的epic records及Syco Music2010年8月29日发行首支单曲“please don’t let me go” 首周既以9万3千张得销量拿到了英国单曲榜冠军。 Olly Murs在获得英国偶像之后，Murs 宣布自己自己已经签了Epic Records 和Syco Music 的唱片和经纪约并讲自傲不久之后将会录制专辑。在2010年8月，Murs发行了自己的首只独唱单曲《Please Don\'t Let Me Go》并在英国单曲榜获得了冠军成绩，这也是他继09年英国偶像合唱曲《You Are Not Alone》之后的第二首冠军单曲，并且获得了英国唱片协会的白银认证。接着发行的单曲《Think of Me》虽然排名单曲榜第四但是也获得了白银成绩。 Olly Murs的母亲是Vicky-Lynn Pollard, 父亲是有着拉脱维亚血统的Peter Murs。Olly Murs有2个兄弟姐妹， 妹妹Fay以及双胞胎弟弟Ben。 Murs进入了Notley高中并成为了这所学校足球队的得分手，他也曾经为Witham镇上的一个半职业球队效力过，是曼彻斯特联盟和凯尔特人的粉丝。他曾经在一个呼叫中心做过能源咨询师还在电视真人秀Deal or No Deal中露过脸。2010年的早些时候，Murs为了资助慈善事业而踢足球。 2009-2010 Olly Murs参加了第六季的英国偶像（The X-Factor）。在他第一次登台演唱表演完《Superstition》后，Simon Cowell当即就点评他说，这是我最早给的通过。第一次现场演唱《She’s the One》和第二次《A Fool in Love》的现场演唱被Cowell大赞是不同的风格和水平。在接下来的几周里，他的表演都让评委和观众陶醉不已。Walsh评价他为该次比赛的黑马而美女评委Cole则认为每一次都能沉醉在自己的世界中。在比赛中多次采用在表演中加入舞蹈动作包括他招牌式的“奥利扭”，使得他在大赛中威力十足。在比赛进行的第四周，Murs再次演唱了《Come Together》并且得到了评委们的一致好评，Walsh还当场预测他将会进入最后三强，Cowell则认为他的进步比任何人的都要大。第五周的《Twist and Shout》和第六周的《Don’t Stop Me Now》的表演更是另评委们惊叹，Minogue还认为他绝对是到目前为止她见过的的最好的现场表演者。 比赛进行的第七周是极具戏剧化的，在Murs演唱完《First Love》之后，Cowell和谢莉尔决定淘汰双胞胎兄弟组合John & Edward，但是Louis Walsh投了Murs的否定票，而丹妮·米洛（Dannii Minogue）决定启动大众投票来打破僵局继而决定是否改淘汰John & Edward。出现在独立电视台网站上面的数据数据显示，10.7%的人认为Minogue应该把双胞胎淘汰，而9.8%则认为应该淘汰Murs。就这样Murs有惊无险地进入了下一轮的半决赛，但是也将意味着他将因此会错过他兄弟的婚礼虽然婚礼举行地就在附近的几公里。在半决赛的时候，他作为最后三强演唱了《Can You Feel It》和《We Can Work It Out》并且泪洒全场。 2010-2011 专辑的成功英国第一台电视台（ITV1）中歌唱选拔节目《X-Factor》的第六季亚军Olly Murs已与两家唱片公司签约——包括索尼音乐旗下的Epic和SIMON COWELL旗下的Syco音乐公司。Olly Murs正忙碌于“The X-Factor”直播巡回表演中，并已开始着手为他的第一张个人专辑制作。Epic的老板Nick Raphael表示，Olly是一个非常有才华的歌手，我们希望能够在即将发布的新专辑将他独特个人才华充分的体现出来。 2010年8月29日发行首支单曲《Please Don\'t Let Me Go》首周既以9万3千张得销量拿到了英国单曲榜冠军之后推出了多首单曲和专辑在英国单曲榜和专辑榜都取得了不俗的成绩。 2010年11月，Murs发行了以自己名字命名的首张专辑《Olly Murs》。 这张专辑首周上榜排行第二，单周最大销量达到了108,000张，是2010年单周销量最大的专辑，专辑的销量突破了60万张并且获得了英国唱片协会的双白金认证。 2011年11月，Murs发行了自己的第二张专辑《In Case You Didn\'t Know》，首支打榜单曲《Heart Skips a Beat》是和嘻哈团体Rizzle Kicks合作的，单曲在发行之后也成了大热金曲，同样取得了单曲榜冠军的好成绩。 2011年5月， Murs宣布自己将回归The X-Factor并和Caroline Flack联袂演出。他也确认了将会参加Heart FM的一个名人俱乐部访谈节目。 2011年6月，有传言说Olly Murs将要出新专辑，后来Olly Murs确认专辑《In Case You Didn\'t Know》。 2011年起，Olly回归TheX-Factor，与Caroline Flack一同主持每周六和每周日在ITV2和ITV3台播出的Xtra-Factor，并在The X-Factor中担任表演嘉宾，演唱了包括《Dance with Me Tonight》等在内的自己的新歌。 2012年，Olly携手Chiddy Bang推出专门为进军美国市场而打造的Heart Skips a Beat，并且将在One Direction组合的北美巡演上担任嘉宾，希望以此进军北美市场。 2014年，发行了最新专辑《Never Been Better》。 2011年2月，Olly Murs参加2011年喜剧救济基金会红鼻子日活动，与其他名人一起慈善跋涉。名人们要在肯尼亚北部的覆盖100公里（62英里）、温度达40°C的Kaisut沙漠呆五天时间。[2]  2011年4月22日，Olly Murs名人版的一掷千金(Deal or Nodeal)，当他赢得50便士时，他将钱捐给了当地的慈善机构，他成为了大脑患有脑性瘫痪或发育迟缓患儿的赞助人。 Olly Murs在X-Factor节目中与英国流行天王罗比·威廉姆斯结下了深厚的友谊，后者也成为了Olly在乐坛的领路人。罗比的身份不仅仅是一名歌手，也还是慈善足球赛Soccer Aid（足球援助）的发起人，这项球赛旨在筹集善款帮助那些贫困地区的弱势儿童。Olly Murs在2010年以选秀亚军的身份出道，作为一名忠实的曼联球迷，当年即获罗比邀请，参加了第3届Soccer Aid慈善足球赛，成为了英格兰队的一员。当年的Soccer Aid还集结了包括齐达内在内的多名足坛巨星。 2012年，Olly再次确认加盟第4届Soccer Aid，成为了第一批宣布加盟的英格兰队队员。2012年Soccer Aid将于5月27日在曼彻斯特老特拉福德球场举行。在球赛上，Olly是表现最为出色的球员之一，在上场的不到20分钟里，多次对世界队大门发动进攻，虽未攻入进球但表现十分抢眼！');
INSERT INTO `tb_singer` VALUES ('36', 'Ed Sheeran', '欧美男歌手', 'http://p1.music.126.net/PAjrw0ORKRPWwdX8TaGukQ==/109951164191868755.jpg?param=130y130', '爱德华·克里斯多弗·希兰（Edward Christopher Sheeran）艺名艾德·希兰（Ed Sheeran），1991年2月17日出生于英国英格兰西约克郡，是大西洋唱片（Atlantic Records）旗下的一位歌手同时也是一位创作人。 2011年6月，推出首支单曲《The A Team》荣获英国单曲榜第三名，同时该单曲在第55届格莱美颁奖典礼中被提名为年度最佳歌曲。2012年在第32届全英音乐奖中荣获英国最佳男艺人、英国最具突破艺人、英国最佳单曲和英国最佳专辑四项提名。 2014年第二张专辑专辑《X》在英国销售达170万张。2015年在全英音乐奖颁奖盛典荣获“年度最佳男歌手”和“年度最佳专辑”两项大奖 。2016年2月，在第58届格莱美音乐奖获得年度单曲奖和最佳流行歌手奖。 艾德·希兰1991年出生于英国西约克郡，自幼就开始学习吉他，并且在高中时期就开始学习创作歌曲。艾德在四岁时就加入了教堂的合唱团，并在晚些接触了吉他。在中学时期开始尝试写歌作曲 。和父母去伦敦的途中听Van Morrison和在他11岁时和Damien Rice一起在爱尔兰看公演[6]  。Sheeran在2005年开始录制音乐带，2008年搬到伦敦开始他的事业生涯。 2005年—2011年：事业初期 Ed Sheeran在2005年开始录音，也在当年发行首张EP《The Orange Room》。2009年一年间，Sheeran演奏了312场演奏会。在2009年，他参加了许多公演。这让主流说唱艺人Example邀请他一起巡演。 在2010年2月，Ed发行了他的第二张独立唱片Loose Change这张EP，正是这张专辑里面包含了他那首最脍炙人口的The A Team，这首歌的音乐录影带只花了20英镑。这也是他签约后首次发片。4月，他离开了以前的经纪公司，举目无亲来到了洛杉矶，一直在参加open mic nights。直到被Jamie Foxx发现并邀请他在接下来的日子里待在他家里录音。整年Sheeran都通过YouTube获得更多的关注，得到了《独立报》，英格兰国家队队长里奥·费迪南德和Elton John的看好。同年发行了多张EP，包括一张现场EPEd Sheeran: Live at the Bedford和一张他在威尔士与同样身为歌手和创作人的Amy Wadge合作的情歌合集Songs I Wrote With Amy。 2011年—2014年：《+》 2011年1月Ed Sheeran签约了大西洋唱片公司，首先发行了一张名为No.5 Collaborations Project的合集。24月12日，Ed在卡姆登市的Barfly酒吧举行了一场答谢歌迷的免费演出。4月26日，Ed Sheeran参加Later...with Jools Holland并演唱了《The A Team》。6月12日，《The A Team》在英国发行。Sheeran的首张单曲《The A Team》初测登台就在“英国单曲排行榜”上排名第三。7月，Ed Sheeran在iTunes Festival London 2011的合集EP正式发表。9月12日，发行首张专辑《+》。12月，Ed Sheeran就发表了EP《You Need Me》。 2012年2月，Ed Sheeran和美国说唱歌手Yelawolf合作的EP《The Slumdon Bridge》发表。4月，Ed Sheeran回到欧洲，继续他的巡演。6月，艾德·希兰在美国正式发行了他首张大碟《加号》的豪华版，并立刻登上了美国专辑榜冠军宝座。在2012年全英音乐奖中艾德·希兰荣获“英国最佳男艺人”、“英国最具突破艺人”、“英国最佳单曲”和“英国最佳专辑”等四项音乐提名，最终荣获最佳英国男歌手奖 。 2013年2月10日，参加第55届格莱美颁奖典礼并献唱单曲《The A Team》，该单曲还获得年度最佳歌曲提名 。 2014年—2016年：《x》 Ed Sheeran艾德-希兰2014年人气上升，被全球流媒体音乐服务商Spotify公布为2014年度最受欢迎的歌手，紧接着出现在维多利亚的秘密秀上做起了表演嘉宾 ，并在第57届格莱美大奖提名名单上荣获三项提名。开始围绕专辑《x》所展开的世界巡演。创作并献唱《霍比特人：史矛革之战》主题曲《I See Fire》 。 2015年3月，在2015年全英音乐奖荣获“年度最佳男歌手”和“年度最佳专辑”两项大奖。3月7日，艾德-希兰巡演将首次来到中国，于上海梅赛德斯-奔驰文化中心开唱。 参演宝莱坞《新年快乐之盗贼联盟》的续集。 2016年2月，在第58届格莱美奖获得最佳流行歌手，同时凭《Thinking Out Loud》获年度歌曲。 艾德的父亲是为艺术展策展人与讲师，母亲是珠宝设计师，两人共同开了 间艺术顾问事务所，从1990年起持续了20年的光阴。哥哥是位古典音乐作曲家。 艾德的父亲有爱尔兰血统，家里虔诚信仰天主教。 2012年，艾德·希兰在萨福克郡的弗瑞林姆买下一块农场。 2013年，艾德主要在亨德森维尔、田纳西和洛杉矶三个地方居住。他还是主持人Gordon Burns的第二个表兄弟。[18]  2015年10月20日，艾德·希兰（Ed Sheeran）凭借自己“在音乐方面的突出贡献”而被授予萨福克大学荣誉博士学位，这是他自从16岁离开校园后得到的最高级别的校园荣誉。但是在之后的演讲中，他大唱反调，一再强调“学位并不重要。”');
INSERT INTO `tb_singer` VALUES ('37', 'Eminem', '欧美男歌手', 'http://p1.music.126.net/4nBVmtjIoX5A-QZmLPaHdg==/109951163078482452.jpg?param=130y130', '埃米纳姆（Eminem）是美国的一名说唱歌手。其风格类型为：Hardcore Rap（硬核说唱）。埃米纳姆最大的突破就是证明白人也能介入到黑人一统天下的说唱（RAP）界中，而且获得巨大的成功。同时他的叛逆不仅长期以来深受美国青少年喜爱，也让他在舆论中始终遭到抨击。Eminem获得的奖杯总数窜至历史第三位，居麦当娜和皮特-加布里埃尔之后。 左肩膀：念已故Uncle Ronnie(阿姆指出Ronnie是家庭中惟一关心他的人) 手前臂：“D”和“12”意味“Dirty Dozen”在底特律组成乐队团 左腕关节：部落图腾 较低的左前臂：“Hailie Jade”女儿名字 腹部：“Rot in Pieces” 右腕关节：“Slit here” 右肩膀：女儿Hailie的脸 美 国时代杂志，在2004年12月时，发表一篇名为《影响美国社会的现象人物10》。本文中写道：“当一些明星的本质已经超越明星的时候，当他们能够影响整 整一代人，而不是一群人，或者一帮人的时候。那么他（她）就成为了一种现象。美国历史上诞生过很多伟大的明星。但能够被称之为现象的明星，不过10人。” 下面就是Eminem了。 文章中写到：“这个男孩的音乐是突然之间闪现出来的，像一架战略轰炸机一样，打击了美国年轻人内心思想的薄弱之处。 他的音乐充斥着愤怒，他用一种近乎于呐喊的音量向我们阐述了一些关于暴力、毒品、婊子、女人、同性恋、死亡、阴谋和爱的故事。每一个故事都贴切的体现了这 一代70-80年代出生的美国年轻人的悲哀。也是整个美国社会的悲哀。短短时间里，他就用歌声营造了属于他的——EMINEM现象。” 这一段简短的介绍，正是Eminem最真实的写照。 从小生活艰辛的Eminem，几乎没有享受过什么温暖，因此造就了他独立和决绝的性格。小时候的他一直过着那种衣食无着，颠沛流离的生活，因此在他的生命里，我们同时也能看见他的一丝脆弱和孤独。 直到如今，Eminem也不知道自己的父亲是谁。而他的母亲，也没能给予他多少母亲的关心和照顾。 Eminem从小在“黑人区”里成长。因此他目睹了许多丑恶的交易，人性的卑劣，一些令人毛骨悚然的枪击事件，暴力 事件。Eminem在接受电台访问的时候，他说过这样一段话。“你能想象在回家的时候，在家门口看见一具睁大着双眼的尸体么？我发誓我看见它了。在以后的 日子里，我最希望的就是上帝保佑我别让我在看见这该死的东西”。 就是在这样糟糕透顶的环境里，Eminem倔强的成长。 有很多年长一些的人不屑于听Eminem的歌，他们认为Eminem充其量就只能算是一个疯子。他们认识Eminem只会说一些粗俗下流的语言，认为Eminem只会骂人，只会无中生有的闹事。大概我们很多人也这么认为的吧。 不错Eminem骂总统Bush，骂拉姆斯菲尔德，甚至在接受美国电视节目邀请参加节目录制的时候，现场发挥一段 Rap，在这段Rap里他把他认为虚伪和厌恶的明星骂了遍，其中还包括英国足球运动员贝克汉姆，Eminem在歌里说：“贝克汉姆，你何不去演电影呢？你 这个只会用脸面征服别人的家伙，我想你能拿到奥斯卡，但你绝不会得到世界杯。”这个节目现场录象目前仍然可以在英国“天空”电视台的官方网站上观看。 但是渐渐的，我们也发现Eminem收敛了很多。从他的歌里，我们也能感受一二，他写给他女儿的歌 “Mockingbird”、“Hailie\'s Song”、以及电影《8 Mile》的歌曲“Lose Yourself”，还有以信件方式向歌迷唱的歌曲“Stan”。让我们觉得，Eminem真的变了。他不再是哪个只会骂街的男孩子了。不知道在哪个时 候，他已经完成了人生的蜕变，从一个男孩变成了一个男人。 Eminem是勇敢的，他的勇敢之处在于，他能把那些别人有意逃避，或者难以启齿的事情全部说出来，全部唱出来。和那些心口不一的人比起来，Eminem 单纯许多。很多人，在心里痛恨某个人或者某件事，嘴巴上却不说。而Eminem的嘴巴和心脏是连接在一起的，他能想到的，就都能唱出来。 首先从他的歌迷群来说，这个群体包含范围之广。主要以全世界的年轻人为主，其次包括各国的总理和总统。其中的代表人 物，应该是加拿大前副总理涅里茨，他曾公开表示他非常欣赏Eminem，Eminem协他的弟子50-Cent和他一手栽培的乐队D12在美国的巡演的时 候，涅里茨几乎场场到场，即使因为公务在身，无法亲临的时候，也叫手下把演唱会全程录制下来。美国媒体据不完全调查，Eminem的歌迷在全世界已经超过 1亿，这对一个歌手来说，已经是个无法想象的成绩。何况这些人里，还包括各个国家的政府大员，官员，甚至是总统。 然后我们再来谈他的唱片销量。Eminem专辑《The Eminem Show》在美国上市三天的时间内，以每秒出售2.3张的令人瞠目结舌的速度，被疯狂抢购。 他是特立独行的那类人。即使成为了万众瞩目的明星，他仍然和别人斗欧，仍然打架骂人，仍然被警察逮捕。 关于自己，他说：“你说我是个什么东西，我就是，如果你认为我是个坏蛋，我就表现成个坏蛋。如果你说我厌恶女人我就是个女人憎恶狂。你们说我痛恨同性恋那我就攻击同性恋。” “Hip hop向来是以黑人歌手占主导，我并不否认这一点。然而有时白人也不赖，像Beastie Boys，3 rd Bass等等，‘江山代有才人出’，只不过这次轮到了我。” “有时我感觉自己站在世界的顶端，而有时我又感到全世界都在压迫着我。” “总有人在我身边阴魂不散地转悠，以为我欠了他们的钱，要向我讨债。” “我想说什么说要说什么，即使被起诉，即使被人揍，我却无所谓，没人能让我停住思想，停住嘴巴。你们想爱我的将来就爱吧，想恨我的，随他去吧！” “我并不害怕坐牢。对所发生的一切，包括坐牢，钱被取走，我都不会害怕。” “如果历史上第一位白人说唱乐手在街上被暗杀或是出现什么事故的话，我想那一定是我”。 关于妻子，他说：“我和Kim就象是在演戏，但如果说我不爱她或者是因为女儿才和她在一起，那纯粹是在胡扯。我跟她在一起只因为我想和她在一起。我爱她，真的爱她。” 关于美国校园枪击事件，他说：“我们对校园枪击事件抱以深深的同情。但没有人站在那些遇到问题的孩子们的角度上去观 察整个事件，人们只管过自己的。出这种事是因为有的孩子被逼到了疯狂的边缘，我就曾经徘徊在这个边缘上，上学时我常遭到其他孩子作贱，因为我小，因为我是 新来的。” 关于他的影响，他说：“我只是把某些人的想法唱了出来，也许会招来很多讨厌我的人的抨击。但他们爱怎么就怎么，我就想做我自己的音乐。我是个疯子……” 这就是美国存在了近三年的疯狂的“EMINEM现象”……');
INSERT INTO `tb_singer` VALUES ('38', 'Martin Garrix', '欧美男歌手', 'http://p1.music.126.net/WzisRYQO9v0hnjWF9mmQhg==/1382086117897057.jpg?param=130y130', '马丁·盖瑞斯（Martin Garrix），原名马亭·杰拉德·嘉伟森（Martijn Gerard Garritsen），1996年5月14日生于荷兰阿姆斯特丹，荷兰DJ、音乐制作人，毕业于赫尔曼育学院。 2012年，马丁·盖瑞斯签约荷兰斯宾尼唱片公司，并发行无人声电音单曲《Error 404》。2013年6月，发行浩室电音单曲《Animals》，该首歌曲进入了十几个国家的音乐榜单前十。2014年4月，发行首张迷你专辑《Gold Skies》。2015年10月，马丁·盖瑞斯获得MTV欧洲音乐奖“最佳电音艺人”奖项 。2016年10月被《DJ Mag》评选为百大DJ第一名，成为该杂志创办之后最年轻的百大DJ第一名。同年11月，再次获得MTV欧洲音乐奖“最佳电音艺人”奖项 。2017年10月，马丁·盖瑞斯蝉联百大DJ第一名。 马丁·盖瑞斯四岁时开始用吉他自弹自唱，八岁时从荷兰DJ提雅斯多的奥运会开幕式表演中获得灵感，开始攒钱并买了自己的DJ音响设备。在听了提雅斯多制作的《Traffic》之后，他下载了专业音乐制作软件，开始自己的DJ之路。 2012年，马丁·盖瑞斯签约荷兰斯宾尼唱片公司，并发行无人声电音单曲《Error 404》；11月，对《Your Body》的混音版被美国歌手克莉丝汀·阿奎莱拉收录在其第五张录音室专辑《Lotus》中 。 2013年2月，荷兰歌手西德尼·萨姆森为马丁制作的歌曲《Torrent》献声；6月，发行Bigroom风格的浩室电音作品《Animals》，该首歌曲进入了十几个国家的音乐榜单的前十 ；11月，加入DJ斯库特·布劳恩策划的“斯库特·布劳恩计划”；12月，与杰·哈德韦发行合作单曲《Wizard》。 2014年2月17日，发行与荷兰DJ组合Firebeatz合作的电音作品《Helicopter》，该支单曲在全球电子舞曲榜上蝉联了两周第一；4月，发行个人首张迷你专辑《Gold Skies》，专辑收录了5首歌曲；8月4日，被美国第16届青少年选择奖提名“最佳电子舞曲艺人”和“最佳电子舞曲”  。 2015年3月，发表由美国R&B歌手亚瑟小子献声的前卫浩室风格作品《Don\'t Look Down》；5月22日，与瑞典音乐制作人Avicii共同制作的歌曲《Waiting for Love》发布[12]  ；7月27日，发行与俄罗斯DJ组合Matisse & Sadko合作的迷你专辑《Break Through the Silence》；10月26日，马丁·盖瑞斯获得MTV欧洲音乐奖“最佳电音艺人”奖项；10月30日，发行前卫浩室单曲《Poison》 。 2016年3月，马丁·盖瑞斯创立自己的厂牌STMPD RCRDS （Stampede Records）；7月，推出由碧碧·雷克萨献唱的未来贝斯（Future Bass）风格歌曲《In The Name Of Love》；10月，成为《DJ Mag》评选的百大DJ第一名，成为最年轻的百大DJ第一名；10月28日，发行第三张迷你专辑《Seven》，专辑收录了《Make Up Your Mind》等七首电音作品；11月7日，再次获得MTV欧洲音乐奖“最佳电音艺人”奖项。 2017年1月，发行由英国女歌手Dua Lipa献唱的Future Bass风格单曲《Scared to Be Lonely》；4月14日，中国地区独享版精选专辑《The Martin Garrix China Ulitimate Collection》通过腾讯音乐娱乐集团首发；5月1日，来到上海参加日落春浪电音节上海场；10月，马丁·盖瑞斯蝉联百大DJ第一名。');
INSERT INTO `tb_singer` VALUES ('39', 'Troye Sivan', '欧美男歌手', 'http://p1.music.126.net/zNL_fBxTqtNWxHE8wRr_LA==/109951164141607056.jpg?param=130y130', 'Troye Sivan ，1995年6月5日出生于南非约翰内斯堡，南非裔澳大利亚歌手。 2007年开启了他的歌唱事业，在YouTube个人频道上上传第一个翻唱视频Declan Galbraith的Tell Me Why，之后并不断上传音乐作品。 作为网络社交达人，截止2015年10月其YouTube频道订阅已经突破370万，推特粉丝突破300万。 2014年8月15日，他的个人首张主流厂牌EP Trxye上架并且首周空降美国第5位及加拿大BillboardHot 200以及新西兰专辑销量第二位，在全球范围内更是登顶了55国下载榜冠军。首单Happy Little Pill被澳洲认证黄金销量。2014年10月，入选《时代周刊》“2014年网络最具有影响力青少年25位”。 2015年9月4日，个人第二张厂牌主流录音室EP WILD 发行。预售便迅速登顶美国，澳大利亚等41个国家及地区iTunes即时下载榜单，首周空降ARIA澳洲专辑榜首同年，入选Billboard杂志2015年全球最富有影响力的21岁以下的音乐人第6名 。 2015年12月4日 个人首张厂牌主流录音室专辑Blue Neighbourhood正式全球发行。 2006年，特洛耶在Youtube上传了一段翻唱英国童星迪克兰·加尔布雷斯歌曲《Tell Me Why》的视频并因此引起网友关注，之后多次受邀参加综艺节目。之后推出首张个人EP《Dare To Dream》，包括\"There\'s a Hero\", \"Angels Brought Me Here\", \"Somewhere Over the Rainbow\", \"Unsung Hero\" 和 \"The Prayer\"共5首歌曲。 2007年，在Regal Theatre剧院上演的舞台剧《雾都孤儿》里扮演主角Oliver Twist。 2008年Troye参加著名电影《X战警前传：金刚狼》的拍摄，在其中饰演主角罗根的童年时期，并获得好评。（经过如下：好莱坞的经纪人在YouTube上看到了Troye Sivan的歌曲视频，随即请他参加电影《X战警前传：金刚狼》的演员面试，Troye Sivan最终获得少年Logan（少年金刚狼）的角色。原先这一角色确定由澳大利亚天才少年演员柯蒂·斯密特-麦菲（Kodi Smit-McPhee）扮演，但由于Kodi要出演《The Road》，出现档期冲突。） 2009年Troye发行单曲《For Them》，这首为世界苦难儿童所唱的歌，无论是从Troye清澈的声线还是他个人深情的表达，都深深打动了许许多多的人。 新歌《Somebody Out There》翻唱的是2008年《美国偶像》亚军David Archuleta的同名专辑的Bonus Tracks。这里，Troye Sivan用自己独特的嗓音来演绎这首动听的R&B抒情歌曲。 troye在09年翻唱了Declan Galbraith的an angel，他把这首歌曲放到了自己的YouTube上，当日就受到了好评。 2010年他在youtube上为庆祝订阅者超过1万人，演唱了Crazy Love。2月，参与\"We Are The World 25 for Haiti \"的录制，为海地地震遇难者筹集善款。3月初到4月中旬，在南非参与电影《Spud》的拍摄，在该片中出演男主角John \"Spud\" Milton。该电影改编自南非作家 John van de Ruit 在2005年撰写的同名小说 2012.03.09年来到中国湖南参加了一档名为《天天向上》的娱乐节目 2013年06月05日正式签约公司——澳大利亚百代唱片集团 2014年7月25日发布单曲 Happy Little Pill 发布（澳洲销量50W 认证黄金唱片） 2014年8月15日发布个人首张厂牌主流EP TRXYE（加拿大销量峰值第二，全美销量峰值第五） 2014年11月17日出席Spud 第三部南非首映礼。 2015年9月4日个人第二张厂牌主流EP WILD 发行  2015年10月15日个人北美巡演Troye Sivan Live于同年于西雅图启程。 2015年12月4日发行个人首张主流厂牌录音室专辑Blue Neighbourhood 2013年8月7日在YouTube发布视频，向粉丝大方承认自己的同志身份，并正式宣布出柜。 家庭成员：steele（哥哥）sage（妹妹）tyde（弟弟）。 Troye和妹妹sage继承了爸爸的蓝眼睛，哥哥和弟弟继承了妈妈的棕色眼睛。 2014年10月 入选时代周刊“2014年网络最具有影响力青少年25位” 2014年7月 TCA（青少年选择奖）网络最佳艺人 提名 2014年7月21日 与Tyler Oakley合作“The \'Boyfriend\' Tag”获得TCA(青少年选择奖）网络最佳拍档奖获奖 2014年11月12日被《Out》杂志票选为百大同志公众艺人');
INSERT INTO `tb_singer` VALUES ('40', 'Bruno Mars', '欧美男歌手', 'http://p1.music.126.net/Zf1ESZwNs0MaiqLBAZ2PWQ==/18723583511044011.jpg?param=130y130', '彼得·基恩·埃尔南德斯（Peter Gene Hernandez，生于1985年10月8日），以其艺名布鲁诺·马尔斯（Bruno Mars）出名，是美国的创作型歌手、音乐制作人。成长于夏威夷火奴鲁鲁的音乐人世家中，马尔斯自幼就开始创作音乐。其童年时期在当地的多家音乐场所表演后，他立志以音乐为业，并在高中毕业后搬到洛杉矶。 在摩城唱片公司度过一段并不成功的职业生涯后，马尔斯在2009年同大西洋唱片签约。在为B.o.B的“Nothin\' on you”以及崔维·麦考伊的“Billionaire”创作并献声后，他作为独唱艺人的才华得到重视。 Peter Hernandez[1]出生于1985年10月8日，是一名美国歌手、词曲作者和音乐制作人。 以他的艺名Bruno Mars为人们熟知。Bruno Mars嗓音独特，凭借与B.o.B合作的出道单曲《Nothing On You》挤下了连续5个星期排名第一的蕾哈娜，在美国Billboard顺利拿下冠军。其他还有与Travis McCoy合作的Billionaire拿下Billboard第30期的第4名。 Bruno Mars在美国夏威夷出生并长大，是父母的六个孩子中的一个。他出生在一个音乐家庭，这给了他将Regge，摇滚，嘻哈和R&B等多种风格融合在 一起的能力。在很小的时候，Bruno Mars就开始模仿和表演例如猫王、迈克尔等很具影响力的艺术家的歌曲。1990年他四岁的时候被MidWeek杂志精选为“小猫王”。2003年，17 岁的他从President Theodore Roosevelt高中毕业，不久后搬到洛杉矶追求自己的音乐生涯。在成为一个成功的歌手之前，Bruno Mars是一名知名的音乐制作人，为 Flo Rida， Maroon 5和Brandy等写歌。在《Nothing On You》成功不久之后，他就宣布将要在2010年5月11日推出自己的细碟《It\'s Better If You Don\'t Understand》，首张专辑将在2010年晚些时候亮相。 Bruno Mars是美国的创作型歌手、音乐制作人，成长于夏威夷火奴鲁鲁的音乐人世家中，Mars自幼就开始创作音乐，童年时期在当地的多家音乐场所表演后，他立志以音乐为业，并在高中毕业后搬到洛杉矶，开始为其他艺人制作歌曲，并加入了制作团队The Smeezingtons。 在摩城唱片公司度过一段失败的职业生涯后，Mars在2009年同大西洋唱片签约。在为B.o.B的\"Nothin\' on you”以及Travie McCoy的\"Billionaire”创作并献声后，他作为独唱艺人的才华得到重视。他还共同创作了诸如Flo Rida和Ke$ha的\'Right Round”、K\'naan的\"Wavin\' Flag”、Cee-Lo Green的\"**** You!”等热门歌曲。2010年10月，他发布了自己的首张专辑《Doo-Wops & Hooligans》。以冠军单曲\"Just the Way You Are”和\"Grenade”打底的这张专辑迅速登上排行榜冠军位置，并凭借着\"Just the Way You Are”在2011年第53届格莱美奖上获得最佳流行男歌手奖。 左上臂内侧：一把匕首，下面写有“PETE\'S BOY”。 右肩：一颗红心，是火星为妈妈纹的。 左前臂（内侧）：吉普赛女人，好运的象征，很多人都纹这个。 右前臂（外侧）：锚，是凯旋的象征。 Best Collaboration \"Nothing on You (with B.o.B) (提名) 2010: Video of the Year \"Nothing on You (with B.o.B) (提名) Teen Choice Awards 2010: Best Single \"Nothing on You (with B.o.B)\" (提名) 获奖 MTV Video Music Awards 2010: Best Pop Video \"Nothing on You (with B.o.B)\" (提名) MTV2 Sucker Free Summit Awards 2010: Instant Classic \"Nothing on You\" (with B.o.B) (提名) 2010年第37届美国人民选择奖最突出进步歌手 2010年公告牌最佳新人 GRAMMY Awards 2010:Record Of The Year \"Nothing On You (with B.o.B) (提名) 2010:Best Male Pop Vocal Performance \"Just the way you are \"(获奖) 2010:Song Of The Year \"**** You\" Brody Brown, Cee Lo Green, Ari Levine, Philip Lawrence & Bruno Mars,songwriters (Cee Lo Green) (提名） 2010:Best Rap/Sung Collaboration \"Nothing On You (with B.o.B)(提名) 2010:Best Rap Song \"Nothing On You (with B.o.B)(提名) 2010:Producer Of The Year, NonClassical The Smeezingtons (Bruno Mars, Philip Lawrence,Ari Levine)(提名) 马尔斯的音乐被认为包容广泛的音乐风格，包括流行乐、摇滚乐、雷鬼音乐、节奏布鲁斯、灵魂乐、以及嘻哈音乐。尽管因为使用假声，马尔斯被认为是“柔性的”，但是他的合作制作人菲利普·劳伦斯却表示：“人们不知道的是，布鲁诺·马尔斯还潜藏着阴暗的一面。”马尔斯自己则说：“这要怪我在高中时爱给女生唱歌。” 马尔斯的音乐作品被认为展现了多变的风格，含有多种音乐流派的元素。《纽约时报》的乔恩·卡拉曼尼卡（Jon Caramanica）点评道，马尔斯是“流行乐中最具多元性、最平易近人的歌手之一”。 火星哥是美国流行歌手Bruno Mars的戏称，因为Mars有火星的意思。[1]');
INSERT INTO `tb_singer` VALUES ('41', 'Marshmello', '欧美男歌手', 'http://p1.music.126.net/C8S6yDKjFpOXM_WwIVmITQ==/3244658817058795.jpg?param=130y130', 'Marshmello（棉花糖），是从2015年开始崛起的天才电音制作人，他制作的单曲\"Alone\"令他一夜爆红。从他开始发布自己的单曲开始，他带着可爱的头套面具，总以呆萌的形象示人，就连“棉花糖”这个名字也充满激萌感，而从未露出庐山真面目的他，也使他充满神秘感。在公众场合时，Marshmello会戴着一个头盔，他的身份是未知的。 大众普遍觉得Marshmello是美国的 DJ Chris Comstock，也称为Dotcom，其风格类似Marshmello。 此外，两者都据称具有相同的疤痕和生日。');
INSERT INTO `tb_singer` VALUES ('42', 'Billie Eilish', '欧美女歌手', 'http://p1.music.126.net/nKfpcOrY03UoaBwTPOyVDg==/109951164219903323.jpg?param=130y130', 'Billie O\'Connell（出生于2001年12月18日），以艺名Billie Eilish为人们所知，美国环球旗下流行女歌手。因空灵精致的嗓音广受好评。 ');
INSERT INTO `tb_singer` VALUES ('43', 'Christine Welch', '欧美女歌手', 'http://p1.music.126.net/dKr8EogX6EZKiufPSUc3XQ==/622323581345739.jpg?param=130y130', '');
INSERT INTO `tb_singer` VALUES ('44', 'Sia', '欧美女歌手', 'http://p1.music.126.net/jmco6xGiq6gSuZOhKG1-6w==/3437073362800682.jpg?param=130y130', 'SiA，全名Sia Kate Isobelle Furler.生于1975年12月18日，澳大利亚。父母均从事音乐工作，\"I only owned 2 CDs: a Jackson 5 anthology and Jeff Buckley\'s Grace.\"SiA在真正从事音乐之前，她听的音乐真的很少很少。因为在和Zero 7一起巡回演出之后，SiA才非常认真的去听各种不同的音乐作品。 男友的去世，把Sia的生命弄得一团糟，脑海里的感觉搅成一块。她用了很长的一段时间疗伤，终于慢慢地从阴影中走了中走了出来，也开始重新思考往后的音乐路向。Sia早在2001年就推出过一张充满R&B流行气味的处女专辑《Healing Is Difficult》，其中采样了俄国作曲家普罗科菲耶夫芭蕾舞剧《罗密欧与朱丽叶》音乐片段的单曲“Taken For Granted”还打入了排行榜前十位，之后她却沉寂下来了，初涉乐坛 2004年1月12日在英国,Sia创作完成并发行了自己的第一张音乐专辑\"Color the small one\".专辑中最为成功的作品有3首\"Sunday\" \"Breath Me\" \"Don\'t Bring Me Down\". 在2009年的 ARIA Music Awards，她获得了最佳音乐DVD奖，并且因专辑Some People Have Real Problems被提名最佳突破艺人。 在2010年ARIA Music Awards ，她获得6项提名，并且因专辑We Are Born赢得Best Independent Release,Best Pop Release ， \"Clap Your Hands\"获得Best Video。');
INSERT INTO `tb_singer` VALUES ('45', 'Selena Gomez', '欧美女歌手', 'http://p1.music.126.net/nq7D8p0Mi-BW3MnFjD9EsQ==/109951163288700419.jpg?param=130y130', '赛琳娜·戈麦斯（Selena Gomez），1992年7月22日出生于美国德克萨斯州，美国女演员、歌手。 在2004年的迪士尼全球才艺计划中，赛琳娜被迪士尼相中并签约。2007年主演原创魔幻喜剧《少年魔法师》，一举成名。2008年主演三部迪士尼原创电影《灰姑娘之舞动奇迹》、《公主保护计划》与《少年魔法师电影: 神秘魔法石》。2009年4月组建乐队Selena Gomez & The Scene；同年9月29日发行首张专辑《Kiss & Tell》。第二张专辑《A Year without Rain》于2010年9月发行。2011年担任MTV欧洲音乐大奖颁奖礼主持人。2013年7月19日发行第三张专辑《Stars Dance》。 中文名：赛琳娜·戈麦斯 外文名：Selena Gomez 别    名：Selena Marie Gomez 国    籍：美国 星    座：巨蟹座 血    型：A型 身    高：165cm 体    重：53kg 出生地：美国得克萨斯州大草原城小镇 出生日期：1992年7月22日 职    业：演员、歌手 代表作品：影视:少年魔法师、公主保护计划 歌曲:Who Says、Come & Get It 主要成就：最受欢迎电视女演员 最佳电视喜剧女主角 1992年7月22日，赛琳娜·戈麦斯（Selena Gomez）出生于美国纽约，是家中的独生女，成长于Grand Prairie小镇，意大利裔的母亲和墨西哥裔的父亲让她从出生就拥有墨西哥、英格兰和意大利的血统。 赛琳娜从小就开始寻求以童星身份演出的机会。7岁出演美国儿童电视节目《Barney and Friends》饰Gianna，是她演艺生涯中的第一个荧屏角色。在2004年的迪士尼全球才艺计划中，她被迪士尼相中并签约，开始了演艺生涯。 2005年，赛琳娜在美国电视系列剧《小查与寇弟的顶级生活》与《汉娜孟塔娜》中客串演出。2007年，她主演了迪斯尼原创魔幻喜剧《少年魔法师》，她在剧中饰演“Alex Russo”，由此成名。 2008年，赛琳娜主演了三部迪士尼原创电影《灰姑娘之舞动奇迹》、《公主保护计划》和《少年魔法师电影: 神秘魔法石》。 2009年4月，赛琳娜组建了自己的乐队“Selena Gomez & The Scene”；同年9月29日，发行首张个人专辑《Kiss & Tell》，专辑风格为加入了电子元素的流行摇滚； 9月，发行第二张专辑《A Year without Rain》，发行首周登上了全美公告牌专辑榜第四位。 2010年，赛琳娜开展了银幕之路，主演了电影《蕾梦娜和姐姐》与《蒙特卡洛》；同年9月21日，发行专辑《A Year Without Rain》的豪华版。 2011年6月28日，赛琳娜发行第三张个人专辑《When the sun goes down》，在公告牌专辑榜中最高升至第三位，主打单曲《Come & Get It》成为了她第一首打入公告牌Hot 100单曲榜的个人单曲，在Hot 100单曲榜和流行单曲点播榜中的最好成绩分别是第六名和亚军， 单曲《Who Says》荣登白金销量， 赛琳娜与美国歌手布兰妮·斯皮尔斯首度合作，为专辑里的歌曲《Whiplash》谱曲。 2013年7月19日，赛琳娜第三张专辑《Stars Dance》发行，在美国Billboard 200专辑榜榜首；[9]  同年8月14日，举办Stars Dance巡回演唱会，在加拿大温哥华拉开序幕。 2015年2月10日，赛琳娜宣布与DJ Zedd参与歌曲合作  。 2015年11月10日，首次参加维多利亚的秘密秀场演出。 赛琳娜·戈麦斯与美国演员泰勒·洛特纳在2007年短暂交往过，于2009年6月分手。 2011年2月6日，赛琳娜·戈麦斯与加拿大歌手贾斯汀·比伯公开恋情。2012年11月，赛琳娜·戈麦斯被爆与贾斯汀已经分手，随后《人物》杂志确认了该消息；同年11月23日，在比伯连续数周的赔罪认错攻势下，赛琳娜·戈麦斯已经原谅了男友，两人重归于好，恢复了恋情， 但在2013年的金球奖上，赛琳娜证实与比伯分手。 2015年1月，赛琳娜·戈麦斯被爆结交新男友安东·斯拉夫斯基，对方是DJ兼音乐制作人 。 2017年1月，赛琳娜·戈麦斯被拍到与加拿大歌手威肯当街接吻；后又被拍到二人同游意大利，新恋情坐实[19]  。');
INSERT INTO `tb_singer` VALUES ('46', 'Halsey', '欧美女歌手', 'http://p1.music.126.net/bKR_yYFVfLrvp_dRUuGPrA==/18753270325235289.jpg?param=130y130', '1994年9月29日出生于美国新泽西州华盛顿市，美国创作型歌手。2014年7月，与Astralwerks唱片签约，并发布首支个人单曲《Ghost》；10月27日，发行首张迷你专辑《Room 93》 。2015年8月28日，推出首张录音室专辑《Badlands》。2016年7月29日，发行与烟鬼组合合作的单曲《Closer》，歌曲在美国公告牌百强单曲榜取得了连续12周冠军的成绩；12月9日，获得第11届公告牌年度女性奖“最具突破新人”（明日之星）奖。2017年2月10日，为电影《五十度黑》献唱的插曲《Not Afraid Anymore》发行；2月12日，凭借《Closer》获得第59届格莱美奖“最佳流行组合/合作”提名。2017年6月2日发布第二张录音室专辑《hopeless fountain kingdom》');
INSERT INTO `tb_singer` VALUES ('47', 'Rihanna', '欧美女歌手', 'http://p1.music.126.net/f21NQmJ7Zc_HiIp48RUJqA==/18561955301751999.jpg?param=130y130', '蕾哈娜（Rihanna），1988年2月20日出生于巴巴多斯圣迈克尔区，在美国发展的巴巴多斯女歌手、演员、模特。 2005年8月发行首张音乐专辑《Music of the Sun》开始歌唱事业生涯。2008年在第50届格莱美奖上入围“年度制作“和“年度歌曲”在内的六项提名，凭借歌曲《Umbrella》获得“最佳饶舌/演唱合作”奖。 2011年被巴巴多斯政府授予为旅游大使，巴巴多斯政府也将每年的2月20日定为“蕾哈娜日”。2012年首次以演员身份主演的好莱坞科幻战争电影《超级战舰》上映。 2015年4月公开歌曲《American Oxygen》音源与MV。 截至2015年，蕾哈娜在美国公告牌榜上拥有12首冠军单曲，被评选2010年最佳艺人奖，也是蝉联多座格莱美、全英音乐和MTV音乐大奖，并二次获得MTV年度录影带大奖的女歌手。 1988年2月20日，蕾哈娜出生于加勒比海地区巴巴多斯岛的St. Michael教区。15岁时，她通过朋友和美国音乐制作人伊万·罗杰斯结识，在罗杰斯面前，她表演了前美国演唱组合天命真女的《Emotions》和歌手玛丽亚·凯莉的《Hero》，之后罗杰斯将她带到纽约录制了多支Demo并投往各个唱片公司，后受到美国歌手Jay-Z的赏识，得到了一张来自Def Jam的六张专辑的唱片合约。 2005年8月30日，蕾哈娜的发行录音室专辑《Music of the Sun》，首周登上了美国Billboard200专辑排行榜的第十名，首支单曲《Pon de Replay》获得Billboard Hot 100单曲榜亚军。 2006年5月29日，蕾哈娜发行了第二张录音室专辑《A Girl Like Me》，新专辑在发行首周的销量为11万5千张，名列本周Billboard 200专辑榜第五位，比上张专辑提高了五位 ，在美国的销量突破了100万张，成为了蕾哈娜第一张白金认证专辑，之后蕾哈娜举行了她的第一次巡回演唱会Rihanna: Live in Concert Tour。 2007年6月5日，蕾哈娜发行了她的第三张录音室专辑《Good Girl Gone Bad》，在美国发行第一周，本张专辑共售出16万2千张，获得了本周Billboard 200专辑榜的亚军。在Hot 100单曲榜中，Rihanna与Hip-Hop大腕Jay-z合作的单曲《Umbrella》依然稳坐冠军宝座；同年在MTV音乐录影带颁奖礼上，蕾哈娜凭借《Umbrella》获年度最佳录影带奖。 蕾哈娜在格莱美表演 在2008年的第50届格莱美奖上，蕾哈娜获得了包括“年度制作“和“年度歌曲”在内的6项提名并最终凭《Umbrella》夺得了“最佳饶舌/演唱合作”奖，为她夺得了第一座“金唱机”，也使她成为第一位获此殊荣的巴巴多斯人；同年6月，蕾哈娜发行改版专辑《Good Girl Gone Bad: Reloaded》，其中收录了三首新歌；同年她举行了她的第二次巡回演唱会Good Girl Gone Bad Tour。 2009年11月23日，蕾哈娜发行了第四张录音室专辑《Rated R》。 2010年11月15日，蕾哈娜发行了第五张录音室专辑《Loud》，她与加拿大说唱歌手Drake合作的单曲《What’s My Name》在美国公告牌排行榜排行第一，另一单曲《Only Girl (In the World)》在榜上排名第四 。 2011年11月14日，蕾哈娜发行了第六张录音室专辑《Talk That Talk》，收录11首单曲，专辑中的首支单曲《We Found Love》在美国Billboard Hot 100上从2011年到2012年占据十周榜单冠军。 2012年，蕾哈娜首次主演了好莱坞科幻战争电影《战舰》，4月18日在中国内地公映 ，5月全球上映，在影片中，她饰演一名女海军”雷克斯“；同年在美国歌手凯蒂·佩里的电影《Katy Perry：Part of Me》中客串。在2012年公告牌发布的“1992-2012年间百大流行歌手排行”中，蕾哈娜成功摘得桂冠。英国官方音乐排行榜亦将她列为史上最畅销的女歌手排行第二（仅统计英国地区销量）；9月，蕾哈娜发行单曲《Diamonds》发行；同年11月19日，蕾哈娜的第七张录音室专辑《Unapologetic》发行，上市首周23万8千张的销量成绩获得了本周Billboard 200专辑榜冠军，是蕾哈娜的第一张冠军专辑；专辑里的歌曲《Right Now》被选为2013年NBA季后赛主题曲；11月与Bruno Mars、Justin Bieber一起担任了2012年“维多利亚的秘密”内衣秀的表演嘉宾。 2013年，蕾哈娜参演的科幻喜剧片《世界末日》于6月12日在北美地区上映；9月13日，首次在中国澳门威尼斯人金光综艺馆展开一连两场的巡回演唱会。 2015年，蕾哈娜参与配音的由美国梦工场动画出品的3D动画巨制《疯狂外星人》于4月陆续在全球上映。 2015年10月29日，据国外媒体报道，法国导演吕克-贝松(Luc Besson)日前通过社交媒体宣布，欧美流行天后蕾哈娜(Rihanna)将加盟他筹备已久的科幻片《星际特工：千星之城》(Valerian)，在片中饰演一位重要角色。');
INSERT INTO `tb_singer` VALUES ('48', 'Taylor Swift', '欧美女歌手', 'http://p1.music.126.net/LC5ACpoTqcB9K5sNXAV7Ag==/109951164025975823.jpg?param=130y130', '泰勒·斯威夫特（Taylor Swift），美国乡村音乐著名创作女歌手。1989年出生于美国宾州。2006年与独立唱片公司Big Machine签约并发行首张个人专辑《Taylor Swift》。第二张专辑《Fearless》在2008年11月11日发行，在Billboard排行榜上到达了第一的位置，首支单曲《Love Story》在2008年9月正式发行，成为了第二畅销的乡村单曲，在公告牌最热100中最高排到第四。该专辑也卖出了乡村音乐最高的销售量约60万张，包括其他种类的音乐，也是美国女歌手公开销售最多的专辑。Taylor曾获得美国乡村音乐协会奖年度最佳专辑奖、格莱美年度专辑奖等荣誉。 “霉霉”是中国粉丝给泰勒的萌爱称。因为泰勒每次有强势的单曲冲击Billboard Hot100榜单冠军时，都会遇到各种妖孽，非常倒霉的屈居亚军！这粉丝们心疼也无力挽回啊，不过“霉霉”这个爱称并没有贬义的意思，而是中国粉丝对泰勒的调侃和太过热爱！再来是泰勒颜值太高，美国那边都叫她美国甜心之类的，中国这边就叫她小美女，美和“霉”读音相同，由此，泰勒“霉霉”的萌萌的外号一直被广泛流传。 歌曲创作风格 斯威夫特的歌词带有高度的自传性；她说过：“你听我的专辑，就像读我的日记一样。”例如歌曲《Forever & Always》就是受她和 Joe Jonas的关系的启发而写的，而《Hey Stephen》就是写一个为她公开演出的人。 《You belong with me》描写的是她高一时候的事。有一种说法是“她的歌词具有讽刺的意味，一位安静、喜欢独处的女孩挑战啦啦队长，或是挖苦以前甩掉她的男孩。“（can be tinged with acid: the quiet loner girl getting one over on the cheerleaders, or a caustic payback for the boy who dumped her.）[85] 她也声明说她努力写一些粉丝能够产生共鸣的歌词，“我的目标是永远不写不能产生共鸣的歌。” 歌曲具有个性的本质为她获得了很多的关注。斯威夫特有一次说：“我原以为这些歌很难产生共鸣，但结果是越针对我个人的歌，越能产生共鸣。”她歌曲具有的自传本质使得一些歌迷研究歌曲的来源。有一次，斯威夫特说：“我的歌迷对我歌曲中描述的每一个人都在MySpace上进行了追踪。” 《纽约时报》把斯威夫特描述成“流行音乐最佳作词之一，乡村音乐最实用主义者，并且比大多数成人更能触及内心世界。“ 泰勒的专辑《Fearless》之前一共在告示牌专辑榜拿下11周冠军，至今已卖出620万张,全球已突破863万张。即使是本届格莱美大赢家Robert Planet与Alison Krauss的得奖专辑有格莱美得奖光环加持，仍不敌Taylor的威力，只能屈居亚军。拥有亮眼外型与创作才华的Taylor被认为是从一群迪士尼偶像 与选秀冠军中杀出重围的乐坛新希望，Taylor swift“国民小公主”的魅力正准备在全球开始蔓延。 泰勒10岁就立志当歌手，13岁时父母为了达成泰勒的音乐梦想，举家搬到美国音乐重地纳什维尔，泰勒也成为Sony 版权公司最年轻的签约创作人。Taylor17岁发行首张“同名专辑”立刻一炮而红，销售突破超过400万张，Taylor的创作才华更让她入围格莱美最佳新人奖。 在MySpace上，斯威夫特已经被点击超越了2亿次。她还是在MySpace的10佳音乐排行榜内，并且在乡村歌 手排行上位于第一，成为目前网络上最热门的歌手。Taylor的歌曲一共付费下载 1100万次，更创下史上第一人在一年之内连创 6 首发行首周空降前20名的纪录。Taylor还接连成为《滚石》杂志、《告示牌》、《Seventeen》、《Cosmo Girl》、《Teen Vogue》等杂志的封面人物。 “格 莱美”节目制作人肯·爱因里希（Ken Ehrlich）一语道破她成名的秘诀，泰勒·斯威夫特唱的歌为她赢得了如今最大的歌迷群：年轻人。谁赢得年轻人谁就赢得世界。她写歌的习惯也成为捕获年 轻人的杀手锏，她以写自己的成长经历闻名，歌曲里都是青春的味道，这一点正好切合了年轻歌迷的心，他们能听懂歌曲的内容，自然就会产生共鸣，从青春期开 始，这一路下来，会有一批歌迷跟着她一起成长。年轻是她的先天优势，她将这个优势利用得很彻底。 除了在歌迷群里有着天使般的位置，她在同辈歌手中同样很吃香，2010年6月的美国创作名人堂大奖上，泰勒·斯威夫特（Taylor Swift）成为美国作曲家名人堂最新成员。[3]颁奖嘉宾约翰·梅尔（John Mayer）对她大加赞赏，他毫不吝啬地赞扬说，随意在任何一个时代，她都能做出热门唱片，并不是那些被大肆宣传的东西才是人人都喜欢的，有时候每个人都认同的就是最出彩的。');
INSERT INTO `tb_singer` VALUES ('49', 'Camila Cabello', '欧美女歌手', 'http://p1.music.126.net/KkFiUsZtyfn4UTo5QrLuWA==/109951163077710517.jpg?param=130y130', 'Camila Cabello是美国的女子组合五美（FifthHarmony)中的一员 ，她出生于1997年。Camila出生在古巴，她五岁时随父母搬到了美国，在这之前，她曾住在哈瓦那和墨西哥。2016年12月19日退出Fifth Harmony单飞。 她的艺名是Camila Cabello。在2012年，她参加了美国的选秀节目：X音素。在这个节目中，她和另外的四个女孩组合成了一个乐队——fifth harmony。 Camila拥有特别的嗓音给了这个团队一个“生力”，这也帮助提升她们的和音到一个新的高度，她被认为是团队里的小傻瓜。在7年级的时候，她找到了唱歌的热情。在加入到Fifth Harmony前，她经常翻唱喜爱的歌曲并上传到YouTube。她谦虚的性格以及她可爱的长相也让她成为5H中最受欢迎的人。讽刺的是，她在参加x factor之前，在学校中并没有什么朋友，也不与同龄人有过多的联系，成为了5妞中唯一从来没有谈过恋爱的人。 她还受到了一些迪斯尼童星和青少年偶像比如泰勒·斯威夫特，赛琳娜·戈麦斯，麦莉·塞勒斯的影响。给她影响最大的是黛米·洛瓦托。  现已和Austin Mahone分手。Camila做过黛米·洛瓦托单曲‘Skyscraper’在YouTube上的封面');
INSERT INTO `tb_singer` VALUES ('50', 'Cozi Zuehlsdorff', '欧美女歌手', 'http://p1.music.126.net/wo57wDoX3Us2NF28tJgvDw==/19006157997859278.jpg?param=130y130', 'Cozi Zuehlsdorff (born August 3, 1998)[1] is an American actress and singer known for her role as Hazel Haskett in the movie Dolphin Tale (2011) and the sequel, Dolphin Tale 2 (2014). She also appears in Mighty Med as Jordan, and in K.C. Undercover as Pinky Carter. In November 2014, she released her debut EP, Originals. Cozi collaborated with Monstercat house artist Hellberg with his single \"The Girl\", on which Zuehlsdorff contributed vocals to, which was featured on his EP, \"This Is Me\" and on \"Monstercat 021 – Perspective\". As of May 5, 2017, the song has reached more than 9.7 million views. She has also contributed vocals to other Monstercat songs, such as \"Nevada\" by Vicetone, \"Where I\'ll Be Waiting\" by Rich Edwards, \"Confessions\" by Myrne and \"Way Back\" by Vicetone.');
INSERT INTO `tb_singer` VALUES ('51', 'Madilyn Bailey', '欧美女歌手', 'http://p1.music.126.net/pk2eicPuVe3ykszlw54_Pw==/109951163164836659.jpg?param=130y130', 'Madilyn Bailey是一位来自美国的歌手，靠网络翻唱走红。从小喜爱音乐并且会钢琴、吉他、架子鼓等乐器。其声线极富磁性，受到很多人的好评。2012年以来，Madilyn Bailey更是推出了自己的原创歌曲，Twitter、Facebook粉丝数一直在直线上升。 Madilyn从小就非常关怀、关心他人。早在七岁时，她就用写歌的方式表达她通过生活中看到的人们的悲欢离合。 曾经有一个女人听了她的歌之后满含泪水的走近她，从那时起，Madilyn明确了她自己的目标和音乐梦想。那女子不仅被她的表演感动，而且惊讶Madilyn如此年轻就能自己写歌。她的作品已问世，而她与她的歌迷继续以一种特殊的方式联系着”音乐“。用Madilyn自己的话来说：“我希望我的音乐有可信度，并且能够触动人们的心。我的目标是，当他们听到我的歌声时，他们能为之动容。” 一开始，Madilyn迫切想让更多人接触她的音乐，但是获得的成效并不好，她的愿望几乎立刻碰壁了，毕竟她只是一个很普通的喜欢音乐的人。于是她想到了网络，想到了YouTube。因为YouTube是一个可以扩大她粉丝的巨大资源库。 Madilyn开始和一个亲密的朋友发布一些音乐视频。在2009年的秋天，Madilyn勇敢地上传了她的第一个视频。在同年十一月Madilyn Bailey频道正式发起。 音乐的自然延伸，是对Madilyn本身最好的诠释。现在的Madilyn Bailey依然在追逐着她的音乐梦想，并且一直在尽自己最大的努力。 社会评价 来自威斯康辛的奇迹，Madilyn Bailey创造了超过200万并在持续增长的点击记录。她翻唱艾米纳姆的《Not Afraid》就单独创造了50万的点击。 只有十八岁的Madilyn Bailey（现在她已经快20岁了，这篇文章来自于2011年三月）安静地坐着，肩上金黄色的头发微卷。她轻轻地把她自称为“最好的朋友”的吉他放好，伴着遗传美妙的弦声开始哼唱起来。她的嗓音显出厚重的专业功底。 一月份刚刚从高中毕业的Bailey，一直保持沉默寡言，但演唱每首歌时的情感都随着歌曲而有所不同，有时轻蹙双眉，散发出吸引千万粉丝的强烈气场。 被朋友称为Maddy的她，她并不是在舞台演出，而是在自家的地毯上，柔软的沙发上，甚至于是在卧室床上，拍下视频上传到Youtube——一个让无数演唱者事业开始腾飞的网站。 和五个兄妹一起，Maddy在威斯康辛州北部度过了她的童年。只有1000居民的威斯康星州离好莱坞十万八千里，但是距离并没能影响这个小姑娘向世界散发她的音乐激情。一年半以前，Bailey受到走红的Kina Grannis和Marie Digby的影响，开始用Youtube作为“活动场地”。 如今有着4000个订阅和超过200万的观看记录的Bailey已经成为知名人物。——而她如何赢得赢得如此广泛的粉丝支持呢，当然她的才气和热情很重要，还有就是她很挑剔地选择能感染人的翻唱歌曲。Bailey说，“我的音乐梦想是希望能我的音乐能够传播到尽可能多的人并和他们保持沟通。”带着50万的点击率，她翻唱艾米纳姆的《 Not Afraid》不仅仅是因为原唱很火，也是因为她的及时翻唱并发布。“选择那些当下流行的音乐——它们很快就会在Youtube上被搜索和观看。” 现在，她正准备延迟自己的大学学业并专注于音乐事业。创造并维护一个在Youtube上很火的频道需要大量的经历和耐心。但她似乎已经掌握了这门技巧，每两周就在上面贴个视频。（“每周一个比较烦人，而每三周一个又很无聊。”Bailey解释说。） 1.I Knew You Were Trouble 2.Skyfall 3.both of us 4.Crescent Of The Moon 5.Part Of Me 6.Drive By 7.Bad Habit 8.Eyes Open 9.I Won\'t Give Up 10.Boyfriend 11.What Makes You Beautiful 12.Wide Awake 13.Want U Back 14. It Girl 15.Domino 16.Somebody That I Used To Know 17.Not Afraid 18.Starships 19.Lego House 20. Last Christmas 21. We Are Young 22. My Immortal 23. Is Anybody Out There 24. In These Halls 25. Do You Remember 26. The A Team 27. Safe and Sound 28. Titanium 29. Young and Beautiful');
INSERT INTO `tb_singer` VALUES ('52', 'The Chainsmokers', '欧美组合/乐队', 'http://p1.music.126.net/0PJOX5d5lQ1iFO395aWsnQ==/109951163845700865.jpg?param=130y130', 'The Chainsmokers，是来自美国纽约的DJ组合。由成员安德鲁·塔格特和亚历克斯·鲍尔组成，2014年因一曲《#Selfie》而出名。 安德鲁·塔格特 中文名：安德鲁·塔格特 英文名：Andrew Taggart 生日：1989年 出生地： 缅因州的波特兰 亚历克斯·鲍尔 中文名：亚历克斯·鲍尔 英文名：Alex Pall 生日：1985年 出生地：纽约市 2012年12月4日，发行与印度女演员朴雅卡·乔普拉合作的单曲《Erase》 。 2013年12月，在网络上发布电音歌曲《#SELFIE》，提供免费下载 。2014年1月28日，通过Dim Mak唱片正式发行《#SELFIE》；8月10日，凭借《#SELFIE》获得青少年选择奖“最佳电子舞曲”提名；9月，在纽约的音乐会场Terminal 5进行了组合的首次演出。 2015年4月，与索尼音乐旗下的Disruptor唱片签约；6月16日，发行与女歌手Rozes合作的Future bass风格单曲《Roses》；10月，发行他们的首张迷你专辑《Bouquet》。 2016年2月1日，《Roses》到达美国公告牌百强单曲榜第六名；2月5日，发行与女歌手Daya合作的歌曲《Don\'t Let Me Down》；3月，受邀在美国迈阿密超级电音节（Ultra Music Festival）演出；7月5日，《Don\'t Let Me Down》到达公告牌百强单曲榜第三名；7月29日，发行与女歌手海尔希（Halsey）合作的电音单曲《Closer》，歌曲在美国公告牌百强单曲榜取得了连续12周冠军的成绩；8月28日，11月4日，发行第二张迷你专辑《Collage》；11月20日，获得第44届全美音乐奖“最受欢迎电子舞曲歌手”奖。 2017年2月12日，凭借歌曲《Don\'t Let Me Down》获得第59届格莱美奖“最佳舞曲录制”奖，并获得“最佳新人”和“最佳流行组合/合作”两项奖提名；3月5日，在第4届iHeartRadio音乐奖中，获得包括“最佳新人”在内的五项奖；3月8日，与酷玩乐队合作的单曲《Something Just Like This》来到公告牌单曲榜第五位，成为烟鬼第5首进入该榜单前十的单曲[19]  ；4月，发行首张录音室专辑《Memories... Do Not Open》，该张专辑与酷玩乐队等艺人进行了合作，专辑标准版收录了《Paris》、《Something Just Like This》等12首歌曲；同月，他们展开了为期5个月的Memories Do Not Open Tour，而女歌手Kiiara作为巡演嘉宾将完整出席他们所有的北美巡演；5月，公告牌音乐奖揭晓，烟鬼以22项提名的成绩成为该届公告牌音乐奖上获提名最多的音乐人，最终获得了“最佳HOT 100单曲”、“最佳合作”、“最佳舞曲/电子单曲”和“最佳电子/舞曲艺人”四项大奖；9月，发行与防弹少年团合作的歌曲《Best Of Me》；10月，升至《DJ Mag》“百大DJ”第6位 ；11月20日，获得全美音乐奖最受欢迎电子舞曲歌手奖。');
INSERT INTO `tb_singer` VALUES ('53', 'Coldplay', '欧美组合/乐队', 'http://p1.music.126.net/80QNblLgZLHLNuqIPbIN-Q==/109951163719744219.jpg?param=130y130', 'Coldplay是英国摇滚乐坛进入新世纪之后崛起的最受欢迎的摇滚乐队之一，他们秉承了英式摇滚乐队一贯的风格，成为了英国新一代乐队中的杰出代表。Coldplay有四个成员，1996年时在UCL（University College London）四人相遇，两年后决定合组此乐团。Coldplay乐队成军之后的每一张专辑都不断进步，一步一步地扩大他们的影响，目前他们正处于事业的快速上升期。 Chris Martin （主唱∕吉他∕键盘；Mar 2,1977）- 很小的时候就已展现音乐天份，喜欢在钢琴上快乐地敲击音符，早在15岁时就已经开始加入乐团玩Band。） 主唱Chris Martin在乐队中司职原声吉他，钢琴和键盘，他出生在多文市，他从15岁开始玩吉他，至今参加过三只乐队The Rockin\'Honkies,The Red Rooster Boogie Band 和Pectoralz，他最喜欢的乐队/歌手是Sparklehorse,The Flaming Lips,Tom Waits,BobDylan,NeilYoung。如果问他为什么作起音乐，他肯定会坚决地告诉你，“摇滚就是我想要得一切东西，但是它他XX的根本和那些被吹嘘的一塌糊涂的花花绿绿的药丸，那跟摇滚没他XX的一点关系，也没必要把自己搞的神神叨叨，更没必要关心别人怎么看你，酷不酷和我的音乐没关系，摇滚乐的 意义在于告诉你如何寻找最终的快乐。至于我们就喜欢一起四处闲逛和作音乐，我们不管别人怎么说，我们感到愉快而心安理得。有时候，我们看起来有些过于坦 率，而且不关心我们到底该怎么做，但是，我确认我们热爱生活而且异常勤奋，我们只是不希望把时间浪费在那些陈词滥调的规矩上，我们不想为陈腐的人活着。 Guy Berryman （贝斯手；Apr 12,1978）- 由于Guy本身对放克Funk音乐的热爱，他在13岁时开始玩贝斯，曾经是英国三十岁以下第四富有的男人）贝斯手GUY出生在苏格兰的费弗，但12岁的时候搬到了肯特市，13岁他开始弹BASS，以前只参加过一只乐队TIME OUT，他喜欢James Brown,Kool& The Gang,funk and soul。GUY性格很倔强。 Jonny Buckland （首席吉他手；Sep 11,1977- 11岁时，他在哥哥的鼓励下开始玩吉他，不过直到听到石玫瑰合唱团The Stone Roses的音乐之後，才开始认真地想成为一名吉他手）吉他手JONNY他出生在伦敦市，当问及他的家乡北威尔士的 Mold他说：“那儿和音乐似乎没什么关联，但是Rhys Ifans是在哪儿成长起来的。”JONNY 11岁就开始玩吉他，COLDPLAY是他参加的第一只乐队，能得到他推崇的乐队只有The StoneRoses和Ride。他是个让人吃惊的家伙，除了作音乐，他还获得了数学和天文学的双学位。 Will Champion （鼓手；Jul 31,1978） - 成长岁月中，除了年复一年密切地关注他热爱的Southampton F.C.球队避免被降级之外，就是学习各式各样的乐器）鼓手WILL出生在南安普顿，很小的时候就开始摆弄各种乐器，他进过一只叫做“肥老鼠”的乐队，至于喜欢什么乐队，他自己也说不清楚，但他说他最喜欢的是爱尔兰民谣。WILL的爸爸是考古学家，马丁总喜欢四处宣扬WILL的爸爸简直就是考古界的的迈克尔·杰克逊！WILL在乐队中最小而且巨捣蛋，他总是给你讲他在学校的趣事，比如“我的生物学教授总是在课上唠叨‘我用六个星期也说不完的证据说明，大猩猩的确有手淫的习惯’， 哈哈，那简直逗极了。乐队的每个人都喜欢他，马丁和WILL总有说不完的话，“天啊，你可不知道，WILL这家伙简直就是一个人体点唱机，他会的歌比任何人都多，以前我们经常坐在寓所的楼梯上唱歌，你只要说出一个歌的名字，他立刻就能给你弹出来。他更适合作一个吉他手……”这时GUY回在旁边说；“WILL在事情上总是表现的坚强，而且他异常幽默……哦……他对迈克尔·欧文的印象出奇的好……世界上还有什么样的人比WILL更值得信赖？” COLDPLAY 2011 受到一些摇滚先驱的影响，Coldplay乐队的成员从少年时期就拿起了乐器开始音乐表演。Coldplay乐队的成员都来自普通的工人家庭，ChrisMartin从很小的时候就开始弹钢琴，15岁开始已经混迹于各种乐队，并且得到过Tom Waits的称赞。Jon Buckland受到了Eric Clapton以及Jimi Hendrix等吉他大师的影响，从11岁开始弹奏吉他。来自苏格兰的Guy Berryman则受到了一些Funk音乐熏陶而拿起了贝司。再加入Coldplay乐队之前Will Champion曾经演奏过吉他，贝司，笛子等各种乐器，但是由于Coldplay乐队成军伊始缺少鼓手，所以多才多艺的Will Champion便成为了乐队鼓手和打击乐器的人选。 因其第一支单曲《Yellow》而成名，随后他们的处女作《Parachutes》（降落伞）（2000）曾入围英国水星音乐奖。后来《A Rush Of Blood To The Head》（心血来潮） （2002）亦获得NME年度最佳专辑奖等多项大奖。到了第三张专辑《X&Y》（XY密码）（2005），热度略有下降，但总的来说依然很受欢 迎。乐队的第四张录音室专辑《Viva La Vida》（玩酷人生）（2008），由布莱恩伊诺（Brain Eno）担任制作人，并再次大获好评。酷玩乐队的所有专辑都获得了商业上的成功。 98年，1999年乐队发行了500份第一张EP《Safety》的拷贝，这张EP录制于“同步 城市”录音棚，录制了500张，只有50份公开销售。有三首歌囊括其中：《Bigger Stronger》，《No More Keeping My Feet On The Ground》，《Such ARush》，令他们异常兴奋的是这张EP在5月份得以在LONDON周边地区做商业发行，Phil Harvey成了他们的经纪人。可事情的结果是EP大部分都被朋友们要走了，还有一部分被用于送给各个唱片公司。该EP他们在1999年2月仅用了4天便 录完。但是如愿以偿的是----宇宙唱片的Debs Wild 对他们的作品很感兴趣，他把这张EP送给了Parlophone唱片公司的Dan Keeling和BMP出版社的Caroline Ellery。于是COLDPLAY在99年的夏天同时和这俩家公司签了唱片约。 99年是乐队快速成长的一年。 4月份，乐队出版了EP《Brothers & Sisters》。随后，SimonWilliams，伦敦“凶猛的熊猫”唱片的主管（98年11月在CamdenFalcon.看了COLDPLAY的 现场演出。）约他们为他的公司录制一首歌。事后，乐队正式签约到EMI旗下品牌Parlophone。同时，著名的电台DJ Steve Lamacq 开始在电台---“夜间1频道”播放他们《Brothers &Sisters》里面的歌，EP在排行榜上爬到了92名。而切在这一年，英国最权威的音乐媒体“NME”开始注意COLDPLAY乐 队，“NME”称乐队是有着清澈的眼睛，诚实的脸庞的，等待一鸣惊人的年轻乐团。 6月份，他们出现在专门推出新乐队的Glastonbury的舞台上，并且和BETA乐队的制作人Chris Allison一起完成了三首作品：《Dont Panic》、《See You Soon》、《High Speed》。完成他们最大的考验之后，酷玩在1999年春天与Parlophone签下了5张专辑的合同。最后一次出现在格拉斯顿伯里之 后，乐队开始录制他们的第三张EP《蓝月》（Blue Moon）。到10月便发行了5000张，并且其中的单曲《Bigger Stronger》被Radio1播放。在录制《蓝月》期间情况十分混乱。马丁把Will踢出了乐队，但后来又恳求他回来，由于他感到愧疚，他们出去喝酒 大醉了一次。之后，他们制定了一套规矩以保证乐队的完整。首先，乐队的一切都基于一点：酷玩是一个民主的乐队，所有收入平均分配，像U2和REM那样。第 二，谁要是吸食会致瘾的毒品将被直接驱逐出乐队。10月《Bigger Stronger》和《Such A Rush》被作为附赠曲目出版了EP《The BlueRoom》。EP推出后，“NME”表示了极大的惊喜“如此完美的处女唱片，很象NickDrake，很英国化！” 报纸上的报道则写到：“这只乐队的歌声让你无限亲近地沉浸在对过去的美好记忆之中，乐队的小伙子们就象画家壁橱上摆 放的小甜饼一样诱人。”和Bellatrix一起巡演的“夜间1频道”的DJ Jo Whiley开始在巡演中大力推崇COLDPLAY乐队。这一年，乐队在许多重要的地方赢得了大量的歌迷。 2000年1月，乐队和“NME”的顶梁极乐队Shack,Campag Velocet and Les Rythmes Digitales开始名为“NME Carling Premier Tour”的全国巡演。3月份，乐队在威尔士和利物浦的“街道幼鱼”录音棚录制了单曲战栗，B面歌曲是为你和 小心你站着的地方，“NME”称此唱片是“年轻的人，成熟的音乐。”这只歌成了他们的惊世之做，当他们和TERRIS乐队正一起巡演时，此曲一下子打进排行榜的前35名。马丁谈及这首歌时说，“这首歌写的是关于一个对自己丧失热情的女孩的故事， 她那样的孤立无援，没人关心她-----但是当歌写完以后，事情变的奇怪起来，这女孩似乎有了代表性，象是在讨论无回报的爱的问题----有的爱得不到回 报，这由来已久的问题她知道吗？我想她当然知道。所以她不在被那个问题困扰。”紧接着，乐队歌曲《YELLOW》完成，它彻底为后面专辑的成功铺平了道 路。 5月份乐队开始和导演Jools Holland一起拍摄《YELLOW》和《战栗》的MTV。 6月份，乐队单曲唱片《YELLOW》面世经过在Saturday afternoon at Glastonbury和highlight ofthefestival的演出后，这张单曲冲上了英国单曲榜的第4名。关于这首歌，马丁说道，“这是一首威尔士歌曲，它是在利物浦和威尔士写的，那时我们正在录音，那里美丽的景色给了我无限的灵感，在一个异常美丽的夜晚，我完成了它，这首歌听上去并不那么时髦，而且很简单，但我在创作和演唱的时候确实全心全意的。 7月份，专辑制作完成，发行演出是在牛津街的 HMV唱片店，人们在街道上排起了长队。乐队成了“MME”的头版，赞誉之声席卷了COLDPLAY的整个世界。专辑只用几周时间就坐稳了英国专辑销量榜 的第1名。很快专辑被 Mercury MusicPrize提名，同一月里，乐队在电台作了几次《YELLOW》和《SHIVER》的不插电演出以后，最终在伯明翰的Ronnie Scott\'s举行了整张专辑的不插电演唱会。 8月出尽风头的乐队受到来自 AlanMcGee的攻击，他说乐队是一群只知道爬在床上自慰的弱智。对此JONNY作出了经典的回答，“我们不得不按我们认为好的去做，确实是这样，如果我们为了作明星而去装疯癫或者装出一副摇滚巨星的样子那无疑是悲哀的。” PS：值得我们国内圈内人士思考。 9月Mercury Music Prize被Badly Drawn Boy夺得COLDPLAY获得3等奖。 10月，乐队开始在全英最大的巡演。 2002年面世的《A Rush Of Blood To The Head》ChrisMartin细腻深情的嗓音为这张新作保留了与首发专辑《Parachutes》一样精彩美妙的色调但他们显然在风格转变上花了不少功夫。 在4座葛莱美奖、4座全英音乐奖加持和两张专辑累积全球1700万张销售之后，费时一年半筹划而成的全新专辑《X&Y》面世，曾被主唱克里斯马汀形 容为：“可能再也做不出来。”就知道外界对Coldplay全新专辑的期待、这张专辑同时也是EMI唱片年度最重要的发行！克里斯马汀表示：“这张专辑是 我们最真挚的宣言，音乐所表现出的就是真正的我们，我们四人没有一人可被别人取代，Jonny、Guy和Will都做到我想都想不到的程度！对我而言，这 比得到葛莱美奖或是全英音乐奖都 来得更重要，因为我从中得到真正的感动。当然，能得到肯定也是很好啦，但我们并不是为了得奖而做音乐的。我们希望能够做出自己一听到就会被感动的音乐，因 为在掌声、奖座或喝彩沉淀下来之后，能感动人的音乐才是最重要的。”克里斯马汀如贯的文艺式发言，或许正是掳获娇妻-格温妮丝帕特洛的秘密武器！ 就个人来说，这是一只能够在音乐上和人格上将我彻底征服的团体，他们是我生活中不折不扣的偶像。我想，如果在地球灭亡之前世界会有100000000个天才，那么他们一定是其中四个。 Coldplay芝加哥演唱会开场前 酷玩乐队全新专辑《生命万岁》（Viva la Vida）08年六月十二号在伦敦正式发行。专辑里的一首新歌《紫罗兰山丘》已经提前放在网上供歌迷下载，7天的下载量超过200万人次。乐队宣布，将在新专辑发行两周内，先在伦敦、巴塞罗那及纽约举办3场免费新专辑发布会，接着展开全球售票巡回演唱会。2008年6月15日，《生命万岁》在英国专辑排行榜上登顶，尽管只是刚刚发行了三天。当时专辑已销售302000张；BBC称其为“英国历史上销售最快的专辑之一”。到6月底，专辑又创造了下载量的新纪录。2008年10月，《生命万岁》在伦敦格罗维纳酒店赢得Q音乐奖最佳专辑奖和当今最佳艺人奖。2008年10月16日，接受英国广播公司第一电台Zane Lowe的采访时，马丁暗示乐队计划在2009年在赫特福郡的奈伯沃斯公园办一场演唱会。 乐队紧随《生命万岁》于11月25日推出EP《Prospekt\'s March》，并且第五张录音室专辑将会在2011年上半年发行。 2010年1月22日，全球赈灾公益性演出为海地人民送去了温暖。这次演出从美国洛杉矶发起，以迅雷不及掩耳之势传 到纽约和伦敦。所有参演艺人的歌曲都可以在iTune store上购买，所得款项将分配给7家公益性组织去帮助海地的灾民。其中，英国顶级乐队Coldplay献上一曲“A Message”。 酷玩乐队早 期的音乐风格令人联想到Radio Head，Jeff Buckley，U2和特拉维斯等。从《降落伞》开始，酷玩的音乐风格还受到其它来源的影响，包括《心血来潮》中的Echo & the Bunnymen，凯特·布什和George Harrison；《XY密码》中的约翰尼·卡什，发电厂乐队；《玩酷人生》中的Blur、Arcade Fire，My Bloody Valentine。酷玩乐队还活跃于各种社会和政治团体中，比如乐施会（Oxfam）的促进公平贸易活动。乐队还参与各种慈善活动，比如BandAid 20，现场八方，青少年癌症筹款音乐会（Teenage Cancer Trust）等。 格莱美在音乐界，正如电影界的奥斯卡一样，是公认的最权威的奖项。迄今为止，Coldplay共获得八项格莱美奖，分别是：1、四十四届，最佳另类音乐专辑：Parachutes 2、四十五届，最佳摇滚乐队.3、四十五届，最佳另类音乐专辑：A Rush Of Blood To The Head4、四十六届，年度唱片奖：Clocks 5、四十九届，最佳非古典类混音唱片 《Talk (Thin White Duke Mix）》Jacques Lu Cont,remixer ，与Be Without You (Moto Blanco Vocal Mix并列）。 在2009年（51届）格莱美提名中，Coldplay凭借Viva la Vida or Death and All HisFriends这张火遍全球的新专辑，一举拿下了包括年度唱片、年度专辑、年度歌曲在内的的七项提名。最终荣获“最佳流行乐队组合”、“最佳摇滚专辑”和“年度最佳歌曲”三项大奖。');
INSERT INTO `tb_singer` VALUES ('54', 'Vicetone', '欧美组合/乐队', 'http://p1.music.126.net/C8950M-wl-s1gjQqXvXmDg==/109951164091880958.jpg?param=130y130', '来自荷兰格罗宁根的电音组合Vicetone由出生于同样出生于92的Ruben Den Boer和Victor Pool组成。深受受Eric Prydz及Swedish House Mafia的影响，Boer和Pool决心追随偶像的脚步创作自己的音乐。2012年正式出道，与Monstercat签约，得到与Collin McLoughlin合作机会推出单曲《Heartbeat》一炮而红。2014年在发行了单曲曲《Lowdown》及《Ensemble》后，Vicetone顺理成章的被保送Ultra音乐节。此后作为DJ Mag百大DJ常客，他们又陆续推出了如《What I’ve Waited For》，《No Way Out》和《Way Back》等多支热门单曲。');
INSERT INTO `tb_singer` VALUES ('55', 'Maroon 5', '欧美组合/乐队', 'http://p1.music.126.net/ezwY0SNgQYyAIt-YtsqWCA==/109951163353496516.jpg?param=130y130', 'Maroon5，中文译名魔力红乐队，来自LA的摇滚乐队，确切一些说是新灵魂摇滚。maroon 融合了红色的狂野魅力，神秘热情，奔放烈爱再掺入摇滚力道，灵魂旋律及放克节奏，这样的红流泻着新灵魂乐性感风情的放克摇滚这样的红，在流行歌坛注入了一股新的颜色。 亚当·李维 （Adam Noah Levine） - 主唱、主音吉他、旋律吉他（1994 - 至今） 詹姆斯·柏根·瓦伦汀（James Burgon Valentine） - 主音吉他、旋律吉他、和声（2001 - 至今） 杰西·罗亚·卡迈克尔（Jesse Royal Carmichael） - 键盘、旋律吉他、和声（1994 - 至今，2012年暂时离团，于2013年回归） 米基·米奇·麦登（Mickey \"Mickey\" Madden） - 贝斯（1994 - 至今） 麦特·弗莱恩（Matt Flynn） - 鼓、打击乐（2006 - 至今；2004 - 2006作为巡演伙伴成员） PJ Morton - 键盘手、和声（2012年至今; 2010-12作为巡演伙伴成员） Sam Farrar -键盘，合成器，MPC，吉他，低音，打击乐，和声 （2016年至今；2012–2016作为巡演伙伴成员） ·已离开成员 莱恩·度赛克（Ryan Dusick） - 鼓、打击乐、和声（1994 - 2006） 乐队成立于1994年的洛杉矶， 当时的成员还是五个高中生。也许是出于青春期的萌动和向往，最初乐队的名字叫做KARA Flower。但是高中时代的辉煌与光荣转瞬即逝，五个人毕竟要继续发展。后来他们在唱片公司Reprise旗下推出过一张唱片“The Fourth World”（《第四世界》），反应平平。可要知道，这四个字给他们带来了多大的压力，在美国，除了真正的大牌明星以外，绝大部分艺人的 生活都很一般，为了自己的音乐理想，每天也要做着自己不喜欢的事情，也要为一袋面包而折腰。Maroon 5做过暖场嘉宾，酒吧驻唱，商业演出，巡回表演等等。五个年轻人徘徊在人生的十字路口，不知道自己何去何从。他们的创作精选集“Songs About Jane”（《写给珍妮的情歌》）也在唱片店被静静的放置了一年多也无人问津。 沉寂了一年多，机会终于来了，这张写给前女朋友的肺腑之作被一位经纪人慧眼拾起，炒热起来，在各大美国电 台金榜题名。而2004年是它们开始大红大紫的丰收之年，连主流音乐市场的风向标格莱美也垂青了这群坚持理想的年轻人，把2005届的最佳新人奖杯 （Best New Artist）送到了他们手中。主唱Adam在颁奖典礼上不无抱怨的感叹：“两天前，正是我们乐队成立11周年的纪念日，而今天我们获得了最佳新人奖，这 很搞笑。” 具有非常典型的美国流行摇滚乐特 点——“Aggressive”（富有冲击力和侵略性）。大部分的歌曲除了情歌“She Will be Loved”以外，节奏总是一强一弱，非常抢耳，主唱Adam的嗓音也是随性而无谓。每次在听歌的时候，尤其是那首主打单曲“This Love”，我的脑子里都会闪现一副鲜活的画面——五个摇滚青年穿着牛仔裤，双手插兜，嘴里叼着一根烟，无所顾忌的走在大街上，带着一副谁也不欠谁的表情 对你说：“这就是我做的音乐，你爱听不听，I DON’T CARE!”。 决非一夕得来的侥幸，这两年来他们巡回全美在超过两百场的演唱会中表演，并为许多知名艺人暖场，这些现场演出让Maroon 5一点一滴地累积起人气，原本在2002年就已发行的”Harder To Breathe”因此开始口耳相传地慢慢走红，到了2003年夏天更成为歌迷的最爱之一，打入全美单曲榜第18名，而收录”Harder To Breathe”的专辑《Songs About Jane》也连带获得全美专辑榜第七名的佳绩。2004年由同一张专辑所选出的单曲”This Love”不但延续了”Harder To Breathe”的气势，还更上一层楼地获得全美单曲榜第五名，而Maroon 5在欧洲以及亚洲各国也都创下杰出的成绩，俨然已成为全球最受欢迎的团体之一。 Maroon 5乐队获得了第47届格莱美最佳新人奖提名，并成为首个表演嘉宾，该乐队融合灵魂、疯克、摇滚的乐风在摇滚乐坛前所未见，被誉为“新灵魂乐界的第一摇滚乐队”。Maroon 5乐队的主唱兼吉他手亚当·莱文就为格莱美揭幕一事表示：“那将是很酷的表演，我们准备演唱成名曲《烈爱》（This Love）。” Maroon 5一举得到了最佳新人大奖，他们的竞争对手包括诸如说唱艺人Kanye West和乡村歌手Gretchen Wilson等夺标热门。Maroon 5成员之一Adam Levine对Kanye West充满了敬意，他表示：“能够击败West得到这么一个重要的奖项，我觉得这是一生当中最幸福的时刻，我简直难以相信这是真的。”');
INSERT INTO `tb_singer` VALUES ('56', 'Imagine Dragons', '欧美组合/乐队', 'http://p1.music.126.net/35LBShqXLXLezNw1oL1s2Q==/109951163650007429.jpg?param=130y130', 'Imagine Dragons是美国一支独立摇滚乐队，被国内乐迷称为“梦龙”。2008年诞生于犹他州普洛佛，之后驻扎于拉斯维加斯。2012年凭借主流出道的录音室专辑《Night Visions》获得巨大成功。 现役成员 主唱：Dan Reynold Daniel Coulter Reynolds生于1987年7月14日，是IMAGINE DRAGONS的主唱。他也和自己的妻子Aja Volkman Reynolds合作了一首单曲。 他是九个兄弟姐妹中的老七，生于拉斯维加斯，父母 Ronald Reynolds和 Christene Reynolds都是内华达州当地人。在青少年时期，他就学习了奏鸣曲，并在圣诞钢琴演奏会上进行了表演。进入Bonanza高中之后，Reynolds 在几个当地的小乐队里担任了鼓手、吉他手和主唱。在大学读了两学期之后，他为在内布拉斯加州奥马哈的耶稣基督后期圣徒教会全职工作了两年。然后他又回到杨 百瀚大学，学习交流和音乐。他喜欢强调自己是第四代内华达人。 贝斯：Ben McKee 吉他：Wayne “Wing” Sermon 鼓手：Dan Platzman 前成员 鼓手、主唱：Andrew Tolman (2008–2011) 吉他、主唱：Brittany Tolman (2009–2011) 吉他、主唱：Theresa Flaminio (2011–2012) 巡演成员 键盘、吉他：Ryan Walker IMAGINE DRAGONS是一只来自美国内华达州，拉斯维加斯的独立乐队。 乐队主唱丹·雷诺斯是拉斯维加斯人，2008年在犹他州遇到吉他手韦恩·瑟蒙。当时主唱丹正在上学，而韦恩则已经从伯克利音乐学院毕业。在经历过数次阵容变化之后，乐队在拉斯维加斯正式成立。成员包括丹和韦恩以及新加入的本·麦基、安德鲁·托尔曼和布里特妮·托尔曼。乐队成员一起住在拉斯维加斯，并在那里录制发行了前三张EP。 乐队在2010年发行了两张EP《Imagine Dragons EP》和《Hell and Silence EP》 ，这两张EP都是在Battle Born Studios录制完成的。2011年，乐队又回到了这个录音室。在乐队签下唱片合约之前又录制了另一张EP《It\'s Time》。 IMAGINE DRAGONS诞生于普洛佛，是犹他州的当地乐队，之后转移到内华达的拉斯维加斯，在乐队一举赢得back-to-back奖杯之后，终于在2009年进入了录音棚。 他们于2010年发布了两张EP，IMNAGE DRAGONS EP和HELL AND SILENCE EP（混音部分由MARK NEESHAM完成），两张EP都在BATTLE BORN STUDIOS（拉斯维加斯很棒的录音棚）录音完成，不久后，他们受邀在13届拉斯维加斯年度食品音乐节参演，在当地电台107.9FM里被授予 “2010最受欢迎的乐队”的称号，被选为拉斯维加斯的超级头牌乐队，被拉斯维加斯周刊投票选为“最棒的本地独立乐队”，并被拉斯维加斯七本杂志选为 “2011年最棒的CD”。 IMAGINE DRAGONS在2011年11月签约了一家唱片公司，他们和制作人ALEX DA KID(曾为阿姆，蕾哈娜和帕拉莫做过音乐)关系十分亲密，并且加利佛尼亚西好莱坞的WESTLAKE 录音棚录音。 这支乐队受到BLUE MICROPHONE的认可，并出现在MTV\'s World of Jenks，The Real World: Las Vegas, The Real World: San Diego，CBS\'s Around the World for Free, TeenNick\'s Degrassi, AOL Jobs, Windows Media Player, MLS\' Real Salt Lake commercials, American Idol commercials, and notable hit predictors like CrazedHits.等各大音乐节目和网站中。');
INSERT INTO `tb_singer` VALUES ('57', 'Two Steps From Hell', '欧美组合/乐队', 'http://p1.music.126.net/nG3AaqQN4fMQ-Xwhf19Trg==/6027522744141514.jpg?param=130y130', 'Two Steps from Hell / 两步逃离地狱（又名 地狱边缘、地狱咫尺、两步逃离地狱、逃陷地域）成立于2006年3月，总部设于美国加州洛杉矶，是一家专业的音乐制作公司，Two Steps from Hell (以下简称TSFH) 是由尼克·菲尼克斯和托马斯·J·柏格森共同创办，他们创作的音乐类型属于SOUND TRACK（原声配乐），而现在此公司属于HANS ZIMMER (汉斯季莫) 旗下的RC公司所拥有。 声乐是TSFH老板托马斯的招牌元素，这使得他们的音乐风格大气壮观、雄浑有力又不失细腻，能在百转千回之余，依然刻划宏伟的景深。也因其音乐风格有时犹如史诗般雄浑，有时带着些黑暗诙谐的冷冽，又有些激昂澎湃的奔腾、或时有恐怖阴郁的重击。多样而广阔的风格，使得TSFH所创作的音乐常被用来制作电影广告及预告的配乐。也因为超高的使用率，所以成立仅短短两年就已经在好莱坞名声大噪。诸如许多耳熟能详的电影: 《香水》、《全面启动》、《移动世界》、《血钻石》、《国家宝藏》、《恶灵古堡》、《黑暗元素：黄金罗盘》、《瓦力》、《绿巨人浩克》、《荷顿奇遇记》、《少年汉尼拔》、《达芬奇密码》 、《我是传奇》、《暮光之城》、《澳大利亚》、《墨水心》、《波斯王子》、《星舰迷航记》、《创：光速战纪》、《阿凡达》、《星尘传奇》、《史前一万年》、《2012》、《蝙蝠侠2：黑暗骑士归来》、《纳尼亚传奇2：贾思潘王子》、《神鬼奇航3：加勒比海盗》、《X战警3：背水一战》、《蜘蛛人3 》、《神鬼传奇3》、《纳尼亚传奇3：黎明行者号》、《法柜奇兵4》、《哈利·波特5：凤凰会的密令》 等等…的电影，皆有使用他们的乐曲。同样的，他们的音乐也被用于电玩游戏之中，如《质量效应2》、《暗龙纪元：序章》和英国电视剧《超时空博士》之中。同时，他们也把配乐作品挑选集结成非公开专辑，也因为很多经典好莱坞音乐都是出于其手，所以其中许多曲子听了都会有似曾相识的感觉。目前，该音乐公司已公开发行了《Invincible》、《Archangel》、《Legend》、《Sky World》等专辑，而特别的是一片原名为《Nemesis II》的专辑因不明原故改为《Illusions》，并以公司成员 柏格森之名发行。而他们的成名曲[勇敢之心]出现在2011年12月1日在马德里的世界青年日，再之后这首歌更被当作2012年欧洲锦标赛的开幕曲。随着与日俱增的人气，TSFH的乐曲也越来越常出现于收音机、网络影片、自制电影等 媒体之中，可谓新一代的音乐巨擘。 主创人员是 Thomas Bergersen（托马斯·伯格森）和Nick Phoenix（尼克·菲尼克斯）。托马斯的音乐刚柔并济，特别擅长柔中带刚，Female Vocal是托马斯的招牌，他的个人Solo专辑Nemesis无与伦比、震撼人心！Nick Phoenix（尼克·菲尼克斯），音频界著名的领军人物，很多专业的音频合成师、作曲家、音频导演对这个名字应该非常熟悉，因为他是著名的East West音色出品公司的两位创始人之一。他们的音乐大气恢宏，擅长史诗、动作、黑暗、恐怖、戏剧、喜剧等。 关于Two Steps From Hell的中文译名，国内网络上有“两步逃离地狱”、“逃出升天”、“逃陷地狱”、“地狱边缘”、“地狱咫尺”等诸多译名，但官方没有正式给出中文译名，在此不做统一。 Two Steps From Hell主要的预告片配乐作品里比较有名的包括《香水:一个杀人犯的故事》、《血钻》、《勇敢的人》、《老无所依》、《星尘》、《国家宝藏》、《生化危机》、《黑暗物质:黄金罗盘》、《史前一万年》、《霍顿与无名氏》、《少年汉尼拔》、《达芬奇密码》、《1408幻影凶间》、《我是传奇》、《加勒比海盗3》、《通天塔》、《理发师陶德》、《X战警3》、《刺杀神枪侠》、《蜘蛛侠3》、《心灵传输者》、《木乃伊3》、《哈利波特5》、《地狱男爵2》、《贝奥武夫》、《Wall-E》、《夺宝奇兵4》、《神奇绿巨人》、《纳尼亚传奇2》、《蝙蝠侠:暗夜骑士》、《暮光之城》、《圣安娜奇迹》、《澳大利亚》、《小鼠侠》、《墨水心》、《星舰迷航》等。[1]很多好莱坞电影预告片音乐都是他们的作品，包括2009年上映的的《2012》。看看这些作品就知道，这是一个实力超强的公司。同时，他们也把配乐作品挑选集结成专辑发行。其中许多曲子你听了都会有似曾相识的感觉。他们的音乐也被用在电子游戏之中，如《质量效应2》、《龙腾世纪：起源》等，在电影《纳尼亚传奇3：黎明踏浪号》、《阿凡达：特别版》预告片中，我们同样能听到来自Two Steps From Hell的配乐。');
INSERT INTO `tb_singer` VALUES ('58', 'Fall Out Boy', '欧美组合/乐队', 'http://p1.music.126.net/lPgsuTf0ma76HpXK8ff0jw==/109951163054786259.jpg?param=130y130', 'Fall out boy是来自芝加哥的一个乐队，组建于2001年，曾获格莱美提名。充满年轻活力朝气，畅快将庞克的不羁气焰完全释放，些许EMO风格夹带流畅声线， Fall Out Boy虽然和时下偶像团体般，在团名中加入个\"Boy\"字眼，但是，他们可完全不按牌理出牌，踢爆时下做作男孩偶像团体的面具，给你最热血的新世代之音！ 来自芝加哥的Fall Out Boy，却是在全美地下Hardcore乐界，窜升最快的一组抢眼年轻部队。由主唱/吉他手Patrick Stump、吉他手Joseph Trohman、贝斯手Peter Wentz及鼓手Andrew Hurley四人在2000年组织而成，夹带Metal-Core、Hardcore Punk等劲道，不时点缀出的流行音韵，都让Fall Out Boy的歌曲朗朗上口容易消化，充满旺盛精力所演出的舞台效果，皆是令台下乐迷为之疯狂的诱因。2001年自资发行DEMO带，引起广泛讨论，隔年偕同独立Emo乐团Project Rocket合力发行专辑，这时独立厂牌的兴趣随即蜂拥而至，2003年AMG送上四星半近满分专辑『Take This To Your Grave』，无强大宣传后盾下，狂销20余万的惊人数字，对Fall Out Boy而言，可是莫大鼓舞，很快的主流大厂纷纷丢出善意合作计画，几经评估花落环球音乐旗下名厂Island，日后大大小小的庞克音乐盛会上，都可看到Fall Out Boy身影，终於苦尽甘来的将他们音乐版图扩展至放眼国际！ 2001年，乐队发行了首张专辑《Fall Out Boy\'s Evening Out With Your Girl》。2002年，他们与另外一支EMO团体“Project Rocket”发表了一张合辑，之后很多独立厂牌都争先恐后地想要签下Fall Out Boy，他们最终选择了拉蒙的纵火唱片。 2003年，乐队的第二张专辑《Take This To Your Grave》发行，不但AMG网站给了这张专辑四星半的高分评价，没有费心宣传，这张专辑便创下20多万的惊人销量。此后Fall Out Boy开始被很多主流大厂所关注，而环球音乐旗下的名厂小岛唱片公司则成了乐队的新东家。 最近在美国公告牌排行榜(Billboard)上，他们有一首单曲《Sugar,We’re Goin Down》持续21周称霸单曲榜前10名，而他们的专辑《From Under The Cork Tree》也在专辑榜的前20名停留4个月之久。唱片公司请来了从重金属、另类摇滚、朋克等领域都赫赫有名的幕后高手尼尔·阿福隆(Neal Avron)主理，之前与威瑟(Weezer)、优质果冻(Good Charlotte)等乐队都与他有过合作，阿福隆的加入再加上乐队两位主将—吉他手/主唱帕特里克(Patrick)和贝司手彼德(Peter)谱写出的一首又一首狂暴而又不失旋律的歌曲，使《From Under The Cork Tree》成为Fall Out Boy所有唱片中制作最为精良的一张，极具可听性。尽管这支团体的队名里有男孩(Boy)一词，他们并不是一支偶像团体，他们是一支实力的情绪硬核(EMO)乐队。');
INSERT INTO `tb_singer` VALUES ('59', 'OneRepublic', '欧美组合/乐队', 'http://p1.music.126.net/n3sr7bNMdjILj44rYi7Y8g==/18828037115920682.jpg?param=130y130', 'OneRepublic（共和时代或称一体共和） 是美国的一个流行摇滚乐队，曲风pop-rock/indie/alternative。乐队成立是2004年科罗拉多州，几个成员都是受Ryan Tedder所影响，贝斯手Meyers，吉他手Filkins、Drew Brown，鼓手Eddie Fischer。2006年OneRepublic的天使专辑打破哥伦比亚纪录，而Ryan Tedder说 \"我要让人们喜欢.我不想有人说,\'噢, 他有一个漂亮的声音。灵魂人物Ryan Tedder从5岁开始就被他的音乐家父亲训练学习钢琴。Ryan希望他们的音乐能够像u2那样给人近似于宗教关怀的感悟，而不仅仅只是觉得主唱嗓音不错。 共和时代 2006年OneRepublic的天使专辑打破哥伦比亚纪录，而Ryan Tedder说 \"我要让人们喜欢.我不想有人说,\'噢, 他有一个漂亮的声音。灵魂人物Ryan Tedder从5岁开始就被他的音乐家父亲训练学习钢琴。Ryan希望他们的音乐能够像u2那样给人近似于宗教关怀的感悟，而不仅仅只是觉得主唱嗓音不错。 成员：Ryan Tedder，Zach Filkins，Eddie Fisher，Brent Kutzle，Drew Brown 从一支标准的地下乐队到后来有机会与Timbaland这样大师级的人物合作甚至被点名看好，不得不说是一种幸运， 而他们的Myspace也从2006开始始终保持着超高的点击率，这也彻底改变了乐队的环境，星路变的平坦，成为了Billboard的热门选择。这首 Apologize好像最好获得过Billboard排行版第二的成绩，而且还是最近的事。当然同样也有很多人是因为Timbaland Presents，Shock Value中优美感人的Apologize开始认识这支新鲜的乐队. 英美两地乐队的风格已从上世纪八九十年代的泾渭分明，慢慢转变为相互融会贯通，与一般美国乐队的粗线条不同，OneRepublic的音乐相当感性细腻，音质动人的Tedder一开腔便散发出像是Keane般的英伦摇滚气质，但也不乏坚毅强硬的阳刚之气。另一方面，OneRepublic的音乐也像Maroon5一样很重视节奏感，只不过Maroon5以摇滚融合Funcky，而他们则是渗入了R&B以及Hip-Hop节奏。 Ryan Tedder – 主音、吉他、电贝斯、钢琴、钟琴、爵士鼓（2002年至今） 乐队主唱 Zach Filkins – 吉他、和声、中提琴（2002年至今） Drew Brown – 吉他、电贝斯、钟琴（2002年至今） Eddie Fisher – 爵士鼓、打击乐器（2005年至今） Brent Kutzle – 电贝斯、键盘乐器、大提琴、和声（2007年至今） 已离开成员 Jerrod Bettis - 爵士鼓（2002年至2005年） Tim Myers - 电贝斯（2004年至2007年）');
INSERT INTO `tb_singer` VALUES ('60', 'Linkin Park', '欧美组合/乐队', 'http://p1.music.126.net/uxUY64QwAiri3NhBicA2fQ==/109951163050440275.jpg?param=130y130', '林肯公园（Linkin Park）是一组来自美国加利福尼亚州的摇滚乐队，由乐队主唱查斯特·贝宁顿，麦克·信田、贝斯手菲尼克斯·法雷尔、吉他手布莱德·德尔森、鼓手罗伯·巴登和DJ采样手约瑟夫·韩组成。 林肯公园在2000年以首张专辑《混合理论》（Hybrid Theory）在主流音乐市场上获得成功，专辑销售量超过2400万张。2002年11月发行第二张专辑《流星圣殿》（Meteora）。2002、2006年获得格莱美奖。2007年5月15日发行第三张专辑《末日警钟：毁灭·新生》（Minutes to Midnight） 。2010年，林肯公园发行第四张专辑《烈日千阳》（A Thousand Suns）。2012年，林肯公园推出第五张专辑《生命·进化·原点》（Living Things），于6月26日全球发行。2014年6月13日，乐队发行第六张专辑《狩猎聚会》（The Hunting Party） 。2017年5月19日，林肯公园发行第七张专辑《光芒再现》（One More Light）。同年7月，美国当地时间20日9点，乐队主唱查斯特·贝宁顿在住宅内上吊自杀。 演艺活动外，林肯公园还助力于慈善事业。2005年创立公益组织“Music For Relief”（MFR）。2008年为四川地震灾区提供援助。2011年获得联合国基金会颁发的“全球领袖”奖 。 Linkin Park——世界上最优秀的现场表演团体之一，你可以说以前从没有听说过，也可以用你对音乐对时尚最挑剔的眼光审视他们，但是无论如何，林肯公园的确是这个时代最独一无二的混种音乐霸王，对流行金属、Hip-Hop、Post-Grunge、说唱金属、Alternative Metal、等各种风格的诠释早已在全球大放异彩，尽情炫出E时代音乐风情。他们博采众家之长，容各派之精华，不经意间，首张大碟《Hybrid Theory》 狂卖2，400万张，销量惊人。终成大器的Linkin Park在世界范围内狂掀阵阵Linkin热浪，引发一场场“时尚风暴”。也因为乐队成员的亚裔血统而使亚洲不甘人后的新一代青年发现自身力量 Linkin Park带给我们的不仅仅是混合的音乐、前卫的时尚、触动心灵的呐喊，在它的身后更是新时代年轻人自由、博大、包容、无可限量的精神世界。 现任成员 【主唱1】查斯特·贝宁顿(Chester Bennington) 【主唱2】麦克·信田(Mike Shinoda）（主要是说唱、和声，监管吉他、键盘、采样、钢琴） 【鼓手】罗伯·巴登(Rob Bourdon) 【吉他手】布莱德·德尔森(Brad Delson)（节奏吉他、采样器） 【贝斯手】大卫·菲尼克斯·法雷尔（David PhoenixFarrell)（贝斯、采样器。原名大卫·法雷尔，在团内名称「菲尼克斯」(Phoenix)，曾经初始创团的一段时间离团担任其他乐团的贝斯手等六人。） 【采样】约瑟夫·韩(Joseph Hahn) 离任成员 【主唱】马克·维克菲尔 【贝斯手】史考特·克佐 【贝斯手】凯尔·克里斯坦 1993年，查斯特·贝宁顿与友人在亚利桑那州的菲尼克斯组建了灰色眩晕（Grey Daze）乐队。 1996年，身为学校同窗的主唱麦克·信田与布莱德·德尔森在麦克的卧室兼迷你录音室录下第一首歌，两人随后结识了罗伯·巴登和菲尼克斯·法雷尔，他们同为住校室友。菲尼克斯·法雷尔在大学毕业后曾一度离团，一年后重新归队，初步组建为Xero乐队。 1998年，查斯特因不满灰色眩晕乐队的一些人而离开了那支乐队，此时正值Xero被各个唱片公司拒绝签约而面临解散，麦克决定刊登广告公开招聘主音歌手，而查斯特因为野性的咆哮，成为了乐队中的主唱。乐队亦改名为“混合理论”——即他们首张专辑的名字。但是，他们却发现同名乐队已经存在。恰巧此时乐团途径芝加哥，大都市的繁荣喧嚣深深感染了乐队的六位年轻人，他们决定，以芝加哥著名的”林肯公园“（Lincoln Park）作为乐队的名称。当他们准备申请网站时，却发现申请“Lincoln Park”这个域名的开支无法承受，所以他们改了拼写，从而变成了Linkin Park[8]  。 1999年查斯特加入乐队，但乐队又足足吃了42回闭门羹，办过无数次地下演唱会却均以失败告终。2000年，乐队赌气把他们的一支单曲《One Step Closer》发布到了互联网上，结果这首歌却意外地在网上获得关注，Yahoo的歌迷讨论区一周之内涌入了上千篇评论，更让华纳兄弟唱片公司看到了这支乐队的潜力。终于，乐队在2000年得以和华纳兄弟正式签约。 2000年，林肯公园发行他们的第一张录音室专辑《混合理论》（Hybrid Theory），共收录12首歌，在全球范围内销量突破2400万张。 2001年，林肯公园被邀请与众多艺人参加Ozzfest巡演。之后，乐队也组织了自己的定期巡演——工程革命（Project Revolution）。6月，参加“Rock Am Ring”2001摇滚音乐节。同年年底，华纳兄弟推出《混合理论》的双张全球庆功版，其中添加了乐队的演出现场录音，以及两首歌曲《My December》和《High Voltage》。这一年，乐队做了324场的现场表演 。 2002年，林肯公园和众多歌手合作发布了一张重混音专辑《重生》（Reanimation）[12]  。2月27日，乐队在格莱美奖评选上共获得3项提名，并最终凭借单曲《Crawling》获得最佳硬式摇滚演出奖。8月30日，MTV音乐录影带大奖在纽约揭晓，林肯公园凭借单曲《In The End》 获得3项提名，并最终获得最佳团体音乐录影带奖  。 2003年1月13日，乐队当选全美音乐奖最受喜爱另类艺人。3月，乐队发行第二张录音室专辑《流星圣殿》（Meteora），发行首周便登上美国公告牌专辑榜榜首。单曲《Figure.09》还成为了美剧《反恐特警组》的插曲。8月28日，MTV音乐录影带大奖在纽约举行，乐队分别凭借单曲《Somewhere I Belong》、《Breaking The Habit》获得了最佳摇滚音乐录影带奖与观众票选大奖。同年与众多乐队参加2003夏日疗养巡演，乐队在巡演后节选了一些在德州演出的片段，制成了现场专辑《德州现场》（Live in Texas）。 2004年，林肯公园开始了他们的专辑巡演，并参加“Rock Am Ring” 2004摇滚音乐节。11月30日，乐队和美国嘻哈说唱教父Jay-z合作发行了第二张混音专辑《冲击理论》（Collision Course） 。 2005年，专辑《重生》中的单曲《krwlng》（即Crawling的混音版本）成为美剧《越狱》第二季的官方主题曲[9]  。 2006年，林肯公园在Youtube的乐队帐号上开设了一个叫做“LPTV”的栏目，专门播放乐队的录像、新闻以及MV和歌曲的幕后制作，后来这些视频被移植到了乐队的官网上。单曲《In Pieces》被选为电影《寂静岭》的插曲，而与Jay-Z合作的《冲击理论》中的单曲《numb encore》则被电影《迈阿密风云》选取作为背景音乐，并于同年的格莱美奖评选上获得年度最佳说唱合作奖。此外，乐队还在颁奖典礼上与Jay-Z以及披头士乐队主唱保罗·麦卡特尼联合献唱了歌曲《Yesterday》。 2007年，发行专辑《末日警钟：毁灭·新生》（Minutes to Midnight），上市首周即以62万张的销量登顶公告牌专辑榜 。在这张专辑中，乐队减轻了标志性的金属在曲目中的比重。同时，专辑中的单曲《What I\'ve Done》被选作电影《变形金刚》的主题曲，而单曲《Leave out All the Rest》则被选为电影《暮光之城：暮色》的片尾曲  。同年9月，MTV音乐录影带大奖颁奖典礼在美国拉斯维加斯举行，乐队获得包括最佳音乐录影带剪辑在内的5项提名。 2008年，林肯公园发行了第二张现场专辑《革命之路：米尔顿凯恩斯现场》（Road to Revolution），选取的是在英国米尔顿凯恩斯的演出，并且在演出中，Jay-z也登台献唱。汶川地震后，林肯公园原计划来中国和五月天同台举办赈灾巡演，但因为乐队主唱查斯特·贝宁顿背伤复发，计划被迫取消  。 2009年，林肯公园再度携手《变形金刚》系列，为电影《变形金刚：堕落者的复仇》创作并演唱主题曲《New Divide》 。 2010年，乐队和美国Artificial Life合作开发了一个面向iPod/iPhone/iPad平台的横版过关游戏“Linkin Park 8-bit Rebellion”，并制作了一些歌曲的相应的8-bit版本，同时通过游戏发布主题曲《Blackbirds》。乐队还联合MySpace网站推出了一个名为“林肯公园邀请你”的推广活动，优胜者可获得参与制作第四张专辑的机会。9月，乐队发行了第四张录音室专辑《烈日千阳》（A Thousand Suns）。其中，单曲《催化剂》（The Catalyst）不仅被美国艺电公司选中作为游戏《荣誉勋章2010》的主题曲，还被华纳日本选中作为游戏《机动战士高达 EXTREME VS》的主题曲；单曲《彩虹光芒》（Iridescent）则被电影《变形金刚：月黑之时》选中作为主题曲 。 2011年7月，乐队单曲《Black out》、《Crawling》、《Numb》被选为游戏英雄联盟的系列主题曲[24]  。 2012年6月，在查斯特背伤康复之后，乐队发售了第五张录音室专辑《生命·进化·原点》（Living Things），发行首周即获得美国公告牌专辑榜冠军，成为21世纪首支5张专辑获得公告牌专辑榜冠军的乐队（分别是《Meteora》、《Minutes to Midnight》、《A Thousand Suns》、《Living Things》以及同JAY-Z合作的《Collision Course》） 。其中，单曲《Burn It Down》被特纳电视网（TNT）选为2012年NBA季后赛主题曲。《Powerless》被选为《吸血鬼猎人林肯》的主题曲。同年，乐队于2009年发表的单曲《New Divide》在YouTube上的点击率突破10亿次，使得乐队成为全球第一个在YouTube点击率超过10亿的摇滚团体 。 2013年，乐队继续着全球巡回演唱会，美国艺电公司也将《生命·进化·原点》这张专辑中的《Castle Of Glass》作为其游戏作品《荣誉勋章：战士》的游戏主题曲，并且乐队还配合游戏的发售拍摄了主题MV  。11月，发行第三张混音专辑《电能补给》（Recharged），专辑一发布便登上10国iTunes专辑榜第一名，其中的单曲《A Light Never Comes》与Steve Aoki合作，一经推出便空降单曲试听iTunes榜首 。 2014年，单曲《Roads untraveled》被选为电影《极品飞车》的片尾曲。6月13日，乐队发售专辑《狩猎聚会》（The Hunting Party） 。 2015年4月，乐队再次与Steve Aoki合作，发行单曲《Darker Than Blood》。7月，乐队开启中国巡回演唱会。此次巡回演唱会总投资规模接近8000万元，为欧美艺人来华演唱会投资金额最多纪录 。 2017年，乐队与Kiiara合作发布单曲《Heavy》，正式宣告回归。此外，乐队成军以来的第7张录音室专辑《光芒再现》（One More Light）也于同年5月19日发行，发行首周登顶美国公告牌专辑榜冠军，这也是乐队第六张全美冠军专辑 。7月20日，乐队主唱查斯特·贝宁顿被发现在加州洛杉矶的住宅内自缢身亡，年仅41岁。就在查斯特自杀消息传出时，林肯公园官方发布了新歌《Talking To Myself》的MV 。 2005年，Linkin Park创立公益组织——Music For Relief（简称MFR） 。截至2013年底，MFR已募集善款超过500万美元，已在全球范围内植树超过100万棵，减少碳排放（二氧化碳）约合455千吨，为全世界受灾者提供帮助。 2007年12月，乐队通过MFR发起了一场援助孟加拉国热带风暴灾区人民的爱心义卖活动，活动募集的全部善款将全部发放到受灾地区。 2008年8月，林肯公园“Projekt Revolution”巡回演唱会在科罗拉多州举行，演唱会以强调环保意识的方式来进行。每卖出一张票，他们就要种一棵树，呼吁世人重视环保议题。 2008年10月，乐队原计划把MFR演唱会带到上海、武汉和北京。此次演唱会的主题为关注地球变暖，关注四川地震的慈善主题，同时通过演唱会为中国四川地震地区灾后重建工作提供援助。但因为乐队主唱查斯特·贝宁顿背伤复发，演唱会被迫取消。 2010年海地地震发生后，乐队在MFR官网上开设了一个叫做“捐赠下载”的页面，支援海地地震的救灾重建工作，只要有人为海地捐献了一定数目的善款，他就可以下载一张名为《Download to Donate for Haiti》的音乐合辑。乐队创作了歌曲《Not Alone》，将其作为其中的曲目供捐款者下载。 2011年，乐队与联合国基金会共同发起设立了“为世界提供动力”项目（Power The World），旨在推动可持续能源的发展，于2030年前实现能源的普遍获取[34]  。同年，乐队收到来自联合国秘书长潘基文的感谢信，感谢他们连续13个月为海地受灾地区的赈灾义举。2011年11月，乐队获得联合国基金会颁发的“全球领袖”（Global Leadership Award）荣誉。潘基文还邀请乐队成员前往联合国总部并接见了他们。 2013年，乐队发动并联合多支乐队举办了“Concert for the Philippines”慈善演出，旨在募集资金帮助因强台风“海燕”而受灾的1200多万菲律宾人民 。');
INSERT INTO `tb_singer` VALUES ('61', 'Owl City', '欧美组合/乐队', 'http://p1.music.126.net/j4uXFu5urMRWpyMCe0pk1g==/18561955301752001.jpg?param=130y130', '猫头鹰之城乐队（Owl City）是一支来自美国明尼苏达州的电子音乐乐队。乐队仅由一名成员组成：亚当·扬（Adam·Young）。亚当·扬于2007年创建了该乐队，并且担任乐队的主唱、编曲、创作、混音合成工作。Owl City的音乐飘逸、灵动，既有梦幻的神秘色彩，又有电子音乐的动感节奏。Ocean Eyes专辑中的主打歌曲《Fireflies》一经推出就登上了各大音乐电台以及音乐榜单的冠军宝座，受到乐迷的热烈追捧。 Owl City音乐中那对于活泼的电子节奏的神奇混音和丰富的旋律 最初是在他父母的地下室中创作出来的。他在《Fireflies》的MV中再现了这一场景，这首MV描绘的是一个和善的歌手在他理想中的地下室环境中表演他的歌曲。这支MV在Youtube上拥有令人惊讶的超过850万的点击量，在VH-1电视台和其他电视机网络平台上有超高的播放量。从人口仅为22，000的明尼苏达小 城走出来的Adam Young，用歌声传达了一种异常简单快乐的情绪，但正是这样的小情绪却牢牢抓住了听众的耳朵和心灵，成为当今纷繁乐坛的一股清新潮流。他管他自己家的地 下室叫“山洞”，他在那里制作了专辑中大多数歌曲，包括《Cave in》， 《Umbrella Beach》， 《Dental Care》和登上iTunes榜单的《Vanilla Twilight》。 Adam也自我承认，他的声音就像少女倾诉心事一样温文细气，但对旋律节奏的掌握却十分到位.专辑以欢快的电子旋律征服了不少听众，象宝石般闪烁明亮.而首张专辑Maybe I\'m Dreaming在演绎方面Owl City显然更加投入，从精致的和声到深情的合唱，Owl City的个人魅力也越加凸现.甜蜜的声线清新的电子音乐，这貌试简单的配搭却被Owl City演绎得绚丽多彩，尽管夏日未到但已仿佛感受到那份清爽的惬意。[1] 来自美国明尼苏达州奥瓦通纳的大学二年级生Adam Young，他深受80年代欧洲电子合成器和新浪潮音乐的影响，于2007年组建了Owl City乐队，他是这支流行电子乐队的唯一成员，负责主音、合成器和编曲等工作。Adam Young称自己为一个“害羞的孩子”，他从2007年开始从事音乐行业。在签约环球音乐之后，唱片公司通过广播、网络和电视在内的全方位的媒体支持，将他这种带有快乐催眠力量的歌曲渗透到了全美国人们的日常生活中。[1] 猫头鹰之城乐队(Owl City)的音乐风格是当下最为流行、时尚的电子混音音乐，但不同于传统的电子舞曲所 Owl City演唱会现场 营造出的喧闹、躁动不安的动感音乐氛围，猫头鹰之城乐队的电子音乐通过使用简单的电子乐器，摒弃了电子舞曲的乐器混杂使用，通过亚当·扬空灵飘逸的嗓音和精致的和声，从而把广大乐迷带入了充满梦幻色彩并且活泼、跃动的音乐奇异王国。猫头鹰之城乐队的音乐风格在很大程度上受到了Disco 和欧洲电子音乐（European Electronic Music）的影响。同时，在乐队的音乐中还能听到合成器流行音乐（SynthPop）和新浪潮音乐（New Wave Music）的众多元素。 Owl City最大的特点就是电音与主唱声线的平分秋色，二者比例协调的恰到好处，完美的勾勒出不落俗套的小清新画面，致使一开始听并不能很快分辨出是男声还是 女声，但却不令人反感，上口动人的旋律反而让人爱不释手，欲罢不能，说来也奇怪Owl City的声音有种奇妙之处，冬季听有种温暖质感，夏季听又有一种凉爽畅快，这样的特质还真是不可多得，也很难想象这样充满欢快感觉的作品都是Adam在 地下室里为了避免失眠而创作出来的，也许是因为防止失眠，便多了梦境一般的童话特质。');
INSERT INTO `tb_singer` VALUES ('62', '米津玄師', '日本男歌手', 'http://p1.music.126.net/28e5ODJRXYLhZ6s3seFoMQ==/109951164021265258.jpg?param=130y130', '米津玄师（1991年3月10日－），是日本的音乐家、创作歌手、插画家、摄影师。出生于德岛县德岛市。血型O型。另有发表笔名“Hachi（ハチ）”。在第57回日本唱片大奖获得优秀专辑奖。 中学二年级至高中时期参加乐团，但与团员在创作方向和型态上不合，遂在网络独自发表乐曲。最初发表的乐曲皆为自作自唱，更新电脑设备后开始使用 DTM 电子软件制作音乐。 2009年，使用VOCALOID软件（初音ミク、巡音ルカ、Megpoid 等）创作歌曲并附上手绘影片，以“ハチ”名义投稿作品一夕成名，至今已累积七首VOCALOID创作歌曲拥有百万点阅率，发行两张自主制作CD。 2010年，参与“南方研究所”独立动画制作社团、合作音乐录影带。 2011年，加入网络音乐家所组成的音乐公司“BALLOOM”。 2012年，以本名“米津玄师”发行第一张个人专辑《diorama》，作词、作曲、编曲、演唱、演奏、混音到宣传动画和专辑设计皆由自己一手包办，获得ORICON唱片周间排行榜第六名、入选第五回CD店大奖。 2013年，加入日本环球唱片，发行第一张单曲《Santa Maria》正式商业出道。 2016年，加入日本索尼音乐。为动画三月的狮子制作动画片尾曲《Orion》，并于同年发行第六张同名单曲《Orion》。同年发行第七张单曲《Peace Sign》，主打歌曲为动画《我的英雄学院》第二期主题曲。 2017年，发行第四张录音室专辑《BOOTLEG》。 2018年，为日本连续剧《UNNATURAL》制作主题曲《Lemon》并于同年发行第八张同名单曲。10月31日发行第九张单曲《Flamingo/TEENAGE RIOT》。12月31日出演《第69回NHK红白歌合战》。 2019年，1月19日至3月11日期间日本展开巡演《米津玄师 2019 TOUR / 当脊椎化作蛋白石》。3月19日，首次来上海演出。 原以VOCALOID音乐家成名的米津玄师，认为“不想藏在VOCALOID的隐形斗篷里头”，因而使用本名发行个人专辑。在NICONICO动画网站投稿的影片，也确实分类为“ハチ”和“米津玄师”两方作品。加入环球唱片，则是抱持“和拥有相同热量、相同方向的人们一起制作音乐会是最正确的姿态”的理念，决定加入商业音乐公司。 米津在访谈表示自己喜欢的音乐风格是 BUMP OF CHICKEN，歌词音韵和世界观则受到三岛由纪夫、宫泽贤治等文学作品影响。');
INSERT INTO `tb_singer` VALUES ('63', 'DAISHI DANCE', '日本男歌手', 'http://p1.music.126.net/gxL5_d0N-d_ECgpv17WTkQ==/109951164061543352.jpg?param=130y130', 'DAISHI DANCE，一位在日本，乃至世界，都享有盛誉的DJ。他来自日本北海道，曾为滨崎步、中岛美嘉打造过mix版本的HEAVEN和SAKURA~花霞，他的标志是：如涓涓流水般细腻，流畅的钢琴伴奏；表演时惯用3台turntable混音；将哀愁与优雅发挥得淋漓尽致。在不破坏原曲优美旋律的前提下,融入house音乐的热烈与奔放。旋律优美，音色悦耳，很轻柔又不失动感，用来放松或是跳舞都很合适。 2009年对于日式的电子音乐而言，都有不少佳作产生，无论是现在大家都很热衷的Jazzy Hip Hop还是其他类型，都有不少可圈可点之作。而在年末，Daishi Dance作为从日本札幌出道的制作人，以独特的House音乐风格在年末再次获得了许多人的关注和好评。 Daishi Dance在2007年开始就逐渐的以单曲的形式逐步的在电子乐坛慢慢的树立了自己的风格。无论是自己的Solo式作品还是和别人合作的Remix都有非常精彩的表现。 而在09年岁末，Daishi Dance的全新创作专辑Spectacle再次集合了诸多日本一线音乐人一起为乐迷献上了一份绝对令人享受的音乐大餐。 第一波主打歌Memory，这首歌合作的可谓是日本当下最火的女歌手-中岛美嘉。可能大多数中国乐迷还是多从日本电影《Nana》中认识的这位日本女歌手，而中岛美嘉当前在日本的人气指数是非常之高。Daishi Dance与中岛美嘉的合作，让中岛美嘉在一个全新的领域尝试了一种精彩的可能性。也让Daishi Dance将一首House作品呈现出了非常精致和典雅的感觉。 接下来，我们看到Daishi Dance与日本首席小提琴加金原千惠子合作的专辑同名主打曲Spectacle，其实早在2008年，金原千惠子的专辑Sweet Day之中就已经收录过她和Daishi Dance合作的一首Romance for Strings。这次由她再来主打Daish Dance的旋律更表现出了Daishi Dance在音乐中兼容并包的多面手身份。 而接下来这张专辑的另一亮点就是Daishi Dance与吉田兄弟及井上鉴的合作-Renovation。其实熟悉日本New Age乐坛的人都很庆祝，吉田兄弟是当下日本最杰出的New Age音乐制作人，他们将日本的传统民族音乐与当代流行乐之间嫁接成功的作品非常多。而这次Daishi Dance与他们一起合作的这首Renovation则是将日本三味线这个传统而古老的乐器赋予了全新的表现形式。让三味线成为House音乐旋律的主角，仿佛在传统与潮流之间架起了一座鸿沟，深游在古代与现代之间。 另一个令人叫绝的合作就是Daishi Dance与已故音乐大师姬神之间的合作—Sunset in the Lake。作为姬神的主要成员之一星吉昭虽然已经在2004年与世长辞，但是这次Daishi Dance与当时姬神的成员星吉纪参与制作并完成，虽然我们无从寻找当初姬神在音乐中的影子，但是星吉纪的参与还是让我们感受到了一种时空穿梭的绝妙感受。尤其是这首作品中女声的吟唱仿佛在构建一个跨越生死的桥梁，让Dashi Dance精彩的制作手段打通与逝者之间沟通的通道。 这次Daishi Dance的合作对象还包括韩国时下人气非常高的女歌手—吴志恩。这个以韩剧出名且演、歌俱佳的歌手这次在Daishi Dance的专辑之中演唱了一首Journey to the Sky。其实原因很简单。第一，吴志恩卖座，第二，相比之下，对英文的发音，韩国人会比日本人的更好。Daishi Dance成功的在这张专辑之中把吴志恩打造成了一个电子音乐之中出色的Sound Toy，也为吴志恩发展个人事业提供了另一个可能的道路。 综合的看来，Daishi Dance此张专辑绝非偶然邀请到了这么多出色的艺人与之合作，从以往Daishi Dance的合作名单看来，他的身边就已经聚集起了一大群出色的音乐人与其一起合作各种不同的音乐。而这次Daishi Dance真的是拿到了最高的人气，以他现在的发展势头，他势必将成为日本电子音乐中最大的赢家，因为在日本的流行音乐史上也确实没有人能够获得如此高的支持。因此，我们拭目以待，Daishi Dance会带给我们的更多精彩。');
INSERT INTO `tb_singer` VALUES ('64', '高梨康治', '日本男歌手', 'http://p1.music.126.net/zyDcnvLfS22JNqtqYkcWwQ==/3439272376857848.jpg?param=130y130', '高梨康治，日本作曲家、编曲家、键盘演奏者；和风硬摇滚乐队“六三四Musashi”的成员之一。早年曾在J.D.K.BAND等诸多摇滚乐队中活跃。因格斗大会PRIDE的主题曲为人熟知后，逐渐开始涉及剧伴音乐。现今主要致力于动画音乐的制作工作，《火影忍者》、《光之美少女》、《妖精的尾巴》、《地狱少女》等一系列知名动画中的经典曲目皆是出自他的手笔。 舞台生涯 少年时期的高梨康治因酷爱重金属音乐而开始了吉他的练习。在当时，能像Ritchie Blackmore(Deep Purple、rainbow乐队的吉他手)那样无拘无束的活跃在舞台中是他唯一的梦想。不过成年后的他经过一番深思熟虑，最终还是转向了键盘演奏。 1983年4月，刚满20岁的高梨康治与清水保光、铃木顺一两位友人在琦玉县成立了重金属乐队“Hellen”，开始了他的地下乐队生涯。当时乐队主要在关东领域活动，一度与关西成立的重金属乐队“Terra Rosa”齐名，成为摇滚乐迷之间津津乐道的话题。 八十年代末Hellen解散后，高梨加盟了J.D.K BAND，在此期间他主要参与了乐队的专辑录制和一些相关游戏   J.D.K BAND时期的高梨康治(右一) 音乐会的现场演奏。1992年，硬摇滚乐队“PLANET EARTH”结成，高梨康治与Hellen时期的老搭档清水保光也参与了其中，正式签约出道——遗憾的是，在1993年发表初张专辑《BIG BANG》后不久，乐队就因个中缘由解散了。恢复自由身的高梨康治曾一度退居幕后，参与了包括原SHOW-YA成员寺田惠子在内的一些摇滚音乐人的专辑制作。直到1997年加入了和风硬摇滚乐队“六三四Musashi”后，他才得以重新活跃在舞台之上，并跟随乐队到海外进行过多场演出，博得了众多喝彩。 2002年，在一位友人的撮合下，高梨与六三四原太鼓师茂户藤浩司成立了硬摇滚乐队“刃yaiba”。不过他并未脱离六三四，而是同时进行了两个乐队的活动。 幕后故事 因格斗大会PRIDE的主题曲一鸣惊人后，高梨康治一举参与了众多格斗比赛的主题曲制作，各类配乐相关的委托也纷纷接踵而至。伴随着六三四乐队的活动终止与日益增多的剧伴工作，高梨康治不得不阔别他万分憧憬的舞台，终日在录音室中忙碌。即便如此，他依旧觉得这是另外的一种幸福。“要知道，这个世界有这么多人在电视机前听着我写的音乐!这是在我少时连做梦都想象不到的事情。” 火影忍者疾风传剧场版（2007年）※刃-yaiba- 另外身份参加 火影忍者疾风传剧场版 牵绊（2008年）※刃-yaiba- 另外身份参加 咯咯咯鬼太郎（2008年） 光之美少女 All Stars DX 大家都是朋友☆奇迹的全员大集合！（2009年） 火影忍者疾风传剧场版 火意志的继承者（2009年）※刃-yaiba- 另外身份参加 FRESH光之美少女！玩具王国有很多秘密！？（2009年） 光之美少女 All Stars DX2 希望之光☆守护彩虹宝石！（2010年） 火影忍者疾风传剧场版 失落之塔（2010年）※刃-yaiba- 另外身份参加 Heartcatch 光之美少女：超级时尚秀在花之都...真的吗！？（2010年） 火影忍者疾风传剧场版 染血的囚徒（2011年）※刃-yaiba- 另外身份参加 Suite 光之美少女♪ 夺取回来！连结心中的奇迹旋律♪（2011年） 光之美少女 All Stars New Stage 未来的朋友（2012年） 电影 Smile 光之美少女! 儿童图画书里的世界都不协调！（2012年） 电视动画·OVA 火影忍者动画（2002年-2007年）※以六三四Musashi的名义 战斗陀螺 G-REVOLUTION)（2003年） 新 北斗之拳（2003年） 杀戮都市（2004年） それいけ!ズッコケ三人組（2004年） 韦駄天翔（2005年-2006年） 地狱少女（2005年-2006年）※与水谷广实共同 怪 ayakashi（2006年） ぽかぽか森のラスカル（2006年）※与水谷广实共同 地狱少女 二笼（2006年-2007年）※与水谷广实共同 完美小姐进化论（2006年-2007年）※与水谷广实共同 鸟的歌（2007年） 一骑当千 Dragon Destiny（2007年） 火影忍者疾风传（2007年-）※以刃-yaiba-名义参加 奔向地球（2007年） 濑户的花嫁（2007年） 物怪（2007年） 淘气小亲亲（2008年） 