INSERT INTO `tb_singer` VALUES ('65', '久石譲', '日本男歌手', 'http://p1.music.126.net/QyLSKOuyTI3vWMQgcyJbGA==/3275445145346068.jpg?param=130y130', '久石让，日本著名作曲家、歌手、钢琴家，以担任电影配乐为主，是宫崎骏作品中不可欠缺的配乐大师，从宫崎骏的《风之谷》至《悬崖上的金鱼公主》的二十多年间所有长篇动画电影的音乐制作，更与北野武是黄金组合，创作了《坏孩子的天空》、《花火》、《菊次郎的夏天》、《大佬》等佳作的配乐。1981年久石让推出第一张专辑《Information》，确定了自己的音乐风格。1983年，经人介绍，久石让结识了宫崎骏，并为《风之谷》配乐，让当时不太有名的久石让受到了公众的注目，1985年宫崎骏创建“吉卜力”工作室后，久石让便一直担当宫崎骏动画的音乐监督至今。主要配乐作品有《天空之城》《龙猫》《菊次郎的夏天》等。 4岁时久石让在铃木镇一的音乐教室里开始学习小提琴，之后在中学里的演奏部社团里担任吹奏小号的位置，并在此时期兴起从事作曲家的念头。 后续1969年久石让进入国立音乐大学就读作曲科，并在校内教授岛冈让名下学习。而大学期间久石让开始受到简约音乐的风格影响，并曾尝试分析菲利普·格拉斯或特里·赖利等简约音乐乐家的作品内容。 自大学毕业后，久石让首次接手配乐的事务是在1974年替改编自园山俊二漫画作品的电视动画《山林小猎人》配乐。之后在1981年发行了第一张监制的专辑《MKWAJU》，另个人第一张专辑《Information》则在1982年推出。在此期间久石让以个人本名“藤泽守”名义发表居多，而个人的事务所“Wonder City”（ワンダーシティ）则同在1982年成立。 之后因动画室TOP Craft企划推出电影动画《风之谷》，该片的导演宫崎骏及制作人高畑勋舍弃原先计划好的配乐人名单，决定采用推荐的人选久石让负责该作品的音乐内容，而久石让也因替《风之谷》配乐后开始获得关注，并后续多次为宫崎骏在吉卜力工作室执导的动画配乐。另久石让也多次获得北野武及大林宣彦等电影导演邀约，为他们的作品构思音乐。 在1992至1994年期间，久石让创下了连三年在日本电影金像奖夺得音乐大奖的成绩。并在1998年受邀担任长野身障奥运会的开幕演出。而久石让首次尝试执导的电影，则为2001年由袴田吉彦主演的《四重奏》（Quartet カルテット）。 除持续为日本的电影、动画配乐及举办个人演奏会外，2004年后久石让开始尝试接案亚洲其它地方拍摄电影的配乐工作，其中为2005年韩国电影《欢迎来到东莫村》制作的配乐，创下首位以日本人身份在大韩民国电影大奖上获得最佳音乐奖的记录，而另一接手的2007年港片《姨妈的后现代生活》，也得到第27届香港电影金像奖的音乐大奖。 1992 第15届日本电影金像奖 最优秀音乐奖 那年夏天，宁静的海 1993 第16届日本电影金像奖 最优秀音乐奖 青春デンデケデケデケ 1994 第17届日本电影金像奖 最优秀音乐奖 奏鸣曲 1998 第48届艺术选奖新人赏 大众艺能部门 1999 第17届JASRAC奖 铜奖 幽灵公主 1999 第22届日本电影金像奖 最优秀音乐奖 花火 2000 第23届日本电影金像奖 最优秀音乐奖 菊次郎的夏天 2002 第30届安妮奖 最佳动画音乐奖 千与千寻 2002 第16届日本金唱片大奖 年度动画专辑 千与千寻 2003 第21届JASRAC奖 金奖 千与千寻 2005 第31届洛杉矶影评人协会 最优秀音乐奖 哈尔移动城堡 2005 第4届大韩民国电影大奖 最优秀音乐奖 欢迎来到东莫村 2006 ACC广告大奖 最佳音乐奖 三得利茶类饮品“伊右卫门”广告 2007 第21届JASRAC奖 金奖 哈尔移动城堡 2008 第27届香港电影金像奖 最优秀音乐奖 姨妈的后现代生活 2009 第32届日本电影金像奖 最优秀音乐奖 悬崖上的金鱼公主 2009 第23届日本金唱片大奖 年度最佳原声带 悬崖上的金鱼公主 2009 第23届日本金唱片大奖 年度器乐作品 Piaon Stories Best \'88-\'08 2009 - 紫绶褒章- 2011 第34届日本电影金像奖 最优秀音乐奖 恶人 2011 国际电影音乐批评家协会奖 电子游戏部门最佳原创音乐 第二国度 白色圣灰的女王 2013年：第36届日本电影金像奖 优秀音乐奖（《天地明察》） 2014年：第16届国际电影配乐评论家协会奖（IMFCA） 动画类最佳原创音乐奖（《起风了》） 2014年：第37届日本电影金像奖 最优秀音乐奖（《起风了》） 2014年：第38届日本电影金像奖 优秀音乐奖（《小小的家》）