INSERT INTO `tb_singer` VALUES ('69', '高橋優', '日本男歌手', 'http://p1.music.126.net/QIQ3EG5cMJffq-lrzrtjQg==/109951164249633701.jpg?param=130y130', '高桥优（日语：高橋 優／たかはし ゆう Takahashi Yu，1983年12月26日－），日本创作男歌手，出生于日本秋田县横手市。 札幌大学入学同时开始在路边吉他弹唱。 2002年2月自主制作专辑《Sepia》200枚。 2007年5月自主制作专辑《无言的暴力》500枚。 札幌的榜单3周连续第一位。 首次在札幌个人活动动员200人。 2008年在东京独自活动。 2008年演唱会限定发售专辑《胡座~agura~》。 2009年5月13日发售单曲《小孩之歌》。 2009年7月8日全国发售专辑《我们的平成摇滚》。 2010年7月21日单曲《美好的日常》发售，并宣布自己正式出道。 2010年10月16日为日剧《Q10》配唱主题曲《真正的心情》。 2011年2月23日发售单曲集《福笑い/现実という名の怪物と戦う者たち》。 2011年2月26日在美国纽约中心街头开mini演唱会。 2011年4月3日配信发售单曲《少年であれ》。 2011年4月20日发售专辑《リアルタイム・シンガーソングライター》。 2011年5月28日举行首个全国巡回演唱会。以爱知县为首站共全国8市巡回演唱。 2011年6月29日发售单曲《誰がために鐘は鳴る》。 2011年10月26日发售单曲《誰もいない台所》。 2017年，为4月15日公映的动画电影《蜡笔小新: 宇宙人来袭》演唱主题曲。 2018年，为9月21日公映的电影《爸爸是坏人冠军》演唱主题曲。');
