INSERT INTO `tb_singer` VALUES ('71', '和田光司', '日本男歌手', 'http://p2.music.126.net/FuTSACXbAsVEGaGAWw3Ddw==/18934689742214357.jpg?param=130y130', '和田光司（1974年01月29日-2016年4月3日），出生于日本京都府福知山市， 日本歌手。和田光司最为乐迷所知的歌曲是1999年为动画《数码宝贝》献唱的主题曲《Butter-fly》。1999年4月，和田光司在富士电视台系动画《数码宝贝大冒险》中演唱主题歌，成功完成了首次亮相。2016年4月3日，因咽喉癌医治无效去世。 《Butter-fly》 和田光司1974年1月29日出生于京都府福知山。他并不是音乐世家出身，高中时也没有受过音乐训练，但因为听到了朋友演奏的吉他之后，深深为之倾倒，也动了自己做音乐的念头。高中毕业，和田进了大阪一家电气设备公司做营业员，住在谷町的宿舍，3个月后自愿顶替同事调往东京支社，然而又只做了3个月就辞职回了老家。之后他一面打工一面反思，决定要做一名唱出自己探索人生的感悟的歌手，他要去东京。一年以后，他打工存了40万元。1993年1月12日，19岁的和田从福知山站乘车来到了东京站。 和田在东京只身一人举目无亲，对地形也完全不熟，走到一个叫新桥的地方，在一家一天2500元的叫「Kapsel Hotel」（胶囊旅馆）的旅馆住了两周才找到公寓租。他看到杂志上一家工作室招工作人员的消息前去求职，但希望能做演员。这段时间他做了不少电视剧和电影的临时演员，甚至还有时代剧。他对这种生活厌烦了，思乡病之下动了回家的念头。这时候，曾经说过随时可以回家的父亲却在电话里对他说，「这样就放弃了吗？再努力一下吧！」和田深受感动，从此再不言放弃。回想时，他说这是决定他人生命运的一句话。如果不是他父亲，就没有今天这个唱歌的和田了。 之后，和田光司认准了音乐这条路走下去。他认为做演员对他的发展没有帮助，并离开了事务所。他曾组建过乐队，举办过live，把自己的音乐作品寄给各个音乐事务所、公司、唱片行，有时一次甚至要寄100张，但全都石沉大海无回音。在经历过一次又一次失败之后，终于有一天，命运之神睁开了眼睛。制作导演（大概是角铜博之）给他打了个电话，要求他表现出与DIGIMON初次邂逅以及希望再相逢的感觉。他与导演多次会面协商，反复修改之后终于拿出了他的出道作——对，就是那首「Butter-Fly」。这张CD于次年（1999年）1月录成，4月发售，并于03月17日作为デジモンアドベンチャー（数码兽大冒险）的OP在电视上播出。之后，经历了很多事的他坚持了下来，并成为了今天大家所见到的音乐人-和田光司。 直至2006年，数码宝贝系列动画推出第五部数码宝贝拯救队，所有主唱的歌曲都没有和田光司的参与，加上第五部的主题歌旋律与前几作的质素相差太大，随即被日本观众要求更换主题歌并由和田光司再次参与该动画歌曲，可见和田的声音已深入民心。事实上，当年和田光司因病失声数年（当年没有交代患病原因），直至第五部推出时亦未赶及回复状态，因此才首次调动主题歌的主唱者。 然而，不论第五部的音乐经费如何短缺下，受到舆论压力的东映制作组和富士电视台决定把系列主题歌更换，后期主题歌再次由和田光司担任，打破数码宝贝每个系列只有一首主题歌的先例，但是复出后的和田，声音和声带已不及从前的清澈响亮，也可从歌曲里听到他演唱高音位的时候感到吃力的地方。 2011年10月4日，数码宝贝系列动画第六部－数码宝贝合体战争播放期间，这次和田光司才交代八年前（大约在2002~2003年期间）患上的咽喉淋巴腺恶性肿瘤及体内癌细胞转移并复发，所有活动暂停演出。直到现在，和田都没有在他的博客（光司广场Ⅱ）更新他的状况，病情令人担忧。 2013年10月3日。和田在其推特以及博客宣布他“回来了”，其同为歌手的好友宫崎步回复道“欢迎回来”。和田再次更新推特表示下月开始第一场复出live！期待和田光司复出新作！让我们一同期待！ 最早的一条是2013年10月3日早上突然放出的，那时候距离和田2011年10月4日突然宣告急病已经过去2年了，之后第二天和田宣布要在11月举行live。 2013年10月5日，和田放出了自己的复出宣言视频，复出live定为11月24日。 2014年8月1日，东映于在日本台场举办名为“昨日重现”的纪念《数码宝贝》播出15周年的演出，和田光司登场演唱 赤色冲击 和 butterfly ，因为喉癌明显的虚弱音引得无数歌迷心痛，亦有网友感慨“和田真的老了”。 2014年8月29日至31日，在“埼玉Super Arena”举办的夏季大型动漫歌曲演唱会“Animelo Summer Live 2014 -ONENESS-”和田光司参加8月29日的表演。 2014年10月1日，在香港九龙湾国际展贸中心 Music Zone@E-Max与米仓千寻举办“Animate Presents 米仓千寻·和田光司 Fan Meeting”和田光司参加了当天两场的演出。 2015年7月1日，原计划7月25日在上海参加b站线下活动的和田光司，宣布因身体原因无法参加，由远藤正明前来替代。 2016年4月8日，SOLID VOX官方发表悲报，数码宝贝御用歌手和田光司于4月3日上午因上喉癌去世，享年42岁。');
INSERT INTO `tb_singer` VALUES ('72', 'Ayasa绚沙', '日本女歌手', 'http://p2.music.126.net/TReiDb4RmfnXcugKYzWU2A==/109951163781763573.jpg?param=130y130', 'Ayasa，原名岛村绚沙，3岁开始学习音乐，拥有23年小提琴演奏经验。毕业于桐朋学园大学演奏专业。毕业后参与摇滚乐队远东之剑，擅长五弦小提琴，在新一季网球王子的OP《Best Games!!》担任小提琴手。YouTube上的成名作品《前前前世》、《红莲的弓矢》、《千本樱》等广受好评。');
INSERT INTO `tb_singer` VALUES ('73', '初音ミク', '日本女歌手', 'http://p2.music.126.net/tMz0TTyDO4pJv3FMETjRGw==/109951163021786523.jpg?param=130y130', '初音未来（初音ミク），通常简称为“初音”。初音未来（初音ミク，中文界部分人简称为“初音”）可指CRYPTON FUTURE MEDIA以Yamaha的VOCALOID 2语音合成引擎为基础开发贩售的虚拟女性歌手软件角色主唱系列的第一作；亦可指该音乐软件的拟人化产物，是此软件的角色，也衍生出动漫和游戏人物。 初音未来（初音ミク，中文界部分人简称为“初音”）是CRYPTON FUTURE MEDIA（下略作“CRYPTON”）以Yamaha的VOCALOID 2语音合成引擎为基础开发贩售的虚拟女性歌手软件角色主唱系列的第一作，是VSTi规格的电子乐器。此软件具有一个深入人心的印象角色（这只是软件的象征，不会在实际使用时出现）。2007年8月31日发售并开放价格，官方估计系列软件实际价格约15,750日元。软件原只可用于Microsoft Windows，2008年3月19日随CrossOver Mac 6.1发表而可用于Mac OS X。发售后大受欢迎，并出现大量用户制作的翻唱歌曲、原创曲等。官方表示初音未来擅长由1980年代至最新的流行歌曲。 软件使用了Yamaha的VOCALOID 2语音合成引擎，能够将人类的声音录音并合成为酷似真正的歌声。使用时只需输入音调、歌词则可发出声音，亦可以调整震音、音速等的“感情参数”，最多能够16人合唱，亦支持即时演奏、对应ReWire。制作完成后会以WAV格式输出，但软件本身只可做出歌唱部分，伴奏音声需要使用其他音乐软件合成。歌词输入能辨认平假名、片假名和罗马字，但不能辨认は、へ作为助词和う、い作为长音时会分别转为わ、え、お、え的发音，亦不能对应促音、汉字，需要自行修改。 软件并非设计给初学者，初接触电子音乐制作的用户需要一段时间适应，因此在2ch等地方也出现不少以此类用户为对象的教学讨论。大阪电气通信大学甚至于2007年10月19日和10月25日举行以初学者为对象的讲座。 另有POCALOID，也是一款电子音乐制作语音合成软件，是vocaloid2的破解版本，其包含的所有Vocaloid2中的角色由来自11区的peace-out小组rip出来，可以进行单独安装。这款软件是人声合成技术的软件革命，但是其装置和系统还远未完善。 Vocaloid3在2011年9月正式发售，而相应的Pocaloid3也会在其后破解出。构成：管理器（Manager）、主程序（System Standalone）、歌手音源库（Library） 共三个部分。 meiko(メイコ) kaito(カイト) 初音ミク（初音未来） 镜音 リン·レン（镜音双子） 巡音流歌（巡音ルカ） がくっぽいど（神威/茄子） Megpoid（GUMI） 歌爱ユキ AHS （ボカロ小学生） 氷山キヨテル AHS（ボカロ先生） 开発コード miki（机械娘） Miku Append（Miku Append） Lily Big AL VY1 Library Tonio 猫村いろは （DEMO） ガチャッポイド（青蛙果冻） 开発コードPIKO / 歌手音ピコ RIN/LEN APPEND（镜音Append） VY2 海外组（旧）： Prima Sweat.Ann Sonika');
INSERT INTO `tb_singer` VALUES ('74', 'Aimer', '日本女歌手', 'http://p2.music.126.net/LJoFlsgnmADsBq-9KpLEEg==/109951163992209298.jpg?param=130y130', 'Aimer是一名日本女歌手，个人资料非公开，艺名Aimer取自法语，意为“爱”，作词以aimerrhythm名义。在2011年以单曲《六等星の夜/悲しみはオーロラに/TWINKLE TWINKLE LITTLE STAR》正式出道，隶属的唱片公司是日本索尼音乐娱乐旗下的SME Records。所属的经纪公司是FOURseam。 由于父亲有成立乐团，Aimer从小就培育在十分良好音乐环境中。小学时就开始学习钢琴，中学时由于崇拜艾薇儿·拉维尼，正式开始进行吉他音乐活动。另一方面，有了海外生活经验，过程中也在英文作词上投注了非常大的心力。十五岁时，因为过度使用喉咙导致声带发痛，于是选择了沉默治疗法，在有了约半年无法良好发声的经验之后，确立了现在的唱法和音质。那个时候对声带所造成的损伤直到现在仍未痊愈，主治医师对Aimer提出忠告，如果将声带的损伤完全根治的话将无法再保有现在的音质，Aimer为了保住现在的音质采取了保持现状的方式。日本音响研究所所长铃木松美先生分析说“Aimer声音的振幅与周波数的波长相同，如此的声音是非常之稀少的”。 2011年，在FOURseam所属的agehasprings下开始音乐活动，该组合曾与YUKI，中岛美嘉，flumpool，Superfly，ゆず（柚子）等人合作，制作或提供乐曲。2月，被J-WAVE的节目HELLO WORLD中的新人发掘企划SPIDER SOUNDS邀请，以agehasprings feat. Aimer的名义客串演出，4月以相同名义在与COMIC ZENON合作的CM中演唱キズナ。 5月11日，在FOURseam的官方网站开设，收录了10首热门爵士和乡村西部音乐翻唱的概念专辑Your favorite things登陆iTunes，其中收录的歌曲Poker Face在iTunes爵士区获得初登场第1位的成绩，专辑最高排到了第4位。 2011年6月6日，以DefSTAR Records作为品牌正式宣布出道，并在9月7日发布单曲《六等星の夜/悲しみはオーロラに/TWINKLE TWINKLE LITTLE STAR》其中《六等星之夜》作为富士电视台noitaminA档《未来都市No.6》的片尾曲登场，并获得了RecoChoku音乐销量榜最高第9位的成绩。第二张单曲《Re:pray/寂しくて眠れない夜は》在2011年12月14日发售，在Mora音乐下载网站最高排位第1位，Re:pray作为《死神》的的第29首ED登场。2016年，Aimer首度来台演出，门票随即抢购一空。 2017年1月6日，首次于Tokyo Music Odyssey2017年的Space Shower Music Award上被提名为年度最佳女歌手。2017年3月10日，首度来港参与“Anisong Fantasy Live 2017”。3月13日，凭著第4张大碟《daydream》夺得第九屇全日本唱片店大奖的准大赏。 2017年8月29日，首次于日本武道馆使用四面舞台进行单人演出。');
INSERT INTO `tb_singer` VALUES ('75', '花澤香菜', '日本女歌手', 'http://p2.music.126.net/PyVjJIELBa6Nl5OYEIpaVw==/109951163749358629.jpg?param=130y130', '日本的女性艺人、声优、演员。儿童演员出身，2006年开始声优工作， 2012年2月宣布以个人歌手名义出道，唱片公司为Aniplex，4月25日推出首张单曲《星空☆ディスティネーション》。 幼稚园开始就在童星身份活动，参加了综艺节目《やっぱりさんま大先生》和电视剧《ガッコの先生》的出演。 随后先后加入Big Apple、Five☆Eight、Smile Monkey等三个事务所。 2003年，14岁时在动画《最终流放》出演荷莉·马德赛因，首次担当声优。 2006年，高中三年级时在动画《ZEGAPAIN》出演女主角守凪了子。 随后在川澄绫子的建议下以及知己好友的鼓励下，离开Smile Monkey移籍到大泽事务所，正式声优出道。 2007年大学入学，工作繁忙但也有参加大学合宿和去上课，直到2011年毕业都是半工半读。 2010年12月19日，获得《ノン子とのび太のアニメスクランブル》听众投票选出的“动画大赏2010”最优秀女声优奖。 2011年，因共同出演动画《萝球社》的缘故，与日笠阳子、井口裕香、日高里菜、小仓唯一起组成了声优团体“RO-KYU-BU!\"，并演唱了该动画的OP和ED。 2011年8月28日，“RO-KYU-BU!\"参加了“Animelo Summer Live  2011”的演出，这是花泽首次在埼玉超级体育馆演出。 ASL2011 ro-kyu-bu现场(8张) 2012年2月23日，宣布以个人歌手名义出道，唱片公司为Aniplex。 2012年4月25日，推出个人首张单曲《星空☆ディスティネーション》。 2012年3月11日，到香港参加“C3日本动玩博览2012 DAY3”。 2013年2月20日，推出个人首张专辑《claire》[1]。 2013年4月17日，获得“Fami通大赏 2012”角色声优奖。 儿童演员出身，出演《ZEGAPAIN》的女主角守凪了子时，由于其独特的棒读（棒読み，毫无感情、平铺直叙的语调）大受好评而为人所认知，被评为“很可爱的棒读”。粉丝们称之为“和初期的能登麻美子说话没有感情起伏（良い棒読み）很像”，简称“良い棒”、“棒子”。 在《ZEGAPAIN》演出当时仍不是声优，共演的川澄绫子建议她成为全职声优，移籍到川澄隶属的大泽事务所，正式踏上声优之路。川澄绫子仍经常给她技术指导。 2009年，花泽香菜出演动画《化物语》的千石抚子一角，同时演唱角色歌《恋爱サーキュレーション》而一炮走红。 演员身份方面则在东京深夜播放的电视剧《怨屋本铺》饰演青山美香。 有一个弟弟，而且是弟控，曾经和田村由加利与樱井浩美谈话时谈到弟弟的时候就变得很兴奋。 容易害羞，访问时本来想答得婉转一些但结果却常出现答非所问的笑话，甚至在电台节目中也常说出牛头不搭马嘴的怪话。 曾经在录音室里发挥了超S的体质。 头发是天然的卷发，在弄发型的时候要花很多时间。 爱好是读书，高中时受村上春树的《海边的卡夫卡》影响很大，喜欢的作家有山田咏美、川上弘美、佐藤多佳子、西加奈子。 经常在作品中和比她年长得多的声优大演对手戏，其中女的包括川澄绫子、泽城美雪、渡边明乃、皆川纯子、田村由香里、堀江由衣、水树奈奈、折笠富美子、桑岛法子、中原麻衣、能登麻美子、生天目仁美、斋贺观月。男的则有浅沼晋太郎、神谷浩史、宫野真守、木内秀信、中村悠一、鸟海浩辅、石田彰、梶裕贵、下野紘等等。当中合作最多则是神谷浩史。 由于多部作品都演姐妹，和户松遥感情很好，但有趣是不论是入行时间还是实际年纪花泽都比户松长和大，但动画中却总是户松演姐姐。另外也和辻步美感情很好。   咲saki阿知贺篇五声优合影，右二为香菜 自从在《我的妹妹哪有这么可爱！》中和竹达彩奈合作后二人感情要好，在网路电台中经常大放闪光弹，甚至在花泽生日的当天被竹达逼问“给我说清楚哪个才是正妻啊！！”。 爱发白日梦，因而被中世明日香和牧野由依评为“写实版梶原空”。 曾有过偷饮母亲的酒而变成吻魔到处吻人的事件，因此已经不喝酒了。 《ZEGAPAIN》监督下田正美回忆其在试音时印象为“非常治愈的声音（超绝愈しボイス）”。 《文学少女》作者野村美月称赞其为“清晰可爱的声音（澄んだ可爱らしい声）”。 2010年参加新加坡亚洲动漫节（AFAX- Anime Festival Asia）时，官方网站介绍为“天使般的声音（angelic voice）”。');
INSERT INTO `tb_singer` VALUES ('76', 'DAOKO', '日本女歌手', 'http://p2.music.126.net/7WJxq8yetuBHS6AzgBovxg==/109951164271441708.jpg?param=130y130', 'DAOKO（1997年3月4日－），日本女性饶舌歌手，于东京都出道。 国中3年级的时候开始在NICONICO动画的“NICO饶舌”上传影片。在Jinmenusagi（人面兔子）的邀请下参加乐曲活动，被独立音乐唱片公司“LOW HIGH WHO? PRODUCTION”的主持者中意，在升高中的同时与该唱片公司签约。不过由于DAOKO就读的女子高中有禁止演艺活动的严厉校规，所以在高中的这段期间都是以蒙住脸的方式在活动。 后来跟m-flo的Taku Takahashi一起以“m-flo + daoko”的名义推出乐曲《IRONY》，获起用为2013年电影《鷹の爪 ～美しきエリエール消臭プラス～》的主题曲。这加深了电影导演中岛哲也对她的印象，于是2014年上映的电影《渴望。》中采用了DAOKO的《Fog》作为插曲。同年，在由庵野秀明带领的Khara工作室制作短篇映像系列“日本动画人展览会”的第3弹作品《ME!ME!ME!》中，她与TeddyLoid一起担任音乐部分，受到世界各国注目。 随着大唱片公司的DAOKO争夺战结束，2015年3月，高中毕业的同时经TOY\'S FACTORY主流出道。同年10月又推出了首张单曲，封面上首次对外公开DAOKO的样子。 一开始制作音乐的时候是使用家中客厅电脑（iMac）的内建音乐制作软件GarageBand，之后从网络上学习作词的方法，她参考的作品都是以抒情诗居多。所以做出的歌词也都以抒情诗为主，但是她最初也不是就想在这样的环境下制作，因为在客厅的声音容易干扰乐曲的录制。只好临时混用自己的房间的个人电脑制作。之后考虑到进入唱片公司制造音乐，要怎样的气氛能有好的印象。因为乐器等配合器具没有现场对照要做成完整的唱片旋律会很复杂。最后她在家先完成作词，用电脑打成文字。变成平时不用考虑歌词，只要拿出之前想好的歌词放入即可，后来也都是同样的做法。');
INSERT INTO `tb_singer` VALUES ('77', 'れをる', '日本女歌手', 'http://p2.music.126.net/t7s8OjovMdachonDJoNQPw==/3283141725800255.jpg?param=130y130', 'reol(れをる)是在ニコニコ动画的人气唱见，代表曲有《+♂》、《ver.れをる》、《kradness&れをる》、《おこちゃま戦争》。 她同时也在帮助ギガP(GigaP)进行作词。投稿选曲是以VOCALOID/原创歌曲为主。 Reol 本人比较喜欢模仿声音，从高音到低音都能很好地掌握，有独特的中毒性唱腔技巧以及萌萌的声线。主要活跃于声音模仿，在nico投稿vocaloid翻唱作品。最喜欢模仿的人物是灰原哀。 她还担任人气P主ギガP(GigaP)的原创曲「ギガンティックO.T.N」等歌曲的作词。成名作是〔オリジナル〕，ギガンティックO.T.N ver れをる。 2012年06月20日 02:31 投稿  〔れをる〕ゆるふわ树海ガール〔歌ってみた〕  2012年07月26日 13:00 投稿[1]   〔れをる〕magician\'s operation 〔歌ってみた〕   2012年08月01日 22:02 投稿  〔れをる〕ジャバヲッキー・ジャバヲッカ〔歌ってみた〕  2012年09月22日 00:00 投稿  〔れをる〕ネトゲ廃人シュプレヒコール〔歌ってみた〕  2012年09月23日 00:30 投稿  〔れをる〕いーあるふぁんくらぶ 〔歌ってみた〕  2012年09月29日 01:00 投稿  〔れをる〕WAVE〔歌ってみた〕  2012年10月12日 21:01 投稿  〔れをる〕lllトゥルティンアンテナlll 〔歌ってみた〕  2012年11月11日 15:45 投稿  〔れをる〕小夜子〔歌ってみた〕  2012年12月08日 19:00 投稿  〔オリジナル〕 ギガンティックO.T.Nverれをる  2013年01月25日 19:00 投稿  〔れをる〕深海シティアンダーグラウンド〔歌ってみた〕  2013年02月22日 19:00 投稿  〔れをる〕エンヴィキャットウォーク 〔歌ってみた〕  2013年03月24日 20:33 投稿  〔れをるfeatkradness〕SweetDevil 〔歌ってみた〕  2013年04月19日 19:00 投稿  〔オリジナル〕 ぴんこすてぃっくLuvver れをる  2013年05月10日 20:32 投稿  （kradness&れをる） しんでしまうとはなさけない！ （歌ってみた）  2013年05月24日 22:17 投稿  〔れをる〕ロストワンの号哭〔歌ってみた〕  2013年06月21日 22:42 投稿  〔れをる〕ラズベリー*モンスター 〔歌ってみた〕  2013年07月21 19:00 投稿  〔オリジナル〕cLick cRack ver NORISHIO味  2013年08月23日 00:06 投稿  〔れをる〕パレットには君がいっぱい 〔歌ってみた〕  2013年09月02日 20:13 投稿  〔れをる〕圣枪爆裂ボーイ 〔歌ってみた〕  2013年09月23日 21:00 投稿  「Ib」-forever- 歌ってみた （松下・れをる・鸟子）  2013年09月25日 21:37 投稿  〔ななひら×れをる〕 8HIT 〔歌ってみた〕  2013年10月20日 19:00 投稿  〔れをる〕ジッタードール 〔歌ってみた〕  2013年11月29 19:00 投稿  （kradness&れをる） おこちゃま戦争 （歌ってみた）  2013年12月15日 00:00 投稿  Masked bitcH -GIGA Birthday Arrange-  2013年12月22日 18:00 投稿  〔れをる〕一心不乱〔feat ill.bell,nqrse〕  2014年01月16日 18:13 投稿  〔れをる〕FACE〔歌ってみた〕  2014年02月01日 18:00 投稿  （kradness&れをる） リモコン （歌ってみた）  2014年02月09日 23:10 投稿  〔れをる〕サイバーサンダーサイダー 〔歌ってみた〕  2014年02月21日 18:00 投稿  〔れをる〕毒占欲〔歌ってみた〕  2014年02月22日 02:22投稿  〔96猫×れをる〕 DOGS 〔歌ってみた〕  2014年03月09日 17:00 投稿  LUVORATORRRRRY! ver れをる feat.nqrse  2014年03月20日 20:00 投稿  +♂ ver れをる  2014年04月18日 18:00 投稿  〔れをる〕 女子高生チェーンソウデイズ 〔歌ってみた〕  2015年07月29日 投稿  2015.07.29、1stソロアルバム「极彩色 / れをる」をリリース致します  2015年09月30日 15:42投稿  〔れをる〕 顿珍汉の宴 〔歌ってみた〕  2015年10月20日 09:03投稿  〔れをる〕WAVE〔niki × EZFG〕  2015年11月22日 09:00投稿  〔れをる〕脳内革命ガール 〔ill.bell〕  2016年02月07日 11:49投稿  〔れをる〕クラブ=マジェスティ 〔歌ってみた〕  2016年04月12日 11:30投稿  Nintendo アカペラメドレー  2016年05月13日 08:00投稿  〔れをる〕ECHO〔歌ってみた〕     ——————————————————————————————————————     れをるとは、ニコニコ動画で「歌ってみた」カテゴリに投稿している女性歌い手である。  声真似が得意であり、低音からものすごく高い音域を使い分けるのが特徴。  独特な歌い方と力強い声には中毒性があるため、魅了されてしまうファンも少なくない。  以前は声真似主として活躍しており、当時仲の良かった生主とTwitter等で現在も交流がみられる。     人物  人気プロデューサーと交流が深く、ギガPのオリジナル曲「ギガンティックO.T.N」「ぴんこすてぃっくLuv」の歌で参加している。  また、作詞も手掛けるなど多才な一面を垣間見せることもしばしば。  声真似のレパートリーは数十種類におよび、一つ一つの完成度は高くその中でも  声優の大谷育江が演じるキャラクターと声質が似ているため定評があり、本人も好む傾向にある。  好きなキャラクターは名探偵コナンに登場する灰原哀。関連したモノマネも多数存在する。  可愛らしい少年のような声から”ショタ声”と賞賛されており、自らもショタコンだと公言している。  ワンダフル☆オポチュニティ!の「しんでしまうとはなさけない!」ではその滑舌の良さを披露した。  Twitterでは美少女れをるの面白いツイートがみれる。  好きな食べ物は「牛肉」。好きな飲み物は「スタバの抹茶フラペチーノ」。  ガラケーを愛用中。      経歴  2012年6月20日 「〔れをる〕 ゆるふわ樹海ガール 〔歌ってみた〕」を初投稿。圧倒的な女子力をみせつけた。  2012年12月8日 「〔オリジナル〕 ギガンティックO.T.N ver れをる」を投稿後、驚異的な中毒性で一躍人気を集めることになった。  2013年3月14日 歌い手と初のコラボ楽曲「〔れをる feat kradness〕 Sweet Devil 〔歌ってみた〕」を投稿。     歴史投稿（および投稿に参加）  2012年06月20日 02:31 投稿  〔れをる〕ゆるふわ树海ガール〔歌ってみた〕  2012年07月26日 13:00 投稿[1]   〔れをる〕magician\'s operation 〔歌ってみた〕   2012年08月01日 22:02 投稿  〔れをる〕ジャバヲッキー・ジャバヲッカ〔歌ってみた〕  2012年09月22日 00:00 投稿  〔れをる〕ネトゲ廃人シュプレヒコール〔歌ってみた〕  2012年09月23日 00:30 投稿  〔れをる〕いーあるふぁんくらぶ 〔歌ってみた〕  2012年09月29日 01:00 投稿  〔れをる〕WAVE〔歌ってみた〕  2012年10月12日 21:01 投稿  〔れをる〕lllトゥルティンアンテナlll 〔歌ってみた〕  2012年11月11日 15:45 投稿  〔れをる〕小夜子〔歌ってみた〕  2012年12月08日 19:00 投稿  〔オリジナル〕 ギガンティックO.T.Nverれをる  2013年01月25日 19:00 投稿  〔れをる〕深海シティアンダーグラウンド〔歌ってみた〕  2013年02月22日 19:00 投稿  〔れをる〕エンヴィキャットウォーク 〔歌ってみた〕  2013年03月24日 20:33 投稿  〔れをるfeatkradness〕SweetDevil 〔歌ってみた〕  2013年04月19日 19:00 投稿  〔オリジナル〕 ぴんこすてぃっくLuvver れをる  2013年05月10日 20:32 投稿  （kradness&れをる） しんでしまうとはなさけない！ （歌ってみた）  2013年05月24日 22:17 投稿  〔れをる〕ロストワンの号哭〔歌ってみた〕  2013年06月21日 22:42 投稿  〔れをる〕ラズベリー*モンスター 〔