INSERT INTO `tb_singer` VALUES ('78', 'majiko', '日本女歌手', 'http://p2.music.126.net/2JmvUeWhIYOo9BWAHqr8Mw==/109951164172370721.jpg?param=130y130', '天性の歌声で聴く者を魅了するネットシーン発の実力派女性ボーカリスト。 1992年10月28日生まれのシンガーソングライター。 幼少の頃から音楽の溢れる家庭で育ち、高校の頃からソングライティングを始める。 2010年、友人の勧めで「歌ってみた」動画を「まじ娘(ルビ：こ)」という名義で投稿。 その圧倒的な歌唱力にネット上で大きな話題となり、シングル1枚、アルバム2枚をリリースする。 2017年2月、メジャーデビュー作となるミニアルバム「CLOUD 7」のリリースタイミングで名義を「majiko」へ変更する。 2018年3月、2ndミニアルバム「AUBE」をリリース。同年7月にはシングル「ひび割れた世界」 (東海テレビ・フジテレビ系 オトナの土ドラ「限界団地」主題歌)をリリース。');
INSERT INTO `tb_singer` VALUES ('79', '茅野愛衣', '日本女歌手', 'http://p2.music.126.net/9LfzCNSQpOVCybnDMC1PvQ==/109951163332433122.jpg?param=130y130', '茅野爱衣（1987年9月13日－）是日本的女性声优，大泽事务所所属，东京都出身。身高153公分，血型O型。 于Pro-Fit声优养成所第11期毕业后，2010年成为Pro-Fit的所属声优。 2012年，获得第六回声优奖新人女优赏。 2014年9月30日，退出Pro-Fit，成为自由身。2015年1月加入大泽事务所。 在转行当声优前的工作是美容师，因为她希望可以作的是治愈他人的工作。直到有次忙碌的工作后，回家看了《水星领航员》，发现原来声优和动画也可以治愈人心，就决定成为声优。 从小就做事好强，不管是运动会还是各种比赛，都是练习最久，希望可以拿到最好的成绩，中学的时候第一次听到声优这个行业，原因是有一个同学还满有研究的，不过当时并没有任何兴趣，因为她想从事的是美容、咖啡店这种疗伤的行业，高中就读美容相关科系，毕业后拿到美容相关证照，大学就一面从事美容工作一面读书。 兴趣是画画和散步。 演绎《未闻花名》本间芽衣子是名气大增主因，这部作品也是她配音的目标（治愈系动画）。 成为声优前就已经认识赤崎千夏，两人是咖啡厅同期的打工店员。');
INSERT INTO `tb_singer` VALUES ('80', '小林未郁', '日本女歌手', 'http://p2.music.126.net/eqq6dxPXG7R1Nz5kXNY1Lg==/109951163326908311.jpg?param=130y130', '小林未郁 生日 昭和53年5月31日 星座 双子座 血液型 AB型 三岁——开始学会唱歌 五岁——开始学会弹钢琴 小学时期——进入演艺部，钢琴比赛得奖 中学时期——在演艺部一个人演戏剧，每天放学后去卡拉OK。 高中时期——进入弦乐部，得到最佳演唱者大赏。 18岁——只身去往东京，进入专门学校学习跳舞。后进入小型事务所，开始自己学会作曲。 21岁——CD DEMO得到发行，展开LIVE活动，销量较低。受挫于是去往广岛。 22岁——某选秀活动得奖，再一次去往东京。 25岁——成为自由作曲者 26岁——开始自己边弹奏边唱歌，第一次发专辑，并且销量很好。 32岁——意大利及欧洲各地演唱会开始启动。');
INSERT INTO `tb_singer` VALUES ('81', '鹿乃', '日本女歌手', 'http://p2.music.126.net/lWs2xcIMPuFzcg2k9k-uqA==/109951163594456462.jpg?param=130y130', '鹿乃（日语：かの），是一名日本歌手。原来是独立同人歌手，从2010年首个作品上载至niconico动画开始活动至今，作品以翻唱使用VOCALOID创作的原创歌曲和动画歌曲为主。现在是TEICHIKU ENTERTAINMENT旗下的歌手。 在2010年1月16日以“鹿乃”（读作“かの”）为名，在niconico动画上投稿自己的首个翻唱作品‘恋爱サーキュレーション’（动画‘化物语’主题曲，原唱是花泽香菜），以可爱的萝莉声线吸引了大量的听众，尽管日语的发音有些奇怪。同月下旬开始活跃。5月25日投稿的‘けいおん！！に负けた鹿乃が’在同月28日的niconico翻唱排名中位列第五，获得超过10万次的点击播放。7月23日投稿的‘ハロ/ハワユ’，获得了niconico翻唱排名第一的记录，也是鹿乃的翻唱成名作之一，进入过VOCALOID原创歌曲翻唱殿堂（ボカロオリジナルを歌ってみた）。 2011年1月6日发布了第一张个人单曲《ばんび～の》，16日发表了同名的首张个人专辑《ばんび～の》。 歌唱风格以萌系少女、电音为主，但偶尔也有强势女性风格歌唱的翻唱作品，像是《小夜子》。 2015年1月，加入日本华纳娱乐并正式出道。5月4日，其Twitter追随者数量超过了10万。5月20日，宣布电视动画‘放学后的昴星团’的OP主题曲‘Stella-rium’(ワーナー・ホーム・ビデオ)由鹿乃主唱。2016年1月6日推出目前个人最新的同人专辑《メリー》。 从未公开过个人形象照片，一直以Pixiv用户“水玉子”（个人Twitter）所作的立绘形象插画（波波头发型+一对小鹿角的小女孩形象）示人以及印制于个人单曲/专辑的封面。不过根据一些追随者曾经在C87的同人CD专辑摊位以及出道后的一次Fans见面会上见到的本尊，描述的本尊形象和立绘形象接近（除了鹿角以外），身高也在她公开的14x公分的范围内，不过年龄依旧未知。目前在鹿乃的Line部落格首页上也可隐约见到其本尊形象。 2016年5月11日推出《nowhere》专辑，收录出道以来的演唱作品（包括《Stella-rium》等10支），于同年7月2日举行出道以来的首次Live演出。 2016年9月7日电视动画‘发条精灵战记 天镜的极北之星’的片尾曲使用鹿乃主唱的《nameless》，本歌曲也作为她的第三张单曲发售。 2017年5月24日鹿乃主唱的《day by day》作为电视动画‘剑姬神圣谭’的片尾曲，同时也作为她的第4张单曲发售。 2018年4月播出的电视动画《实验品家庭》，片尾曲《春に落ちて》主唱由鹿乃担当。');
INSERT INTO `tb_singer` VALUES ('82', 'ラムジ', '日本组合/乐队', 'http://p2.music.126.net/4v58OLejhQRatNYKIZ7BJQ==/1389782699016779.jpg?param=130y130', '山下祐樹 （やました ゆうき、1981年7月15日 - ），担任组合主唱。当时遇到井上慎二郎时，看到他被雨淋湿的姿态，联想到了动画《ラムヂーちゃん》里“子羊”这一角色，因决定采用ラムジ这一名字为组合名。 井上 慎二郎 （いのうえ しんじろう、別名：SJR、Shinjiroh Inoue、1967年7月14）。负责音乐制作，吉他担当。是组合所属公司株式会社グロール的社长。 组合共发行三张单曲，五张迷你专辑和两张录音室专辑。2011年2月2日预定发行第三张录音室专辑《merry go round》。 2013年3月31日，该组合解散。');
INSERT INTO `tb_singer` VALUES ('83', 'SawanoHiroyuki[nZk]', '日本组合/乐队', 'http://p2.music.126.net/cO9Jg8H3t6B1HYaNer0DWw==/109951163023646812.jpg?param=130y130', 'SawanoHiroyuki[nZk]是泽野弘之的Project。 Aimer (SawanoHiroyuki[nZk]:Aimer) mizuki (SawanoHiroyuki[nZk]:mizuki) Mica Caldito (SawanoHiroyuki[nZk]:mica) Gemie (SawanoHiroyuki[nZk]:Gemie) Yosh (SawanoHiroyuki[nZk]:Yosh) Tielle (SawanoHiroyuki[nZk]:Tielle) naNami (SawanoHiroyuki[nZk]:naNami) Eliana (SawanoHiroyuki[nZk]:Eliana)');
INSERT INTO `tb_singer` VALUES ('84', 'RADWIMPS', '日本组合/乐队', 'http://p2.music.126.net/9Gbc8MAh4NOoobijWbVx1A==/109951164103421755.jpg?param=130y130', 'RADWIMPS（拉德温普斯，日语：ラッドウインプス），是日本4人摇滚乐队，日本环球音乐旗下的艺人，所属经纪人公司为voque ting。 野田洋次郎（主音兼吉他） 桑原彰（吉他兼和音、队长） 武田祐介（贝司兼和音） 山口智史（鼓手兼和音） 2001年：野田洋次郎于朋友桑原彰的邀请下成为主音，RADWIMPS结成。 2002年：2月5日，以RADWIMPS的名义在横滨关内的B.B.SREET举行首场Live。 2003年：7月，第一张同名专辑《RADWIMPS》发行。 2004年：3月，乐队的活动再次启动，队员更换，武田与山口的加入促成了现在的RADWIMPS。 2005年：3月8日，第二张专辑《RADWIMPS 2 ～発展途上～》发行。11月23日，以单曲《25コ目の染色体》于东芝EMI唱片公司出道。 2006年：2月，发行第三张专辑《RADWIMPS 3 ～無人島に持っていき忘れた一枚～》也作为出道专辑，初登ORICON专辑榜第13位。12月，第四张专辑《RADWIMPS 4 ～おかずのごはん～》发行，获得ORICON专辑榜第5位。 2007年：7月11日发表Live DVD《生春巻き》。 2008年：1月23日，单曲《オーダーメイド》发行，并初次夺得ORICON单曲榜的第一位。5月31日，MTV VIDEO MUSIC AWARDS JAPAN 2008，RADWIMPS获得BEST ROCK大奖。 2009年：3月，第五张专辑《アルトコロニーの定理》获得ORICON单日榜第2位。 2010年：3月22日，《おしゃかしゃま》获得SPACE SHOWER录像带音乐大奖的BEST YOUR CHOICE大奖，同时也是既去年SSTV举办的MVA以来，两年蝉联夺得由网友投票选出的BEST YOUR CHOICE大奖。6月30日，同日发表两张新单曲《携帯電話》及《マニフェスト》，首日分别获得ORICON每日榜3、2位。 2011年：3月9日，相隔两年再次发表新专辑《绝体绝命》。 2012年：1月11日，发表Live DVD/Blue-ray《绝体延命》。 2013年：12月11日，发表新专辑《Xと○と罪と》。 2014年：3月11日，发表对2011年3月11日地震的追悼曲《カイコ》。 2015年：10月9日-23日，RADWIMPS 2015 Asia-Europe Live Tour 海外巡演。11月25日，第18张单曲《記号として/‘I’ Novel》发售。 2016年：8月24日 ，由该团制作的《你的名字。》电影原声带正式发行。11月23日，第八张专辑《人间开花》发行。11月24日，确认将出席第67回NHK红白歌合战，为乐队历史上首次登上红白歌合战的舞台。 2017年：2月22日，纪念《你的名字。》在美国上映，发行动画英文版主题曲专辑《君の名は。English edition》。2月25日-5月10日，举行《Human Bloom Tour 2017》Live。10月18日，发行BD/DVD&LiveCD《Human Bloom Tour 2017》，此次也将在网易云音乐平台同步上线发售。 2018年：2月21日发行单曲「Mountain Top / Shape Of Miracle」。2月24日官方year book 「まとめてボクチン 2017」发布。4月18日发行 “ \'你的名字。\' 交响音乐会” Blu-ray & DVD。6月开始live巡演「Road to Catharsis Tour 2018」。6月6日发行新单曲「カタルシスト」。7月-8月举行海外巡演「RADWIMPS Asia Live Tour 2018」。12月12日最新专辑「ANTI ANTI GENERATION」发行；同日LIVE Blu-ray & DVD「Road to Catharsis Tour 2018」发行。 2019年：2月24日「まとめてボクチン 201官方year book8」发布。3月27日发行「ANTI ANTI GENERATION」(アナログ盤)。6月-8月举行巡演「ANTI ANTI GENERATION TOUR 2019」。');
INSERT INTO `tb_singer` VALUES ('85', 'MYTH & ROID', '日本组合/乐队', 'http://p2.music.126.net/FtseV0yTkjzT-U4-jQyBxQ==/109951163778994282.jpg?param=130y130', 'MYTH & ROID（ミス アンド ロイド）为日本MEDIA FACTORY所属的音乐团体。 Tom-H@ck - プロデューサー、ギター hotaru - 作詞家、コンセプトメイキング KIHOW - ボーカリスト Mayu - ボーカリスト（现已退出） 2015年8月26日发行第一张单曲《L.L.L.》，为《OVERLORD》片尾曲。 2016年2月24日发行第二张单曲《ANGER/ANGER》，为《舞武器·舞乱伎》片尾曲。5月25日发行第三张单曲《STYX HELIX》，为《Re:从零开始的异世界生活》片尾曲。8月24日发行第四张单曲《Paradisus-Paradoxum》，为《Re:从零开始的异世界生活》第二首片头曲。 2017年2月8月发行第五张单曲《JINGO JUNGLE》，为《幼女战记》片头曲。4月26日发行第一张专辑《eYe\'s》，其中《Crazy Scary Holy Fantasy》为剧场版总集篇《OVERLORD 不死者之王》主题曲。');
INSERT INTO `tb_singer` VALUES ('86', 'Valentin', '日本组合/乐队', 'http://p2.music.126.net/RLHyxqT0esen_7pVafQ_UQ==/3383197285993515.jpg?param=130y130', '日本Jazz-Rap');
INSERT INTO `tb_singer` VALUES ('87', 'ONE OK ROCK', '日本组合/乐队', 'http://p2.music.126.net/LmS6iOLzNB_JiRO0Mcgo1w==/109951163799982032.jpg?param=130y130', 'ONE OK ROCK（ワンオクロック），日本AMUSE事务所四人乐队，现任成员：Taka(タカ，Vocal&Guitar)、Toru(トオル，Guitar&Vocal)、Ryota(リョータ，Bass)、Tomoya (トモヤ，Drums)。2005年夏天，Toru和他高中的好朋友ALex以及Ryota一起在准备好他们自己的乐器后组成了摇滚乐队ONE OK ROCK，之后Taka加入他们。2006年7月26日凭借第一张迷你专辑「ONE OK ROCK」出道，销量不错。2007的4月新成员鼓手Tomoya正式加入，4月25日推出的新五人乐团以单曲「内秘心书」同样大受好评。2009年4月5日，吉他手Alex丑闻发生，被逮捕。同年9月，活动再开。2010年2月3日，复归后发布“完全感觉Dreamer”的Oricon单曲榜的乐队首次进入TOP10。同年8月，ROCK IN JAPAN FESTIVAL·SUMMER SONIC·MONSTER baSH等的大型连续出演到夏天结束。11月28日职业首次在日本武道馆进行现场录音。代表作品：《The Beginning》《Re:make》。 内秘心书 努努-ゆめゆめ- エトセトラ 完全感覚Dreamer アンサイズニア Taka(タカ，Vocal&Guitar)、Toru(トオル，Guitar&Vocal)、Ryota(リョータ，Bass)、Tomoya (トモヤ，Drums)   乐队名 ONE OK ROCK 的灵感来自于他们经常预定录音棚时间为 One o\'clock（一点钟），曾用taxis作为候补名。因为他们刚开始进行乐队排练时还是高中生，而只有周末才可以排练，所以他们通常从周六深夜一点（即周日凌晨一点）开始排练到早上。由于日本人的发音，“R”与“L”的发音相同，并且将“O\'C”改成“OK”而成了他们的乐队名。 成立初期（2005年~2006年） 2005年，堀越高等学校山下亨（Toru）、小浜良太（Ryota）、Alex、小柳友（You）四人组成乐团。同年5月、Toru邀请森田贵寛（Taka）加入，担任主唱。7月第一次现场表演在NEW POWER GENERATION Vol.3。 2006年，6月鼓手小柳友为了追求演员生涯而离开乐团。鼓手的职位则暂由神吉智也（Tomoya）担任。7月26日，发行第一次自由迷你专辑“ONE OK ROCK”。8月在THE 梦人岛Fes.2006出演。 五人乐团时期（2007年~2009年） 2007年，加盟Amuse，Tomoya正式加入，并于4月25日发行首张单曲“内秘心书”并正式出道，同年11月21发行首张专辑“奢侈病”（ゼイタクビョウ）。12月展开第一次巡演“クアトロ\"トロトロ\"ツアー \'07”，并将12月28日涉谷场为主的三场演唱会部分录制为DVD“全世界碎纸机”（世の中シュレッダー）发售，为乐团首张演唱会映像。 2008年，5月发行第二张专辑“BEAM OF LIGHT”，仅收录8首歌，为一张Punk风的专辑。在之后2012年的访谈中[5]Taka提到这张专辑是为了成长而做的，对他们来说并非一张真正的专辑。11月发行第三张专辑“感情Effect”，收录了乐团第一首全英文歌“Reflection”。 四人乐团时期（2010年~2012年） 2009年，4月5日吉他手Alex因为在电车上非礼女学生遭到拘捕，此举使原本乐团预定为连续剧“天生妙手”演唱主题曲遭到更换，并且取消了单曲《aroundザworld少年》的发行以及当时的巡回“ONE OK ROCK 2009 “Emotion Effect” TOUR”。其他团员在见过被拘捕的Alex之后，5月中旬ONE OK ROCK宣布Alex退出乐团的消息，从此成为四人乐团，并由Toru担任第一吉他手，将已有的歌曲重新编曲为单吉他的形式。6月，ONE OK ROCK宣布将在同年9月重新展开新的巡回“ONE OK ROCK 2009 \"Overcome Emotion\" TOUR”，以四人姿态重新登场。 2010年，2月3日发表四人乐团时期的第一张单曲“完全感觉Dreamer”，销量大量成长，并于6月9日发行了收录此张单曲的专辑“Niche Syndrome”，为四人乐团时期首张专辑，虽已是单吉他手的乐团，但许多曲目仍为双吉他编曲，收录。8月参加ROCK IN JAPAN FESTIVAL、SUMMER SONIC、MONSTER baSH。11月28日首次在日本武道馆表演。 2011年，发行“残响Reference”，11月起在日本展开“残响 Reference Tour”，并于2012年首次登上横滨体育馆演唱，该场次被记录下来并于5月30日发行DVD/蓝光纪录片。 2012年，6月9日展开“Start Walking the World Tour”巡回演唱，为首次海外个唱演唱会，并首次至台湾演唱。8月22日发行单曲“The Beginning”，作为电影版“神剑闯江湖”的主题曲，至今仍为该乐团youtube上点阅率最高的歌曲，点阅率突破5000万，之后两部续集“神剑闯江湖 京都大火篇”和“神剑闯江湖：传说的最终篇”的主题曲也分别为该乐团的“Mighty Long Fall”和“Heartache”。年底11月15、16日于台湾二度展开海外演唱会。 2013年，10月23日“Who are you??Who are we?? Tour”首次跨足世界各地的世界巡回演唱，首度到港展开演唱，同年12月7日第三次来台展开演唱。台湾场发生了小插曲，在曲目“Let\'s take it someday”时观众情绪过于亢奋而将前方栏杆推倒，表演中断了一阵子，于中断期间ONE OK ROCK演奏了不在演出节目中、较为抒情的“Notes\'n\'Words”舒缓观众情绪。 2014年，1月美籍制作人John Feldmann宣布ONE OK ROCK已经开始制作新的专辑，这张专辑就是隔年2月发行的“35xxxv”。于5月16日上映由海外巡回“Who are you??Who are we?? Tour”制作成的纪录片“FOOL COOL ROCK”，并于11月12日发行DVD/蓝光版本，纪录片主题曲为“Decision”。 加盟华纳兄弟后（2015年~） 2015年，7月7日加盟华纳兄弟音乐，并将于9月于全球发行“35xxxv Deluxe Edition”第一张全英文专辑，这张专辑也会发行台湾版本。同年9月18日于Youtube释出美式POP风的“Last Dance”MV作为Deluxe Edition的宣传。8月30日宣布隔年2016年的“35xxxv Asia Tour”，将于2016年1月16日再次造访台湾，并成为首位登上台北小巨蛋的日本乐团。10月5日于Youtube上公开收录于全英文专辑“35xxxv Deluxe Edition”中的新歌“The Way Back”的日文版，并同时于日本地区iTunes上架。值得注意的是，Taka一直以来的招牌红色麦克风于此MV中变为白色，意外和在乐团MY FIRST STORY同样身为主唱的弟弟撞色了。 2015年，10月9日“35xxxv Asia Tour”开卖当日，售票系统KKTIX号称可“同时开卖 10 场台北小巨蛋 120,000 张票”。当 10 场同时开卖抢票的状况下，系统每秒可以处理 400 笔划位订单。假设每张订单有 4 张票，每分钟约可以处理 10 万张划位票券，但服务器在开卖后1秒马上被灌爆这个问题持续了几个小时，让许多歌迷都没有购买到ONE OK ROCK“35xxxv Asia Tour”的演唱会门票。所以在主办单位和美国的经纪人联络后，决定加场，成为第一组连续2晚在台北小巨蛋开唱的日本乐团。');
INSERT INTO `tb_singer` VALUES ('88', 'EGOIST', '日本组合/乐队', 'http://p2.music.126.net/aN-DehZP5tnXnPejwK8GHg==/109951163955718201.jpg?param=130y130', 'EGOIST是在2011年10月TV动画「罪恶王冠」中设定的拥有超高人气及超大影响力的的网络歌手，在剧中演唱OP/ED以及插曲。而实际上这位歌手则是由supercell的ryo担任制作、并由ryo选出的chelly担任演唱的角色。 动画《罪恶王冠》插入曲以及ED演唱者。 supercell从约2000位候选人中选定的歌姬，日本歌手chelly（日本千叶县出身、19岁）。 目前尚未有其他官方资料放出。 所演唱的罪恶王冠插入曲以及ED受到观看者一致好评，其淡雅清新的声音以及具有自己特色的高音受到欢迎，而配搭上ryo清新的曲风更能让人平静下来。 TV动画《罪恶王冠》的女主角。浅粉色头发深红色眼眸，有着天籁般的嗓音。一面是网络偶像egoist的歌手，同时也是反抗组织葬仪社的16岁女英雄，起初感情不会显露出来，是个颇为神秘的少女。对集来说是令人憧憬的存在，但是与她的相遇却大大改变了集的命运。其虚空是一把巨大的剑。她本人则是是茎道等人为了与真名对话而造出的连接性实验体。但是在与集的相处中，渐渐的拥有了许多情感。 エウテルペ エウテルぺ～ Silence～ Departures～あなたにおくるアイの歌～ The Everlasting Guilty Crown Planetes （只有1、2是EGOIST的） 「THEME SONGS COLLECTION」 ryo(supercell)、泽野弘之によるテーマソング集。 Phase 02「适者-survival of the fittest -」いのりが歌う、『エウテルペ』アナザーバージョン『エウテルペ ～Silence～』や、泽野弘之氏みずからの手による剧伴曲のリミックス（2曲）を収録。');
INSERT INTO `tb_singer` VALUES ('89', 'ハンバート ハンバート', '日本组合/乐队', 'http://p2.music.126.net/OY-7SqksF3dWDNWySQaHtg==/1385384660419778.jpg?param=130y130', '是日本男女双人组民谣团体，成立于1998年。佐藤良成,出生于神奈川县，擅长声乐、吉他、小提琴、曼陀林、作词、作曲。1998年与妻子佐野游穂组成二人民谣组合humbert humbert，佐野游穂在组合中负责声乐、口琴、锡哨笛、作词。 音乐类型 民谣 活跃年代 1998年 - 唱片公司 ミディ（2003年-2008年） Red River Records（2009年） UNIVERSAL J（2010年-） 1998年結成、佐藤良成と佐野遊穂によるデュオ。 2001年CDデビュー。2005年のシングル「おなじ話」が各地のFM局でパワープレイとなったのをきっかけに、東京を拠点としていた活動を全国へ広げる。テレビ・映画・CMなどへの楽曲提供多数。 2007年 映画『包帯クラブ』劇中音楽／舞台『砂利』劇中音楽 2008年 デンマークのデュオ、ハウゴー＆ホイロップとの共作シングルをリリース／小田急電鉄CMソング「待ち合わせ」／日本テレビ系列『2クール』エンディングテーマ「罪の味」 2009年 映画『プール』主題歌「タイヨウ」（佐野遊穂）／ACジャパンCM『あなたでいいのだ。』楽曲およびナレーション（佐藤良成）／スコットランドのグループ、フィドラーズ・ビドとの共作CD＋DVDをリリース／ラジオ番組「ハンバートハンバートのなんじゃらほいアワー」（北陸放送／山陽放送） 2010年 サントリー・ニチレイアセロラCMソング「アセロラ体操のうた」 2011年 スコットランドのフェスティバル「ケルティックコネクション」出演／「群像」4月号（講談社）佐藤良成の短編小説「ばばぬき」掲載／NHK Eテレ『シャキーン！』楽曲提供「ホンマツテントウ虫」 2012年 NHK Eテレ『ハートネットTV』ナレーション（佐藤良成）／村田製作所CMナレーション「恋のドキドキ」篇（佐藤良成）、「届くドキドキ」篇（佐野遊穂） 2013年 NHK Eテレ『おかあさんといっしょ』楽曲提供「ポンヌフのたまご」／CDレビューブログ「佐藤良成のCD原人」開設 2014年 「クーヨン」4月号（クレヨンハウス）表紙 2015年 ミサワホームCM企業ソング「いついつまでも」歌唱／NHK Eテレ『ミミクリーズ』歌唱「おおきさのうた」（作詞・作曲：トクマルシューゴ） 2016年 TOKYO MX 他 アニメ『この素晴らしい世界に祝福を！』楽曲提供 エンディング主題歌「ちいさな冒険者」／初の海外単独公演 MAO上海『清新治愈之音 — 日系民谣组合 humbert humbert 中国首演』／NHK Eテレ『シャキーン！』歌唱および作詞「サイコロソングス」（佐藤良成）');
INSERT INTO `tb_singer` VALUES ('90', 'Goose house', '日本组合/乐队', 'http://p2.music.126.net/JZXqCl_ZXVir_0nCrBa_6A==/109951163418300685.jpg?param=130y130', 'Goose house是由日本一群创作歌手所组成的乐团，当初经过Sony“Walkman”的宣传企划“PlayYou.House”选出，至企划结束后仍然以乐团形式持续演出。 来自随着季节迁徙的鹅，引申为期待以群体的力量投入其中。 乐团发表的影片会上传至Ustream和YouTube等网站，包括乐团的原创曲、翻唱曲影片等。此外，也推出专辑，并参加各地的现场演出。于PlayYou.House时期隔周的Ustream Live则依旧存在，不过时间改为不定期。 （至2014年4月30日为止）有竹渊庆（竹渕庆）、工藤秀平、竹泽汀、マナミ、沙夜香、渡边修平（ワタナベシュウヘイ）、齐藤Johnny（齐藤ジョニー）共7人。已经离开的成员有关取花（PlayYou.House）、中村千寻（PlayYou.House）、木村正英、神田莉绪香、d-iZe。 2010年6月19日集合写真 在此之前以“PlayYou.House”的名义参与表演，直到活动结束后，名称变更为“Goose house”，由相同成员投入乐团。活跃时间为2010年6月 - 2011年3月。 2011年 4月：重启YouTube频道，再度上传自身的乐曲表演。另外，除了从PlayYou.House时期即使用的官方twitter之外，新增乐团的Facebook。 5月：转移Goosehouse的活动场所，于Ustream上再次开始现场演出。此外，活动场所自PlayYou.House时期以来实际地点皆未公开。 10月：在这个月的首次Ustream Live中，加入来自乐团“ANNY PUMP”的マナミ，第二次的Ustream Live则新增另一新成员沙夜香。 12月：PlayYou.House时期属于K.K组的木村正英毕业。   2012年 5月：举办组成一周年的纪念LIVE活动。 5月23日：首张完整专辑《Goose house Phrase #03 Wandering》发行，取得单日Oricon公信榜专辑第七名。 5月26日：齐藤Johnny从Goose house毕业。 6月23日：新成员渡边修平加入（ワタナベシュウヘイ）。 10月1日：首张专辑的歌曲被游戏“绝对☆星”（ゼッタイ☆スター）选为主题曲，自1日Android版、16日iOS版起开始下载。 10月19日：在FM NACK5的广播节目《Midnight Rock City+R》首次担任主持人。 10月24日：第四张专辑《Beautiful Life》发行。参与的由YUI担任制作人的音乐专辑《SHE LOVES YOU》于同日发售。 Goose house Phrase #04 Beautiful Life 2013年 1月：举行乐团首次巡回演唱会，从27日至2月24日止，于名古屋、大阪、横滨开唱。 2月14日：进行日本歌手和亚洲歌手的创作活动、与支持向全球发展的录音设施“YouTube Space Tokyo”，公开其介绍影片的背景音乐启用乐团歌曲《CHANGE!!》。 3月9日：神田莉绪香毕业。 4月2日：齐藤Johnny复出。 7月30日：第七张专辑《Soundtrack?》发行。 8月19日 ~ 10月27日：《Soundtrack?》 live巡演在名古屋、大阪、福冈、东京进行。 11月13日：出演freebit会社手机事业的 「自由の先を见に行こう」活动的印象角色电视广告。 Goose house Phrase #07 Soundtrack? 2014年 2月19日：第一张单曲《オトノナルホウヘ→/恋はヒラひらり》发行。其中《オトノナルホウヘ→》被选作为TV动画《银之匙》第2期ED。 4月：d-iZe毕业。 11月19日：第二张单曲《光るなら》。主打歌《光るなら》被选为TV动画《四月是你的谎言》的OP1。 オトノナルホウヘ→ 期间生产限定アニメ盤 2015年 2月25日：第十张专辑《Milk》和第十一张专辑《Bitter》同时发行。 至2014年4月30日为止。 竹渊庆（竹渕庆） 工藤秀平 竹泽汀 マナミ 沙夜香 渡边修平（ワタナベシュウヘイ） 齐藤Johnny（齐藤ジョニー） 7人 关取花（PlayYou.House） 中村千寻（PlayYou.House） 木村正英（主唱、钢琴） 神田莉绪香（主唱、钢琴） d-iZe 组合 Johnny Beans /齐藤Johnny、d-iZe なんだ神田K.K. /神田莉绪香、木村正英、工藤秀平 1150（ひとひとごーまる。）/神田莉绪香、齐藤Johnny 849 （やしっく）/d-iZe、竹渊庆 ONDOSA /工藤秀平、竹泽汀 signal /工藤秀平、d-iZe、竹泽汀 豆英（やしっく）/d-iZe、木村正英 ミニマム /マナミ、神田莉绪香 R25（チームアダルト）/d-iZe、沙夜香、マナミ ちーむプシュケ /竹泽汀、マナミ、（新：沙夜香・旧：神田莉绪香） ふぇあみり～ /マナミ、工藤秀平、神田莉绪香 チームパワフルモリモリ/渡边修平、竹渊庆、マナミ 大人の余裕/渡边修平、沙夜香、齐藤Johnny お兄さんお姊さん/工藤秀平、沙夜香 播出集数 第1回 Goosehouse Start!! 2011年5月7日 第2回 2011年5月14日 第3回 2011年5月28日 第4回 2011年6月11日 第5回 2011年7月16日 第6回 夏日歌曲（全员集合&同学会） 2011年7月30日 第7回 2011年8月6日 第8回 2011年9月10日 第9回 2011年10月1日 第10回 2011年10月15日 第11回 2011年11月26日 第12回 1时间版也不够用SP 2011年12月10日 第13回 2012年1月21日 第14回 2012年2月18日 第15回 2012年3月31日 第16回 2012年4月14日 第17回 2012年5月26日 第18回 大型新人、现身。 2012年6月23日 第19回 2012年7月14日 第20回 2012年8月11日 第21回 2012年9月22日 第22回 2012年10月27日 第23回 2012年11月17日 衍生 2012年11月22日 2012年回顾 2012年12月15日 第24回 2013年1月19日 第25回 2013年2月16日 第26回 2013年3月9日 第27回 2013年4月20日 第28回 2013年5月25日 第29回 2013年6月29日 第30回 2013年7月20日 第31回 2013年8月24日');
INSERT INTO `tb_singer` VALUES ('91', 'Foxtail-Grass Studio', '日本组合/乐队', 'http://p2.music.126.net/R19_Rn4wD9bYf_AcNlBTnw==/1714138627702799.jpg?param=130y130', 'Foxtail-Grass Studio是东方project同人社团，创立于2010年，于C79发布了第一张专辑《Lupinus 幻想写景 -風-》。这个社团的音乐主要是治愈系的轻音乐，音乐十分适合用来放松，其代表作为雲流れ等。');
INSERT INTO `tb_singer` VALUES ('92', 'SHAUN', '韩国男歌手', 'http://p1.music.126.net/JVgT0Bq7zwXYcqvvyyotig==/109951163537429532.jpg?param=130y130', '韩国 DJ 兼音乐制作人 SHAUN 出生于1990年1月12日，2010年以单曲《Over and Over》出道。他出演过韩国Mnet电视台的DJ生存节目《Headliner》，所属社将他称为韩国的Ed Sheeran、Calvin Harris。他也是独立乐团 THE KOXX 的键盘手。这些年来 SHAUN 一直展现出他作为一个DJ、音乐人、作曲家和制作人的多样天赋，尤其是他精彩绝伦的现场表演，吸引了大量世界各地的粉丝。在2015年夏天，他通过出演韩国 Mnet 电视台的一档DJ生存综艺节目《Headliner》正式亮相，同时也作为一名歌曲制作人，参与过 BOA、EXO、SHINEE、F(X)、少女时代、4MINUTE、EPIKHIGH、李承焕和高润荷等韩国一线艺人的歌曲制作。2013年SHAUN 通过西班牙音乐厂牌 Mirage Records 发行个人独唱单曲《Silence》和《Curta in call》。2018年6月17日发行首张 EP《TAKE》，在韩国获得巨大成功，其中的《Way Back Home》是2018年 K-pop 领域最成功的单曲，排名甚至超过了防弹少年团 BTS 和 BLACKPINK。在YouTube平台，这首单曲抒情的 MV、UGC 视频剪辑和众多翻唱版本已累计获得上亿关注。《Way Back Home》连续五周在韩国 Melon 榜单上排名第一；SHAUN 也作为“2018年度突破独唱歌手”在韩国Melon上连续40天排名第一，是独唱歌手突破记录中登顶第一名时间最长的歌手。');
INSERT INTO `tb_singer` VALUES ('93', 'George', '韩国男歌手', 'http://p1.music.126.net/kumrHJTUvOmXjnHZDhFETw==/109951163462166631.jpg?param=130y130', '죠지，本名이동민，出生于1993年 11月 29日；2016年以个人单曲 [아엠죠지]出道。擅长R&B曲风，是一位优秀的韩国创作歌手。');
INSERT INTO `tb_singer` VALUES ('94', 'July', '韩国男歌手', 'http://p1.music.126.net/Lj_LlJMv-0hHfbw5q8QIag==/879609302244569.jpg?param=130y130', 'July，本名李东勋，是韩国歌手、作曲家。1980年2月6日出生于韩国釜山广域市，曾就读于韩国梁山大学建筑设备系，中途辍学。July于2006年1月23日发行了个人第一张专辑《旧爱》，现在所属社为digitalrecord。');
INSERT INTO `tb_singer` VALUES ('95', 'G-Dragon', '韩国男歌手', 'http://p1.music.126.net/0jQmRXv0j-vVGQ5_Z4BliQ==/18725782534592929.jpg?param=130y130', 'G-Dragon（权志龙，别名GD）出生于1988年8月18日，YGEntertainment公司旗下艺人，也是YG主要制作人之一，拥有出色的作词作曲才能；是韩国偶像组合BIGBANG的制作人、队长兼Rapper，作为solo歌手亦取得巨大的成功，是韩国乐坛数一数二的偶像。具有出众的时尚感被媒体称为Fashion Icon；又因其每次穿着、造型及表演总能引起轰动，被韩国媒体及大众称为“流行缔造者”、“话题制造机”。个性风格独具，拥有超高的人气和影响力。G-Dragon5岁时参加韩国儿童综艺节目BOBOBO，然后参演电影《太白山下》。6岁时小孩组合ROORA出道，并且登上了蚕室演唱会的舞台。8岁-12岁在SM公司里当练习生。小学四年级时，第一次听到并喜欢上HIP-HOP。13岁rapper正式出道《大韩民国hip hop flex》,g-dragon艺名正式启用。13岁-19岁在YG Entertainment练习，六年练习生期间磨练了坚强的意志和过硬的基本功底。19岁以BigBang队长正式出道，22岁solo出道，其优秀的音乐作品不断涌现，其词曲永远带给人们无限惊喜。代表作品：《Heartbreaker》《One Of A Kind》《Crayon》等。 中文名： 权志龙 外文名： G-Dragon（韩文：지드래곤/권지용 / Kwon Ji Yong） 经纪公司： YG Entertainment 现属组合：BIGBANG         小分队：GD&TOP 出道日期 2006年8月19日（韩国） 2009年5月14日（日本） 2013年8月14日（以个人名义在日本出道） 2006年《This Love》 2008年《나만바라봐 Part 2》 2009年《Heartbreaker》 2012年《One Of A Kind》、《Crayon》 2013-02-28    第10届   韩国大众音乐赏 - 最佳Rap / Hip-Hop   （获奖） ▪ 2013-01-31    第22届   首尔歌谣大赏 - 最佳专辑奖   One Of A Kind   （获奖） ▪ 2013-01-19    第27届   金唱片颁奖礼 - 音源本赏   （获奖） ▪ 2013-01-19    第27届   金唱片颁奖礼 - Ceci人气赏   （获奖） ▪ 2013    澳洲Australia PopAsia Awards - 最佳Solo   （获奖） ▪ 2013    HIPHOPPLAYA Awards - 年度Fashion / Style   （获奖） ▪ 2013    HIPHOPPLAYA Awards - 最佳MV   One of A Kind   （获奖） ▪ 2013    3rd Rhythmer Awards - 年度Rap / Hip-Hop单曲奖   One of A Kind   （获奖） ▪ 2012-12-29    第8届   演艺大赏 - 时尚王   （获奖） ▪ 2012-12-29    第8届   演艺大赏 - 吉尼斯记录奖   （获奖） ▪ 2012-11-30    第4届   MAMA颁奖礼 - 最佳男歌手   （获奖） ▪ 2012    欧洲K-pop大奖So-Loved Awards 最佳男子独唱   （获奖） ▪ 2012    Allkpop Awards - 最佳男歌手   （获奖） ▪ 2010-03-01    Cyworld音乐颁奖礼 - 年度最佳歌手   （获奖） ▪ 2009-11-21    第1届   MAMA颁奖礼 - 年度专辑奖   Heartbreaker   （获奖） ▪ 2007-11-17    第4届   MKMF颁奖礼 - 编曲赏   （获奖）');
INSERT INTO `tb_singer` VALUES ('96', 'Yiruma', '韩国男歌手', 'http://p1.music.126.net/7fY0w3LzqvMMkxqQahXwFg==/7708676023531211.jpg?param=130y130', '李闰珉在韩国出生英国长大，曾就学于英国伦敦\'The Purcell School\' 特别音乐学校，后来毕业于 \'King\'s College of London University\' ，主修作曲。在他的音乐作品里，展现了兼融东方的抒情与西方的典雅细致的音乐风格。因主修古典钢琴与作曲，Yiruma展现他傲人的古典才情与欧洲人善感的特质；同时，纯净与清新的东方特色也呈现在他的音色里。藉由细致的音乐性探触，他精致的演奏技巧，予人一种非凡艺术家的深刻印象。YIRUMA是韩国偶像剧大导尹锡湖御用钢琴手。代表作品：《Love Scene》《First Love》《Kiss The Rain》 1990.9 - 1997.7 毕业于在伦敦的 \"The Purcell of Specialist Music School\"，主修钢琴 与作曲 。 1997.9 - 2000.6 毕业于 King\'s College London，University of London，主修作曲，师从于 Harrison Birtwishtle。 1992.6 在Fairfield Hall Croydon的 \"年轻音乐节\" (Young Musician\'s Festiva担任演出 1996.12 参与 \"The Musicians of Purcell\" (Decca) 专辑。 1997.5 参与 George Benjamin 的作品 \"Piano Duet for Two Piano\" 专辑。在 Lontano Ensemble Workshop演出 \"Piano Duet for Two Piano\" 。 2000.4 为 \"TAE\" 戏剧制作一张特别的音乐， 由韩国与英国共同制作。 2001.5 出版第一张专辑 \"Love Scene\"。 2001.12 出版第二张专辑 \"First Love\"， 在世界知名的英国Metropolis制作 。 2001.12 在Youngsan Art Hall 举办 第一场音乐会 \"First Love\"。 2002.1 受邀在第36届坎城Midem唱片展表演， 并在韩国之夜演出。 2002.4 为电影 \"Oasis\" 制作一张特别的音乐专辑，于2002年六月出版。');
INSERT INTO `tb_singer` VALUES ('97', '伯贤', '韩国男歌手', 'http://p1.music.126.net/4OUqNDRmDdYC05rcZBIYJg==/109951163128715745.jpg?param=130y130', '边伯贤，1992年5月6日生于韩国京畿道富川市，韩国男歌手、演员，男子演唱组合EXO成员。 2012年4月8日，随EXO-K发行首张迷你专辑《MAMA》并正式出道，专辑发行一个月后售出7万张。2013年8月14日，在纪念韩国与秘鲁两国建交50周年的足球友谊赛中，献唱韩国国歌。2014年2月16日，与SUHO担任音乐节目《人气歌谣》的主持人。2015年4月，主演爱情网络剧《我邻居是EXO》，该剧是韩国首部点击量破千万的网络剧 ；10月15日，拍摄时尚杂志《ELLE》创刊23周年的画报。2016年1月7日，与裴秀智合作发行单曲《Dream》，歌曲在Gaon Chart的数码综合榜、下载量榜、Streaming榜、专辑榜、公众榜中夺冠；5月13日，与K.Will合作演唱抒情歌《The Day》，歌曲发行后占据MeOn、Genie等8个音乐网站排行榜榜首；8月，出演爱情古装剧《步步惊心：丽》。');
INSERT INTO `tb_singer` VALUES ('98', 'HYE SUNG', '韩国男歌手', 'http://p1.music.126.net/kfmyvwtuOFXcZQt8opm_lw==/109951163462642753.jpg?param=130y130', '韩国独立音乐制作人');
INSERT INTO `tb_singer` VALUES ('99', 'Loco', '韩国男歌手', 'http://p1.music.126.net/mkxrN9lPIVwTG-m3S2yxbw==/18553159209010176.jpg?param=130y130', 'Loco，本名权爀禹，出生于1989年12月25日，朴宰范独立工作室AOMG旗下优秀艺人，韩国说唱界的小清新歌手，大热hiphop选秀节目《show me the money》第一季中的冠军选手。乖乖男的面庞配上真挚的Rap，Loco被韩媒喻为端正的野心家，是韩国hiphop界的优秀新生代力量，被歌坛众前辈着重栽培及看好，拥有超高人气及无限潜力。就像在西班牙语中LOCO意为“疯子”一样，Rapper歌手Loco对音乐像疯了一样执着，放弃所有疯了一样去做，也希望运用说唱的力量在舞台上让观众疯狂。');
INSERT INTO `tb_singer` VALUES ('100', 'PSY', '韩国男歌手', 'http://p1.music.126.net/OWdCOh0yMStrhndtHIl7qA==/623423092970209.jpg?param=130y130', '朴载相，艺名PSY，别名鸟叔，出生于1977年12月31日，毕业于美国伯克利音乐学院，2001年正式的出道，2010年8月签入YG Entertainment，是韩国很著名的R&B实力派歌手，“鸟叔”之名大概是源自于他2001年1月18日发行的正式一辑《PSY来自神经质的世界》中的歌曲《鸟》，这首歌当时在席卷韩国，让鸟叔人气飙升。让鸟叔真正在全球火起来的，是2012年的《江南Style》，2012年11月8日，韩国歌手PSY的《江南Style》获得了吉尼斯认证,打破youtube吉尼斯世界纪录.被评为史上最多网民“Like”数最多的视频。2013年，朴载相推出单曲《绅士》。2014年6月，朴载相与饶舌歌手Snoop Dogg携手合作了《HANGOVER》 。2015年7月，发行个人第七张正式专辑。2017年5月10日，发行第8张正规专辑《4X2=8》。 2012年7月，他发行了单曲江南Style，此曲不断重复和非常容易传唱的旋律，加上Psy于此曲音乐录像带中独特的骑马舞，使此曲突然于网络爆红。直至9月，此曲已经登上美国Billboard Hot 100第二名，是韩国流行音乐在美国创下的最高纪录。该曲同时于苹果公司iTunes Store的音乐录像带排行榜获得第一名。在网上视频网站Youtube，此曲成为该网站点阅率最高的影片及音乐类影片第一名，点阅率达到14亿多（截至2013年3月10日），也是Youtube史上获得“喜欢（Like）”数最多及点阅率增速最快的影片。在美国，此曲获得大量顶尖流行歌手与艺人，如Robbie Williams、Tom Cruise、Britney Spears、Katy Perry、Maroon 5、Nelly Furtado等人推荐，也引起了社会不同阶层的模仿热潮。 2013年4月，他发行了单曲Gentleman。此曲成为该网站增长率最高的影片。 PSY的表演受到皇后乐队的弗雷迪·莫库里很深的影响，邦乔飞、史密斯飞船和枪与玫瑰乐队、图派克、声名狼藉先生、德瑞医生、艾米纳姆、史努比狗狗也对PSY的音乐风格有影响。 2005 第7届M.net KM Music Festival - 最佳影片表演者奖（환희） 2006 第8届M.net KM Music Festival - 最佳音乐录像带奖（Entertainer） 2010 第2届Melon Music Awards - 业绩文化奖（Right Now） 第12届Mnet Asian Music Awards - 制片人奖 第19届首尔音乐大赏 - 公演文化赏 2011 第20届首尔音乐大赏 - 最佳专辑赏 2012 英国UK单曲榜 - 榜首（江南Style） 韩国大众文化艺术奖 - 玉冠文化勋章 MTV Europe Music Awards - 最佳 MV 奖（江南Style） 第40届American Music Awards - 新媒体奖 第14届Mnet Asian Music Awards - 最佳个人舞蹈表演奖（江南Style）、网络最受欢迎艺人奖、最佳音乐录像带奖（江南Style）、年度歌曲奖（江南Style） 第4届MelOn Music Awards - 全球艺人奖、年度最佳歌曲奖、年度最佳MV奖、Top10歌手奖 KBS歌谣大典 - 年度最佳歌曲奖(江南Style) 2013 第27届韩国金唱片大赏 - 音源本赏（江南Style）、音源大赏（江南Style） 韩国形像传播学研究院 - 韩国形象奖 法国NRJ Music Awards - 年度International song、年度music video、特别奖 第22届首尔音乐大赏 - 大赏、本赏 第2届Gaon Chart Kpop Award - 8月音源奖(江南Style) Korea Kids Choice Awards - 最佳男歌手奖 第10届韩国音乐大奖 - 年度最佳歌曲奖(江南Style)、年度最佳音乐人奖 纽约翠贝卡电影节 - 颠覆性创新奖');
INSERT INTO `tb_singer` VALUES ('101', 'Junggigo', '韩国男歌手', 'http://p1.music.126.net/WCNw887Y_nGzSDJjnfW9dA==/18939087788646259.jpg?param=130y130', '郑基高（Junggigo），1980年9月5日出生于韩国首尔，韩国男歌手。 2002年，因参与了 I.F 的《Respect You ( Urban Night Mix )》的合唱而出道。2005年，与JazzyI vy组成“seoulstar”，并推出单曲《do you remember》。2008年，推出首张个人EP专辑《Byebyebye》。2012年，凭借专辑《pathfinder》获得“韩国音乐大赏”最佳R&B部门奖。2014年2月，推出与SISTAR成员昭宥合唱的歌曲《Some》。2015年，凭借歌曲《Some》获得第12届“韩国大众音乐奖颁奖典礼”，最佳流行歌曲奖，并获选年度歌曲。');
INSERT INTO `tb_singer` VALUES ('102', 'J.Fla', '韩国女歌手', 'http://p2.music.126.net/PtePFslTAC5CcrMjTakqmg==/109951163985094652.jpg?param=130y130', 'J.Fla，原名Kim Jung Hwa，韩国歌手,歌曲制作人。2013年正式出道并发行首张原创EP《바보 같은 Story》,出道后不久就迅速在日本和韩国成为热门话题.2016年，J.Fla的翻唱作品在国内转载而得到关注，因其甜美声线和惊艳侧颜得到许多人的喜爱。');
INSERT INTO `tb_singer` VALUES ('103', '泫雅', '韩国女歌手', 'http://p2.music.126.net/9R1pNiqt4AKrH1JrbtyUAw==/109951163076395338.jpg?param=130y130', '金泫雅，出生于1992年06月06日，CUBE Entertainment旗下艺人，女子组合4MINUTE成员之一，外表甜美可爱的她舞蹈性感、节奏强劲，被称为大韩民国最会跳舞的女艺人。泫雅原是Wonder Girls成员，2009年6月18日，以4minute组合成员身份正式复出，以首张单曲《HOT ISSUE》正式出道。2010年1月4日泫雅发表了她的个人单《Change》。2012客串了Psy的《江南style》，后来又演唱了女版《哥哥就是我的Style》。而泫雅个人第二张迷你专辑《MELTING》一经发出，主打歌《Ice Cream》在YouTube里的点击量不到三天就打破了韩国神曲“江南style”的记录，成为了韩国娱乐界在国际的代表人物之一。代表作品：《Change》《Bubble Pop》《Icecream》等。');
INSERT INTO `tb_singer` VALUES ('104', '太妍', '韩国女歌手', 'http://p2.music.126.net/x33NaG488W0SbbN8l-0uyw==/109951163950480788.jpg?param=130y130', '金泰妍(김태연/ Kim Tae-yeon/金泰耎)，艺名太妍(태연/TaeYeon)，1989年3月9日出生于韩国全罗北道全州市，韩国女歌手、主持人，女子演唱团体少女时代成员之一。2004年在第八届SM青少年选拔大赛歌王中夺得第一名，进入韩国SM娱乐有限公司开始练习生生涯。2007年8月以演唱团体少女时代成员身份正式出道。2008年为韩国KBS电视台电视剧《快刀洪吉童》演唱主题曲《如果》；同年12月凭借歌曲《听得见吗》获得第23届韩国金唱片大奖人气奖 。2012年与黄美英、徐珠贤组成了少女时代的小分队组合“TaeTiSeo”。2013年为电影《大明猩》献唱主题曲《Bye》。2014年2月发布歌曲《Set Me Free》。2015年10月8日发行首张个人专辑《I》。2016年2月3日，金泰妍在SM娱乐公司“SM全新企划“旗下数字音乐频道”STATION”中公开歌曲《Rain》。6月28日发行第二张MINI专辑《Why》。2016年11月1日发行数位单曲《11:11》。 太妍为爱贝克思公司公布的官方中文艺名。金泰妍为中国大陆非官方本名译名。金泰耎则是本人韩国身份证上的汉字本名。 早期生涯 太妍在1989年3月9日出生于韩国的全罗北道全州市。家庭成员除父母外，还有一位哥哥（金志勇）和一位妹妹（金夏妍）。中学时期在全州艺术高等学校就读，并且接受歌唱跟舞蹈课程训练。 太妍未出道之前深受前辈BoA影响。BoA舞蹈、歌唱技巧和流利的日语都让太妍折服不已，让她决心以BoA为人生目标。她曾说道：“我一直都想跟BoA一样，在日本和全世界活动”。这个梦想在她后来成为少女时代成员后实现了。 太妍于中学时期开始于SM Academy（SM Entertainment旗下训练学院，已于2013年关闭）接受声乐训练，SM Academy的主席Lee Solim说太妍是他最有印象的学生。太妍的爸爸以前也想过当歌手，所以当太妍问爸爸“我应该去尝试一下吗？”，爸爸立即赞好，并说自己这方面懂得很多，更鼓励太妍去首尔。父母都对太妍的决定很是鼓励。于是，太妍每个星期天都由爸爸陪同由家乡全州到首尔去上歌唱班。2004年，太妍参加SM Entertainment举办的第八届SM青少年选拔大赛，获得最佳歌手奖及大会奖，并因此正式获得SM Entertainment的聘约，成为公司的练习生。 韩国歌手The One（原名郑淳元，或译郑顺渊）曾是太妍的歌唱老师。他称赞太妍是一位优秀独特的学生，对音乐充满热诚，并让她于自己的在单曲〈You Bring Me Joy〉中担任合声。他说：“（那时候）我可以跟更加有名的女歌手合唱，但我想让人知道太妍的才华。” 经过三年四个月的密集训练，太妍在2007年8月5日以女子团体少女时代出道。 2008年2月，当时已经出道的太妍自全州艺术高等学校正式毕业，在毕业典礼的颁奖仪式中获得校方颁发终生成就奖。 ----------------------------------------- 个人歌唱生涯 太妍的个人作品多为电视剧或电影主题曲或插入曲，部分是独唱，更多是与少女时代的其他成员或SM娱乐的歌手合唱。 2008年1月28日，太妍为KBS2连续剧《快刀洪吉童》主唱剧中的主题曲〈如果（만약에）〉，并因此获选为赛柏数码音乐奖的“当月最佳歌曲”。同年3月14日，太妍跟安七炫（Kangta）合作男女对唱歌曲〈7989〉，此曲被收录在安七炫最后一张个人专辑《Eternity》及少女时代第一张同名专辑《少女时代》内，两人在3月27日于Mnet的《M! Countdown》现场节目中献唱此曲。9月17日，太妍又为MBC连续剧《贝多芬病毒》主唱插入歌〈听得见吗（들리나요）〉，并因此歌曲在韩国唱片产业协会举办的2008年金唱片奖典礼中获颁“最佳人气奖”。 2009年9月23日，太妍先与少女时代另一成员Sunny为MBC连续剧《向大地头球》合唱插入曲〈这是爱情（사랑인걸요）〉，不仅于数个音乐流行榜取得冠军，更被誉为2009年下半年最佳原声大碟之一。同年12月12日，太妍与队员洁西卡、徐玄、Sunny、秀英及同公司另一流行音乐团体Super Junior成员圭贤、晟敏、东海和厉旭合唱韩国观光宣传歌曲〈首尔颂（S.E.O.U.L.）〉。 2010年5月2日，太妍与Jessica、徐玄、Tiffany、Sunny、俞利、润娥联同另一团体2PM合唱韩国水上乐园加勒比海湾的广告歌曲〈Cabi〉。同年11月7日，太妍再次跟声乐老师The One合作，两人合唱歌曲〈像星星一样（별처럼）〉。12月13日，太妍为SBS推出的电影《雅典娜：战争女神》主唱其中一首插入歌〈我爱你（사랑해요）〉，此曲在不久后在韩国歌曲流行榜获得第一名的成绩。 2011年1月31日，太妍与歌手金范秀合作，两人合唱歌曲〈不同（달라）〉，同样地在推出不久便进占韩国歌曲流行榜首位。二人于两年后于金范秀的演唱会去再次碰头，演出另一首合唱曲〈男和女（남과여）〉。 2012年3月28日，太妍为MBC连续剧《The King 2 Hearts》主唱剧中插入歌〈疯狂地想念你（미치게보고싶은）〉，此曲在推出当天横扫包括Melon、Naver、Mnet、Soribada、Bugs、Olleh和Daum等韩国各大网上音乐流行榜的冠军位置，实现了“All Kill”（意即横扫所有榜单）的优异成绩，另外此曲亦于KBS的音乐银行原声大碟榜连夺三周冠军。由于歌曲大受欢迎，所以MBC特别邀请太妍于音乐中心节目中现场演唱此曲。歌曲的制作人Park Hae Woon表示“（太妍）完全理解歌曲的含意，将每个细节都细致地表现了出来。”在此之前，太妍本来考虑到少女时代日趋忙碌的海外行程，而打算婉拒推辞这次原声插入曲的制作邀请，但是由于她曾与此曲的另一制作人（即音乐监制李弼浩）在《贝多芬病毒》原声大碟制作完成后，互相约定以后再合作，所以太妍最终还是信守承诺，答应担任这首插入曲的主唱。李弼浩更进一步指出当他自己刚刚接到《The King 2 Hearts》剧本时，就认定只有太妍能胜任此连续剧原声插入歌曲的主唱。 2013年，太妍再为SBS连续剧《那年冬天风在吹》主唱插入曲〈还有一个（그리고 하나）〉。此曲由安七炫包办曲词，是二人继2008年〈7989〉后的再次合作。歌曲一推出后便横扫其他音乐流行榜，再次得到“All Kill”的成绩。稍后，太妍为电影《大明猩》献声，主唱主题曲〈Bye〉的韩文和中文版本，这也是她首次为电影唱主题曲。 2014年，太妍为JTBC的公益活动演唱主题曲〈Colorful〉。其后，她又为SBS连续剧《你们被包围了》主唱插入曲〈爱那一句话（사랑 그 한마디）〉，并于Melon音乐流行榜获得第二名的成绩。 2015年10月7日正式以SOLO歌手身份出道，并发行首张个人专辑《I》。音源公开后在韩国各大音源榜上位居第一，并在13个国家和地区的iTunes专辑榜上获得冠军。10月23日起首次举办个人演唱会《太妍非常特别的一天》。 2016年6月28日，太妍发行第二张迷你专辑《Why》。于28日发行的这张专辑，预售量高达102598张，突破了10万张大关。 2008 Cyworld Digital Music Awards－2月份歌曲奖《如果》 Mnet 20\'s Choice－Hot DJ赏（与强仁，《强仁、太妍的亲密朋友》） 第23届韩国金唱片大赏－YEPP 人气赏《听得见吗》 第3届首尔国际电视剧大赏－OST部门赏 2009 MBC演技大赏－Radio部门新人赏《太妍的亲密朋友》 2010 第16届大韩民国演艺艺术大赏－女子Radio赏 Yahoo Buzz! Awards－女子部门Top Buzz Star奖 2012 第7届首尔国际电视剧大赏－韩流剧集OST赏《疯了般想念》 2015 第10届首尔国际电视剧大赏－韩流电视剧主题歌奖《爱这句话》 第17届Mnet Asian Music Awards－最佳女歌手奖《I》 2016 第25届首尔歌谣大赏－本赏《I》 第30届韩国金唱片大赏－爱奇艺全球女艺人奖、音源本赏《I》 第5届Gaon Chart K-POP Award－10月音源部门年度歌手奖《I》 第8届Melon Music Awards－TOP10奖');
INSERT INTO `tb_singer` VALUES ('105', '宣美', '韩国女歌手', 'http://p2.music.126.net/FmjBjP1FHLJ8a48mXMqQaA==/109951163706126186.jpg?param=130y130', '李宣美（Lee Sun Mi），艺名宣美，1992年5月2日出生于韩国庆州青旦县、韩国女歌手，Wonder Girls组合成员。 2007年2月10日，以演唱团体Wonder Girls出道，年末获得第17届首尔歌谣大赏新人奖，2007年度韩国最受欢迎歌手奖；2010年2月20日，因学业暂时退出Wonder Girls组合； 2013年8月20日，以Solo歌曲《24小时也不够》回归乐坛；2014年2月17日，发行迷你专辑《Full Moon》；12月3日，获得2014Mnet亚洲音乐大奖最佳舞蹈表演奖。 2015年8月3日，Wonder Girls以乐队形式回归，宣美归队担任贝斯手。');
INSERT INTO `tb_singer` VALUES ('106', 'Hari', '韩国女歌手', 'http://p2.music.126.net/WkmD7E4DBJTOfWqY_mcEHQ==/5934064255471547.jpg?param=130y130', 'Hari，韩国女歌手，音译郑圣京，1990年生，出道3年。2013年3月，因《可爱颂》的小情歌急速爆红。2013年3月30日23岁女歌手请人把BTOB郑镒勋2012年在电视节目表演的“数字撒娇”手势写成歌，再配合她的娃娃音演唱，推出了新单曲《可爱颂》，2013年2月推出后立刻吸引大批网友模仿。 姓名：郑圣京 国籍：韩国 民族：朝鲜族 职业：歌手 性别：女 身高：162cm 体重：45kg 生日：1990.02.17 星座：水瓶座 在全球最大视频网站「Youtube」上一首名为《可爱颂》的小情歌急速爆红，没有油滑的腔调和肉麻的歌词，是典型的韩式清新说唱。其亮点在于，这首歌MV的高潮部分，演唱者会边唱「1+1、2+2……」等数字组合，边用两手比划几个相应的可爱手势来表达心中对情人的爱恋。 《可爱颂》是韩国歌手Hari（原名郑圣京，音译）的单曲。对于这首歌的走红，Hari在接受采访时腼腆说：「真没想到这首歌会突然走红。 2013年2月18日，《可爱颂》正式在官方音源网站上公开后，迅速包揽了各大社交网站关键词检索第一位。由于歌词简单易于上口，手势动作「1+1=小可爱」配上Hari的甜美嗓音，「数字恋爱」瞬间俘获了众多少男少女的心。 一首中毒性极强的歌曲就这样诞生了，正如鸟叔的《江南Style》那般，这首歌被无数海内外艺人和网友反覆翻唱流传，煽热了一股「可爱风」。先是韩国美少女的可爱版，后有男生版、警察版、性感版等等，韩流天团Super Junior成员始源及银赫、韩国女星张熙珍等亦进行翻唱，韩国知名谐星刘世允（音译）还特别上传了一部精心炮制的搞笑版MV不仅仅是在网络上流传，这首歌中的「数字可爱」已被韩国各大综艺节目的主持人和嘉宾相继效仿，大街小巷甚至是学校、聚会、练歌厅里都是炙手可热的传唱曲目。 Hari深有感触地说：作为歌手出道已近四年时间，期间漫无目标地一路走来，至今才意识到歌手这一行的真实感与责任感。 然而她的艺名极为普通，直到现在才开始被人关注。对此，Hari给出一个让人意外的诠释：在展开歌手活动之际，为了起一个艺名可谓绞尽脑汁，偶然发现家附近洗衣店中的狗名字叫『Hari』，就立马确定了我的艺名。 她坦言称：「这首歌是由我的经纪人作词作曲，而自己是在小耍淘气的状态下唱出来的，有点古灵精怪，没想到会受这么多人的关注，我真心表示感谢，日后将带着责任心去唱歌。    对于今后的歌曲路线，Hari表示：「我将继续给大家献上更多可爱的歌曲，希望我的歌能够让所有人都感受到幸福和欢乐。」 正如她形容自己的歌曲风格那般，Hari谈到自己的抱负时称：「我将作为一个能够分享幸福与快乐的歌手，逐渐获得大家的肯定，而不会像泡沫一样昙花一现。');
INSERT INTO `tb_singer` VALUES ('107', 'IU', '韩国女歌手', 'http://p2.music.126.net/4BerNRq1kaEaA5JEQPlm4A==/109951163587936941.jpg?param=130y130', '李知恩 (IU)，1993年5月16日出生于韩国首尔特别市，韩国女歌手、演员、主持人。2008年以一首《迷儿》正式出道，历经一年的练习生生涯。2011年以一首《好日子》在韩国走红，随后于2011年末推出正规二辑《Last Fantasy》 PK记录74次，AK约90次。2013年IU发行正规三辑《MODERN TIMES》再次获得关注。2012年~2015年分别位列韩国福布斯名人榜第三、第八、第十和第十四位。2015年，发行迷你专辑《CHAT-SHIRE》，并被《Billboard》认可为韩国流行音乐百强榜的领跑者；同年，获得韩国大众文化艺术奖国务总理表彰奖；2017年4月，发行第四张正规专辑《Palette》。 李知恩还涉足主持以及表演领域，2011年1月，出演校园剧《dream high》；3月，成为SBS音乐节目《人气歌谣》的固定主持人。2013年，凭借周末剧《最佳李顺心》获得KBS演技大赏新人女演员奖 。2015年，主演KBS金土剧《制作人》。2016年，主演古装穿越《步步惊心：丽》。 中文名：李知恩 (曾译”李智恩”) 外文名：IU (艺名)，이지은 (韩文)，Lee Ji Eun (英文)  出生日期：1993年05月16日 星    座：金牛座  血    型：A型  出生地：首尔特别市 毕业院校：同德女子高等学校 经纪公司：LOEN Entertainment 出道日期：2008年9月18日 中国粉丝名称：GuiStar (知恩的吉他( 韩国粉丝名称：U爱娜 (Uaena) 代表作品：《迷儿》、《Boo》、《好日子》、《你和我》、《粉红色高跟鞋》 主要成就：MAMA颁奖礼最佳女歌手奖(两次)   IU，本名李知恩，韩国SOLO女歌手。IU在Green AliensFC评出《最高收入的韩国偶像明星排行榜》第三名。IU从幼儿园开始就十分喜欢听音乐，也常跟着爸爸去唱卡拉OK。在中学一年级时她被体育老师推荐站在了学校演出的舞台上，从那一刻起就萌生了成为歌手的想法。她曾先后20次参加过选拔，包括JYP娱乐举办的练习生选拔，均被拒绝。2007年10月，她通过现时经纪公司LOEN娱乐的试镜，并开始了为期10个多月的练习生生活，其中得到河东均等不少音乐人的帮助。   2008年，9月18日IU于Mnet的音乐节目《M! Countdown》中以演唱《迷儿》一曲正式出道。9月24日，首张迷你专辑《Lost and Found》正式发行。成时京还邀请IU与他一起合唱了歌曲《是你》。同年推出首张专辑《Lost and Found》，在当时以15岁的少女身份为主要特色，她只经历了10个多月的练习期就正式出道。 2009年，4月16日首张正规专辑《Growing Up》正式发行。专辑主打歌《Boo》在三周内成为SBS的音乐节目《人气歌谣》一位后选，并于其他音乐节目和线上音源排行榜取得不错的成绩。其后以后续曲《不是吗！(Rock ver.)》继续专辑宣传，直至8月15日结束。11月12日，第二张迷你专辑《iu...im》正式发行。11月13日，以《棉花糖》作为主打歌于KBS的音乐节目《音乐银行》回归。 2010年，IU的演艺事业迎来了高峰时期，推出的歌曲《好日子》和《唠叨》在各大排行榜上数周占据前几位，同时这两首歌也让她成为歌谣节目中的常胜将军，还获得了金唱片大赏以及首尔歌谣大赏。年中，IU和2AM成员瑟雍为MBC综艺节目《我们结婚了》合唱主题曲《唠叨》。6月27日，凭该曲于SBS的音乐节目《人气歌谣》获得出道后首个一位，其后在7月2日于KBS的音乐节目《音乐银行》中同样获得一位。12月9日，第三张迷你专辑《Real》正式发行。她在专辑主打歌《好日子》中连续三段的高音唱功在当时引起关注，并且凭此曲分别于SBS《人气歌谣》及KBS《音乐银行》夺得出道后首个三连冠。并于Mnet的音乐节目《M! Countdown》中首得一位。2010年末，IU正式向演技领域进军，出演青春电视剧《Dream High》，并受到一些观众的喜爱。 2011年，《好日子》一曲受到不少歌迷的喜爱，但因宣传时间较短让IU留下不少的遗憾。因此在2月17日，额外收录有3首新曲的改版迷你专辑《REAL+》正式发行。韩国线上音乐公司Soribada将《好日子》列为2011年第一季最多人下载的歌曲。3月20日，成为SBS音乐节目《人气歌谣》的主持之一。5月，为动画片《芽芽，走出院子的母鸡》演唱主题曲[11]  。5月14日，参与日本富士电视台在东京举办的《Tokyo Legend 2011》慈善演唱会，为16组韩国演出人员之一。表演其后在7月17日通过富士电视台播出。6月18日，适逢IU出道后的第1004日，于AX-Korea举办了首次官方歌迷见面会及迷你演唱会。7月13日，参与KBS在日本东京举办的《Music Bank in Tokyo》演唱会，为15组韩国演出人员之一。11月29日，发行第二张正规专辑《Last Fantasy》，专辑的全部13首歌曲迅速占据了各大音乐网站榜单的1至13位。海外方面，专辑在iTunes专辑排行榜中获得名次；日本及澳洲获得第一名；美国及加拿大获得第三名；纽西兰获得第十名。12月23日，在KBS的音乐节目《音乐银行》年末结算中以《好日子》取得年度一位。全年凭《Last Fantasy》主打曲《你和我》分别于KBS《音乐银行》及SBS《人气歌谣》中连续6次及3次获奖。 2012年，1月24日在日本举行SHOWCASE正式出道。3月15日，参与KBS在越南河内举办的《Music Bank in Vietnam》演唱会，为7组韩国演出人员之一。3月21日，发行日文单曲《Good Day》。该曲在日本Oricon排行榜一进榜就登上第八名，单周排行榜上则拿下了第六名的佳绩，IU也是少数进入前10名的韩国独立女歌手。4月初，经纪公司宣布将为她举行首次韩国巡回演唱会《REAL FANTASY》。5月11日，第七张单曲《二十岁的春天》在无宣传活动情况下发行，其中凭《桃子》及《一天结束》多次获得前三名成绩。从6月开始，《REAL FANTASY》演唱会于包括首尔和釜山在内的韩国6个不同城市举行。因演唱会准备工作，期间需暂时退出SBS音乐节目《人气歌谣》的主持，直到演唱会完毕。6月23日，在演唱会期间参加了KBS在香港举办的《K-Pop Festival Music Bank in Hong Kong》演唱会，为8组韩国演出人员之一。7月18日，第二张日文单曲《You & I》正式发行。12月29日，成为SBS除夕年度音乐节目《SBS歌谣大战》主持人之一。 2013年，IU位列韩国福布斯名人榜第8位。2月，IU被任命为学校暴力防治形象大使以及名誉警察。1月26日，IU确定演出KBS周末剧《最佳李顺心》的女主角李顺心。2月初，日本专辑《Can You Hear Me?》的封面及造型公开。3月20日，在日本推出首张日语原创迷你专辑《Can You Hear Me?》。7月下旬，公布将于9月11日推出第三张日本单曲《Monday Afternoon》，该辑讲述一位女人满心期待着一个能够找回遗失的爱的机会的故事。7月28日，IU于SBS的音乐节目《人气歌谣》中宣布当天是她在该节目的最后一次主持，告别担任了2年4个月的主持工作。8月25日，IU在《最佳李顺心》大结局后，于网上公开与男主角曹政奭的合唱曲《Beautiful Song》。年9月10日，第三张日文单曲《Monday Afternoon》完整MV由官方提前公开，该曲于11日正式发行。9月17日，官方确定IU将在10月7日凭正规三辑《Modern Times》的推出回归，并发表了一组带有专辑名称的概念照。9月18日，IU透过官方Daumcafe传达对出道5周年的感受和给粉丝们的感谢问候，亦表示全新MV刚拍摄完成，回归的准备也几近完成。9月23日至10月4日，以《双唇之间》为首，官方每隔两天发表一支收录曲的MV预告。并透过音源网站MelOn公开专辑曲目。10月8日韩国时间凌晨0时，正规三辑《Modern Times》音源正式上线。继二辑《Last Fantasy》后，全辑13首歌曲再次攻占了音源榜第1至13名。翌日更于ichart的周榜达到「Perfect All-kill」。主打歌《粉红色高跟鞋》更于回归的第二个星期便取得所有音乐节目一位。 10月22日，IU接拍KBS水木剧《漂亮男人》，和张根硕合作，饰演女主角金普通，是一个比较可爱的普通女孩。10月30日，IU出演综艺节目《隐藏歌手2》。其后节目于11月23日播出，而IU也打破了该节目最终轮的纪录，得到了100票当中的88票，成功地拿下了优胜。此外，该集也以5.515%的平均收视率打破该节目两季以来的收视纪录。12月13日，公司宣布IU计划于12月20日推出正规三辑《Modern Times》的改版专辑《Modern Times - Epilogue》，额外收录两首新歌《星期五见面》及《Pastel Crayons》。《星期五见面》由IU自创，歌曲直白传达恋爱的激动心情，并邀请后辈History的张利贞合唱。而《Pastel Crayons》则是作曲家KZ与Junjaman共同制作，同时也是IU主演的影集《漂亮男人》的原声带收录曲。该专辑也包含她第二场个人演唱会的DVD和特别写真册，限量发售一万张。12月22日韩国时间晚上9时，歌曲《星期五见面》取得ichart的所有日榜一位排名。凌晨0时，歌曲再次达到「Perfect All-kill」，成为ichart改版后获得该称号的第二位歌手。随着《星期五见面》登上美国Billboard杂志K-Pop Chart一位后，IU与女团Sistar及男团Busker Busker并列为该榜成立以来拥有4首榜首歌曲的歌手。 2014年，3月21日IU在上海浅水湾艺术中心大剧场举办中国首场Live Show ；3月24日，李知恩在香港九展举行个人演唱会。2014年福布斯韩国十大名人位列第十位 。5月9日，IU官方Facebook表示翻唱专辑《花书签（꽃갈피）》音源将于5月16日凌晨12点公开，并公开了复古风格的概念照。合作专辑的歌手分别是前辈歌手赵德培、酷龙、金昌完（김창완）、尹尚（윤상）。5月16日凌晨0时，《花书签》音源正式公开。5月17日下午，歌曲《我过去的故事》取得ichart的所有日榜一位排名。5月19日凌晨0时，歌曲《我过去的故事》达到“Perfect All-kill”，成为IU第5首获得该称号的歌曲，是2014年第一位歌手达到“Perfect All-kill”。5月22日至6月1日，IU于首尔西江大学Mary Hall举办8场小型演唱会《One More Step... Just That Much》，表演歌曲中包括《花书签》内全部七首新曲。2014年10月2日0点发行的单曲《昭格洞》，取得了GENIE 实时榜连续7次破表，MelOn 实时榜连续4次破表，全网AK的成绩。 2015年3月9日确定加入KBS金土剧《制作人》，饰演一个外冷内热的大明星。5月8日，她自创的歌曲《心情》首发后在Melon、Mnet、Ollehmusic、Navermusic等8家网站位居第一位，该曲是她送给粉丝的礼物，以古典吉他为主调，旋律简单悠扬，表达了思念重要之人时的心情。8月22日，她和朴明秀为MBC《无限挑战岭东高速公路歌谣祭》组成了“不像理由（GOD-G）的理由”，并发布合作歌曲《Leon》。而《Leon》这首歌曲不仅在歌谣祭中大受好评，更登上了MelOn、Genie、NAVER Music、Olleh Music、Mnet、Monkey3、Soribada等九大音源排行榜的冠军宝座，威力惊人。 10月12日，韩国歌手IU经纪公司LOEN TREE宣布，IU将于10月23日零点公开第四张迷你专辑《CHAT-SHIRE》。这是IU在去年发布特别翻唱专辑《花书签》之后时隔1年零5个月再推出新专辑。IU亲自参与了每一首歌的词曲创作和专辑整体制作，将自己的真实故事收录其中。 10月19日，据韩国《亚洲经济》报道，韩国女歌手IU为纪念第四张迷你专辑的发行，将举办个人巡回演唱会。IU计划将于11月21日-11月22日在首尔奥林匹克公园奥林匹克厅举报“CHAT-SHIRE”个人演唱会，与粉丝们近距离接触。这是继2012年“REAL FANTASY”之后，IU时隔3年再次举办全国演唱会，在演唱会上，IU不仅将首次公开新专辑《CHAT-SHIRE》的主打歌《二十三岁》，还将讲述与专辑有关的故事。另外，IU将此次首尔演唱会为起点，相继在釜山、大邱、光州等4所城市进行巡回演唱会。   2016年1月10日，在台湾举行粉丝见面会, 并首度尝试用闽南语翻唱了莫文蔚的歌曲《爱情》 。2月3日，登上湖南卫视小年夜春晚演唱《好日子》、《Marry you》 。7月9日，以广州为起点，陆续在长沙、南京、重庆、武汉、深圳和成都7个中国城市举办《IU GOODDAY IN CHINA 2016》巡演  。8月29日，主演的古装剧,《步步惊心：丽》在韩国国内及海外多个频道同步播出，她在剧中饰演从21世纪穿越到高丽时代的女子解树。12月3日、4日, 在韩国首尔奥林匹克公园的SK手球竞技场举办一连两场的《24 STEPS:ONE TWO THREE FOUR》演唱会，除了带来精彩的歌舞演出外，也与歌迷们首度分享过去几年她的内心世界；12月16日，在香港于会议展览中心展览厅5BC举办《IU CONCERT 24 STEPS IN HONG KONG》演唱会，并带来《喜帖街》、《喜欢你》两首粤语歌曲。 2017年1月7日，在台湾举行演唱会，并翻唱了田馥甄的《小幸运》。3月24日，正规4辑第一首先行曲《夜信》音源公开，成为韩国Melon音源榜单改版后首个空降一位歌曲，并于26日在韩国八大音源网站达成“Perfect All-kill”。4月7日，第二首先行曲《爱情不太顺》音源公开，并于10日达成\"Perfect All-kill\"。4月21日，正式发表第四张正规专辑《Palette》 。 李知恩艺名为IU，其中“I”指其自己、“U”则指受众群，意为希望自己和观众永远在一起，也希望自己的歌声能使听歌的人产生共鸣。其韩国的粉丝名称为U-ana（Uaena），其中“U”代表英文的you（你），而“ae”是韩文汉字语中“爱”的意思，“na”亦是韩文的“我”。在台湾尚未有其代理公司时，台湾网络上多将其姓名误译为“李智恩”。直至2010年9月26日在韩国SBS播出的节目《星期天真好－英雄豪杰》第11集中，IU在个人履历表的名字汉字一栏中填写的为“李知恩”而非“李智恩”，方获正名。   韩国文化体育观光部 ▪ 2008    11月份最佳专辑奖    Lost and Found    （获奖）   Melon Music Awards ▪ 2014    第6届    十大歌手奖    （获奖）     ▪ 2014    第6届    年度歌手奖    （获奖）     ▪ 2013    第5届    十大歌手奖    （获奖）     ▪ 2012    第4届    十大歌手奖    （获奖）     ▪ 2011    第3届    十大歌手奖    （获奖）     ▪ 2011    第3届    年度歌曲奖    《好日子》    （获奖）     ▪ 2010    第2届    十大歌手奖    （获奖） 首尔歌谣大赏 ▪ 2012    第21届    本赏    《你和我》    （获奖）     ▪ 2012    第21届    年度专辑    《Last Fantasy》    （获奖）     ▪ 2011    第20届    本赏    《好日子》    （获奖）     ▪ 2011    第20届    最佳数码专辑    《Real》    （获奖）  韩国金唱片颁奖典礼 ▪ 2010    第25届    数码音源本赏    《唠叨》    （获奖）    Gaon Chart K-POP大奖 ▪ 2013    第3届    音源部门年度歌手（10月）    《粉红色高跟鞋》    （获奖）     ▪ 2011    第1届    音源部门年度歌手（2月）    《只有我不知道的故事》    （获奖）     ▪ 2011    第1届    音源部门年度歌手（12月）    《你和我》    （获奖）  Ment亚洲音乐大奖(MAMA) ▪ 2014    第16届    最佳女歌手    （获奖）     ▪ 2014    第16届    最受欢迎歌手    （获奖）     ▪ 2012    第14届    最佳女歌手    （获奖）     ▪ 2011    第13届    最佳个人演唱    《好日子》    （获奖）     韩国大众音乐赏 ▪ 2012    第9届    最佳流行歌曲奖    《好日子》    （获奖）     ▪ 2012    第9届    最佳年度歌曲奖    《好日子》    （获奖）     ▪ 2012    第9届    最佳女歌手奖    （获奖）     我们的数字音乐奖 ▪ 2012    第67届    月度歌曲（5月）    《桃子》    （获奖）     ▪ 2011    第66届    月度歌手（12月）    《你和我》    （获奖）     ▪ 2011    第66届    年度歌手    （获奖）     ▪ 2011    第66届    最畅销歌手    （获奖）     ▪ 2010    第65届    月度歌曲（6月）    《唠叨》    （获奖）     ▪ 2010    第65届    月度歌曲（12月）    《好日子》    （获奖） 韩国PD大赏 ▪ 2012    第24届    歌手部门奖    （获奖）         韩国表演艺术奖 ▪ 2010    第17届    新世代歌手奖    （获奖）  日本韩流10周年大奖 ▪ 2013    最佳solo女歌手    （获奖）     日本金唱片大赏 ▪ 2012    第27届    亚洲区三大新人奖    （获奖）     SBS MTV of the best ▪ 2013    最佳solo女歌手    （获奖）     Sona大奖 ▪ 2013    最佳女歌手    （获奖）     Style Icon Awards ▪ 2011    第4届    10 Style Icon    （获奖）     亚洲模特儿大奖 ▪ 2012     人气歌手奖    （获奖）     韩国尼克儿童选择奖 ▪ 2012    第5届    最喜爱女歌手    （