INSERT INTO `tb_singer` VALUES ('108', '尹美莱', '韩国女歌手', 'http://p2.music.126.net/lQoUyyLpIILnBZ_r2kNdqg==/2528876746101225.jpg?param=130y130', '尹美莱在现在的韩国是首屈一指的女RAPPER，绝对的大前辈，老公更是RAP圈内的大佬，两个人堪称韩国HIP POP 音乐的最高结合，可以毫不夸张地说是韩国的Beyonce和Jay-Z。 中文名：尹未来 外文名：Natasha Shanta Reid 别名：Yoon Mi-rae、尹美莱 国籍：美国，韩国 民族：朝鲜族 出生地：美国德克萨斯州波特兰 出生日期：1981年5月31日 职业：rapper 经纪公司：jungle entertainment 代表作品：依靠悲伤、幸福的我、Touch Love 尹美莱在1997 年以4人Hip-hop组合 \'업타운\' 出道，也曾经是二人组合Tashannie的一员，另一成员为Annie Lee，美籍韩裔，现居香港，已婚育一子，老公为Tiger JK。AL经营潮牌Matahari bags。 尹美莱在韩国是首屈一指的女RAPPER，绝对的大前辈，老公更是RAP圈内的大佬，两个人堪称韩国HIP POP 音乐的最高结合，可以毫不夸张地说是韩国的Beyonce和Jay-Z。');
INSERT INTO `tb_singer` VALUES ('109', '金娜英', '韩国女歌手', 'http://p2.music.126.net/fwfwmz4oMux_nYfRiLzMSw==/109951163766704591.jpg?param=130y130', '金娜英（朝鲜语：김나영，1991年12月31日－），韩国女歌手。《Super Star K5》参赛者。金娜英2012年通过参与Jung Key的《Alone》在歌谣界出道，随后一曲《会怎么样呢》横扫各大音源榜，开始受到各方关注。由她演唱的《太阳的后裔》OST《再次见到你》与《任意依恋》OST《Say Goodbye》接连大热，金娜英逐渐成为韩国乃至亚洲范围内受到瞩目的歌手。 原文名：김나영 罗马拼音：Kim Na Young 国籍：韩国 出生：1991年12月31日；韩国首尔特别市 职业： 歌手 语言： 韩语 教育程度：首尔艺术大学实用音乐系 出道作品：《As you told me / 니 말대로》 经纪公司： Neverland Entertainment');
INSERT INTO `tb_singer` VALUES ('110', 'Ailee', '韩国女歌手', 'http://p2.music.126.net/LRHHomvXXr3zNaWhTrXv3w==/18616930883348771.jpg?param=130y130', '李艺真（이예진 )，英文名Amy Lee，艺名Ailee（에일리），美籍韩裔歌手、演员。1989年5月30日出生于美国科罗拉多州丹佛，在新泽西州成长，毕业于苏格兰平原高中，曾就读佩斯大学，现休学中。经纪公司为YMC Entertainment，2012年2月9日以单曲《Heaven》正式出道。 1989年5月30日，李艺真出生于美国科罗拉多州丹佛市，但是在新泽西州长大。毕业于苏格兰平原高中之后进入美国佩斯大学学习。出于对音乐的喜爱，李艺真在Youtube创建了一个叫aileemusic频道。 2006年，李艺真获邀参加“NY Kollaboration 20”最佳声乐歌唱比赛表演；2010年，回到韩国；2011年，9月李艺真在YMC Entertainment实习期间和歌手辉星参加MBC举办的MBC中秋特辑 《歌手与练习生》节目，凭借歌曲《Halo》通过所有评审，拿下第一名。10月和辉星一起合作演唱歌曲《They Are Coming》。 2012年，1月李艺真与姜素拉、林宰范、朴智妍等演员参演电视 剧《Dream high2》，饰演HershE成员之一“Ailee”一角。同时演唱该剧插曲《Super Star》。2月发行数码单曲《Heaven》，正式出道。3月起作为固定嘉宾参加歌唱竞赛节目《不朽的名曲2》。10月发行首张迷你专辑《Invitation》。该专辑主打歌《给你看》以9577分的成绩打败之前连续10周获得音乐银行一位的歌曲《江南style》，获得出道以来首个一位。同年获得第14届Mnet亚洲音乐大奖最佳女子新人奖。11月为爱情剧《浪漫满屋2》演唱插曲《爱情的初感觉》。 2013年，1月李艺真获得第27届韩国金唱片大赏新人奖和第22届首尔歌谣大赏新人奖。同时为情感剧《野王》演唱插曲《冰花》。7月发行第二张迷你专辑《A’s Doll House》，该专辑主打曲《U&I》获得第28届韩国金唱片大赏音源本赏。2月受邀以VIP身份出席第55届格莱美奖。10月为爱情剧《秘密》演唱插曲《眼泪偷走了心》。同时在日本东京涩谷举行日本出道SHOWCASE。11月推出首张日文数位单曲《Heaven》，该专辑收录了出道曲《Heaven》的日语版和《Starlight》。同年获得第15届Mnet亚洲音乐大奖最佳演唱女歌手奖。 2014年，1月发行数字单曲《歌唱的更好了》，该歌曲由歌手辉星创作并且邀请李准出演MV。3月发行日本第二张单曲《U&I》。5月为亲情剧《Triangle》演唱插曲《一天一天》。7月与2LSON推出单曲《re;code Episode V》，合作歌曲《I’m in love》。8月为爱情剧《命运一样爱着你》演唱插曲《Goodbye My Love》，获得第7届韩国电视剧节和第3届大田电视剧节最佳OST奖。9月发行第三张迷你专辑《Magazine》，专辑主打曲《不要碰我》获得第29届韩国金唱片大赏音源本赏  。12月与Amber一同参加多期旅游真人秀节目《美好的一天》。同年再次获得第16届Mnet亚洲音乐大奖最佳演唱女歌手奖 。 2015年，1月为古装剧《闪耀或疯狂》演唱插曲《你也一样吗》。3月发行日本单曲《SAKURA》，该歌曲翻唱自日本乐团生物股长推出的同名单曲，而李艺真以英语歌词重新演绎了这首歌曲。6月推出勇敢兄弟10周年纪念新曲《Johnny》。。9月发行首张正规专辑《VIVID》。 2016年，3月为奇幻剧《回来吧大叔》演唱插曲《因为是爱》。5月为励志剧《戏子》演唱插曲《有你才能活》。10月发行第四张迷你专辑《A New Empire》。 2012 Cyworld Digital Music Awards - 2月份最佳新人奖 第14届Mnet Asian Music Awards - 最佳女子新人奖 第4届MelOn Music Awards - 年度最佳新人奖 第3届European K-POP So-loved Awards - 最佳女子新人奖 第3届Remarkable German Korean Entertainment Awards - 最佳女子新人奖 Korean Updates Awards - 最佳女子新人奖 MBC Show Champion Awards - 最佳女子新人奖 Soompi Gayo Awards - 最佳新人奖 2013 第27届韩国金唱片大赏 - 音源部门新人赏 第22届首尔歌谣大赏 - 新人赏 Jpop Asia Music Awards - 最佳单人女子歌手奖 Soompi France Awards - 最佳单人新人奖 AllKpop Awards - 最佳单人女子歌手奖 Omona They Didn\'t Awards - Best Debut、Best Vocal Performance 第55届格莱美音乐大奖 - Mnet America Rising Star Award 第2届Gaon Chart K-POP Awards - 女子Solo新人奖 第5届Melon Music Awards - TOP10 歌手奖 第15届Mnet Asian Music Awards - 最佳演唱表演女歌手奖《U & I》 第4届European K-POP So-loved Awards - 最佳单人女子歌手奖 第4届Remarkable German Korean Entertainment Awards - 最佳单人女子歌手奖 2014 第28届韩国金唱片大赏 - 音源本赏《U & I） 第5届European K-POP So-loved Awards - 最佳单人女子歌手奖 第7届韩国电视剧节 - 最佳OST奖《Goodbye My Love》 第3届大田电视剧节 - 最佳OST奖《Goodbye My Love》 第16届Mnet Asian Music Awards - 最佳演唱表演女歌手奖《Singing Got Better》 SBS 歌谣大战 - 最佳女歌手奖、TOP10歌手奖 Soompi France Awards - 最佳Solo女歌手奖 2015 第29届韩国金唱片大赏 - 音源本赏《Don\'t Touch Me》 第9届 Cable TV放送大赏 - 歌手部门 人气奖 第23届大韩民国文化演艺大赏 - K-pop部门 10代歌手奖 第17届Mnet Asian Music Awards - 最佳演唱表演女歌手奖《Mind Your Own Business》 2016 第25届首尔歌谣大赏 - 舞蹈表演赏 Rookie Asia Awards - K-pop star奖 第18届Mnet Asian Music Awards - 最佳演唱表演女歌手奖《If You》 2017 Korea cable TV AWARDS 2017 - OST部门大赏《鬼怪》OST《如初雪般走向你》');
INSERT INTO `tb_singer` VALUES ('111', 'Punch', '韩国女歌手', 'http://p2.music.126.net/kxywgUVjA50bX9LcjP0dLg==/109951164031805394.jpg?param=130y130', 'Punch(펀치)，出生于1993年2月19日的韩国新人女歌手，曾参与多部热门韩剧OST演唱。');
INSERT INTO `tb_singer` VALUES ('112', 'BTS (防弹少年团)', '韩国组合/乐队', 'http://p2.music.126.net/o3Tv7bqIaIBGOGoXzuj88g==/109951163992758796.jpg?param=130y130', 'BTS (防弹少年团)，是韩国BigHit Entertainment旗下2013年出道的男子演唱组合，由RM、Jin、SUGA、j-hope、Jimin、V、JUNG KOOK7名成员组成。BTS (防弹少年团)的含意是\"具有承受像子弹一样的时代偏见和压力的音乐团体\"，2017年7月4日则加入了“不安于现状，朝着梦想不断成长的青春”的涵义，原先以“防弹少年团”为英文缩写的“BTS”（BangTan Sonyeon Dan），也增添了“Beyond The Scene”超越现状的意思。BTS (防弹少年团)的官方歌迷名称为“A.R.M.Y”（韩语：아미），这个名称是在2013年7月9日通过官方网站首度亮相，来自于英文“Adorable Representative M.C for Youth”的缩写，意指“值得人们景仰的青年代表”，由成员们阅读约1000个粉丝意见后亲自选出，官方应援物为炸弹造型的手灯“A.R.M.Y BOMB”。2013年6月12日，发行出道专辑《2 COOL 4 SKOOL》；6月13日，以Mnet《M! Countdown》为出道舞台。 经纪公司：BigHit Entertainment 出道日期：2013年06月12日 出道舞台：2013年06月13日 Mnet M! Countdown 出道专辑：《2 Cool 4 Skool》 出道曲目：《No More Dream》 Fanclub名称：A.R.M.Y 艺    名：RM 本    名：金南俊 外文名：김남준 ，KimNamJoon 国    籍：韩国 星    座：处女座 血    型：A型 身    高：181cm 出生地：韩国京畿道高阳市日山 出生日期：1994年9月12日 队内职务：队长 主Rapper 家庭成员：父母，妹妹 ------------------- 艺    名：Jin 本    名：金硕珍 外文名：김석진，Kim Seok Jin，진 国    籍：韩国 星    座：射手座 血    型：O型 身    高：179cm 出生地：韩国京畿道果川市 出生日期：1992年12月4日 队内担当：副主唱、门面担当 ------------------- 艺   名：SUGA 本   名：闵玧其 外文名：민윤기，Min Yun Ki，슈가 国    籍：韩国 星    座：双鱼座 血    型：O型 身    高：176cm 出生地：韩国大邱 出生日期：1993年03月09日 队内担当：领Rapper ------------------- 艺   名：j-hope 本   名：郑号锡 外文名：정호석，Jung Ho Seok，제이홉 国    籍：韩国 星    座：水瓶座 血    型：A型 身    高：177cm 出生地：全罗南道光州市 出生日期：1994年02月18日 队内担当：领Rapper 主舞 ------------------- 艺   名：Jimin 本   名：朴智旻 外文名：박지민，Park Ji Min，지민 国    籍：韩国 星    座：天枰座 血    型：A型 身    高：175cm 出生地：韩国釜山 出生日期：1995年10月13日 队内担当：高音主唱 主舞 ------------------- 艺   名：V 本   名：金泰亨 外文名：김태형，Kim Tae Hyung，뷔 国    籍：韩国 星    座：摩羯座 血    型：AB型 身    高：178cm 出生地：韩国大邱 出生日期：1995年12月30日 队内担当：副主唱 形象担当 ------------------- 艺   名：Jung Kook(柾国) 本   名：田柾国(田正国) 外文名：전정국，Jeon Jung Kook，정국 国    籍：韩国 星    座：处女座 血    型：A型 身    高：177cm 出生地：釜山 出生日期：1997年09月01日 队内担当：主唱 副Rapper 领舞 【2010年－2012年：出道前】 2010年方时赫以Rap Monster为中心成立防弹少年团，后来陆续经历成员汰换，最终七名成员成为防弹少年团出道。 2011年7月，成员们成立Twitter账号，共用同一账号更新生活点滴。 2012年12月17日，Big Hit娱乐为防弹少年团成立官方网志和官方Youtube频道，并且将网志交由成员们亲自管理。除了成员V作为隐藏人物而无法露脸之外，其他成员自此透过网志不时更新自制歌曲、练习影像、log影像等，以及成员Twitter，不断与大众进行交流。 ------------------------------------------------------------------------------------------------------------------------ 【2013年：出道】 首张单曲《2 COOL 4 SKOOL》、首张迷你专辑《O! R U L8, 2?》 5月20日，官方网志暂时关闭并且进入出道倒数计时。27日，公开首支出道预告，借此传达防弹少年团的团体理念与音乐走向。 6月3日，一直保持神秘的成员V成为首位公开出道概念照的成员，成员们发Twitter声援：“秘密武器V终于公开啦！”。4日，公开就读建国大学电影系的Jin、釜山艺术高中舞蹈科首席入学的Jimin，以及团内年纪最小但实力出众的Jung Kook出道概念照。5日，公开队长Rap Monster、SUGA和j-hope出道概念照，整个团体历时三年培训。7日，公开出道歌曲〈No More Dream〉第一个预告，Rap Monster唱道：“面对偏见和挑战，我们将为我们这一代和音乐而战。”，在预告中展现出防弹少年团的强烈形象。12日，首张单曲《2 COOL 4 SKOOL》发行，在首尔Ilchiart Hall举行出道记者会和出道Showcase，并且透过Melon直播。13日，凌晨在Naver网站，“방탄소년단”首次升上即时搜寻榜第一名。同天，于Mnet《M! Countdown》第一个出道舞台，防弹少年团正式出道，初舞台后再次登上Naver即时搜寻榜第一名。14日，音乐节目Music Bank结束之后在场外举办首场短暂的迷你见面会。28日，在汝矣岛举办首场粉丝签名会。 7月8日，《2 COOL 4 SKOOL》在韩国HANTEO排行榜获得日榜和即时销售榜第一名。9日，Big Hit娱乐透过防弹少年团官方粉丝俱乐部，公布防弹少年团的粉丝名称为“A.R.M.Y（아미）”。 9月3日，防弹少年团第一个专属综艺节目《新人王Channel防弹》开始在SBS MTV播出。12日，首张迷你专辑《O! R U L8, 2?》发行，主打歌〈N.O〉传达出“不要活在别人给予的框架里，必须自己找寻自己的幸福”的意念。25日，因韩国直播节目《After School Club》首次登上Twitter关键字世界排行榜第一名（关键字：BTSASC）。 11月6日，以《O! R U L8, 2?》后续曲〈进击的防弹〉回归音乐舞台。14日，获得出道后首座新人奖：Melon Music Awards最佳新人奖]。30日，首次在泰国电视演出，现场集合8000名歌迷参与。 12月，获得欧洲K-Pop So-Loved颁奖典礼的最佳男子新人奖与最佳单曲专辑奖，从15万名欧洲乐迷直接投票中脱颖而出，这是他们首座非韩国颁发的海外奖项。7日，首度进军日本，在日本涉谷O-WEST举办第一场日本Showcase，超过4万6千名歌迷申请，由于申请人数过多而决定在同一天加开一场。9日，官方粉丝俱乐部公告成员SUGA因急性阑尾炎手术而将暂时缺席之后的所有行程。29日与31日，分别参加SBS歌谣大战与MBC歌谣大祭典，展现特别的大型舞台表演。 ------------------------------------------------------------------------------------------------------------------------ 【2014年：发展】 于去年12月在东京举办第一场Showcase《1st JAPAN SHOWCASE –NEXT STAGE-》因反应超乎预期，1月6日在东京追加两场Showcase，1月7日大阪追加一场，共三场的演出，6,500个座位全数售罄。 1月16日获得第28届韩国金唱片大赏的唱片部门新人奖。1月23日获得第23届首尔歌谣大赏的新人奖。2月12日获得第3届Gaon Chart K-POP Awards的最佳男子团体新人奖。2月12日发行第二张迷你専辑《Skool Luv Affair》以描述少年时代的纯爱为主题，借着歌词呐喊：“爱情要火热，唱歌要直率。”由成员们亲自参与制作，透过音乐替同年龄的少年说出心里话，表现了防弹少年独有的音乐风格。”4月6日公开第二张迷你専辑《Skool Luv Affair》后续曲〈Just One Day〉MV。 8月20日发行首张正规专辑《DARK & WILD》主打歌〈Danger〉，并在首尔汉南洞的举办Showcase。10月17日举行世界巡回演唱会《BTS LIVE TRILOGY：EPISODE Ⅱ. THE RED BULLET》。 12月3日作为表演嘉宾，出席于香港举办的Mnet Asia Music Awards（简称MAMA）。23日、26日、31日分别参加SBS歌谣大战、KBS歌谣大祝祭与MBC歌谣大祭典。 ------------------------------------------------------------------------------------------------------------------------ 【2015年】 2015年3月20日，成员Rap Monster发行首张个人Mixtape《RM》。4月29日，发行第三张迷你专辑《花样年华 pt.1》，主打歌〈I NEED U〉。接着以〈I NEED U〉获得首次出道后的The Show、M!Countdown、Music Bank以及Show Champion第一名成为5冠王。6月23日，公开后续曲〈DOPE〉。11月7日，获得第7届Melon Music Awards的男子舞蹈奖。11月27至29日，在首尔奥林匹克公园SK手球竞技场，举行单独演唱会《2015 BTS LIVE 花样年华 on stage》，并决定在演唱会中首次公开新专辑初舞台，包含“花样年华”系列的这次演唱会将会有防弹少年团特有的强烈演出，以及全场乐团Live伴奏。11月30日，发行第四张迷你专辑《花样年华 pt.2》，主打歌〈RUN〉。接着以主打歌《RUN》获得The Show、Music Bank和Show Champion第一名成为5冠王。12月2日，获得第17届Mnet Asian Music Awards的World Performer。12月19日，《花样年华 pt.2》在美国告示牌列位告示牌200第171名，并且在发行首周，于美国告示牌世界专辑榜获得第一名。 ------------------------------------------------------------------------------------------------------------------------ 【2016年】 2016年，《花样年华 pt.2》发行6周后，取得美国告示牌世界专辑榜K-POP史上最初逆行，接着蝉联4周冠军，之后连续15周TOP 10，成为K-POP史上同一专辑最长时间位居第一名和最长期间TOP 10纪录保持人。3月15日，发行第六张日文单曲《RUN》，取得日本公信榜和Tower Record的单日单曲榜第一名。3月21日，美国权威财经杂志《福布斯》为纪念Twitter创立10周年公布统计，防弹少年团成为过去30天被转发次数最高的全球艺人，高达539万次。同日，确定将在5月2日发行青春系列最后一张、同时是特别专辑的《花样年华 Young Forever (화양연화 Young Forever)》，回归歌坛，并且会在专辑发行之后，于5月7日至8日，首次在首尔奥林匹克公园体操竞技场举办演唱会《2016 BTS LIVE 花样年华 on stage : epilogue》。 8月16日，成员SUGA出道后以艺名“Agust D”首次发表同名Mixtape《Agust D》。9月7日，发行日本第二张正规专辑《YOUTH》。 10月10日，发行韩国第二张正规专辑《WINGS》，主打歌为《피 땀 눈물（血汗泪）》。防弹少年团凭借此专辑获得许多纪录：第一个以韩语正规专辑登上美国iTunes Top Album Chart的韩国歌手；第一个进入“英国金榜”（Official Charts）专辑前百大并且空降第62名的韩国歌手；第一个连续三次登上美国告示牌200的韩国歌手，并且在美国告示牌200以第26名及加拿大专辑排行榜第19名刷新韩国团体最高纪录，专辑15首歌曲全部进入世界数位歌曲榜；发布7小时后登上美国iTunes专辑榜冠军，成为第一个以正规专辑创下此纪录的K-POP团体，并且连续2天占据美国iTunes Top专辑榜第一名；第一个停留美国告示牌200超过一周的韩国歌手；第一个被美国FUSE TV选入“最佳专辑20”的韩国专辑，而他们也凭借〈血汗泪〉空降加拿大百强单曲榜第86名。 10月25日，〈DOPE〉MV突破一亿观看次数，成为第一个非三大公司出身而MV观看次数超过一亿的韩国团体。[66] 11月19日，在《MMA》获得“TOP10奖”和“年度最佳专辑奖”。 12月2日，在《MAMA》获得“最佳舞蹈表演男子团体奖”和大赏“年度歌手”，成为第一个非三大公司出身且得到年度歌手奖的团体。12月22日，美国告示牌以“《WINGS》进入告示牌200专辑排行榜前30名，并且刷新K-POP多项纪录”为由，将《WINGS》选为“2016年十大最佳K-POP专辑”第一名。 ------------------------------------------------------------------------------------------------------------------------ 【2017年】 2017年2月13日，发行专辑《WINGS外传：You Never Walk Alone》。歌曲随即占据各大线上音乐排行榜的前十名，其中主打歌〈春日〉登上Melon等韩国八大音源实时榜冠军，并位列美国iTunes的Top Songs排行榜第八名，让防弹少年团成为第一个进入该排行榜前10名的K-POP团体。2月20日，公开第二支主打曲〈Not Today〉的音乐录影带，并在21小时37分钟后突破一千万观看次数，刷新K-POP团体音乐录影带最快突破千万的里程碑，而此项记录保持至6月22日。2月23日，防弹少年团出道以来首次登上《韩国富比士》年度名人榜，在2017年排行榜列位第5名。 3月23日，宣布日本唱片公司改签环球音乐，成为品牌Def Jam唱片公司旗下歌手，首张作品为《血、汗、涙》。4月20日（美国时间），获得美国颁奖典礼第9届《Shorty奖》Arts & Entertainment类别的最佳音乐奖。 5月21日（美国时间），防弹少年团在第24届《美国告示牌音乐奖》获颁最佳社群媒体艺人奖项，并且以3亿的投票数打破了Billboard纪录，成为此奖项设立以来第一个获奖的亚洲歌手。 7月4日，于各大线上音乐网站发行《Come Back Home》，是徐太志与孩子们出道廿五周年纪念翻唱企划《TIME：TRAVELER》的第一首歌曲。 2017年8月11日凌晨零时，官方网站公开《LOVE YOURSELF》新系列故事的首款预告海报，宣告继“学校三部曲”系列和“花样年华”系列之后，防弹少年团的新系列主题为“LOVE YOURSELF”，而这个主题将持续至2018年。 9月18日，防弹少年团时隔7个月携他们最新主题“LOVE YOURSELF”的系列首张专辑《LOVE YOURSELF 承 \'Her\'》回归韩国乐坛，专辑除了以4个版本发售外，成员Rap Monster也亲自参与了隐藏曲制作。韩国时间18时在官方YOUTUBE频道公开DNA音乐录影带以8小时5分的用时纪录成为韩团中用时最短突破千万点阅率的歌手。 防弹少年团以新专辑《LOVE YOURSELF 承 \'Her\'》打进美国Billboard“Billboard200”的第7位，刷新上一张专辑《WINGS》的第26位纪录外，亦是首位可以连续5张专辑登上“Billboard200”榜的韩国歌手。此外，防弹少年团亦首次成功打进“Billboard Hot 100”的85位。是继PSY之后第2个以韩文歌打入Hot 100的韩国歌手。隔一周后，更以第67名打进“Billboard Hot 100”，写下以KPOP团体打进的最高名次，并打破2009年Wonder girls以〈Nobody〉获得第76名，成为最佳纪录。而专辑推出后在九月份便已卖出120万3,533张，并登上Gaon音乐榜该月份专辑销量榜冠军，同时是Gaon销量榜史上唱片销售最多的歌手，亦是继g.o.d于2001年11月凭第4张正规专辑《Chapter 4》录得144万1,209张的销量后，时隔16年再有韩国歌手突破120万销量。 9月26日，即时通讯软件与行动应用程序《LINE》宣布“LINE FRIENDS”企划与防弹少年团合作推出全新概念卡通角色系列“BT21”企划。由防弹少年团员们亲自设计并参与角色创造过程，共创造出8种充满魅力的个性化角色“宇宙明星BT21”：来自BT星球的TATA，在与VAN一起旅行途中意外登陆地球，立志成为地球上的超级巨星，因此与RJ、CHIMMY、COOKY、MANG、SHOOKY和KOYA这些伙伴组成BT21。自企划推出之后，已发行各种LINE贴图与相关周边商品，并在韩国首尔清潭洞、梨泰院、美国纽约、韩国仁川机场等地商店进行商品贩售。 11月13日，Big Hit娱乐公告队长金南俊官方艺名由“Rap Monster”更换成“RM”。原因在于随着防弹少年团出道时间越长，整体的音乐风格也越来越多样化。他未来也将会做出更加多元的音乐，不仅限于“Rap”，所以决定更改艺名。11月19日，防弹少年团获邀出席2017全美音乐奖颁奖典礼，成为首个登上全美音乐奖的韩国团体，并带来专辑主打曲〈DNA〉的表演舞台。 ------------------------------------------------------------------------------------------------------------------------ 【2018年】 2018年2月6日与9日，防弹少年团〈MIC Drop〉和〈DNA〉分别在美国唱片业协会获得金奖认证，成为首个获得美国唱片业协会认证殊荣的韩国团体。3月2日，成员J-Hope推出首张Mixtape。4月4日，防弹少年团发布第三张日本正规专辑《Face Yourself》。 5月18日防弹少年团携第三张正规专辑《Love Yourself 轉 \'Tear\'》回归乐坛。 5月20日（美国时间），防弹少年团在第25届《美国告示牌音乐奖》再度获颁最佳社群媒体艺人奖项，并且即场表演新歌〈Fake Love〉。 5月28日，美国告示牌宣布了防弹少年团第三张正规专辑《Love Yourself 轉 \'Tear\'》发行首周后于美国告示牌Billboard 200获‘得第一，该成绩是韩国歌手亦是亚洲歌手首次缔造的纪录。 5月29日，防弹少年团本月18日推出的韩文正规三辑《Love Yourself 轉 \'Tear\'》主打歌〈Fake Love〉进入Billboard Hot 100排行榜第10名，首度有韩国团体于该排行中排名Top 10。 6月8日，韩国《Gaon音乐榜》发表的5月专辑排行榜资料，《Love Yourself 轉 \'Tear\'》 推出14天售出166万4041张，夺得“月专辑排行榜”之冠，创下Gaon统计史上“单月最高销售纪录”。防弹少年团的专辑售卖成绩是《Gaon音乐榜》统计史上的最高纪录，亦是时隔17年8个月，首度有专辑售破166万张。 6月29日，防弹少年团被美国《TIME》列为“于网络最具影响力的25名人”之一，成为连续两年打入名单的首个韩国团体以及韩国歌手。 7月9日，国际足球联合会于Instagram选出世界杯足球赛准决赛的背景音乐，防弹少年团《Love Yourself 轉 \'Tear\'》的主打歌〈Fake Love〉获得最高票数，获选为世界杯准决赛背景音乐。 7月15日，防弹少年团正规三辑《Love Yourself 轉 \'Tear\'》以175万117张的累计销量摘下“2018上半年专辑榜”冠军，该专辑也是韩国最具代表性的榜单“Gaon Chart”开始专辑销量认证制度以来，第一张获得百万专辑认证的作品。 7月17日，防弹少年团所属经纪公司Big Hit娱乐宣布将于8月24日推出“Love Yourself”系列新作以及终章《Love Yourself 結 \'Answer\'》。 7月25日，《Love Yourself 結 \'Answer\'》韩国国内预售量突破151万，刷新了韩国国内的记录。 8月15日，防弹少年团〈Fake Love〉获得美国唱片业协会金奖认证。成为继〈Mic Drop〉和〈DNA〉之后第三度获得美国唱片业协会的金唱片认证，成为获得最多金唱片认证的韩国歌手。 8月24日，《Love Yourself 結 \'Answer\'》正式发行。 【2013】 第5届Melon Music Awards－新人奖 第4届European K-Pop So-Loved Awards－最佳男子新人奖 第4届European K-Pop So-Loved Awards－最佳单曲专辑奖《2 Cool 4 Skool》 第4届Remarkable German Korean Entertainment Awards－最佳新人奖   【2014】 第28届韩国金唱片大赏－唱片部门新人奖 第23届首尔歌谣大赏－新人奖 第3届Gaon Chart K-POP Awards－最佳男子团体新人奖 第9届Soompi Awards 2014－年度新人奖 第2届音悦V榜年度盛典－新人奖   【2015】 第29届韩国金唱片大赏－唱片本赏 第24届首尔歌谣大赏－本赏 第4届Gaon Chart K-POP Awards－年度世界新人奖 第29届日本金唱片大奖－亚洲年度新人奖 Europe Music Awards－最佳韩国艺人奖 第7届Melon Music Awards－男子舞蹈奖〈I NEED U〉 第17届Mnet Asian Music Awards－World Performer   【2016】 第25届首尔歌谣大赏－本赏 第30届韩国金唱片大赏－唱片本赏 第5届Gaon Chart K-POP Awards－全球韩流明星奖 第11届Soompi Awards 2015－突破歌手奖 第11届Soompi Awards 2015－最佳舞台造型奖〈DOPE〉 第11届Soompi Awards 2015－最佳编舞奖〈DOPE〉 第7届韩国大众文化艺术奖－文化体育观光部