INSERT INTO `tb_singer` VALUES ('113', 'EXO', '韩国组合/乐队', 'http://p2.music.126.net/WHSpYYP9pDOhZV332CrenA==/109951163641201684.jpg?param=130y130', 'EXO是韩国SM娱乐有限公司于2012年4月8日正式推出的12人男子流行演唱团体。现以金珉锡、金俊勉、张艺兴、边伯贤、金钟大、朴灿烈、都暻秀、金钟仁、吴世勋9名成员的形式展开活动。EXO这个名字从意为太阳系以外的外部行星EXO PLANET一词中得来，蕴含了他们是从未知的世界来的新星之意。2012年4月8日，推出首张迷你专辑《MAMA》正式出道。2013年6月3日，发行首张正规专辑《XOXO》，正规一辑《XOXO（Kiss&Hug）》专辑销量突破100万张 。2014年5月7日公开发行的第二张迷你专辑《Overdose》。2015年3月30日，发行第二张正规专辑《EXODUS》。2015年6月3日，发行正规二辑改版专辑《LOVE ME RIGHT》。2016年6月9日，发行第三张正规专辑《EX\'ACT》。8月18日，发行正规三辑改版专辑《LOTTO》。 所属公司：S.M.Entertainment 出道时间：2012年4月8日 口号：We Are One！我们是一体的！ 分队：EXO-M、EXO-K 粉丝名称： EXO-L   【现任成员】   Xiumin (시우민) 本名：金珉锡 (김민석/Kim Min-seok)， 出生日期：1990年3月26日 出生地点：韩国京畿道南杨州市 国籍：韩国   Suho (수호) 本名：金俊勉 (김준면/Kim Jun-myun) 出生日期：1991年5月22日 出生地点：韩国首尔特别市 国籍：韩国 队内担当：队长            Lay (레이) 本名：张艺兴 出生日期：1991年10月7日 出生地点：中国湖南省长沙市 国籍：中国                     Baekhyun  (백현) 本名：边伯贤 (변백현/Byun Baek-hyun) 出生日期：1992年5月6日 出生地点：韩国京畿道富川市 国籍：韩国                     Chen (첸) 本名：金钟大 (김종대/Kim Jong-dae) 出生日期：1992年9月21日 出生地点：韩国京畿道始兴市 国籍：韩国                     Chanyeol  (찬열) 本名：朴灿烈 (박찬열/Park Chan-yeol) 出生日期：1992年11月27日 出生地点：韩国首尔特别市 国籍：韩国                     D.O.   (디오) 本名：都暻秀 (도경수/Do Kyung-soo) 出生日期：1993年1月12日 出生地点：韩国京畿道高阳市 国籍：韩国   Kai (카이)  本名：金钟仁 (김종인/Kim Jong-in)   出生日期：1994年1月14日 出生地点：韩国首尔特别市 国籍：韩国                     Sehun (세훈) 本名：吴世勋 (오세훈/Oh Se-hun) 出生日期：1994年4月12日 出生地点：韩国首尔特别市 国籍：韩国   【已离队成员】                      Luhan(鹿晗)、Kris(吴亦凡)、Tao(黄子韬)   2011年: 成立 2011年年中，SM Entertainment的创办人李秀满受邀出席到美国史丹佛大学进行演讲。李秀满首次提到正在准备推出一个新组合，最初计划由七名韩国籍成员和五名中国籍成员组成一个十二人的组合，并使用同一个组合名字分别在韩国和中国活动，组合的主打歌更会用中韩两种语言的策略去发布。EXO在成立初期暂称为“M1”和“M2”。 该组合正式命名为EXO，EXO由八名韩国籍成员和四名中国籍成员组成一个十二人的组合。子团体分别是EXO-K和EXO-M，EXO-K由Suho、Baekhyun、Chanyeol、D.O.、Kai和Sehun组成，EXO-M由Xiumin、Luhan、Kris、Lay、Chen和Tao组成。EXO首支预告片透过YouTube于12月23日公开，截至2012年3月1日合共发布了23支预告片。12月29日，成员Kai、Luhan、Tao和Chen在SBS《歌谣大战》中首次亮相。  -------------------- 2012年: 出道、MAMA时期 1月30日，由Luhan与Chen及Baekhyun与D.O.分别演唱中韩版本的数位序曲〈What is Love〉通过各大音乐网站公开。3月8日，通过YouTube公开第二首数位序曲〈History〉的MV。3月9日，正式发行第二首数位序曲〈History〉的音源。3月31日，在韩国首尔奥林匹克公园奥林匹克大厅举行《EXO 出道Showcase》，当日更邀请了从8000人申请中被选中的3000名粉丝参加。4月1日，在中国北京对外经贸大学图书馆报告厅举行另一场《EXO 出道Showcase》。 4月8日，EXO-K与EXO-M以首张迷你专辑主打歌〈MAMA〉分别在韩国的SBS《人气歌谣》和中国的第十二届《音乐风云榜年度盛典》正式出道。4月9日，正式发行首张迷你专辑《MAMA》的音源和唱片。5月15日，EXO-M首次正式在韩国电视上亮相，并于MBC《Show Champion》演唱主打歌〈MAMA〉。5月20日，EXO-K与EXO-M出道后首次合体于SBS《人气歌谣》演唱主打歌〈MAMA〉。 截至2012年底，EXO的首张迷你专辑《MAMA》总合共取得30万张的销售记录。在各大歌曲颁奖典礼中包揽多个新人奖项，成为2012年值得关注的新人组合。   -------------------- 2013年: 突破、XOXO时期 5月16日，SM Entertainment公布EXO将携首张正规专辑《XOXO (Kiss&Hug)》回归，专辑概念照以学校毕业照片引发话题。新主打歌的宣传活动为《MAMA》时期后首次以12人合体的形式往返于中韩两地进行活动。6月3日，正式发行首张正规专辑《XOXO (Kiss&Hug)》的音源和唱片，《XOXO (Kiss&Hug)》成功取得韩国各大音乐排行榜一位与韩国唱片排行榜Gaon Chart6月份销量统计排行第一位。6月14日，EXO凭借《XOXO (Kiss&Hug)》取得美国Billboard的“全球专辑排行榜”一位。 8月5日，正式发行首张Repackage正规专辑《GROWL (Kiss&Hug)》的音源和唱片[13]。主打歌〈GROWL〉在音源发布后随即登上包括Melon、Olleh Music、Mnet、Genie、Bugs、Soribada、Naver Music、Daum Music在内的8个音源网站即时榜的一位。此外，首张Repackage正规专辑《GROWL (Kiss&Hug)》也荣登HANTEO Chart、Hot Tracks、Yes24等各种唱片销量统计排行榜的实时以及日排行前列，Kiss（韩文）版和Hug（中文）版分别占据榜中一及二位。12月9日，正式发行冬季特别版专辑《十二月的奇迹》的音源和唱片。其后在2013年11月28日至2014年2月13日播放首个团综《EXO\'s SHOWTIME》。 据韩国唱片排行榜统计Gaon Chart，首张正规专辑《XOXO (Kiss&Hug)》和首张Repackage正规专辑《GROWL (Kiss&Hug)》总合共售出100.7577万张销售量，为韩国时隔12年后再次售出100万张以上的专辑。2013年，EXO分别横扫甜瓜音乐奖、Mnet亚洲音乐大奖、KBS歌谣大庆典、金唱片奖、首尔音乐奖和Gaon Chart K-POP大奖等韩国主要音乐奖项大赏，火爆的人气更被韩国媒体喻为“2013年大势”组合。   -------------------- 2014年: 发展、Overdose时期 1月3日，受邀出席韩国文化艺术界人士新年问候会并与韩国总统朴槿惠见面握手和交谈。1月16日，登上美国Billboard的“2014年受瞩目的14位艺人”，并在“Billboard200”排名中登上第129位，成为首组上榜的韩国男团。 4月1日，SM Entertainment宣布EXO于4月15日回归，随后开始公开主打歌名称〈Overdose〉与一系列全新概念照。其后，受到世越号沉没事故影响，全国陷入悲痛中。韩国三大电视台暂停播映所有娱乐节目，以致原定于4月15日发行的EXO第二张迷你专辑《Overdose》及回归的宣传活动也随着事故而延后。 4月19日，EXO于中国全球中文音乐榜上榜舞台上正式回归，并演唱中文版主打歌〈上瘾〉。5月7日，正式发行第二张迷你专辑《Overdose》的音源和唱片，在音源发行后登上包括MelOn、Mnet Music、Bugs、Soribada、Olleh Music、Genie和Naver Music在内的7个音源网站即时榜的一位。此外，这次的唱片预购量高达66万张，创造迷你专辑预购数量的历史最高记录。5月8日，EXO-K于Mnet《M! Countdown》首次公开主打歌《Overdose》回归初舞台。 5月15日，中国籍成员Kris向首尔中央地方法院提出诉讼，提出与SM Entertainment的专属合约无效。5月22日，SM Entertainment在官方网站发表公告表示EXO将以11位成员的形式，进行他们首次的演唱会。5月23日，于首尔奥林匹克体操竞技场展开首次亚洲巡回演唱会《EXO FROM. EXOPLANET ＃1 - THE LOST PLANET -》。8月5日，官方公布EXO的粉丝名称为“EXO-L”并招募全球官方粉丝俱乐部会员，粉丝俱乐部公开招募约一星期已有接近200万人登记。10月10日，中国籍成员Luhan提出与SM Entertainment的专属合约无效申请，并于向首尔中央地方法院提出诉讼，成为五个月内EXO第二位离团的成员。  -------------------- 2015年: 发展、EXODUS时期、Sing For You时期 1月15日，EXO凭借第二张迷你专辑《Overdose》于第29届金唱片奖上分别获颁“唱片大赏”和“唱片部门－本赏”。1月22日，EXO于第24届首尔音乐奖上凭借《Overdose》获颁“大赏”和“本赏”。 3月7日，EXO于首尔奥林匹克体操竞技场展开第二次巡回演唱会《EXOPLANET ＃2 - The EXO\'luXion -》。3月18日，SM Entertainment于YouTube公布成员的回归预告。3月28日，于各大音乐网站公开第二张正规专辑《EXODUS》主打歌〈Call Me Baby〉音源。3月31日，SM Entertainment于YouTube公开〈Call Me Baby〉韩文版、中文版MV。4月8日，SM Entertainment通过官方报导公布中国籍成员Lay在中国设立工作室的消息。6月3日，SM Entertainment于YouTube公开〈Love Me Right〉韩文版、中文版MV，为〈Call Me Baby〉的后续曲。 8月24日，自中国籍成员Tao(黄子韬)向首尔中央地方法院提出诉讼，正式申请与SM公司专属合约无效，成为EXO出道三年第三位提出合约无效并离团的成员。 12月10日凌晨公开冬季特别专辑《Sing For You》音源及主打歌〈Sing For You〉韩文版、中文版MV。全部音源凌晨公开后，席卷韩国各大音源排行榜第一位。包括了Melon、Naver、Bugs、Genie、Monkey3、Soribada等主要音源排行一位，其他收录曲也名列前茅。12月10日于韩国时间晚上10时在乐天世界举行Comeback Stage,是次舞台通过Naver V App直播，逾超过138万观众人数及逾7500万的点赞数结束，打破了单日艺人放送的最高纪录，刷新纪录。 -------------------- 2016年: 飞跃，正规3辑《EX\'ACT》、成员Lay SOLO及子团体EXO-CBX出道 5月7日，EXO〈Overdose〉韩文版MV在youtube点击率突破一亿。5月20日〈Growl〉韩文版的MV观看次数亦突破一亿。 5月31日，EXO所属公司SM公布EXO将于6月9日回归歌坛的消息。 6月1日，SM公司释出此次EXO回归的概念照。翌日释出成员概念照，公布此次回归将以双主打〈Lucky One〉及〈Monster〉进行活动。 6月3日，公开此次主打歌之一〈Lucky One〉的预告。6月6日公开主打歌之一〈Monster〉的预告。 EXO与NAVER期下V APP合作，成为V LIVE+(收费） 的第一组主人公。6月6日及6月7日播出成员个人节目。 6月8日，EXO举行回归Showcase。专辑《EX\'ACT》，预售量为66万180张，当中包括韩文版的44万2890张及中文版的21万7290张，创下韩国史上最高预售量的纪录。 6月9日，凌晨公布双主打中韩版本MV。据统计截止至韩国时间2016年6月9日上午8时，EXO正规3辑《EX\'ACT》双主打曲之一〈Monster〉横扫8大音源榜1位。另一首主打曲〈Lucky One〉则占据各音源榜2位。6月15日，SM公司宣布EXO将于7月23、24、29、30及31日，在首尔奥林匹克公园体操竞技场举办“EXO PLANET #3 - The EXO\'rDIUM”演唱会，并且以首尔站为起点，正式展开他们的第三次巡回演唱会之旅。 6月24日至7月23日，在位于首尔江南区三城洞的SM COMMUNICATION中心1楼，SMTOWN COEX ARTIUM 6楼举办了EXO海报及视频展示会。 7月21日，成员 KRIS、鹿晗与SM Entertainment的诉讼， 长达约两年的合约纠纷在日前正式结束，随着法院下达和解建议的决定，三方当事人最终协议根据原本的合约内容，合约将有效维持至2022年。并表示 KRIS、鹿晗虽然与公司仍然是合约关系，但相关人员表示：“他们当然不会作为 EXO 一员活动，也没有这样的计划。”，他们在韩国与日本的活动仍然由SM公司负责，而除此之外地区的活动则需向公司缴纳一定比例的收入，并正式退出组合。 8月12日，SM公司宣布EXO将于8月18日推出正规3辑Repackage《LOTTO》，透过19日播出的《音乐银行》正式展开打歌活动。EXO的Repackage专辑《LOTTO》将包含正规3辑《EX’ACT》的9首收录曲，再收录包含同名主打曲〈LOTTO〉在内的4首新歌，共计13首歌曲。成员Kai因早前于演唱会上扭伤脚踝，因此需要专注治疗，无法参与回归的音乐节目宣传活动。 8月18日，公开正规3辑Repackage《LOTTO》全碟音源及同名主打曲韩中版本音乐录影带。截至18日上午九点，新主打歌〈LOTTO〉已经拿下Melon、bugs、Mnet、Naver、genie、monkey3、soribada、olleh等韩国8大音源榜即时1位。 正规三辑《EX’ACT》在6月9日发售后，截至本月17日已售出79万6085张，而该专辑的repackage版《LOTTO》也已创下37万4280张的销量，两个版本的总销售量加起来达到了117万4280张。这是EXO在正规一、二辑后，连续第三张销量突破百万销量的专辑，让他们创下了白金三冠王的新记录。另外，因改版主打歌曲〈LOTTO〉被KBS及MBC裁定涉及特定商品品牌名字，拒绝让EXO登上旗下节目打歌。最后，SM娱乐公布于KBS及MBC的音乐放送上，将以〈LOUDER〉代替原来〈LOTTO〉的曲名。 8月22日，EXO〈Call Me Baby〉韩文版在Youtube上打破1亿点击率，亦成为EXO第3首破亿的音乐录影带。 9月2日，SM娱乐公布EXO第二本写真集《dear happiness》将于9月20日公开发售，并由7日起于SMTown@Coexartium、明洞乐天Young Plaza Sum内举行展览。 9月21日，SM娱乐公布EXO成员LAY将成为EXO首位SOLO歌手，正准备个人SOLO专辑，并以2016年下半年推出为目标。个人专辑将会在中韩两地同时推出并宣传，引起广泛关注。 10月5日，SM娱乐表示EXO成员伯贤、XIUMIN和CHEN 将组成子团并发行专辑。同日，中国籍成员LAY其工作室公开了LAY 参与词曲创作的Solo抢听曲《what U need?》MV拍摄花絮照，歌曲亦于10月7日（其25岁生日）通过中韩两地各大音乐网站公开音源和MV，以此作为在生日当天，送给歌迷粉丝朋友们的礼物。此外，10月9日LAY通过釜山举办的“2016 Asia Song Festival”演唱会中献初舞台[49]。 10月28日，中国籍成员LAY首张迷你专辑《LOSE CONTROL》于中韩同时公开，预售量更突破20万。这次专辑的6首中文单曲都由LAY亲自作曲，给粉丝们展现只属于其音乐风格色彩，并正式在中国开始首张SOLO专辑的活动。 10月31日，子团体EXO-CBX将推出首张专辑《Hey Mama！》正式出道。 12月7日，EXO于日本发行第二张单曲《Coming Over》。   金唱片奖(Golden Disk Awards) l 2015年金唱片奖Global人气赏 l 2015年金唱片奖 唱片部门－本赏 《EXODUS》 l 2015年金唱片奖 唱片部门－大赏 《EXODUS》 l 2014年金唱片奖 唱片部门－本赏 《Overdose》 l 2014年金唱片奖 唱片部门－大赏 《Overdose》 l 2013年金唱片奖 唱片部门－本赏 《XOXO (Kiss&Hug)》 l 2013年金唱片奖 唱片部门－大赏 《XOXO (Kiss&Hug)》 l 2012年金唱片奖 新人赏   Melon Music Awards(MMA) l 2016年Melon Music Awards TOP10 l 2016年Melon Music Awards 年度艺人 l 2016年Melon Music Awards 网友人气奖 l 2016年Melon Music Awards KakaoTalk Hot奖 l 2016年Melon Music Awards 男子舞蹈奖《Monster》 l 2015年Melon Music Awards TOP10 l 2015年Melon Music Awards 年度专辑 《EXODUS》 l 2014年Melon Music Awards TOP10 l 2013年Melon Music Awards TOP10 l 2013年Melon Music Awards 网络人气赏   Mnet亚洲音乐大奖(Mnet Asian Music Awards，MAMA) I 2016年MAMA年度专辑《EX\'ACT》 I 2016年MAMA男子组合赏 I 2016年MAMA 