INSERT INTO `tb_singer` VALUES ('114', '脸红的思春期', '韩国组合/乐队', 'http://p2.music.126.net/fuIg3rclf0VVIf24wDqMDA==/109951163969999101.jpg?param=130y130', '脸红的思春期（볼빨간 사춘기/Bolbbalgan4）为韩国的女子双人独立乐队，由안지영（安智英，主唱）和우지윤（禹志润，贝斯, 吉他, 副主唱,rap）组成，于 2016年4月22日通过《Half Album RED ICKLE》正式出道。后因《Full Album RED PLANET》中一曲《给你宇宙》逆袭韩国的各个音乐排行榜而被大众所熟知。 禹志润 生日：1996年1月6日 国籍：韩国 身高体重：160CM,44KG 血型：A型 队内担当：贝斯, 吉他, 副主唱,rap 安智英 生日：1995年9月14日 国籍：韩国 身高体重：165CM,45KG 血型：A型 队内担当：主唱 安智英与禹志润是高中的同班同学，均在庆尚北道荣州市出生。两人因共同拥有成为歌手的梦想而组成乐队。 曾于2014年以《庆北 荣州 乡村乐队 脸红的思春期》之名组成的四人乐队，参加Mnet媒体的选秀节目《Super Star K6》，后在10强止步。 2016年4月22日通过《Half Album RED ICKLE》正式出道 2016年11月19日凭借《Full Album RED PLANET》中的《给你宇宙》一曲获得Melon Music Awards独立音乐奖。 团名取自禹志润的害羞性格，以及安智英的像青春期少女般的行动，她们希望自己的音乐能像青春时期一样诚实和纯粹，所以命名为“脸红的思春期”。 获奖记录 2016年 Melon Music Awards独立音乐奖 《给你宇宙》');
INSERT INTO `tb_singer` VALUES ('115', 'BIGBANG', '韩国组合/乐队', 'http://p2.music.126.net/aO4DvS66i4I9UjcHgX0oSQ==/109951163708666108.jpg?param=130y130', 'Bigbang是于2006年出道的韩国组合，由队长权志龙(G-Dragon)、崔胜铉(T.O.P)、东永裴(太阳)、姜大声、李胜贤(胜利)五位成员组成。2006年8月19日，Bigbang在YG Family世界巡回演唱会首尔站上正式出道，并于同年12月22日发行首张正规专辑《BIGBANGVOL.1 SINCE2007》。2007年5月，Bigbang开始进行全国巡回演唱会，并于7月推出了第一张迷你专辑《谎言》。2011年，BigBang成为历史上第一个获得MTV 欧洲音乐大奖“Worldwide Act”的亚洲组合，并于2012年上半年登上美国格莱美官方网页，成为首个被格莱美介绍的韩国歌手。 【出道日期】2006年8月19日（韩国）             2009年6月24日（日本） 【活跃年代】2006年至今 【经纪公司】YG Entertainment 【唱片公司】YG Entertainment（韩国）             YGEX（日本）             华纳音乐（亚洲） 【粉丝名称】V.I.P 【应援物】皇冠灯   【现任成员】  G-Dragon(지 드래곤) 本名：权志龙(권지용) 别名：GD 国籍：韩国 出生日期：1988年8月18日 毕业院校：庆熙大学 组合担当：队长、Rapper、作词、作曲 主要成就：2007年MKMF最佳编曲赏                  2008年韩国十大作曲家                  2008年最佳魅力先生                  2009年MAMA年度最佳专辑                  2009年Melon年度最佳专辑                  2009年Melon Top10                  2009年CY音乐颁奖礼年度最佳歌手                  2011年Melon最佳Style Rap/HipHop                  2012年MAMA最佳男歌手                  2012年MBC演艺大赏吉尼斯记录奖                  2012年MBC演艺大赏时尚王                  2013年金唱片颁奖礼本赏                  2013年首尔歌谣大赏年度最佳专辑   T.O.P(탑) 本名：崔胜铉(최승현) 国籍：韩国 出生日期：1987年11月4日 毕业院校：檀国大学戏剧电影学系 组合担当：Rapper、作词、作曲 主要成就：大钟电影节获SONATA韩流人气奖                  New Style Icon 最佳演员新人奖                  青龙电影节最佳男新人奖                  青龙电影节人气明星奖                  百想艺术大赏电影部最佳男新人奖                  百想艺术大赏 电影部人气奖   太阳(태양) 本名：东永裴(동영배) 别名：SOL 国籍：韩国 出生日期：1988年5月18日 组合担当：主唱、作词、作曲 主要成就：2010年MAMA最佳男歌手奖                  2010年All Kpop Awards - 最佳男歌手奖                  2009年韩国大众音乐奖 - 最优秀R&B & Soul歌曲奖                  2009年韩国大众音乐奖 - 网民选定男歌手奖   大声(대성) 本名：姜大声(강대성) 别名：D-LITE 国籍：韩国 出生日期：1989年4月26日 组合担当：主唱、作词   胜利(승리) 本名：李昇炫(이승현/李胜贤) 别名：V.I 国籍：韩国 出生日期：1990年12月12日 组合担当：主唱、忙内、作词   【团名由来】 团体名称BIGBANG为宇宙大爆炸之意。歌迷的官方名称为“V.I.P very important people”，名称来自BIGBANG第2张单曲《BIGBANG is V.I.P.》。官方应援物为黄色皇冠手灯。 【演艺经历】 Bigbang五位成员G-Dragon、TaeYang、SeungRi、DaeSung和TOP在小学六年级时便加入YG，然后一直接受严格训练。之后，Bigbang被选中作为Se7en的伴舞，接受Se7en的训练。 2006年8月19日，在韩国首尔奥林匹克竞技场举行的YG Family世界巡回演唱会首尔站上，Bigbang正式出道。之后跟TONY AN的校服公司SKOOLOOKS正式签下了为期6个月的广告代言合同。8月30日，MBC的音乐银行，给了他们长达8分钟的舞台，五个人的介绍DANSE和两首歌的完整现场表演。第一张同名单曲《BIG BANG》发行的第12天，9月10日，他们举办了首次的歌迷见面会，5天后又迎来了首次showcase，之后开始了正式的宣传。9月23日，Bigbang在MBC MusicCore正式以新人身份登上舞台。9月28日，Bigbang发行第二张单曲《BigBangis VIP》。二单发行后不到一个月，Bigbang与FILA签订3个月的代言合同，并在11月获得CY World选定“10月的新人”，11月22日，Bigbang发行第三张单曲《Bigbang03》。11月25日，Bigbang入围2006 Mnet KM Music Festival最佳新组合赏。12月22日，Bigbang发行首张正规专辑《BIGBANGVOL.1 SINCE2007》。12月30日，Bigbang在首尔蚕室体操竞技场举办第一次单独演唱会“THE REAL”，由此，官方歌迷会“VIP”成立。在2006年底MBC的歌谣大对决的现场，Bigbang作为开场的表演嘉宾，演唱了《BIGBANG》，《LA LALA》，《V I P》的串烧版。 2007年5月，Bigbang开始进行全国巡回演唱会BIGBANGLive Concert Tour“Want You”，途径仁川、春川、大邱、昌源四个城市。7月，Bigbang推出了第一张迷你专辑《谎言》。 2011年，BigBang以组合姿态回归韩国歌坛，成为历史上第一个获得MTV 欧洲音乐大奖“Worldwide Act”的亚洲组合，并于2012年上半年登上美国格莱美官方网页，成为首个被格莱美介绍的韩国歌手。 2012年7月，BigBang首度到中国巡演。 2013年，五位成员各自进行solo音乐活动。 2014年4月，Bigbang等18名艺人成为所属社YG娱乐公司的股东。 2015年4月1日，BigBang确定回归，并于五月、六月、七月、八月、九月分别发行《MADE》系列数字单曲专辑回归，也是BigBang时隔三年团体回归；5月1日，BigBang发行数字单曲辑《M》，6月2日，BigBang发表数字单曲辑《A》，7月1日，BigBang发表数字单曲辑《D》。8月5日，大型数字单曲专辑《E》。 【获奖记录】 2006 SBS歌谣大奖 - 本赏 Cyworld - 10月新人奖 2007 首尔歌谣大赏 - 数码音源奖 首尔歌谣大赏 - 大赏 第22届金唱片颁奖典礼 - 本赏 Cyworld Digital Music Award - 8月人气歌曲奖〈谎言〉 Cyworld Digital Music Award - 9月人气歌曲奖〈谎言〉 Mnet KM Music Festival - 最佳编曲人奖（谎言）、最佳男子组合奖、年度最佳歌曲奖〈谎言〉 MKMF颁奖典礼 - 编曲赏（G-Dragon） 第8届大韩民国影像大典 - 男子歌手部门最佳摄影奖 Cyworld Digital Music Award - 12月人气歌曲奖〈最后的问候〉 2008 Korea Kids Choice Award - 最佳男歌手奖 第17届首尔歌谣大赏 - Digital Award、High One音乐奖、最佳唱片奖、本赏、年度十大最佳歌手奖、大赏 Mnet\'s 20 Choice Award - Hot Trend Musician奖 Cyworld Digital Music Award - 9月人气歌曲奖〈一天一天〉 Style Icon Awards - 造型男歌手奖 Mnet KM Music Festival - 年度最佳歌手奖、最佳男子组合奖、年度艺术奖、数位音乐奖、Mnet音乐门户奖 Cyworld Digital Music Award - 11月人气歌曲奖〈红霞〉 2009 第21届PD大奖 - 歌手部门大奖 Korea Kids Choice Award - 最佳男歌手奖 Mnet 20‘s Choice - Hot CF Star奖〈Lollipop〉 第11届Mnet Asian Music Awards - 年度专辑大奖 - G-Dragon〈Heartbreaker 〉 第1届Melon Music Awards - TOP 10奖、年度专辑大奖 - G-Dragon〈Heartbreaker〉 第3届 The Musical Award - 人气赏 （胜利 ） 第18届