INSERT INTO `tb_singer` VALUES ('116', '(G)I-DLE', '韩国组合/乐队', 'http://p2.music.126.net/XkwK15zr9e9Xv7H5tuh6Gw==/109951164174505650.jpg?param=130y130', '(G)I-DLE，(韩语：(여자)아이들），是韩国Cube娱乐旗下的六人女子音乐组合，六位成员包括美延、Minnie、昭妍、穗珍、雨琦、舒华，将于2018年5月2日，以迷你一辑《I AM》、主打 《LATATA》出道。团名写法为“(G)I-DLE”（韩语：(여자)아이들），读音为“I-DLE”（韩语：아이들）。团体名称为“(女)孩子们”，有着将各位不同个性的女孩子聚集起来的意义。 美延 (미연/Miyeon) 本名：曹美延 (조미연) 出生日期：1997年1月31日 出生地：韩国   Minnie (민니) 本名：Minnie Nicha Yontararak (มินนี่ ณิชา ยนตรรักษ์) 出生日期：1997年10月23日 出生地：泰国   穗珍 (수진/Soojin) 本名：徐穗珍 (서수진) 出生日期：1998年3月9日 出生地：韩国 就读学校：韩国艺术高等学校   昭妍 (소연/Soyeon) 本名：全昭妍 (전소연) 出生日期：1998年8月26日 出生地：韩国 官方定位：队长   雨琦 (우기/Yuqi) 本名：宋雨琦 出生日期：1999年9月23日 出生地：中国北京 就读学校：北京101中学   舒华 (슈화/Shuhua) 本名：叶舒华 出生日期：2000年1月6日 出生地：中国台湾桃园市 就读学校：华冈艺术学校 戏剧科 曹美延：2010至2015年，曾是YG娱乐练习生，其后歌唱学院学习音乐。2016年，9月曾与林瑟雍公演，12月曾参与林瑟雍演唱会。2017年，7月参与《YOU》Cover。2018年，2月参与《Missing You》、《Love Scenario》Cover， 3月参与《Try》、《First Love》Cover。 Minnie：曾于泰国Grammy Vocal Studio (Gvocal) 学习唱歌。2014年，9月参加Cube Star World Audition。2016年，11月曾参与全素妍的公演舞台。2017年，6月参与Rising Star Cosmetics 代言，6月演唱Line Friends的儿歌《Twinkle twinkle little star》 。11月参与Line Friends的《Dance Party》英文专辑。 2018年，2月参与《Missing You》、《Love Scenario》Cover， 3月参与《Try》、《First Love》Cover。 徐穗珍：曾于舞蹈和歌唱学院学习歌舞，并考进韩国艺术高中，高中三年级时参加Cube面试，2016年进入Cube。 全昭妍：2014年，1月参加Cube面试进入Cube。2016年，出演Mnet《PRODUCE 101》、《Unpretty Rapstar 3》，2017年，发行出道单曲《Jelly》，2018年，发行单曲《Idle Song》。 宋雨琦：2015年，参加Cube Star World Audition，2017年，6月参与Rising Star Cosmetics 代言。 2018年，2月参与《世上的温度》影片。 叶舒华：2015年，曾参与AF娱乐的Dance Cover。2016年，4月参加Cube Star World Audition。[31]2017年，6月参与Rising Star Cosmetics 代言。 9月出演10cm的《PET》MV、花絮影音。 1月11日，预计昭妍将加入新女团。3月22日，确定昭妍加入新女团，已完成专辑封面拍摄。 4月5日，公开团徽设计。4月7日，公开社群账号。4月9日，公开美延、雨琦个人照。4月11日，公开穗珍、舒华个人照。4月13日，公开Minnie、昭妍个人照、团体照。4月15日，首次全体公开活动，于弘大街头表演。 5月2日，以迷你一辑《I AM》、主打《LATATA》出道。 5月22日，出道仅20天即在音乐节目《THE SHOW》夺下出道后首个一位。5月24日，在音乐节目《M Countdown》获得出道以来第二个一位。5月29日，在音乐节目《THE SHOW》获得第三个一位。 8月14日，韩国时间下午6时，公开首张数位单曲《한 (一) 》。7时，主打歌《HANN(Alone)》空降Melon20位、Mnet46位、Soribada100位、Naver Music53位、genie17位、Bugs2位六大音源实时榜。');
INSERT INTO `tb_singer` VALUES ('117', 'T-ara', '韩国组合/乐队', 'http://p2.music.126.net/ZfdxyAleCzBP6ZF2fXa23g==/3419481180607870.jpg?param=130y130', 'T-ara，别称“皇冠团”，拥有“韩国最百变女团”、“歌谣界的变色龙”等美誉，是M-net公司准备了三年时间的女子组合，于2009年7月29日出道，由全宝蓝、李居丽、朴素妍、咸恩静、朴孝敏、朴智妍六名散发不同魅力的成员组成。组合名称T-ara源自英文Tiara，意指将成为歌谣界的女王。T-ara以无限挑战的团队宗旨完美诠释了百变的无尽吸引力及超高风格驾驭力，如今不仅在歌谣界发光发热，更是在影视界、艺能界小有建树，是韩国极具代表性的偶像团体之一。主要代表作品有《Bo peep Bo peep》《Roly Poly》《Cry Cry》《lovey dovey》等。');
INSERT INTO `tb_singer` VALUES ('118', '少女时代', '韩国组合/乐队', 'http://p2.music.126.net/b4GUHufeoC2tGEgXIQ8htQ==/18703792302097354.jpg?param=130y130', '少女时代（英语：Girls\' Generation；朝鲜语：소녀시대／少女時代 Sonyeo Shidae；日语：少女時代／しょうじょじだい Shōjo-Jidai），是韩国SM娱乐于2007年推出的女子组合。2007年8月5日以〈Into The New World〉一曲正式出道。少女时代在亚洲以及国际都拥有广大的知名度，在韩国被誉为国民女团。 少女时代的应援口号为：“现在是少女时代！以后是少女时代！永远是少女时代！ ”（韩语：지금은 소녀시대！앞으로도 소녀시대！영원히소녀시대！）。官方粉丝名叫“S♡NE”（소원，读音似英文的So One，韩文意思为“愿望”），应援色是玫瑰粉红色。 2014年9月30日，时为成员的Jessica表示因与公司未能达成共识而退出少女时代，往后组合以八人形式进行活动。 2017年10月9日，Tiffany、秀英及徐玄不再与经纪公司SM娱乐续约；太妍、Sunny、孝渊、俞利及润娥则完成续约。SM娱乐方面表示：“少女时代对于SM也好对于粉丝们也好都是具有重要意义的团体，成员们也都绝无解散意愿，只是在有成员合约到期的状况下，对少女时代往后的活动成员们会慎重的讨论后再作出决定。” 中文名： 少女时代 外文名： 韩文 （소녀시대）日文（しょうじょじだい） 英文（Girls\' Generation） 出道日期 韩国：2007年8月5日 日本：2010年9月8日 美国：2011年10月19日 出道作品：《Into The New World》 经纪公司：SM Entertainment 现成员：金泰妍、李顺圭(Sunny)、黄美英(Tiffany)、金孝渊、权侑莉(Yuri)、崔秀英、林允儿、             徐珠贤(徐贤) 离队成员：郑秀妍(Jessica) 组合含义：少女时代组合名取自少女们主导的时代即将到来的含义。 应援色：粉玫瑰色 应援物：粉玫瑰色心形气球、粉玫瑰色应援气球 粉丝名：SONE（发音：So One 韩文写法:소원 中文写法:夙愿） 粉丝名含义：So代表少女时代，One代表歌迷齐心一致，少女时代和歌迷在一起。 小分队：少女时代—Taetiseo（金泰妍、黄美英、徐珠贤） 070829 《再次重逢的世界》Cyworld 8月份Song of the Month奖 071006 【第14届大韩民国演艺艺术赏】 最佳新人女子组合 071213 【韩国第22届金唱片大赏】人气赏 & 新人赏 080131 【韩国第17届首尔歌谣大赏】人气赏 & 新人赏 080405 【第15届文艺表演大赏】 最佳新人赏 080406 韩国CYworld网络歌曲第一名《如果》（泰妍） 080823 【Mnet 20\'s Choice】 最佳Hot DJ奖（泰妍）& Hot Sweet Music奖（《Kissing You》） 081015 【第五届亚洲音乐节】 亚洲最佳歌手奖 081112 【第15届大韩民国演艺艺术奖】 最佳女组合 081210 【韩国第23届金唱片大赏】人气赏（泰妍《听得见吗》） 081231 【2008年KBS演技大赏】 人气奖 & 女新人（允儿） 090227 【第45届韩国百想艺术大赏】 电视剧女新人 & 人气奖 （允儿） 090911 【首尔电视大赏】《听得见吗》最佳ost（泰妍） 090919 【第六届亚洲音乐节】 亚洲最佳歌手奖 091017 【韩国文化观光部】 2009今天的年轻艺术家奖 091130 【第17届大韩民国文化演艺大赏】 歌谣部门大奖 091208 【第4届NAVER HOOD颁奖礼】 少女时代FAN CAFE获 No.1 Fan Cafe \'Cistus\' 091210 【韩国第24届金唱片大赏】 音源本赏 & 音源大赏 091216 【韩国首届Melon大赏】 年度TOP10 & 年度SmartRadio & 年度OdesseyMusic & 年度MobileMusic & 年 度歌曲大赏《Gee》& 年度歌手大赏 091221 【2009国会大奖】 大众流行音乐 091229 【2009MBC放送演艺大赏】 歌手特别奖 091230 Radio 泰妍的亲密朋友 FM部门优秀赏 同时间段收听率第一 091230 【MBC演技大赏】 泰妍的亲密朋友Radio 新人赏 100103 【第16届大韩民国演艺艺术奖】 最佳女子组合 Radio 进行奖（《泰妍的亲密朋