2012年 2');
INSERT INTO `tb_singer` VALUES ('119', 'iKON', '韩国组合/乐队', 'http://p2.music.126.net/BcwQubHpMqhEKvkhQVAYOQ==/109951163708689510.jpg?param=130y130', 'iKON是YG Entertainment于2015年8月推出的男子演唱团体，由金振焕、宋允亨、金知元（Bobby）、金韩彬（B.I）、具俊会、郑粲右、金东赫7名成员组成。 B.I，队长、Rapper，本名金韩彬，1996年10月22日出生 金振焕，主唱，1994年2月7日出生 宋尹亨，主唱，1995年2月8日出生 Bobby，Rapper，本名金知元，1995年12月21日出生 具俊会，主唱，1997年3月31日出生 金东赫，门面、主唱，1997年1月3日出生 郑粲右，1998年1月26日出生 金韩彬曾在2009年与MC梦合作歌曲《Indian Boy》。具俊会初三时曾组成乐队“绝赞”出演SBS综艺节目《K-POP STAR》并进入决赛，并曾以“13岁MJ”身份出演SBS综艺节目《Star King》。郑粲右曾出演《大王世宗》、《该隐与亚伯》等多部电视剧，并在《花样男子》和《继承者们》中饰演李敏镐的少年时期。 金东赫曾在2012年JYP公开选秀里被评为舞蹈部门第一名。  2013年8月23日，成员金振焕、宋允亨、金知元、金韩彬、具俊会、金东赫作为Team B出演YG Entertainment出道生存节目《WIN:WHO IS NEXT》与Team A竞争 ，但最后Team A获得胜利。 2014年成员B.I和Bobby参加Mnet节目《SHOW ME THE MONEY 3》，Bobby获得冠军。2014年9月11日，在《WIN:WHO IS NEXT》组成的Team B与梁洪硕、郑粲右、郑镇馨出演YG Entertainment出道生存节目《MIX & MATCH》，最后Team B和郑粲右胜出比赛，并成为iKON成员；11月3日，公开第四名成员具俊会；11月4日，公布第五名成员宋允亨；11月5日，公布第六名成员郑粲右；11月6日，公第七名成员金东赫；11月15日，作为表演嘉宾参与BIGBANG日本演唱会《BIGBANG JAPAN DOME TOUR 2014〜2015 “X”》。 2015年1月28日，被Billboard评选为2015年值得关注的K-POP明星TOP5；6月16日，代言户外运动品牌NEPA；6月17日，为杂志《HIGH CUT》拍摄写真。9月15日，发布首张正规专辑先行曲《取向狙击》并正式出道，发布后在MelOn、Mnet等8个音源网站的榜单上占据1位，并在马来西亚、泰国等7个国家和地区的iTunes单曲排行榜上排名1位；10月1日，发布正规专辑半专辑，专辑发布后席卷11个国家的iTunes专辑排行榜冠军位置，主打曲《RHYTHM TA》登上Genie、Olleh等音源排行榜的1位，另一主打曲《AIRPLANE》以及其他收录曲也均在排行榜前10位；10月3日，举办首个演唱会“SHOWTIME”；11月7日，获得第7届MelOn Music Awards 男子新人奖；11月16日，发布正规专辑收录曲《APOLOGY》和《ANTHEM》，《APOLOGY》发布后在MelOn、Bugs等5个音源榜单名列1位，而《ANTHEM》也在榜单靠前位置；12月2日，获得第17届Mnet亚洲音乐大奖最佳男新人奖；12月14日，正式发布首张正规专辑《WELCOME BACK》，收录曲《DUMB&DUMBER》《I MISS YOU SO BAD》《WHAT’S WRONG?》都在不同的音源网上排名1位。 2016年1月14日，获得第25届首尔歌谣大赏新人奖；1月20日，获得第30届金唱片大赏音源部门新人奖；5月29日，发布单曲《#WYD》，歌曲发布后包揽Naver音乐、Music-Olleh等7大音源榜单的1位，也在泰国、越南等国家的iTunes音乐单曲榜单上获得1位；6月，出演音乐节目《盖世音雄》。2016年11月19日，获得2016MMA首次通过海外数字音乐平台票选特别大奖Tencent·QQ Music Asia Star”。');
INSERT INTO `tb_singer` VALUES ('120', 'GFRIEND', '韩国组合/乐队', 'http://p2.music.126.net/NJPzkC5Tc_3vPk2ZqAaiNQ==/109951164178911682.jpg?param=130y130', 'GFRIEND(여자친구)是韩国Source Music于2015年推出的女子演唱团体，由金韶情(So Won)、郑艺琳(Ye Rin)、丁恩妃(Eun Ha)、崔俞娜(Yu Ju)、黄恩妃(Sin B)、金艺源(Um Ji)，六名成员组成。2015年1月16日，GFRIEND发行首张专辑《Season of Glass》，以主打歌《Glass Bead》正式出道。粉丝名为Buddy。 所愿 外文名：소원、So Won 本名：金韶情 出生日期：1995年12月7日 队内担当：队长、Rapper   艺琳 外文名：예린、Ye Rin 本名：郑艺琳 出生日期：1996年8月19日 队内担当：领舞，形象担当   银河 外文名：은하、Eun Ha 本名：丁恩妃、정은비 出生日期：1997年5月30日 队内担当：领唱   俞宙 外文名：유주、Yu Ju 本名：崔俞娜 出生日期：1997年10月4日 队内担当：第一主唱   信飞 外文名：신비、SinB 本名：黄恩妃、황은비 出生日期：1998年6月3日 队内担当：主领舞   严智 外文名：엄지、Um Ji 本名：金艺源 出生日期：1998年8月19日   出道经历 出道前 2014年10月30日，Source Music公开将于11月推出6人女团。同日，官网介绍4位成员：Sowon、Yerin、SinB与Umji。 GFRIEND原定出道日期为11月21日，后延迟至2015年。2015年1月15日，Source Music通过官网公布GFRIEND出道日，并公开成员Yuju和Eunha。 --------------------------------- 2015年 【首张迷你专辑《Season of Glass》】 2015年1月7日，GFRIEND以白裙可爱风格亮相， 并于1月15日正式发布迷你专辑\"Season of Glass\"。1月16日于KBS2音乐节目《Music Bank》中正式出道公开演出。出道曲《Glass Bead》由创作过Ailee《Heaven》和Orange Caramel《Catallena》的Lee Gi yongbae作曲。 3月12日公司公布延长宣传活动的消息，GFRIEND继续于音乐节目演出。 GFRIEND确定出演宠物专属频道Sky Pet Park推出的综艺节目《GFRIEND! 拜托了，小狗 (여자친구! 강아지를 부탁해)》。节目内容为照顾小狗，自3月19日起录制，将于4月14日起播出。为首个实境综艺节目。 3月21日于MBC音乐节目《Show! 音乐中心》的表演舞台结束首张迷你专辑宣传，预计7月回归。 【第二张迷你专辑《Flower Bud》】 7月9日经纪公司更新了官咖首页图片，预告即将回归。图片有着Flower Bud (意喻含苞待放的花蕾) 与me gustas tu (意喻我喜欢你) 的字样。GFRIEND确定于7月23日携第二张迷你专辑\"Flower Bud\"回归。经纪公司接续释出三波专辑概念照，并于7月15日公开MV预告，预告中可看出GFRIEND充满活力，展现犹如精灵般的可爱魅力。\"Flower Bud\"全辑音源与主打歌\"Me Gustas Tu\" MV于韩国时间7月23日12时公开。并于《Mnet》音乐节目《M! Countdown》中的回归舞台正式展开第二张迷你专辑的宣传活动。 9月5日，在江原道参加公演时因下雨致舞台湿滑而发生八次摔倒，该影片在网络上传播后点击观看超过2100万次，并得到了世界各地网友称赞成员敬业。美国时报表示，K-pop明星们为了一首歌曲摔倒八次的影片给大家成为一种什么事都能做的活力。英国《每日邮报》也表示，K-pop女团GFRIEND在雨中的舞台上也坚持完成表演。 成员Yuju在《Weekly Idol》对于最近在雨中表演摔倒而逆袭获得人气的事表示，谢谢大家了解，之后也会给大家带来更好的样子，继续长久的看我们吧。 9月6日于《人气歌谣》的表演舞台结束第二张迷你专辑宣传，预计年末回归。 ---------------------------------- 2016年 【第三张迷你专辑《Snowflake》、公布粉丝名、出道初一位、获得15个一位】 《Snowflake》全辑音源与主打歌 \"Rough\" MV于韩国时间2016年1月25日0时公开。1月19日公开回归预告，1月21日公开MV预告，1月22日公开迷你专辑预告。并于《SBS MTV》音乐节目《THE SHOW》中的回归舞台正式展开第三张迷你专辑的宣传活动。一个月后，\"Rough\" MV观看人次已超过1000万。 1月25日于Showcase & Fan Meeting上公布粉丝名为Buddy，为好朋友之意。 2月2日于《SBS MTV》音乐节目《THE SHOW》中获得出道以来第一个一位。 2月3,4,5,7日于《Show Champion》、《M! Countdown》、《Music Bank》、《人气歌谣》中再获得一位。 2月11,12,16,17,21日于《M! Countdown》、《Music Bank》、《THE SHOW》、《Show Champion》、《人气歌谣》获得两周一位。 2月18,19,24,28日于《M! Countdown》、《Music Bank》、《Show Champion》、《人气歌谣》获得三周一位。 2月26日于《Music Bank》连续四周获得第一，成为今年首个在电视音乐节目中连续两周、三周和四周获得一位的女团。GFRIEND于2月在打歌节目中拿到共15个冠军。 国内最大的音源网站MelOn，从2月4日下午3点至2月26日，\"Rough\" 连续22日获得第一。 2月24日公司公布延长宣传活动的消息，GFRIEND继续于音乐节目演出直到三月中旬。 官方粉丝俱乐部于2014年9月开创后，时隔1年5个月粉丝数突破3万人数（2月11日为基准）。成为最短时间内到达该人数的女团。 3月13日于《人气歌谣》的表演舞台结束第三张迷你专辑宣传，预计7月回归。 截至4月3日，GFRIEND的 \"Rough\" 蝉联韩国音源榜单一位共488小时。 【《파도》、《Inferiority Complex (자격지심)》MV 公开】 GFRIEND 为代言商品 AMERICAN TOURISTER 旅行箱演唱的宣传歌曲《波涛》(파도)，MV 于5月2日公开。《波涛》一曲翻唱自男子团体 UN 在2001年发行的热门歌曲。 Block B 成员朴经5月24日透过官方 YouTube 频道公开与 Eunha 合作的单曲《Inferiority Complex (자격지심)》MV。 【首张正规专辑《L.O.L》、获得14个一位】 6月29日，经纪公司表示GFRIEND将于7月11日发行首张正规专辑《L.O.L》，专辑名称“L.O.L”同时具有“Lots of Love”和“Laughing Out Loud”两层意义，实体专辑也会以两个不同的概念制作两种版本。同日公开第一波概念照，展现的是“Laughing Out Loud”概念。成员们穿着多彩的T恤和热裤，搭配小白鞋和彩色袜子，散发出GFRIEND独有的青春活力。 7月4日，公开《L.O.L》第2轮宣传照，在“Lots of Love”的主题下，6名少女现身游乐场，与第一轮宣传照“Laughing out Loud”的活泼甜美风大不同。 《L.O.L》全辑音源与主打歌 \"NAVILLERA\" MV于韩国时间7月11日0时公开。7月5日公开回归预告，7月7日公开MV预告，7月8日公开正规专辑预告。并于《SBS MTV》音乐节目《THE SHOW》中的回归舞台正式展开首张正规专辑的宣传活动。同一天在首尔市广津区广壮洞的YES 24 LIVE HALL举办媒体Showcase和粉丝Showcase。 7月19,20,21,22,24日于《THE SHOW》(8,404分),《Show Champion》,《M! Countdown》(9,154分),《Music Bank》(6,851分),《人气歌谣》(10,328分)获得一位。 7月28,29,31日,8月2,10日于《M! Countdown》(9,406分),《Music Bank》(6,648分),《人气歌谣》(10,156分)，《THE SHOW》(8,039分)，《Show Champion》获得两周一位。 8月4,7,9,12日于《M! Countdown》,《人气歌谣》(10,028分)，《THE SHOW》(8,034分)，《Music Bank》(6,499分)获得三周一位。 GFRIEND在这次打歌节目中拿到共14个冠军。今年累计获29个音乐节目冠军，单年度累计获得的音乐节目冠军数仅次于EXO，在韩国乐坛排在了第二位。目前在韩国所有女团当中音乐节目冠军获得数排在第六位。 8月14日于《SBS人气歌谣》的表演舞台结束首张正规专辑宣传，预计2017年1月回归，Sowon亦表示主打歌想要以girl crush回归。 2017年 【第四张迷你专辑《The Awakening》】 2017年2月23日，公司预告将于3月6日，以第四张迷你专辑《The Awakening》正式回归，并于2月27日公开MV预告，主打歌为《FINGERTIP》[50]。另外《The Awakening》在全球各地的预购量超过10万，比《L.O.L》预购量更高。 3月6日，官方于下午12时公开主打歌《FINGERTIP》MV和《The Awakening》全辑音源，《FINGERTIP》亦登上韩国音源网站Bugs、Soribada、olleh、genie第一位，Melon、Mnet、Naver则登上第五位。3月9日，于Mnet音乐节目《M! Countdown》EP514 中发布回归舞台。3月14日及4月11日，GFRIEND于SBS MTV的《THE SHOW》中，拿下《FINGERTIP》的首个及第二个冠军。《The Awakening》发表时，登上了美国Billboard全球专辑榜第5名。 3月15日，官方于上午9时公布GFRIEND的官方应援棒《GLASS MARBLE STICK》。4月2日，GFRIEND在韩国举行出道以来的首个见面会《Dear Buddy》,6日后亦在泰国曼谷再次举行。4月7日，GFRIEND官方fancafe突破70,000人。 7月9日和7月16日，GFRIEND分别地在台北和香港举行出道以来首次世界巡回迷你演唱会 7月20日，公司预告于8月1日，以第五张迷你专辑《PARALLEL》正式回归，专辑的主打歌为《LOVE WHISPER》。专辑名字意味着“平行”，描写就像平行线而无法触碰到的爱情，相信总有一天能相遇的内心。7月26日、30日和31日公开MV和专辑预告。8月1日，专辑的音源与主打歌MV公开，并举办Showcase表演新歌，Showcase门票于开始发售后30秒全部售出。美国 Billboard世界专辑榜公开8月19日的周榜单中，《PARALLEL》获得第10名。GFRIEND分别先后在《韓秀榜》、《Show Champion》、《Music Bank》和《人气歌谣》合共获得4个《LOVE WHISPER》的冠军。8月27日，于《人气歌谣》进行表演舞台后，结束迷你专辑的宣传。 8月31日，透过官方 Facebook 宣布将于9月13日发行第五张迷你专辑的改版专辑《Rainbow》回归，专辑的主打歌为《Summer Rain》，并公开各成员概念照。9月1日，透过官方 Facebook 公开专辑曲目表。9月4日至6日，于韩国时间0时公开各成员的个人概念照。9月7日、11日和12日，韩国时间0时发布了MV和专辑预告。9月15日，专辑的音源与主打歌MV公开，并举办Showcase表演新歌。GFRIEND在《韓秀榜》、《M Countdown》共获得2个《SUMMER RAIN》的冠军。9月24日，于《人气歌谣》进行表演舞台后，结束改版专辑的宣传。   大型颁奖礼奖项 2015         第7届Melon Music Awards－女子新人奖   2016         第25届首尔歌谣大赏 - 新人赏 第30届韩国金唱片大赏 - 音源部门新人奖 第5届Gaon Chart K-POP大奖 - 新人奖 第28届韩国PD大赏 - 歌手部门大赏 第4届音悦V榜年度盛典 - 韩国最佳新人奖 第8届Melon Music Awards－TOP10奖 第8届Melon Music Awards－女子舞蹈奖 MAMA-女子舞蹈奖');
INSERT INTO `tb_singer` VALUES ('121', 'BLACKPINK', '韩国组合/乐队', 'http://p2.music.126.net/npsf5sgqVmcuOe8NbwY3Pg==/109951163986197930.jpg?param=130y130', 'BLACKPINK（블랙핑크)是YG娱乐于2016年推出的女子团体，包括Jennie、Lisa、Jisoo、Rosé四名成员，BLACK PINK原定于2012年出道，官方也已释出练习影片并且公布其中两名成员身份，然而直到2014年仍旧尚未正式出道，直到2016年才正式透过官方公开了成员名单与团名。BLACKPINK于8月8日发行出道单曲专辑《SQUARE ONE》，正式出道。');
