INSERT INTO `tb_singer` VALUES ('131', 'Ummon Guruhi', '其他男歌手', 'http://p1.music.126.net/64V2WqFyNiJp7Ra1haTopA==/109951163678974022.jpg?param=130y130', 'Ummon guruhi ★ 2007 yilda 3 yigitning qo\'shiq ijro etishga qiziqishi natijasida havaskor guruh sifatida tashkil topgan.Boshida ular guruhni nomini \"Jazo\" deya nomlashgan.Bu nom ko\'pchilikka yoqmaganligi sababli \"Ummon\"ga o\'zgartirishgan.Guruh sifatida ularning ilk qo\'shig\'i \"Sevaveraman\".Ummon hozirgi kunga O\'zbekistonda 1-raqamli guruhga aylandi. Guruhning birinchi konserti 2010-yil 18-sentabrda \"Turkiston\" yozgi saroyida, ikkinchisi 2011-yil 1-iyun \"Istiqlol\" san\'at saroyida 2 seansda, uchinchisi 2011-yil 17-sentabrda \"Turkiston\" yozgi sayoriya bo\'lib o\'tgan. Ilk klipi: Sevaveraman taronasiga ishlangan klip. Undan keyin \"Do\'st\", \"Qanday Unutding\", \"Yo\'q\", \"Boylik\", \"Aldangan Qiz\", \"Vo ajab (Minusa Rizayeva bilan)\", Yettinchi qavat\" va nixoyat 2014-yil \"Eslab qol\" taronalariga ham klip ishlashdi. Aytish joizki, bu guruh internet olamida qo\'shiqlari ko\'chirib olish auditoriyasi bo\'yicha birinchi o\'rinda turadi. Shu paytgacha 150dan oshiq tarona ijro etishgan.');
