INSERT INTO `tb_singer` VALUES ('133', 'Sainkho Namtchylak', '其他女歌手', 'http://p2.music.126.net/CFtloeqlSxtdHXbKEICo7A==/6023124697636333.jpg?param=130y130', 'Sainkho Namtchylak，1957年生于俄罗斯联邦图瓦共和国，祖先是游牧民族，自小学习歌唱，曾组过民谣摇滚乐团。长大后到莫斯科学习声乐，除学习图瓦传统的双声唱法（Throat singing/khoomei），也包括喇嘛与萨满巫教的传统声乐技巧（图瓦的传统信仰是萨满教，后来因为曾被蒙古统治过，所以国教改为藏传佛教）。 生于1957年的Sainkho，从1989年起，开始跨足欧洲前卫即兴乐界，学习更多元化的发声技巧，并致力挖掘双声唱法与其它音乐风格融合的可能性，同年并与苏联前卫爵士乐团Tri-O首次合作。之后即以欧洲作为发展重镇，展开她漫长而精彩的世界巡回演出，并且有机会与各地杰出音乐家/表演团体合作，当中包括Peter Kowald、Buch Morris、Ned Rothenberg、Evan Parker、William Parker、Hamid Drake、Djivan Gasparian、Hector Zazou、Otomo Yoshihide、Hakutobo （白桃房）Butoh Dance Theatre等等，并先后出版近三十张专辑，音乐之外，Sainkho也参与许多电影、剧场与多媒体演出。 虽然大部分时间在世界各地流浪，Sainkho从未忘记自己的家乡，每年她都带着西方乐手到图瓦的首都基吉（Kyzyl）表演，希望西方乐手认识她的国家、文化与音乐。虽然她是图瓦文化的最佳代言人，但并非所有图瓦人都愿意拥抱她，一方面因为她打破\"女人不得喉唱\"传统禁忌，另一方面许多人认为她长年居住在西方世界，就是背叛自己的国家，拥抱了腐化的西方思想。1997年，她在自己四十岁生日前于莫斯科遭到暴徒攻击，身受重创，治疗了两星期才出院。之后沉寂了一段时间才继续演唱创作。 2002年由德国女导演Erika von Moeller执导的纪录片《Sainkho》正式面世，让世人对Sainkho的生活有更深层的了解，同年获家乡图瓦颁发\"二十世纪图瓦最具创意成就奖\"。 Sainkho那出神入化的演唱技巧固然让人惊艳，结合图瓦传统双声唱法、喇嘛与萨满巫教的传统声乐与当代发声技巧，时而像歌剧男高音般清亮，时而像鸟鸣、孩童撒娇、深沉的低吟，人们不免拿她跟Bjork、ZapMama、Patti Smith、Nina Hagen或者Maja Ratkje相提并论，但其实奠定她在当今乐坛的特殊地位以及赋予她的音乐跨乐种、跨文化吸引力的，却是她一直坚持的实验精神。从她每张专辑都试图破格，把别具一格的演唱结合西方前卫爵士、即兴音乐、各地传统乐以致电子乐，加上诗化歌词，Sainkho成功塑造出一种特别强调声音技巧表现、而兼具许多不同国家传统的世界音乐。著名音乐杂志《The Wire》这样形容Sainkho的音乐：运用打击效果的喘息、啧舌声与高音域尖叫作为表情，在流行与传统音乐之外独树一帜，立足于完全不同的境界：一个纯人类、受此纪律驱动而超凡的境界。其它如《Jazz Review》以\"她歌唱的核心普世性与人性几乎有种大自然元素般的魅力\"，以及芝加哥世界音乐节的\"令人惊叹的即兴家、声乐极端份子\"等词表扬Sainkho在世界音乐圈的地位。');
