INSERT INTO `tb_singer` VALUES ('135', 'GulgineMollaemet', '其他女歌手', 'http://p2.music.126.net/NKm8CfzhbxZJ2EJdt6GQLg==/109951164273044812.jpg?param=130y130', '古力格纳·毛拉麦提 - 毕业于新疆艺术学院播音主持专业，作为新疆本土实力派原创歌手，曾多次受邀新疆电视台“古尔邦节”文艺汇演“肉孜节”文艺晚会，下南疆慰问消防官兵慰问演出、五四”青年节文艺晚会等。丰富的音乐元素和极强的感染里力吸引了越来越多的人，现在的歌曲也越来越趋于成熟，最新的专辑马上要与大家见面了，更好的作品陆续出现，让我们拭目以待！');
INSERT INTO `tb_singer` VALUES ('136', 'Lata Mangeshkar', '其他女歌手', 'http://p2.music.126.net/W6pRHkJ8IbGIlZrDksSylw==/667403558106404.jpg?param=130y130', '出生地是印度于1929年9月28日，拉塔Mangeshkar一直活跃在各行各业的印度流行和轻古典音乐上面，她的高音可以说算是印度最高的，她的成功不在于不只是她的惊人歌唱。她的许多表演被认为是永恒的，现在她的声音变了，成熟多了。 拉塔·满吉喜卡，人们习惯叫她拉塔，印度人尊称拉塔为印度南丁格尔，她的歌声令人难以忘怀。她演唱的电影流行歌曲红遍印度半个世纪仍魅力不减。如今她仍然是印度电影炙手可热的天后。她的歌大部分是电影歌曲，曲风如兴都斯坦的甘扎尔ghazals，宗教颂歌bhajans及流行歌等等。拉塔在1948－1987年就已达到3万首独唱或合唱歌曲，包括了20种不同语言。 1991年她的名字被列入吉尼斯世界记录。事实上到了2004年，拉塔唱过的歌曲已超过5万首了，放眼世界除了她妹妹阿夏外无人可与之抗衡。 拉塔·满吉喜卡，1929年９月28日生于MP邦的Sikh Mohalla,是印度鼎鼎大名的电影伴唱歌后。父亲Pt.Deenanath Mangeshkar是一名演绎古典音乐的歌手及演员，也是业余的占星师。拉塔共有4姊妹，其中最有名的阿夏Asha，以及Meena、Usha和弟弟 Hridaynath。虽然她没有上过正规学校，但受到父亲舞台音乐剧耳濡目染的影响，她对音乐的天份和表现异于常人，因此年方5岁就开始受教于父亲并参与父亲剧团的表演。 1934年，拉塔为印度首部有声电影：《阿蓝－阿拉（Alam-Ara）》配了轰动一时的七首MV插曲。随之拉塔父亲的公司被迫关门大吉，举家迁移到一个小镇Sangi。 1942年父亲因心脏病去世，八天后小弟又得了结核病。虽然拉塔只有12岁，但身为长女的她，为了养家糊口，为马拉地语片《Kitti Haasal》伴唱，但没有发行。后来找到Vinayak Rao的电影公司月薪60元的工作，并参与Pahili Mangalagaur演和唱的工作一直到了15岁，共计8部电影，月薪也调到了350元。她亦师从Aman Ali Khan Sahib及Amanat Khan两位大师。拉塔天生一副好嗓子，卓越的天份，以及独特的唱腔令人一听难忘。 1947年拉塔首部伴唱的电影《Aap ke Sewa Main》并未受到重视，不久她的贵人Vinayak Rao去世，顿失依靠，收入不再固定。她又通过名音乐总监Ghulam Haidar的介绍认识了名制片家S. Mukherjee，才得以参加1948年《Shaheed》的伴唱。但试音时S. Mukherjee嫌拉塔声音太尖，拒绝了拉塔。Ghulam Haidar生气的说，我预言不久印度的制片家都将争先恐后地乞求她唱歌。在第二次试音时，拉塔仍原声以对，S. Mukherjee二话不说将新片《Majboor》委由拉塔伴唱，曲名《 Dil Mera Toda》，此后成为拉塔的经典曲目。 1949年拉塔共为4部电影：《Barsaat》、《Andaaz》、《Dulari》、《Mahal》配歌，这些歌曲立刻成为畅销曲。 1950年拉塔改变唱腔，从高嗓音改为今天人们听到的低沉的鼻音。50年代，拉塔成为女歌手中前所未有的成功典范。60及70年代她的成功变成千夫所指，被指控为“电影伴唱垄断者”，因此80年代拉塔以出国演唱为主。 历经近60年的歌唱生涯，她早就想退休安享天年，但热爱她的歌迷让她仍然活跃于歌坛。她一生荣誉等身：主要有印度电影之父Phalke奖，数不尽的电影节奖，及近年来得到的Bharat Ratna荣誉公民奖。 尽管她已70高龄了，但她的歌唱魅力是与时俱增的。业余占星师的父亲早就预言拉塔将会是大红大紫的歌星，果真言中。');
