INSERT INTO `tb_singer` VALUES ('138', 'Saniyam Ismail', '其他女歌手', 'http://p2.music.126.net/lyEYPEpuDF7V9WC8p1ZT7A==/109951163067734082.jpg?param=130y130', 'Saniyam Ismail（Kunakhunova Saniyam Ismailovna）。她出生于1982年10月11日。 1994年，她进入了Yarkent市的柴可夫斯基（Tchaikovsky）音乐学校。 1998年完成了学业，同年，她进入了阿拉木图的柴可夫斯基学院主修都塔尔和作曲课。 2002年以优异的成绩完成了学业。又在2002年她进入Kurmangazy国立音乐学院并2005完成自己的学业。 2004年，寒假期间，她来到乌鲁木齐跟一批著名的音乐人学习都塔尔并交换经验。 2005年她来到乌鲁木齐音乐艺术学院进行了为期两年的进修。 2008年，她在阿拉木图举办了第一场个人演唱会并发行了第一张专辑“Mangu Miras”。 2010年，第二张专辑“Asminim”发行。2017年，她在阿拉木图举办了第二场个人演唱会，目前她在乌鲁木齐工作。 她凭借自己独特的嗓音以及表演风格受到无数音乐爱好人的青睐。');
