INSERT INTO `tb_singer` VALUES ('141', 'Yuna', '其他女歌手', 'http://p2.music.126.net/GpqelrT-ptg4L25M1-iGeQ==/109951164214888787.jpg?param=130y130', '马来西亚另类流行女歌手Yuna Pop/R&B/Alternative 原名Yunalis binti Mat Zara\'ai（1986年11月14日出生），是一位马来西亚创作歌手。Yuna的最早在Myspace上传了原创音乐，获得了超过一百万的点击量并在网上疯狂传播，让她首次曝光在了大众的视野内。这一线上的成功引起了一些了Indie-Pop厂牌和公司对她的关注。2011年初，她与Fader Label签约。她最出名的的单曲是与Usher的一首合作单曲“ Crush ”，这首歌在美国Billboard的R＆B排行榜上最高排名第3。');
