INSERT INTO `tb_singer` VALUES ('144', 'Khalid', '其他组合/乐队', 'http://p2.music.126.net/VnZiScyynLG7atLIZ2YPkw==/18686200114669622.jpg?param=130y130', 'Khalid Donnel Robinson (born February 11, 1998), known mononymously as Khalid, is an American singer and songwriter. He is signed to Right Hand Music Group and RCA Records. His debut single, \"Location\", was released in July 2016 and peaked at number 16 on the US Billboard Hot 100 chart and was later certified quadruple platinum by the Recording Industry Association of America (RIAA). His debut studio album, American Teen, was released on March 3, 2017.');
INSERT INTO `tb_singer` VALUES ('145', '九宝乐队', '其他组合/乐队', 'http://p2.music.126.net/a5rO524MDNDnYCym2_YsSQ==/5830710162207932.jpg?param=130y130', '九宝是一支纯粹的蒙古民族摇滚乐队。他们的音乐有一股的“气”，一头草原的灵兽，音乐就是草原的志怪笔记，记录神话故事的恶梦与虚无，愤怒的草原母体和被现代遮蔽的不可说。令人着迷的是，九宝以非自觉和非刻意的方式阐述一种被现代蒙古人所遗忘的传统：草原的神学力量。他们对民歌的改变和更多自己的原创传递着这个迷幻般的草原哲学。   主唱/吉他：阿斯汗 马头琴：朝克 贝司：敖瑞峰 巴拉莱卡：赛娜 鼓手/采样：丁凯   2015年    无锡太湖音乐节 ；重庆专场演出；最新EP首发专场 2014年    第十三届330金属节、上海迷笛音乐节；长江迷笛音乐节                  北京迷笛音乐节；台湾海洋音乐季、 张北草原音乐节、贵阳中天音乐节                  通辽第十八届赛马节 特邀嘉宾；蒙古国METAL音乐节                  宁波钱湖天地海上丝路城市音乐季 2013年    影响城市之声系列演出 、天津13club 群英会之摇滚中国·蒙古好声音                  13club WOA 金属战火中国区决赛(冠军)、德国WOA音乐节、                  上海长江迷笛音乐节、宁夏乐堡音乐节、 山西汾河音乐节、                  镇江西津渡音乐季、北京通州运河公园麒麟音乐节 2012年    邢台摇滚爬梯、第二届杭盖音乐节、太原摇滚爬梯、                  鄂托克音乐节、HiFi镇江西津渡音乐季、798剧场安达音乐节系列演出 2011年    首届北京安达音乐节、首届亚洲金属音乐节、                  受邀作lapegatina 与 杭盖乐队专场嘉宾');
